    // "Our ability to support this device is coming to an end. You will continue to receive updates until Nov. of 2022, whereupon you will receive your final update for this device. We deeply apologize for the inconvenience. %sAfter you receive the final update, you will still be able to play on your worlds, and access Marketplace purchases (including Minecoins). Realms managed from this device will continue to work for 6 months unless they are updated by the Realm owner on a different device. You will no longer receive the latest updates and will be unable to play multiplayer with devices or Realms which are continuing to receive updates. You will also not be able to connect to certain servers. %sClick on the button for more information, including ways to move your worlds to a new device. =Невдовзі ми припинимо підтримку цього пристрою. Ви продовжите отримувати оновлення до листопада 2022 року, після чого вам надійде останнє оновлення для цього пристрою. Нам дуже прикро за незручності. %sОтримавши останнє оновлення, ви все ще зможете грати у своїх світах і використовувати покупки з Ринку (зокрема, Minecoins). Realms, доступ до яких здійснюється з цього пристрою, продовжать працювати, якщо власник певного Realm не оновить його на іншому пристрої. Ви більше не отримуватимете актуальні оновлення і не зможете грати в мультиплеєрі з пристроями чи в Realms, які продовжують оновлюватися. Ви також не зможете підключатися до певних серверів. %sНатисніть кнопку, щоб дізнатися більше, зокрема про те, як перенести ваші світи на новий пристрій.",
    // "This device is no longer supported. You have received the final update for this device. From this point on you can keep building in your worlds, and your Marketplace purchases (including Minecoins) will continue to be available. Your Realms will continue to work unless they are updated by the Realm owner on a different device. You will no longer receive the latest updates, and will be unable to play multiplayer with devices or Realms which are continuing to receive updates. You will also not be able to connect to certain servers. %sClick on the button for more information, including ways to move your worlds to a new device. We know this is an inconvenience - we deeply appreciate the time you spent with our game, and hope to see you again on an updated device. =Цей пристрій більше не підтримується. Ви отримали останнє оновлення для цього пристрою. З цього часу ви можете продовжити розбудовувати свої світи, а також використовувати покупки з Ринку (зокрема, Minecoins). Ваші Realms продовжать працювати, якщо власник певного Realm не оновить його на іншому пристрої. Ви більше не отримуватимете актуальні оновлення і не зможете грати в мультиплеєрі з пристроями чи в Realms, які продовжують оновлюватися. Ви також не зможете підключатися до певних серверів. %sНатисніть кнопку, щоб дізнатися більше, зокрема про те, як перенести ваші світи на новий пристрій. Ми розуміємо пов’язані незручності та цінуємо час, який ви провели в грі, і ми сподіваємося знову побачитися з вами на оновленому пристрої.",
