    // "Our ability to support this device is coming to an end. You will continue to receive updates until our next major release, whereupon you will receive your final update for this device. We deeply apologize for the inconvenience. %sAfter you receive the final update, you will still be able to play on your worlds and access Marketplace purchases (including Minecoins). However you will no longer have access to multiplayer or Realms from this device. You will no longer receive the latest updates, and will be unable to play with devices or Realms which are continuing to receive updates. You will also not be able to connect to certain servers. %sClick on the button for more information, including ways to move your worlds to a new device. =Наші можливості з підтримки цього пристрою добігають кінця. Ви продовжите отримувати оновлення до наступного великого випуску, коли вам надійде останнє оновлення для цього пристрою. Нам дуже прикро за незручності. %sОтримавши останнє оновлення, ви все ще зможете грати у своїх світах і використовувати покупки з Ринку (зокрема, Minecoins). Однак ви більше не матимете доступу до мультиплеєра чи Realms із цього пристрою. Ви більше не отримуватимете актуальні оновлення і не зможете грати з пристроями чи в Realms, які продовжують оновлюватися. Ви також не зможете підключатися до певних серверів. %sНатисніть кнопку, щоб дізнатися більше, зокрема про те, як перенести ваші світи на новий пристрій.",
    // "Realms Plus is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%sYour Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first 30 days will be free, and you'll be billed %s/month afterwards. You can cancel your subscription to stop future charges by accessing subscriptions settings.=Realms Plus — це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sВаш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступні відразу. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перші 30 днів для вас будуть безкоштовні, а після цього вам виставлятиметься рахунок %s/місяць. Ви можете скасувати підписку в параметрах підписок, щоб зупинити оплату за неї.",
    // "If your subscription ends, you and your friends will no longer be able to play online together on Realms, and you will no longer have access to Realms Plus packs. You can download any world saved to your Realm (within 18 months of ending your subscription). If you used Realms Plus worlds, texture packs, or mash-ups you will need to purchase those packs in the store or, if those packs are still in Realms Plus, re-subscribe, to play those world templates.=Якщо термін дії вашої підписки завершиться, ні ви, ні ваші друзі не зможуть грати онлайн у Realms, крім того, ви втратите доступ до пакетів Realms Plus. Ви можете завантажити будь-які світи, збережені в Realm (протягом 18 місяців після завершення терміну дії вашої підписки). Якщо ви використовуєте світи, пакети текстур або збірні пакети Realms Plus, вам знадобиться придбати ці пакети в магазині або, якщо ці пакети ще входять до Realms Plus, знову придбати підписку, щоб грати з цими шаблонами світів.",
    // "Students can simulate real world chemistry by using the Chemistry Equipment blocks. Build any of the 118 different elements by adjusting the sliders in the Element Constructor or view the composition of elements by placing them in the Element Constructor. Combine elements in the Compound Creator to produce chemical compounds. Put elements and compounds into the Lab Table to create Minecraft items. Reduce blocks to their component elements with the Material Reducer.=Учні можуть моделювати реальні хімічні реакції за допомогою блоків \"Хімічне обладнання\". Створіть будь-який зі 118 різних елементів, регулюючи повзунки в конструкторі елементів, або розміщайте елементи в конструкторі, щоб переглянути їхню структуру. Об’єднуйте елементи в конструкторі сполук і отримуйте хімічні сполуки. Розміщуйте елементи й сполуки на лабораторному столі, щоб створювати предмети Minecraft. Розкладайте блоки на їхні складові елементи за допомогою розбивача матеріалів.",
    // "This device is no longer supported. You have received the final update for this device. From this point on you can keep building in your worlds, and your Marketplace purchases (including Minecoins) will continue to be available. However, you will no longer have access to multiplayer or Realms from this device. You will no longer receive the latest updates, and will be unable to play with devices which are continuing to receive updates. You will also not be able to connect to certain servers.=Цей пристрій більше не підтримується. Ви отримали останнє оновлення для цього пристрою. З цього часу ви можете продовжити розбудовувати свої світи, а також використовувати покупки з Ринку (зокрема, Minecoins). Однак ви більше не матимете доступу до мультиплеєра чи Realms із цього пристрою. Ви більше не отримуватимете актуальні оновлення і не зможете грати з пристроями, які продовжують оновлюватися. Ви також не зможете підключатися до певних серверів.",
    // "Realms Plus is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%sYour Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first 30 days will be free, and you'll be billed %s/month afterwards. You can cancel your subscription to stop future charges by accessing subscriptions settings.=Realms Plus – це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sВаш Realm і понад 150 пакетів вмісту з ринку стануть доступні відразу. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перші 30 днів для вас будуть безкоштовні, а після цього вам виставлятиметься рахунок %s/місяць. Ви можете скасувати підписку в параметрах підписок, щоб зупинити оплату за неї.",
    // "Tap into the source of amazing Minecraft content! With Realms Plus, you get instant access to 150+ marketplace items like mash-ups, worlds, skin packs and epic adventures – with new additions each month. Your content is stored on your own personal server, and made available on any platform where you enjoy both Realms and Minecraft Marketplace. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free!=Дістаньтеся до джерела дивовижного вмісту Minecraft! З підпискою на Realms Plus ви отримуєте миттєвий доступ до понад 150 предметів із ринку, як-от збірних пакетів, світів, пакетів скінів і епічних пригод – зі щомісячними доповненнями. Ваш вміст зберігається на вашому власному персональному сервері й доступний для вас на будь-якій платформі, де ви використовуєте як Realms, так і Ринок Minecraft. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно!",
    // "After sign up, 150+ pieces of exciting Minecraft Marketplace content will be available to you. Download and play adventure maps, wear skins, dive into texture packs, and even claim a set of Character Creator items to keep each month. With a catalog that’s regularly refreshed, there’s always something new to discover with Marketplace Pass. You’ll be billed %s/month and can cancel anytime to stop future charges.=Після реєстрації вам буде доступно понад 150 одиниць захоплюючого вмісту на ринку Minecraft. Завантажуйте карти пригод, носіть скіни, занурюйтесь у пакети текстур і навіть отримуйте набір предметів для створювача персонажів, які можна залишати собі щомісяця. Завдяки каталогу, який регулярно оновлюється, з Marketplace Pass завжди можна відкрити для себе щось нове. Плата стягуватиметься в розмірі %s на місяць із можливістю скасувати підписку в будь-який час, щоб припинити стягнення плати в майбутньому.",
    // "Realms Plus is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%sYour Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! You'll be billed %s/month and you can cancel your subscription to stop future charges by accessing subscriptions settings.=Realms Plus — це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sВаш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступні відразу. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Вам виставлятиметься рахунок %s/місяць, і ви можете скасувати підписку в параметрах підписок, щоб зупинити оплату за неї.",
    // "You can manage your subscription and turn off auto-renewal by accessing your iTunes Account settings after purchase. If you cancel after your subscription has activated, you won't be refunded for the remaining active period of the subscription. Your iTunes account will be linked to your O365 Education Account for this subscription, so you will not be eligible to purchase additional Minecraft Education licenses with this iTunes account.=Ви можете керувати своєю передплатою та вимкнути автоматичне подовження з параметрів свого облікового запису iTunes після придбання. Якщо скасувати передплату після активації, залишок активного періоду передплати відшкодовано не буде. Ваш обліковий запис iTunes буде пов’язано з вашим обліковим записом O365 Education для цієї передплати, тож ви не зможете придбати додаткові ліцензії Minecraft Education за допомогою цього облікового запису iTunes.",
    // "Realms Plus is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%sYour Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! You'll be billed %s/month and you can cancel your subscription to stop future charges by accessing subscriptions settings.=Realms Plus – це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sВаш Realm і понад 150 пакетів вмісту з ринку стануть доступні відразу. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Вам виставлятиметься рахунок %s/місяць, і ви можете скасувати підписку в параметрах підписок, щоб зупинити оплату за неї.",
    // "We have detected that your device does not meet the system requirements to run this pack so you are unable to download this pack. You can review the minimum system requirements below: %s+ GPU: Hardware ray tracing capable GPU such as NVIDIA GeForce RTX 2060 or better. See our FAQ on minecraft.net for more details. %s+ RAM: 8GB or better %s+ CPU: Intel Core i5 or equivalent=Ваш пристрій не відповідає системним вимогам, потрібним для запуску цього пакета, тому його завантаження недоступне. Нижче наведено мінімальні системні вимоги: %s+ Графічний процесор: відеокарта з апаратною підтримкою трасування променів, як-от NVIDIA GeForce RTX 2060 або краще. Докладні відомості наведено в наших запитаннях і відповідях на сайті minecraft.net. %s+ ОЗП: 8 ГБ або більше %s+ ЦП: Intel Core i5 або аналог",
    // "Endlessly explore your own unique worlds and construct anything you can imagine - from the simplest of homes to the grandest of castles! Play Creative mode to build wonders with unlimited resources. Or mine in Survival mode, crafting weapons and armor to fend off dangerous mobs and survive the nights. Plus, play with friends online! Unlock the full game today!=Без кінця-краю досліджуйте свої унікальні світи та будуйте все, чого забажає уява: від найпростіших будиночків до найвеличніших замків! Грайте у творчому режимі, щоб створювати чудеса з невичерпних ресурсів. Або добувайте в режимі виживання, виробляючи зброю та обладунки, щоб захиститися від небезпечних мобів і пережити ночі. А ще, грайте з друзями через мережу! Розблокуйте повну версію гри вже сьогодні!",
    // "Clicking the ADD STORY button on the Story Feed will let you write a story of your own. You can choose to include a screenshot or text (or both!). Clicking the POST button will post your text/screenshot to the Story Feed for all the Realm's members to enjoy. If you don't have any screenshots to post, use the §ecamera§f:camera: on the game menu to capture the moment.=Натиснувши кнопку ДОДАТИ ІСТОРІЮ в стрічці історій, ви зможете написати власну історію. Ви можете додати знімок екрана або текст (або і те, і інше!). Натиснувши кнопку ОПУБЛІКУВАТИ, ви опублікуєте свій текст / знімок екрана в стрічці історій, щоб усі учасники Realm могли його побачити. Якщо у вас немає знімків екрана для публікації, закарбуйте момент за допомогою §eкамери§f:camera: в меню гри.",
    // "Chalkboards are used to display text in the world. Chalkboards display more text than Signs, can be edited after they have been placed, and come in three sizes: Slate, Poster, and Board. The lock toggle allows you to prevent non-World Builders from destroying or editing your chalkboards. Press :_input_key.use: on an existing chalkboard to edit it.=Класні дошки використовуються для відображення тексту у світі. На класних дошках відображається більше тексту, ніж на знаках, а після розміщення їх можна редагувати. Доступні в трьох розмірах: скрижаль, плакат і дошка. За допомогою перемикача із замком можна заборонити гравцям, які не є творцями світів, знищувати або редагувати класні дошки. Щоб редагувати наявну дошку, натисніть на ній :_input_key.use:.",
    // "Click the button below to open a file picker you can use to locate and select your 'minecraftWorlds' folder.%1%1Look inside the 'games/com.mojang' folders, starting from the root of your device or SD card.%1%1Once selected, we will copy your worlds to the new external storage location.%1%1You must have enough space available on your device to hold copies of your worlds.=Натисніть кнопку нижче, щоб відкрити файловий провідник, а потім знайдіть і відкрийте папку \"minecraftWorlds\".%1%1Пошукайте в папках \"games/com.mojang\", починаючи з кореневої на вашому пристрої чи SD-картці.%1%1Після вибору ми скопіюємо ваші світи в нове розташування в зовнішньому сховищі.%1%1Вам потрібно мати достатньо місця на своєму пристрої, щоб тримати копії ваших світів.",
    // "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack. Packs in your worlds will apply on top of these global packs. These resources are just for you. No one else will see the resources you set here. Resource Packs in your worlds or worlds you join will apply on top of these global resources.=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього. Пакети у ваших світах застосовуються поверх глобальних пакетів. Ці ресурси лише для вас. Більше ніхто не бачитиме ресурси, які ви тут установите. Пакети ресурсів у ваших світах або світах, до яких ви приєдналися, застосовуються поверх цих глобальних ресурсів.",
    // "Chalkboards are used to display text in the world. Chalkboards display more text than Signs, can be edited after they have been placed, and come in three sizes: Slate, Poster, and Board. The lock toggle allows you to prevent non-World Builders from destroying or editing your chalkboards. Tap an existing chalkboard to edit it.=Класні дошки використовуються для відображення тексту у світі. На класних дошках відображається більше тексту, ніж на знаках, а після розміщення їх можна редагувати. Доступні в трьох розмірах: скрижаль, плакат і дошка. За допомогою перемикача із замком можна заборонити гравцям, які не є творцями світів, знищувати або редагувати класні дошки. Щоб редагувати наявну дошку, торкніться її.",
    // "The payment will be charged to your iTunes account at confirmation of purchase and the subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period. Your account will be charged for renewal within 24-hours prior to the end of the current period, at the subscription price option you have previously selected. =Плата стягується з вашого рахунку iTunes після підтвердження покупки, а передплата подовжується автоматично, якщо не вимкнути автоматичне подовження принаймні за 24 години до завершення поточного періоду. Кошти стягуються з вашого облікового запису протягом 24 годин до завершення поточного періоду за ціною попередньо вибраної передплати.",
    // "This will remove the current world from your Realm's active slot and replace it with one of your existing worlds. Your Realm's members will have access to your newly replaced world. Select \"Cancel\" and then \"Download World\" to go and download a copy of the current world to prevent data loss, or select \"Confirm\" to continue and replace your world.=З активного слота Realm буде вилучено поточний світ, і ви зможете замінити його на один з ваших наявних світів. Учасники вашого Realm матимуть доступ до нового світу. Натисніть «Скасувати», а потім «Завантажити світ», щоб завантажити копію поточного світу та уникнути втрати даних, або «Підтвердити», щоб продовжити й замінити світ.",
    // "To fly when in Creative Mode, press :_input_key.jump: twice quickly. To exit flying, repeat the action. To fly faster, push :_input_key.forward: twice in rapid succession or press :_input_key.sprint: while flying. When in flying mode, you can hold down :_input_key.jump: to move up and :_input_key.sneak: to move down.=Щоб летіти у творчому режимі, двічі швидко натисніть :_input_key.jump:. Щоб припинити політ, повторіть дію. Щоб летіти швидше, двічі штовхніть :_input_key.forward: у швидкій послідовності або натисніть :_input_key.sprint: під час польоту. У режимі польоту утримайте :_input_key.jump:, щоб переміститися вгору, і :_input_key.sneak:, щоб переміститися вниз.",
    // "With the full Minecraft experience, you get Creative mode, achievements, and more, plus with a Microsoft Account you can meet others in the Minecraft community! You’ll be able to join friends’ worlds, make new friends on Servers, and sync your Marketplace purchases to everywhere you play Minecraft.=Маючи доступ до всіх можливостей Minecraft, ви отримуєте творчий режим, досягнення та багато чого іншого, а з обліковим записом Microsoft ви зможете познайомитися з іншими членами спільноти Minecraft! Приєднуйтеся до світів своїх друзів, зав’язуйте нові знайомства на серверах і синхронізуйте покупки на Ринку зі всіма пристроями, на яких ви граєте в Minecraft.",
    // "Marketplace Pass is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%s150+ marketplace packs will be immediately available. You'll be billed %s/month and you can cancel your subscription to stop future charges by accessing subscriptions settings.=Marketplace Pass — це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sПонад 150 пакетів вмісту з ринку стануть доступні відразу. Плата стягуватиметься в розмірі %s на місяць із можливістю скасувати підписку в параметрах підписок, щоб припинити стягнення плати в майбутньому.",
    // "Get to know the who is part of the Realm by using the Members tab. It's a list of all the players who can play here. You can see who the Realm owner is, who the operators are, and who has joined Realms Stories for this Realm. There are search, sort, and filter options to help you find exactly who you're looking for.=Дізнавайтеся, хто є частиною Realm, за допомогою вкладки «Учасники». Це список усіх гравців, які мають доступ. Ви можете побачити, хто є власником Realm, хто є операторами, а також хто приєднався до Realms Stories цього Realm. До ваших послуг параметри пошуку, сортування та фільтрування, які допоможуть вам знайти саме тих, кого ви шукаєте.",
    // "This will remove your current world from your Realm's active slot and let you replace it with a brand new world. Your Realm's members will have access to your new world. Select \"Cancel\" and then \"Download World\" to go and download a copy of the current world to prevent data loss, or select \"Confirm\" to continue and replace your world.=З активного слота Realm буде вилучено поточний світ, і ви зможете замінити його на новий. Учасники вашого Realm матимуть доступ до нового світу. Натисніть «Скасувати», а потім «Завантажити світ», щоб завантажити копію поточного світу та уникнути втрати даних, або «Підтвердити», щоб продовжити й замінити світ.",
    // "Combine two Shulker Shells with a Chest to create a Shulker Box. Shulker Shells are dropped by Shulkers found in End Cities. Unlike other containers, Shulker Boxes keep their items when broken. Shulker Boxes will break and drop as an item if pushed by Pistons, and can be placed using Dispensers.=Поєднайте два панцирі шалкера зі скринею, щоб створити ящик шалкера. Панцирі шалкера скидають шалкери, які зустрічаються в містах Енду. На відміну від інших контейнерів, у ящиках шалкера зберігаються й зламані предмети. Ящики шалкера зламаються та їх буде викинуто як предмет, якщо їх штовхати поршнями. Їх можна розмістити за допомогою розподілювачів.",
    // "With the full Minecraft experience you get Creative mode, achievements, and more, plus with a Microsoft Account you can meet others in the Minecraft community! Join your friends' worlds, make new friends on Servers, and sync your Marketplace purchases to everywhere you play Minecraft.=Маючи доступ до всіх можливостей Minecraft, ви отримуєте творчий режим, досягнення та багато чого іншого, а з обліковим записом Microsoft ви зможете познайомитися з іншими членами спільноти Minecraft! Приєднуйтеся до світів своїх друзів, зав’язуйте нові знайомства на серверах і синхронізуйте покупки на Ринку зі всіма пристроями, на яких ви граєте в Minecraft.",
    // "Once a world, texture pack, skin pack, or mash-up leaves the catalog, you will need to purchase the item from the Marketplace to continue playing. Packs will not be deleted from your local storage until you delete them. Monthly character creator items you’ve redeemed are yours to keep.=Після того, як світ, пакет текстур, пакет скінів або збірний пакет більше не будуть доступні в каталозі, вам потрібно буде придбати відповідний предмет на Ринку, щоб продовжити гру. Пакети не видалятимуться з локального сховища, доки ви їх власноруч не видалите. Після активації предмети для створення персонажів, які з'являються щомісяця, залишаються вашими.",
    // "Your Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first month will be free, and you'll be billed %s/month afterwards and can cancel at any time.=Ваш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перший місяць для вас буде безкоштовний, а після цього вам виставлятиметься рахунок %s/місяць. Ви можете скасувати підписку в будь-який час.",
    // "Your Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! You’ll be billed %s/month and you can cancel your subscription to stop future charges by accessing subscriptions settings.=Ваш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Вам виставлятиметься рахунок %s/місяць, а щоб зупинити оплату підписки, її можна скасувати в параметрах підписок.",
    // "Realms Stories is a social hub for your Realm. Post to the Story Feed to let others know what you’re up to, and share your adventures and creations. Know who’s who with a handy list of all the members. See when other members are playing to check out their creations or plan to join them next time.=Історії Realms – це соціальний вузол вашого Realm. Публікуйте дописи у стрічці історій, щоб інші знали, чим ви займаєтеся, і діліться пригодами та творіннями. Знайте, хто є хто, завдяки зручному списку всіх учасників. Подивіться, коли грають інші учасники, щоб переглянути їхні творіння або запланувати приєднатися до них наступного разу.",
    // "Unlock the full Minecraft experience and get access to Seeds! Seeds help you discover new biomes - survive on ice plains, ascend extreme hills, or trek across deserts. Start with unique templates or explore random new worlds! Access Seeds, Creative mode, Multiplayer and more by buying Minecraft today!=Розблокуйте повну версію Minecraft і спробуйте сіди! Сіди допомагають знаходити нові біоми — виживати на льодових рівнинах, сходити на височенні пагорби або долати пустелі. Почніть із унікальних шаблонів або досліджуйте випадкові нові світи! Отримайте сіди, творчий режим, мультиплеєр і багато іншого, купивши Minecraft уже сьогодні!",
    // "All Ender Chests in a world are linked. Items placed into an Ender Chest are accessible in any other Ender Chest. However, the contents of the Ender Chests are specific for each player. This allows players to store items in any Ender Chest, and retrieve them from other Ender Chests in different positions in the world.=Усі скрині Ендеру у світі пов’язані між собою. Предмети, розміщені в скрині Ендеру, доступні в будь-якій іншій скрині Ендеру. Проте вміст скринь Ендеру особливий для кожного користувача. Це дає змогу гравцям зберігати предмети в будь-якій скрині Ендеру та діставати їх з інших скринь Ендеру в різних куточках світу.",
    // "with field in rawtext must contain a array or another rawtext object. Example 1: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]  Example 2: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\":{\"rawtext\":[{\"text\": \"value1\"}, {\"text\": \"value2\"}]}}]=поле rawtext має містити масив або інший об’єкт rawtext. Приклад 1: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]  Приклад 2: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\":{\"rawtext\":[{\"text\": \"value1\"}, {\"text\": \"value2\"}]}}]",
    // "Scaffolding needs support. You can only place so many scaffolding horizontally without touching a different block. When you attempt to place too many scaffolding blocks without proper support, it will fall. Scaffolding can be placed like normal blocks, but it can also be placed on its own foundation to quickly build a tall tower.=Риштуванню потрібна опора. По горизонталі можна розмістити лише стільки блоків, не торкаючись іншого блока. Якщо поставити забагато блоків риштування без опори, вони впадуть. Риштування можна ставити як звичайні блоки. Його також можна ставити на власну основу, щоб швидко зводити високу башту.",
    // "You can't extend your Realm right now. We have now introduced subscriptions for Realms and you can buy a new subscription as soon as your Realm has expired in %d days. But don't worry! We will give you 14 extra days for free and your Realm will be kept online, so you will have plenty of time to extend it by then.=Цей Realm не можна подовжити зараз. Ми запровадили підписку на Realms, і ви зможете придбати нову підписку, щойно спливе термін дії вашого Realm через %d дн. Але не хвилюйтеся! Ми збережемо безкоштовний доступ до вашого Realm протягом 14 додаткових днів, тому ви матимете достатньо часу, щоб подовжити його.",
    // "The creative mode interface allows any item in the game to be moved into the player's inventory without the need for mining or crafting the item. The items in the player's inventory will not be removed when they are placed or used in the world, and this allows the player to focus on building rather than resource gathering.=Інтерфейс творчого режиму дає змогу перенести будь-який предмет у грі в інвентар гравця без видобування або крафтингу предмета. Предмети в інвентарі гравця не видалятимуться після розміщення або використання у світі, а це дозволяє гравцю фокусуватися на будуванні, а не на збиранні ресурсів.",
    // "Sign in now to save and share your purchases across platforms. Save purchases so they won't be lost if something happens to your system or if Minecraft is uninstalled. Access your purchased Marketplace content from any platform and use your customized characters across platforms.=Увійдіть зараз, щоб зберегти свої покупки та поділитися ними на різних платформах. Зберігайте покупки, щоб не втратити їх, якщо щось трапиться з вашою системою або якщо Minecraft буде видалено. Отримуйте доступ до придбаного вмісту Ринку з будь-якої платформи та використовуйте своїх індивідуальних персонажів на різних платформах.",
    // "To fly when in Creative Mode, press :_input_key.jump: twice quickly. To exit flying, repeat the action. To fly faster, push :_gamepad_stick_left: forward twice in rapid succession while flying. When in flying mode, you can hold down :_input_key.jump: to move up and :_input_key.sneak: to move down.=Щоб летіти у творчому режимі, двічі швидко натисніть :_input_key.jump:. Щоб припинити політ, повторіть дію. Щоб летіти швидше, двічі швидко штовхніть :_gamepad_stick_left: уперед під час польоту. У режимі польоту утримайте :_input_key.jump:, щоб переміститися вгору, і :_input_key.sneak:, щоб переміститися вниз.",
    // "When playing with cheats on, host options will allow you to teleport yourself or friends, change the weather, set the time of day, and change the entry point or world spawn of your game. Once cheats have been enabled, you can find these options in the chat window by pressing the [/] button next to the chat bar.=Коли ви граєте з увімкнутими чітами, параметри хоста дають змогу телепортувати себе або друзів, змінити погоду, встановити час дня та змінити точку входу або місце призову світу в грі. Якщо ви ввімкнули чіти, ви можете знайти ці параметри у вікні чату, натиснувши кнопку [/] поруч із панеллю чату.",
    // "We want to collect information about your machine to help improve Minecraft by knowing what we can support and where the biggest problems are. All of this information is completely anonymous and viewable below. We promise we won't do anything bad with this data, but if you want to opt out then feel free to toggle it off!=Якщо ви не проти, ми будемо збирати анонімні відомості про ваш комп’ютер, щоб удосконалити Minecraft. Наведена нижче інформація підкаже нам джерело найсуттєвіших проблем і способи їх усунення. Обіцяємо не зловживати цими даними. Утім, ви все одно можете вимкнути цей параметр.",
    // "You can't extend your Realm right now. We have now introduced subscriptions for Realms and you can buy a new subscription as soon as your Realm has expired. But don't worry! We will give you 14 extra days for free and your Realm will be kept online, so you will have plenty of time to extend it by then.=Цей Realm не можна подовжити зараз. Ми запровадили підписку на Realms, і ви зможете придбати нову підписку, щойно спливе термін дії вашого Realm. Але не хвилюйтеся! Ми збережемо безкоштовний доступ до вашого Realm протягом 14 додаткових днів, тому ви матимете достатньо часу, щоб подовжити його.",
    // "If you purchase Marketplace Pass, you can access all the packs from any device with a  compatible version of Minecraft: Bedrock Edition with Minecraft Marketplace (sold separately) if you’re signed into your Minecraft account. Not supported on Amazon Kindle Fire or Minecraft Java Edition.=Якщо ви придбаєте Marketplace Pass, ви зможете отримати доступ до всіх пакетів з будь-якого пристрою з сумісною версією Minecraft: Bedrock Edition з ринком Minecraft (продається окремо), якщо ви ввійшли у свій обліковий запис Minecraft. Не підтримується на Amazon Kindle Fire або Minecraft Java Edition.",
    // "In addition to the full Minecraft experience with Creative mode, Multiplayer, and more, you'll earn achievements and a Gamerscore to mark your Minecraft progress and show your Microsoft Account friends your accomplishments. Get the full game to start earning them!=Окрім творчого режиму та мультиплеєра, маючи доступ до всіх можливостей Minecraft, ви також зможете заробляти досягнення. Досягненнями та очками вимірюється ваш прогрес у грі Minecraft, а також вони розповідають про ваші здобутки вашим друзям за обліковим записом Microsoft. Отримайте повну версію гри, щоб почати їх заробляти!",
    // "Scaffolding can help you create huge structures safely! You can walk inside scaffolding and stand on it. If you have a column of scaffolding you can go upward by standing in the scaffolding and pressing :windowsmr_right_touchpad:. If you want to travel downward you can press and hold :windowsmr_right_stick:.=Риштування допомагає безпечно зводити величезні будівлі! На риштування можна заходити та стояти на ньому. Якщо звести багаторівневе риштування, ви зможете підійматися ним, натискаючи :windowsmr_right_touchpad:. Щоб спуститися вниз, натисніть та утримуйте :windowsmr_right_stick:.",
    // "Your Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first 30 days will be free and you can renew for 30 days at the price of %s afterwards.=Ваш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перші 30 днів будуть безкоштовними, а потім ви можете оплачувати доступ на 30 за ціною %s.",
    // "Your trial of Minecraft Education is complete.%1%1Your school or organization will need to purchase a license for you to continue to use all of the features of Minecraft Education.%1%1You'll be signed out of your %2 account now and you can explore our feature-limited demo lesson.=Ви вже використали всі свої спроби зіграти в Minecraft Education.%1%1Ваш навчальний заклад або організація має придбати ліцензію для вас, щоб продовжити використовувати всі функції Minecraft Education.%1%1Зараз вас викине з облікового запису %2, і ви зможете вивчити відкритий урок з обмеженими функціями.",
    // "Minecraft Education features several special blocks that make it easier for teachers to create and employ lessons. Only players with World Builder ability can place and destroy these blocks. Only players without World Builder ability are subject to the restrictions imposed by these blocks.=Minecraft Education включає кілька спеціальних блоків, які спрощують створення й проведення уроків для вчителів. Тільки гравці з можливістю \"Творець світу\" можуть розміщати та знищувати ці блоки. Обмеження, які накладають ці блоки, не застосовуються до гравців із можливістю \"Творець світу\".",
    // "This will remove your current world from your Realm's active slot and let you replace it with a new one. Your Realm's members will have access to your new world. Select \"Cancel\" to go and download a copy of the current world to prevent data loss or \"Confirm\" to continue and replace your world.=З активного слота Realm буде вилучено поточний світ, і ви зможете замінити його на новий. Учасники вашого Realm матимуть доступ до нового світу. Натисніть \"Скасувати\", щоб завантажити копію поточного світу та уникнути втрати даних, або \"Підтвердити\", щоб продовжити й замінити світ.",
    // "Your Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! You’ll be billed %s/month and you can cancel your subscription to stop future charges by accessing subscriptions settings.=Ваш Realm і понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Вам виставлятиметься рахунок %s/місяць, і ви можете скасувати підписку в параметрах підписок, щоб зупинити оплату за неї.",
    // "Marketplace Pass is an ongoing subscription with a recurring subscription fee which is charged automatically every month until the subscription is cancelled.%s150+ marketplace packs will be immediately available. You can cancel your subscription to stop future charges by accessing subscriptions settings.=Marketplace Pass — це подовжувана підписка з автоматичним щомісячним списанням коштів до моменту скасування підписки.%sПонад 150 пакетів вмісту з ринку стануть доступні відразу. Ви можете скасувати підписку в параметрах підписок, щоб припинити стягнення плати в майбутньому.",
    // "Your Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first month will be free, and you'll be billed %s/month afterwards and can cancel at any time.=Ваш Realm і понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перший місяць для вас буде безкоштовний, а після цього вам виставлятиметься рахунок %s/місяць. Ви можете скасувати підписку в будь-який час.",
    // "The full Minecraft experience lets you enjoy Creative mode, achievements and Multiplayer with your friends across Minecraft devices! Play with friends on console, PC and mobile to create, explore and survive together. Unlock the full Minecraft experience today!=Повний доступ до Minecraft дає змогу насолодитися творчим режимом, досягненнями та мультиплеєром і грати з друзями на будь-яких пристроях із Minecraft! Грайте з друзями на консолі, комп’ютері чи мобільному пристрої, щоб створювати, досліджувати та виживати разом. Розблокуйте повну версію Minecraft уже сьогодні!",
    // "Whenever there is a new story in the Feed that you haven't read yet, a number will appear on the REALMS STORIES button. You'll always know when there is something new to read from your Realm's community. If you like what someone shared, go ahead and leave them a like or comment on their story!=Щоразу, коли в стрічці з’являється нова історія, яку ви ще не читали, на кнопці REALMS STORIES з’являється номер. Ви завжди знатимете, коли з’являються новини від спільноти вашого Realm. Якщо вам сподобалося те, чим хтось поділився, залиште вподобайку або прокоментуйте історію!",
    // "The difference between the two subscriptions is that Realms Plus includes a personal server where you can play with up to ten friends at a time. The content catalog you have access to with your Marketplace Pass subscription is the same catalog that is available with a Realms Plus subscription.=Різниця між двома підписками полягає в тому, що Realms Plus включає персональний сервер, де ви можете грати в компанії до десяти друзів одночасно. Каталог вмісту, до якого ви маєте доступ за підпискою Marketplace Pass, — це той самий каталог, доступний за підпискою Realms Plus.",
    // "When playing with cheats on, host options will allow you to teleport yourself or friends, change the weather, set the time of day, and change the entry point or world spawn of your game. Once cheats have been enabled, you can find these options in the chat window by tapping the chat button.=Коли ви граєте з увімкнутими чітами, параметри хоста дають змогу телепортувати себе або друзів, змінити погоду, встановити час дня та змінити точку входу або місце призову світу в грі. Якщо ви ввімкнули чіти, ви можете знайти ці параметри у вікні чітів, торкнувшись кнопки чата.",
    // "To dye Leather Armor or Leather Horse Armor, press :_input_key.use: on a Cauldron filled with water while holding the desired dye. This will change the color of the water inside of the Cauldron. Then dip your armor into the Cauldron by pressing :_input_key.use: with armor in your hand.=Щоб пофарбувати шкіряний обладунок або шкіряну кінську збрую, натисніть :_input_key.use: на казані, наповненому водою, тримаючи потрібний барвник. Колір води в казані зміниться. Потім опустіть обладунок або збрую в казан, натискаючи :_input_key.use: з відповідним предметом у руці.",
    // "Want to make wolves act like bunnies? Turn all the trees into cotton candy? You can alter everything in the full Minecraft experience with add-ons! Plus get access to Multiplayer, Creative mode, achievements and more! Buy Minecraft now for full access!=Хочете, щоб вовки поводилися як кролики? Щоб усі дерева перетворилися на солодку вату? У повній версії Minecraft із доповненнями можна змінювати в грі все! А ще ви отримаєте доступ до мультиплеєра, креативного режиму, досягнень і багато чого іншого! Придбайте Minecraft і отримайте повний доступ просто зараз!",
    // "Horses, Donkeys, and Mules must be §etamed§f before they can be used. A player can tame a horse by riding it and staying on while it tries to buck them off. Tap the Mount button that appears when near a horse  to attempt to tame Horses, Donkeys, and Mules.=Щоб коней, ослів і волів можна було використовувати, їх спершу потрібно приручити. Щоб приручити коня, гравець має сісти на нього верхи й не впасти, поки кінь намагатиметься його скинути. Щоб спробувати приручити коня, осла або вола, натисніть кнопку «Осідлати», яка з'явиться, коли поруч із вами є кінь.",
    // "Scaffolding can help you create huge structures safely! You can walk inside scaffolding and stand on it. If you have a column of scaffolding you can go upward by standing in the scaffolding and pressing :_input_key.jump:. If you want to travel downward you can press and hold :_input_key.sneak:.=Риштування допомагає безпечно зводити величезні будівлі! На риштування можна заходити та стояти на ньому. Якщо звести багаторівневе риштування, ви зможете підійматися ним, натискаючи :_input_key.jump:. Щоб спуститися вниз, натисніть та утримуйте :_input_key.sneak:.",
    // "You cannot play online multiplayer because of how your Microsoft Account is set up. Please ensure you have an active Xbox Live Gold subscription and your online safety settings allow Multiplayer. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете грати в онлайн-мультиплеєр через налаштування вашого облікового запису Microsoft. Ви повинні мати активну підписку на Xbox Live Gold, і ваші параметри безпеки в Інтернеті мають дозволяти мультиплеєр. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "You can find out what a villager is offering as trade by interacting with them. A villager may adjust the price of a trade whenever a player trades with it. A villager may run out of stock, temporarily disabling the trade if it is used too frequently. Trades usually involve buying or selling items for emeralds. =Ви дізнаєтеся, чим торгує селянин, взаємодіючи з ним. Селянин може змінити ціну предмета будь-коли. Якщо звертатися до селянина надто часто, у нього можуть закінчитися предмети й він тимчасово припинить торгівлю. Зазвичай валютою є смарагди.",
    // "You will be able to purchase and download any world templates saved to your cloud storage within 18 months of ending your subscription unless they are no longer offered by Minecraft. Monthly character creator items you’ve redeemed are yours to keep.=Ви зможете придбати та завантажити будь-які шаблони світів, збережені в хмарному сховищі, протягом 18 місяців після завершення терміну дії вашої передплати, якщо вони не зникнуть із пропозиції Minecraft. Після активації предмети для створення персонажів, які з'являються щомісяця, залишаються вашими.",
    // "Your Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your subscription will be available for 30 days at the price of %s:minecoin:.=Ваш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Ваша підписка буде доступна протягом 30 днів за ціною %s:minecoin:.",
    // "When two like animals are nearby and in Love Mode, they will kiss for a moment and then a baby animal will appear! The baby animal will stay with their parents until they grow into an adult. After having a baby, adult animals must wait 5 minutes before entering Love Mode.=Коли дві тварини одного виду в режимі кохання будуть поруч, вони поцілуються та з’явиться новонароджена тваринка! Новонароджена тваринка залишатиметься з батьками, доки не виросте. Народивши, дорослі тварини повинні почекати 5 хвилин, перш ніж знову перейти в режим кохання.",
    // "Only World Builders can place, delete, name, or edit NPCs. NPCs can execute commands and link to websites. Commands can be assigned to buttons in the NPC's dialog window; website links will always have a button.=Тільки користувачі з можливістю \"Творець світу\" можуть розміщати, видаляти, називати або редагувати неігрових персонажів. Неігрові персонажі можуть виконувати команди та переадресацію на веб-сайт. За кнопками в діалоговому вікні неігрового персонажа можна закріпляти команди; посилання на веб-сайти завжди відображаються як кнопки.",
    // "Cats are a neutral mob that can be found in villages. They will attack Rabbits and Baby Turtles. They will also keep Phantoms and Creepers away. They will try to run from you so taming them can be tough. They like fish so give them Raw Cod or Salmon to tame them.=Коти – це нейтральні моби, які водяться в селах. Вони нападають на кроликів і черепашок. Вони також відганяють фантомів і кріперів. Вони намагатимуться втекти від вас, тому приручити їх буде нелегко. Вони полюбляють рибу, тому дайте їм сирої тріски або лосося, щоб приручити їх.",
    // "Realms Stories is available in the game menu when you're playing in the Realm and on the Realms Tab. You can keep up to date and tell your story from anywhere you are, even when you aren't playing. From your console, computer, and mobile device, Realms Stories is available everywhere.=Realms Stories доступні в меню гри, коли ви граєте в Realm, і на вкладці Realms. Ви можете бути в курсі подій і розповідати свою історію звідки завгодно, навіть коли не граєте. З консолі, комп’ютера та мобільного пристрою – Realms Stories доступні скрізь.",
    // "Scaffolding can help you create huge structures safely! You can walk inside scaffolding and stand on it. If you have a column of scaffolding you can go upward by standing in the scaffolding and pressing :_input_key.jump:. If you want to travel downward you can press :_input_key.sneak:.=Риштування допомагає безпечно зводити величезні будівлі! На риштування можна заходити та стояти на ньому. Якщо звести багаторівневе риштування, ви зможете підійматися ним, натискаючи :_input_key.jump:. Щоб спуститися вниз, натисніть :_input_key.sneak:.",
    // "Minecraft wants to access your local network. This allows you and others on your local network to play together. Declining this permission does not affect online features or gameplay. But will prevent you and others, on the same network, from playing together.=Minecraft потребує доступу до вашої локальної мережі. Завдяки цьому ви зможете грати з іншими людьми через локальну мережу. Відмова в наданні цього дозволу не вплине на онлайнові функції чи геймплей загалом. Проте при цьому ви не зможете грати з іншими людьми в одній мережі.",
    // "You cannot play on Realms because of how your Microsoft Account is set up. Please ensure your online safety settings allow Multiplayer and you have an active Xbox Live Gold subscription. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете грати в Realms через налаштування вашого облікового запису Microsoft. Ваші параметри безпеки в Інтернеті мають дозволяти мультиплеєр, і ви повинні мати активну підписку на Xbox Live Gold. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "Horses, Donkeys, and Mules must be §etamed§f before they can be used. A player can tame a horse by riding it and staying on while it tries to buck them off. Press :_input_key.use: with an empty hand to attempt to tame Horses, Donkeys, and Mules.=Щоб коней, ослів і волів можна було використовувати, їх спершу потрібно приручити. Щоб приручити коня, гравець має сісти на нього верхи й не впасти, поки кінь намагатиметься його скинути. Щоб спробувати приручити коня, осла або вола, натисніть :_input_key.use: , не тримаючи нічого в руках.",
    // "For example, to upgrade Diamond equipment to Netherite, you need a Netherite Upgrade Smithing Template, which you can find in Bastion Remnants. Then, place the Diamond equipment in the equipment slot and a Netherite ingot in the ingredient slot, and you're done!=Наприклад, для модернізації алмазного обладнання до незеритового вам потрібен ковальський шаблон «Незеритова модернізація», який можна знайти в залишках бастіону. Потім помістіть алмазне обладнання в слот обладнання та злиток незериту в слот інгредієнтів, і все готово!",
    // "Build anything you can imagine in Creative Mode. Take no damage, fly through the skies, and enjoy instant access to every block in the game! This mode lets you focus on crafting and gives you everything you need to build something beautiful!=У творчому режимі можна будувати все, на що тільки здатна ваша уява. Тут вам нічого не загрожує, ви можете літати в небі й насолоджуватися миттєвим доступом до будь-якого блоку в грі! У цьому режимі можна зосередитися на крафтингу, адже у вас є все необхідне, щоб побудувати щось прекрасне!",
    // "Thank you for downloading the Minecraft Trial for Chromebook! Your playtesting will provide invaluable data for bug fixes and technical troubleshooting. Uncover a bug? Report it at bugs.mojang.com! Other questions? Check out our FAQ.=Дякуємо, що завантажили ознайомлювальну версію Minecraft для Chromebook! Ваше тестування гри надасть безцінні дані для виправлення помилок і технічних несправностей. Знайшли помилку? Повідомте про це за адресою bugs.mojang.com! Інші питання? Ознайомтеся з нашим розділом «‎Запитання й відповіді».",
    // "Your Realm and the 150+ marketplace packs included in Marketplace Pass will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your subscription will be available for 30 days at the price of %s.=Ваш Realm і понад 150 пакетів вмісту з ринку, що входять до Marketplace Pass, стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Ваша підписка буде доступна протягом 30 днів за ціною %s.",
    // "A Realms Plus subscription includes Marketplace Pass. If you are subscribed to Marketplace Pass and want to explore Realms Plus, we suggest that you unsubscribe from Marketplace Pass first. Active Realms Plus subscribers are unable to subscribe to Marketplace Pass.=Підписка Realms Plus включає Marketplace Pass. Якщо ви підписані на Marketplace Pass і хочете також спробувати Realms Plus, радимо спочатку скасувати підписку на Marketplace Pass. Активні передплатники Realms Plus не можуть оформити підписку на Marketplace Pass.",
    // "Border blocks provide a force field that extends infinitely upward and downward, regardless of the presence of other blocks. Players cannot move through, over, or under a Border block. Players cannot place or destroy blocks that are above or below a Border block.=Блоки кордону утворюють силове поле, яке безкінечно розширюється вгору та вниз, незалежно від присутності інших блоків. Гравці не можуть проходити крізь блоки кордону, над або під ними. Гравці не можуть розміщати або знищувати блоки вище або нижче блока кордону.",
    // "Scaffolding can help you create huge structures safely! You can walk inside scaffolding and stand on it. If you have a column of scaffolding you can go upward by standing in the scaffolding and pressing :rift_A:. If you want to travel downward you can press and hold :rift_X:.=Риштування допомагає безпечно зводити величезні будівлі! На риштування можна заходити та стояти на ньому. Якщо звести багаторівневе риштування, ви зможете підійматися ним, натискаючи :rift_A:. Щоб спуститися вниз, натисніть та утримуйте :rift_X:.",
    // "A beloved part of the full Minecraft experience: Creative mode! Access the entire inventory - the only limit to what you can build is your imagination! Fly around your world, make your dream home out of anything and everything, or just blow up a mountain with unlimited TNT!=Улюблена частина гри в Minecraft: творчий режим! Відкрийте весь інвентар і створюйте найнеймовірніші речі, які спадуть вам на думку! Літайте своїм світом, створіть будинок мрії з будь-чого або просто підірвіть гору необмеженою кількістю вибухівки!",
    // "You can steer while gliding by looking around. If you look downwards, you'll gain some speed, but you'll also hit the ground faster. If you look upward, you'll gain some height, but do it for too long and you'll stall - which means you'll start falling.=Під час планерування ви можете керувати польотом, роздивляючись все навколо. Якщо ви подивитеся вниз, то рухатиметеся швидше, але й приземлитеся раніше. Якщо ви подивитеся вгору, то наберете трохи висоти, але якщо з цим переборщити, то ви зупинитесь і почнете падати!",
    // "Your Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your first 30 days will be free and you can renew for 30 days at the price of %s afterwards.=Ваш Realm і понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Перші 30 днів будуть безкоштовними, а потім ви можете оплачувати доступ на 30 за ціною %s.",
    // "Realms Plus is now active for this device. You now have access to 150+ content packs from the marketplace at no additional cost. Up to 10 players can play on your Realms at one time, and get access to all the subscriber content in your Realm - for free!=Підписку на Realms Plus активовано на цьому пристрої. Тепер у вас є доступ до понад 150 пакетів вмісту з ринку без додаткової плати. У ваших Realms одночасно можуть грати до 10 гравців, які отримують доступ до всього вмісту за підпискою у вашому Realm – безкоштовно!",
    // "To dye Leather Armor or Leather Horse Armor, tap a Cauldron filled with water while holding the desired dye. This will change the color of the water inside of the Cauldron. Then dip your armor into the Cauldron by tapping the Cauldron with the armor in your hand.=Щоб пофарбувати шкіряний обладунок або шкіряну кінську збрую, торкніться казана, наповненого водою, тримаючи потрібний барвник. Колір води в казані зміниться. Потім опустіть обладунок або збрую в казан, торкаючись казана з відповідним предметом руці.",
    // "While gliding, you can steer by looking around. If you look downwards, you'll move faster - but you'll also hit the ground sooner. If you look upwards, you'll gain some height - but do it for too long and you'll stall, falling instead of rising!=Під час планерування ви можете керувати польотом, роздивляючись навколо. Якщо ви подивитеся вниз, то рухатиметеся швидше – але й приземлитеся раніше. Якщо ви подивитеся вгору, то наберете трохи висоти – але якщо з цим переборщити, то ви зупинитесь і почнете падати!",
    // "Trading can be done in villages. Each villager has a profession; they can be Farmers, Butchers, Blacksmiths, Cartographers, Librarians, or Priests. Some professions will trade for items that other professions cannot. Explore and trade with many villagers to find all the trades. =Торгівлю можна вести в селах. Кожен селянин має професію: фермер, м’ясник, коваль, картограф, бібліотекар або жрець. Певні професії можуть торгувати предметами, інші – ні. Розмовляйте та торгуйте з усіма, щоб не згаяти можливості.",
    // "Your Realms subscription has been upgraded to Realms Plus. You now have access to 150+ content packs from the marketplace at no additional cost. Up to 10 players can play at one time, and they get access to all the subscriber content in your Realm – for free!=Вашу підписку на Realms оновлено до Realms Plus. Тепер у вас є доступ до понад 150 пакетів вмісту з ринку без додаткової плати. Одночасно можуть грати до 10 гравців, які отримують доступ до всього вмісту за підпискою у вашому Realm – безкоштовно!",
    // "Unfortunately the integrated Twitch broadcasting on Mac requires a version of OSX newer than the one you are on. You must use 10.7 (Mac OS X Lion) or newer to be able to use this service. Would you like to visit apple.com to learn about upgrading?=На жаль, для інтегрованої трансляції Twitch на комп’ютері Mac потрібна новіша від поточної версія OSX. Щоб використовувати цю службу, вам потрібна версія 10.7 (Mac OS X Lion) або новіша. Хочете перейти на сайт apple.com, щоб отримати відомості про оновлення?",
    // "We're unable to connect to the Marketplace to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Reconnect to the internet and download the template to continue.=Не вдалося підключитися до Ринку, щоб завантажити шаблон, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, повторно підключіться до Інтернету та завантажте шаблон.",
    // "Press :_input_key.use: while looking at a Boat to board it. Press :_input_key.left: or :_input_key.right: to turn left or right. Press :_input_key.forward: to move forward. Press :_input_key.jump: or :_input_key.sneak: to get out.=Натисніть :_input_key.use:, дивлячись на човен, щоб сісти в нього. Натисніть :_input_key.left: або :_input_key.right:, щоб повертати ліворуч або праворуч. Натисніть :_input_key.forward:, щоб рухатися вперед. Натисніть :_input_key.jump: або :_input_key.sneak: для виходу.",
    // "To craft a tool, open up your §ecrafting table§f:crafting_table: by walking up to it and pressing :_input_key.use:. You can craft a basic version of most tools using two sticks and a few planks - your §erecipe book§f will tell you how!=Щоб створити інструмент, відкрийте свій §eверстак§f:crafting_table:. Для цього підійдіть до нього і натисніть :_input_key.use:. Базову версію більшості інструментів можна створити за допомогою двох паличок і кількох дошок. У §eкнизі рецептів§f написано, як саме!",
    // "Buy Minecraft and get Creative mode! Access the entire inventory - the only limit to what you can build is your imagination! Fly around your world, make your dream home out of anything and everything, or just blow up a mountain with unlimited TNT! =Придбайте Minecraft і отримайте творчий режим! Відкрийте весь інвентар і створюйте найнеймовірніші речі, які спадуть вам на думку! Літайте своїм світом, створіть будинок мрії з будь-чого або просто підірвіть гору необмеженою кількістю вибухівки!",
    // "To craft a tool, open up your §ecrafting table§f:crafting_table: by walking up to it and right-clicking it. You can craft a basic version of most tools using two sticks and a few planks - your §erecipe book§f will tell you how!=Щоб створити інструмент, відкрийте свій §eверстак§f:crafting_table:. Для цього підійдіть до нього і клацніть правою кнопкою миші. Базову версію більшості інструментів можна створити за допомогою двох паличок і кількох дошок. У §eкнизі рецептів§f написано, як саме!",
    // "You are switching over to the character creator in this slot. Character creator allows you to build a character in Minecraft item by item. Your classic skin will be saved as a back up in this slot if you want to switch back later.=Ви переключаєтеся на створювача персонажів у цьому слоті. Створювач персонажів дає вам змогу конструювати персонажа в Minecraft предмет за предметом. Ваш класичний скін буде збережено в резервній копії у цьому слоті, якщо ви колись захочете переключитися назад.",
    // "You are switching over to a classic skin in this slot.  Classic skins are applied to the full character and cannot be customized. Your character creator look will be saved as back up in this slot if you want to switch back later.=Ви переключаєтеся на класичний скін у цьому слоті. Класичні скіни застосовуються до всього персонажа й не підлягають налаштуванню. Ваш вигляд зі створювача персонажів буде збережено в резервній копії у цьому слоті, якщо ви колись захочете переключитися назад.",
    // "The Book & Quill lets you record your adventures. Tell your story by entering text into the pages. You can even change the title and the author! Sign the Book & Quill to finalize your work. The Book & Quill will be editable until it is signed. =Книга й перо дають змогу записувати пригоди. Розкажіть свою історію, ввівши текст на сторінках. Ви навіть можете змінити заголовок і автора! Підпишіть книгу й перо, щоб завершити роботу. Книгу й перо можна редагувати, доки не поставлено підпис.",
    // "Parrots are a passive mob that live in the Jungle. They will imitate any other mob in the area. Seeds are their favorite, give them a few to tame them. Parrots will also sit on your shoulder... Yes, you can have more than one up there.=Папуги – це пасивні моби, які живуть у джунглях. Вони копіюють інших мобів у своїй місцевості. Понад усе папуги люблять насіння, тож, щоб приручити їх, дайте їм трохи насіння. Папуги також сидять на вашому плечі… Так, сидіти на плечі може кілька папуг.",
    // "There are several mobs in Minecraft that you can tame and make your pet. Each can be tamed by giving them an item that they like. Once tamed you can have them stay by pressing :_input_key.use: while looking at them.=У Minecraft є кілька мобів, яких можна приручити та зробити своїми домашніми улюбленцями. Щоб приручити одного з таких мобів, потрібно дати йому предмет, який йому подобається. Щоб змусити прирученого моба залишитися з вами, натисніть :_input_key.use:, дивлячись на нього.",
    // "The Crossbow is an alternate ranged weapon. Press and hold :_input_key.use: to load the crossbow. Once the Crossbow is loaded, it will stay loaded until it is fired. Press :_input_key.use: to fire an arrow. The Crossbow requires arrows to load.=Арбалет – це ще одна зброя для дальнього бою. Натисніть і утримуйте :_input_key.use:, щоб зарядити арбалет. Арбалет залишатиметься зарядженим до вистрілу. Натисніть :_input_key.use:, щоб випустити стрілу. В арбалет потрібно заряджати стріли.",
    // "If the Enchantment Table is surrounded by Bookshelves (up to a maximum of 15), with a one block gap between the Bookshelf and the Enchantment Table, arcane glyphs will be seen going to the book on the Enchantment Table and the potency of the enchantments will be increased.=Якщо стіл зачарування оточують книжкові полиці (максимум 15) і між книжковою полицею та столом зачарування є проміжок в один блок, із книги на столі зачарування вириватимуться таємні символи, а сила чарів зросте.",
    // "Selecting \"Keep Owning Player Data\", will retain your current data (such as inventory items & location) and apply it the 'World Owner'. This is any player that loads the world locally or the owner of a realm it's on. =Якщо вибрати \"Залишити дані гравця-власника\", то ваші поточні дані (наприклад, речі в інвентарі та розташування) залишаться й застосуються як до \"Власника світу\". Це будь-який гравець, який завантажує світ локально, або власник Realm, у якому запущено той світ.",
    // "Do you want to play with whatever you buy from any Minecraft Store enabled system? Sign in with a FREE Microsoft account and sync your purchased Skins, Textures, Maps, and Mash-ups to use and play in Minecraft!=Ви хочете використовувати в грі все, що купуєте на будь-якій системі з підтримкою Магазину Minecraft? Увійдіть під своїм БЕЗКОШТОВНИМ обліковим записом Microsoft і синхронізуйте придбані скіни, текстури, карти та збірні пакети, які можна використовувати для гри в Minecraft!",
    // "Press :_input_key.use: while looking at a Boat to board it. Push :_gamepad_stick_left: left or right to turn. Push :_gamepad_stick_left: forward to move forward. Press :_input_key.jump: or :_input_key.sneak: to get out.=Щоб сісти в човен, натисніть :_input_key.use:, дивлячись на нього. Щоб повернути, штовхніть :_gamepad_stick_left: вліво або вправо. Щоб рухатися вперед, штовхайте :_gamepad_stick_left: уперед. Щоб зійти з човна, натисніть :_input_key.jump: або :_input_key.sneak:.",
    // "Your Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your subscription will be available for 30 days at the price of :minecoin:%s.=Ваш Realm і понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Ваша підписка буде доступна протягом 30 днів за ціною :minecoin:%s.",
    // "Realms Plus is currently available on any platform where you can install Minecraft Bedrock Edition. You can play Realms and use any content from Realms Plus on any of these devices if you’re signed into your Microsoft Account.=Нині Realms Plus доступний на будь-якій платформі, де можна встановити Minecraft Bedrock Edition. Ви можете відтворювати Realms і використовувати будь-який вміст Realms Plus на будь-якому з цих пристроїв, якщо ви ввійшли у свій обліковий запис Microsoft.",
    // "The full Minecraft experience lets you enjoy Creative mode, achievements and Multiplayer with your friends across Minecraft devices! Play with friends on console, PC and mobile to create, explore and survive together.=Повний доступ до Minecraft дає змогу насолодитися творчим режимом, досягненнями та мультиплеєром і грати з друзями на будь-яких пристроях із Minecraft! Грайте з друзями на консолі, комп’ютері чи мобільному пристрої, щоб створювати, досліджувати та виживати разом.",
    // "The Trident is a dual-purpose melee and ranged weapon. Press :_input_key.attack: to attack. Press and hold :_input_key.use: to draw the trident back. Release :_input_key.use: to throw the trident. The Trident is the best weapon underwater.=Тризуб – це дистанційна й водночас холодна зброя. Натисніть :_input_key.attack:, щоб ударити. Натисніть і утримуйте :_input_key.use:, щоб замахнутися тризубом. Відпустіть :_input_key.use:, щоб метнути його. Тризуб – найкраща підводна зброя.",
    // "The End is home to the dreaded Ender Dragon. She is a fierce and powerful enemy and seems to draw power from strange crystals. Her breath and fireball attacks leave lingering acid across the battlefield. Bring some friends to ensure your victory!=Енд – домівка страшного дракона Ендеру. Це лютий могутній ворог, який, здається, черпає силу з дивних кристалів. Його дихання та фаєрболи залишають кислотні сліди на полі бою. Візьміть із собою кількох друзів, щоб точно перемогти!",
    // "You cannot chat with other players because of how your Microsoft Account is set up. Please ensure your privacy settings allow communicating with others. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете спілкуватися з іншими гравцями через налаштування вашого облікового запису Microsoft. Ваші параметри конфіденційності мають дозволяти спілкування з іншими людьми. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "This world has ray tracing enabled resource packs applied that you must download in order to play. Your device is not compatible with ray tracing so you will only see the basic textures after downloading. Would you like to download this pack?=Цей світ містить пакет ресурсів із трасуванням променів, який вам потрібно завантажити для гри. Ваш пристрій не підтримує трасування променів, тому ви бачитимете лише базові текстури після завантаження. Хочете завантажити цей пакет?",
    // "To craft a tool, open up your §ecrafting table§f:crafting_table: by walking up to it and tapping it. You can craft a basic version of most tools using two sticks and a few planks - your §erecipe book§f will tell you how!=Щоб створити інструмент, відкрийте свій §eверстак§f:crafting_table:. Для цього підійдіть до нього і торкніться його. Базову версію більшості інструментів можна створити за допомогою двох паличок і кількох дошок. У §eкнизі рецептів§f написано, як саме!",
    // "Do you want to continue exploring, crafting, and building? Unlock the full game to play as long as you want! This world will be saved for you to pick up where you left off but you can't modify it until you unlock the full game.=Хочете й далі досліджувати, крафтити й будувати? Якщо так, розблокуйте повну версію гри! Цей світ буде збережено, тож ви зможете продовжити з того місця, де зупинилися, але ви не можете змінювати цей світ, доки не розблокуєте повну версію гри.",
    // "Example: loading an empty shipwreck into the bottom of the ocean will normally copy air over the water blocks. If the shipwreck was filled with structure void, then the water will stay, and you will have a shipwreck filled with water.=Приклад: внаслідок завантаження уламка корабля на дно океану зазвичай скопіюється повітря поверх водних блоків. Якщо уламок корабля було заповнено структурною пустотою, то вода залишиться, і у вас буде уламок корабля, заповнений водою.",
    // "Welcome!%1%1You have %2 trials of Minecraft Education available before your school or organization will need to purchase a license.%1%1Every time you open Minecraft Education, you will use one trial. Enjoy!=Ласкаво просимо!%1%1У вас доступно %2 спроб зіграти в Minecraft Education, перш ніж вашому навчальному закладу або організації знадобиться придбати ліцензію.%1%1Щоразу, коли ви відкриватимете Minecraft Education, ви використаєте одну спробу. Насолоджуйтеся грою!",
    // "Cows, mooshrooms, and sheep all eat Wheat. Pigs can eat Carrots or Beetroot. Chickens love Seeds of any kinds. Rabbits will eat Carrots, Golden Carrots, or Dandelions. Ocelots enjoy Raw Cod or Salmon. Wolves like to eat any kind of meat.=Корови, мушруми та вівці їдять пшеницю. Свині можуть їсти моркву та буряк. Кури люблять насіння будь-якого виду. Кролики їдять моркву, золоту моркву та кульбабки. Оцелоти полюбляють сиру тріску й лосося. Вовки їдять будь-яке м’ясо.",
    // "We can't update your Realm server right now because other players are currently online. You can close and reopen your Realm from the Manage Realm screen to make the other players quit and then join your Realm to update it.=Ми не можемо оновити ваш сервер Realm зараз, оскільки інші гравці наразі онлайн. Ви можете закрити та знову відкрити свій Realm з екрана «Керування Realm», щоб інші гравці вийшли, а потім знову приєднатися до вашого Realm, коли ви оновите його.",
    // "Want to make wolves act like bunnies? Turn all the trees into cotton candy? You can alter everything in the full Minecraft experience with add-ons! Plus get access to Multiplayer, Creative mode, achievements and more!=Хочете, щоб вовки поводилися як кролики? Щоб усі дерева перетворилися на солодку вату? У повній версії Minecraft із доповненнями можна змінювати в грі все! А ще ви отримаєте доступ до мультиплеєра, творчого режиму, досягнень і багато чого іншого!",
    // "Your Realm and 150+ marketplace packs will be immediately available. Up to 10 players can play at one time, and they get access to the worlds in your Realm for free! Your subscription will be available for 30 days at the price of %s.=Ваш Realm і понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Одночасно можуть грати до 10 гравців, які отримують доступ до світів у вашому Realm безкоштовно! Ваша підписка буде доступна протягом 30 днів за ціною %s.",
    // "In addition to the full Minecraft experience with Creative mode, Multiplayer, and more, you'll earn achievements and a Gamerscore to mark your Minecraft progress and show your Microsoft Account friends your accomplishments.=Окрім творчого режиму та мультиплеєра, повна версія Minecraft надає можливість заробляти досягнення й очки гравця. З їх допомогою ви зможете простежити ваш прогрес у грі та показувати свої досягнення друзям по обліковому запису Microsoft.",
    // "Realms Plus is a subscription to a personal server supporting up to 10 simultaneous players, along with unlimited access to 150+ great Minecraft worlds, texture packs, skin packs, and mash-ups for one low monthly price.=Realms Plus – це підписка на особистий сервер із підтримкою до 10 одночасних гравців, а також необмеженим доступом до понад 150 відмінних світів, пакетів текстур, пакетів скінів і збірних пакетів Minecraft за єдиною низькою щомісячною ціною.",
    // "The full Minecraft experience unlocks access to Seeds! Seeds help you discover new biomes - survive on ice plains, ascend extreme hills, or trek across deserts. Start with unique templates or explore random new worlds!=Розблокуйте повну версію Minecraft і спробуйте сіди! Сіди допомагають знаходити нові біоми — виживати на льодових рівнинах, сходити на височенні пагорби або долати пустелі. Почніть із унікальних шаблонів або досліджуйте випадкові нові світи!",
    // "When creating a world, you have many options. Below are the various settings that can be used to fine tune your experience. Don't worry if you didn't set them when you created the world, they can be changed at any time.=Коли ви створюєте світ, у вас є багато можливостей. Нижче наведено різноманітні параметри, які ви можете використовувати для своєї зручності. Не переймайтеся, якщо ви не бачили їх, коли створювали світ, їх можна змінити в будь-який момент.",
    // "Wolves are a neutral mob that hunt in the colder climates. They will attack Rabbits, Skeletons, and Sheep but run away from Llamas. They won't attack you unless you provoke them. You can tame them by giving them Bones.=Вовки – це нейтральні моби, які полюють у місцевості з холодним кліматом. Вони нападають на кроликів, скелетів і овець, але тікають від лам. Вовки не нападатимуть на вас, якщо ви їх не спровокуєте. Щоб приручити вовка, дайте йому кістку.",
    // "Your purchase succeeded, but we couldn't create your Realm right now. We will create your Realm as soon as possible. Check back later on this device. If this problem happens for more than a day, please contact Mojang Support.=Покупку виконано, але зараз ми чомусь не можемо створити ваш Realm. Ми створимо його, щойно це стане можливим. Перевірте це трохи згодом на цьому пристрої. Якщо проблема триватиме понад добу, зверніться до служби підтримки Mojang.",
    // "You cannot play online multiplayer because of how your Microsoft Account is set up. Please ensure your online safety settings allow Multiplayer. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете грати в онлайновий мультиплеєр через налаштування вашого облікового запису Microsoft. Ваші параметри безпеки в Інтернеті мають дозволяти мультиплеєр. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "Worlds and packs included in the subscription can either be played online, played on your personal Realm, or played on a local device. You just need to play online once every 30 days to validate that your subscription is active.=Зі світами й пакетами, що входять до цієї підписки, можна грати або онлайн у своєму персональному Realm, або на локальному пристрої. Вам потрібно просто грати онлайн кожні 30 днів, щоб засвідчувати, що ваша підписка активна.",
    // "You can §ebreak blocks§f with your bare hands to gather resources like dirt and wood. Aim at a block, then §etouch and hold§f :tip_virtual_button_action_attack_or_destroy:  until it breaks and the resources drop. =Ви можете §eрозбивати блоки§f голими руками, щоб зібрати такі ресурси, як земля і деревина. Наведіть ціль на блок, потім §eторкніться і утримуйте,§f :tip_virtual_button_action_attack_or_destroy: поки він не зламається і ресурси не впадуть.",
    // "Some Dye materials are harder to find than others. Most Dyes can be crafted from flowers, like §eRed Dye§f from a Poppy, but some Dyes are found or created in more obscure ways such as:=Деякі матеріали для барвників знайти важче, ніж інші. Хоча більшість барвників можна виготовити з квітів (наприклад, §eчервоний барвник§f із маку), деякі барвники зустрічаються в місцях, яких складніше дістатися, або потрібно створювати незвичними способами, як-от:",
    // "Want to move something between your §ehotbar§f and your inventory? Use the cursor to select an item and press :_input_key.use:. Then, move your cursor to an empty item slot and press again to drop the item.=Хочете перемістити щось між §eпанеллю швидкого доступу§f й інвентарем? За допомогою курсору виберіть предмет і натисніть :_input_key.use:. Потім перемістіть курсор до порожнього слоту для предметів і натисніть ще раз, щоб залишити там предмет.",
    // "Tap into the source of amazing Minecraft content! With Marketplace Pass, you get instant access to 150+ marketplace items like mash-ups, worlds, skin packs and epic adventures - with new additions each month.=Дістаньтеся до джерела дивовижного вмісту Minecraft! З підпискою Marketplace Pass ви отримуєте миттєвий доступ до понад 150 предметів із ринку, як-от збірних пакетів, світів, пакетів скінів і епічних пригод — зі щомісячними доповненнями.",
    // "Adding a Loom Pattern to the Loom's third slot will allow the crafting of special patterns like a creeper face or a flower pattern. You will not lose your Loom Patterns when you apply these patterns to your Banners.=Якщо до третього слота ткацького верстата додати візерунок ткацького верстата, ви зможете крафтити особливі візерунки, як-от обличчя кріпера чи квітковий узор. Візерунки ткацького верстата не втрачаються після нанесення на стяги.",
    // "There are several mobs in Minecraft that you can tame and make your pet. Each can be tamed by giving them an item that they like. Once tamed you can have them stay by tapping the Sit Button.=У Minecraft є кілька мобів, яких можна приручити та зробити своїми домашніми улюбленцями. Щоб приручити одного з таких мобів, потрібно дати йому предмет, який йому подобається. Щоб змусити прирученого моба залишитися з вами, торкніться кнопки \"Сидіти\".",
    // "To upload your world, accept the Microsoft Services Agreement. Uploaded worlds are subject to the Microsoft Services Agreement, which can be found under Terms of Use. You can still play with your world once uploaded.=Щоб передати свій світ, прийміть Угоду про використання служб Microsoft. На передані світи поширюється Угода про використання служб Microsoft, яка знаходиться під Умовами використання. Ви зможете грати у своєму переданому світі.",
    // "By placing a Banner into the Loom's first slot, and any color dye into the second slot, patterns can be added to the Banner. Once a pattern is selected, take it from the output slot on the right and move it to your inventory.=Щоб нанести візерунки на стяг, потрібно помістити стяг у перший слот ткацького верстата, а барвник у другий слот. Виберіть візерунок, а потім заберіть його зі слота продукції праворуч і перемістіть до свого інвентарю.",
    // "Want to move something between your §ehotbar§f and your inventory? Use the cursor to select an item and press :_gamepad_face_button_down:. Then, move your cursor to an empty item slot and press again to drop the item.=Хочете перемістити щось між §eпанеллю доступу§f й інвентарем? За допомогою курсора виберіть предмет і натисніть :_gamepad_face_button_down:. Потім перемістіть курсор на пустий слот і натисніть ще раз, щоб покласти предмет.",
    // "Oops! It looks like you signed in with a personal account. This account is not eligible to use Minecraft Education. Please make sure you are signing in with a school or organizational account and try again.=Ой! Схоже, ви ввійшли під особистим обліковим записом. Цей обліковий запис не має прав на гру в Minecraft Education. Переконайтеся, що ви входите під навчальним обліковим записом або обліковим записом організації, і спробуйте ще раз.",
    // "You need to put some fuel into the bottom of the Furnace, and the item that you want smelted in the top. The Furnace will then fire up and start working. Lots of things can be used as fuel; try experimenting with anything burnable!=Покладіть трохи палива знизу печі та предмет, який потрібно переплавити, вгорі. Після цього піч загориться та почне працювати. Як паливо можна використовувати багато речей; експериментуйте з усім, що горить!",
    // "Item properties such as enchantments and armor trims will be retained, but the Smithing Template will be consumed when you upgrade your equipment. Don't worry - you can craft copies of them with your Crafting Table.=Властивості предметів, такі як чари та оздоблення обладунків, будуть збережені, але ковальський шаблон буде витрачено під час модернізації обладнання. Не хвилюйтеся, ви можете створити їх копії за допомогою свого верстака.",
    // "Enable cross-platform play in the main menu to connect with friends on other platforms. To play with other friends online without cross-play, the host of the game must also have cross-play disabled via the main menu.=Увімкніть кросплатформенну гру в головному меню, щоб підключитися до друзів на інших платформах. Щоб грати з іншими друзями онлайн на одній платформі, хост гри має вимкнути функцію кросплатформенної гри в головному меню.",
    // "You cannot add friends because of how your Microsoft Account is set up. Please ensure your online safety settings allow adding friends. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете додавати друзів через налаштування вашого облікового запису Microsoft. Ваші параметри безпеки в Інтернеті мають дозволяти додавання друзів. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "Explore, craft, build, and have fun! In this trial world, you will have 90 minutes of play time. Uncover a bug? Report it at bugs.mojang.com! Other questions? Check out our FAQ.=Досліджуйте, створюйте, будуйте та розважайтесь! У цьому світі з ознайомлювальної версії у вас буде 90 хвилин ігрового часу. Знайшли помилку? Повідомте про це за адресою bugs.mojang.com! Інші питання? Ознайомтеся з нашим розділом «‎Запитання й відповіді».",
    // "You'll also have access to Inspiration Island, a tutorial world and introduction to Creative mode that'll teach you how to be a master builder in no time! You can find more great worlds like this in Minecraft Marketplace.=У вас також буде доступ до Острова натхнення – навчального світу, що слугує вступом до творчого режиму, де ви дуже швидко опануєте мистецтво будування. А на Ринку Minecraft ви знайдете інші подібні чудові світи.",
    // "The Trident is a dual-purpose melee and ranged weapon. Tap mobs to attack them. Press and hold the Screen to draw the trident back. Release the press to throw the trident. The Trident is the best weapon underwater.=Тризуб – це дистанційна й водночас холодна зброя. Торкніться мобів, щоб ударити їх. Натисніть і утримуйте ділянку екрана, щоб замахнутися тризубом. Відпустіть її, щоб метнути тризуб. Тризуб – найкраща підводна зброя.",
    // "You cannot play on Realms because of how your Microsoft Account is set up. Please ensure your online safety settings allow Multiplayer. See instructions for changing these settings at aka.ms/MCMultiplayerHelp.=Ви не можете грати в Realms через налаштування вашого облікового запису Microsoft. Ваші параметри безпеки в Інтернеті мають дозволяти мультиплеєр. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCMultiplayerHelp.",
    // "Get access to Minecraft Marketplace, our in-game store. Switch up your look with new skins, change your world, or explore incredible new maps from the best community creators! Get the full game today!=Відвідайте Ринок Minecraft, наш магазин у грі. Змінюйте свою зовнішність за допомогою нових скінів, змінюйте свій світ або досліджуйте нові неймовірні карти від найкращих творців спільноти! Отримайте повну версію гри вже сьогодні!",
    // "The Loom is a fast and efficient way to apply patterns to Banners. The Loom only uses one Dye to apply a pattern. It can also use Loom patterns to apply special patterns.=Щоб швидко й ефективно наносити візерунки на стяги, використовуйте ткацький верстат. На ткацькому верстаті можна нанести візерунок за допомогою лише одного барвника. А для нанесення особливих візерунків можна також використовувати візерунки ткацького верстата.",
    // "Don't worry, you don't need to remember every recipe by heart. The §erecipe book§f in your inventory keeps track of blocks and items you can craft - simply select a recipe to see what you need to craft it.=Не хвилюйтеся, вам не потрібно запам’ятовувати кожен рецепт. §eКнига рецептів§f у інвентарі дає змогу стежити за блоками та предметами, які можна крафтити. Просто виберіть рецепт, щоб побачити, що вам потрібно для крафтингу.",
    // "Don't worry, you don't need to remember every recipe by heart. The §erecipe book§f in your inventory keeps track of blocks and items you can craft - simply tap a recipe to see what you need to craft it.=Не хвилюйтеся, вам не потрібно запам’ятовувати кожен рецепт. §eКнига рецептів§f у інвентарі дає змогу стежити за блоками та предметами, які можна крафтити. Просто торкніться рецепта, щоб побачити, що вам потрібно для крафтингу.",
    // "Don't worry, you don't need to remember every recipe by heart. The §erecipe book§f in your inventory keeps track of blocks and items you can craft - simply click a recipe to see what you need to craft it.=Не хвилюйтеся, вам не потрібно запам’ятовувати кожен рецепт. §eКнига рецептів§f у інвентарі дає змогу стежити за блоками та предметами, які можна крафтити. Просто клацніть рецепт, щоб побачити, що вам потрібно для крафтингу.",
    // "See who's playing and when in the Timeline. Scroll through the members of the Realm to see when they played last and who they played with. Use this information to set up times when you can all play together.=З хронології можна дізнатися, хто й коли підключався. Прокрутіть список членів Realm, щоб побачити, коли та з ким вони були в Realm востаннє. Використовуйте цю інформацію, щоб визначити час, коли ви можете зіграти разом.",
    // "Servers offer some of the most creative ways to enjoy Minecraft! Play great mini-games, meet the Minecraft community and make new friends. Unlock the full Minecraft experience to try Servers today!=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Грайте в чудові міні-ігри, познайомтеся зі спільнотою Minecraft і заводьте собі друзів. Розблокуйте повну версію Minecraft, щоб випробувати сервери вже сьогодні!",
    // "Putting Nether Wart in the top position of the Brewing Stand will give you an Awkward Potion. This doesn't have any effect by itself, but creates a base potion that can be used to create more advanced potions.=Якщо покласти незерський наріст у верхній частині варильної стійки, можна зробити зілля незграбності. Воно не має жодного ефекту саме по собі, але є базовим зіллям, яке можна взяти за основу для створення складнішого.",
    // "Your current skin violates our Community Standards. Please select a different skin to join a multiplayer game. Click \"%s\" to view our Community Standards or submit a case review for your current skin.=Ваш поточний скін порушує наші Стандарти спільноти. Оберіть інший скін, щоб приєднатися до мультиплеєра. Натисніть «%s», щоб переглянути наші Стандарти спільноти, або надішліть запит на розгляд ситуації для поточного скіна.",
    // "Your Realm has expired, but don't worry! We will keep it online for another %d days. You can now go ahead and extend it using the new auto-renewing subscription, so you don't have to worry about keeping your Realm up and running ever again.=Термін дії вашого Realm сплив. Утім, не хвилюйтеся! Він буде доступний ще протягом %d дн. Увімкніть автоматичне подовження передплати зараз, щоб більше не перейматися доступністю Realm.",
    // "You do not have enough space to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Clear up space on your device to continue.=Недостатньо вільного місця, щоб завантажити шаблон, використаний для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, очистьте місце на пристрої.",
    // "Try to watch for landmarks as you explore. The more you play on a world, the more you will be able to remember where you are. Another good trick is to place Torches as you go so that you may find your way back home.=Звертайте увагу на орієнтири в ході дослідження. Що більше ви гратимете у світі, то краще орієнтуватиметеся в ньому. Ще один корисний трюк – розміщати смолоскипи на шляху, щоб можна було знайти дорогу додому.",
    // "§eSeed§f: This is a unique number for the world. By entering a seed when you make a new world, you can control how it is created. You can also use a word or phrase for the seed and the game will convert it to a number for you.=§eСід§f: унікальний номер світу. Якщо ввести сід під час створення нового світу, ви зможете контролювати його створення. Також можна вказати як сід слово або фразу, і гра перетворить їх на номер.",
    // "Place your crafting table in the world, then walk up to it and press :_input_key.use: to open it. The larger crafting grid will let you make bigger and better things, including tools, beds, and doors.=Розмістіть сітку для крафтингу в світі, потім підійдіть до неї та натисніть :_input_key.use:, щоб відкрити. Більша сітка для крафтингу дозволить вам створювати більші та кращі речі, включаючи інструменти, ліжка та двері.",
    // "The Shield will block incoming damage. The Shield can be equipped in the offhand slot as well as the hotbar. Press :_input_key.sneak: or click :windowsmr_right_stick: to toggle block with the Shield.=Щит блокуватиме вхідні пошкодження. Щит може бути на озброєнні в слоті під рукою та на панелі швидкого доступу. Натисніть :_input_key.sneak: або клацніть :windowsmr_right_stick:, щоб прикритися щитом або відставити його.",
    // "You will not be able to add new friends to play on your realm with you because of how your Xbox account is set up. This can be changed in your privacy & online safety settings on Xbox.com. Do you want to continue?=Ви не зможете додавати нових друзів до гри в реалмі через налаштування вашого облікового запису Xbox. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com. Хочете продовжити?",
    // "Achievements are only available in worlds set to survival mode with cheats off. If you continue, no one will earn achievements while playing in this world ever again even if you switch back before playing.=Досягнення доступні лише у світах у режимі виживання з вимкнутими чітами. Якщо ви продовжите, жоден гравець більше ніколи не зможе заробляти досягнення в цьому світі, навіть якщо ви зміните своє рішення перед грою.",
    // "With a Realm subscription, you can create a new %s Realm using the “Create New” button in the main menu. If you don’t have a Realms subscription yet, please go to the full version of Minecraft to sign up. =Маючи підписку на Realm, ви можете створити новий %s Realm за допомогою кнопки «Створити новий» в головному меню. Якщо у вас ще немає підписки на Realms, перейдіть до повної версії Minecraft, щоб зареєструватися.",
    // "Based on your recent support ticket, Mojang Player Support has granted permission to upload your world. You can upload your affected world from the World Select screen or under World Settings.=На підставі вашого нещодавнього запита на підтримку, служба підтримки гравців Mojang надала дозвіл на передавання вашого світу. Ви можете передати свій вражений світ з екрана \"Вибір світу\" або в розділі \"Параметри світу\".",
    // "An item can be repaired by placing it in one of the input slots on the left, along with either some raw materials of the item, like Iron Ingots for an Iron Sword, or combined with another item of the same type.=Щоб відновити предмет, помістіть його в один із вхідних слотів ліворуч разом із сировиною для цього предмета, як-от із залізними злитками для залізного меча, або в поєднанні з іншим предметом такого ж типу.",
    // "Place a Template into the leftmost slot of a Smithing Table to see which items you need for the upgrade. Then place a piece of armor in the equipment slot and a crystal or ingot in the ingredient slot. Done!=Помістіть шаблон у крайній лівий слот ковальського столу, щоб побачити, які предмети потрібні для модернізації. Потім помістіть обладунок у слот обладнання та кристал або злиток у слот інгредієнта. Усе готово!",
    // "When an enchantable item is placed in the slot below the book in the Enchantment Table, the three buttons to the right of the slot will display some enchantments with their Experience Level cost and Lapis Lazuli cost.=Якщо вставити предмет, який можна зачарувати, у слот під книгою на столі зачарування, три кнопки праворуч від слота відобразять деякі зачарування з необхідним рівнем досвіду та кількістю лазуриту.",
    // "When powered by Redstone, Droppers will drop a single random item contained within. Press :_input_key.use: on the Dropper to open it and then you can load it with items from your inventory.=Після активації за допомогою редстоуну виштовхувачі виштовхують один довільний предмет, який міститься всередині. Натисніть :_input_key.use: на виштовхувачі, щоб відкрити його, а потім завантажте його предметами з інвентарю.",
    // "§eDefault Game Mode§f: This is the gamemode that all new players to the world will start with. You can have players start in either survival or creative mode. Selecting creative mode will turn cheats on.=§eСтандартний режим гри§f: виберіть режим гри, який діятиме для всіх нових гравців у світі. Ви можете вказати початок гри в режимі виживання або у творчому режимі. Якщо вибрати творчий режим, ввімкнуться чіти.",
    // "Continuing will remove all current packs and then add the pack you are trying to apply. This will remove all behavior packs from the world which can break the world and cause you to lose what you created.=Якщо продовжити, буде видалено всі поточні пакети, а потім додано пакет, який ви хочете застосувати. Усі пакети параметрів буде видалено зі світу. Це може зламати світ, і ви втратите все, що створили раніше.",
    // "The full game allows access to Minecraft Marketplace, our in-game store. Switch up your look with new skins, change your world, or explore incredible new maps from the best community creators!=Повна версія гри відкриває доступ до Ринку Minecraft, нашого магазину у грі. Змінюйте свою зовнішність за допомогою нових скінів, змінюйте свій світ або досліджуйте нові неймовірні карти від найкращих творців спільноти!",
    // "You have %2 trials of Minecraft Education remaining before your school or organization will need to purchase a license.%1%1Every time you open Minecraft Education, you will use one trial. =У вас залишиться %2 спроб зіграти в Minecraft Education, перш ніж вашому навчальному закладу або організації знадобиться придбати ліцензію.%1%1Щоразу, коли ви відкриватимете Minecraft Education, ви використаєте одну спробу.",
    // "A personal server allows you to create a shared world that is always online and accessible from any device with Minecraft Marketplace. Players that you invite to your Realm can play this world at any time.=Особистий сервер дає вам змогу створювати спільний світ, який завжди доступний для входу з будь-якого пристрою з Ринком Minecraft. Гравці, яких ви запрошуєте до свого Realm, можуть грати в ньому будь-коли.",
    // "You have 1 trial of Minecraft Education remaining before your school or organization will need to purchase a license.%1%1Every time you open Minecraft Education, you will use one trial. =У вас залишиться 1 спроба зіграти в Minecraft Education, перш ніж вашому навчальному закладу або організації знадобиться придбати ліцензію.%1%1Щоразу, коли ви відкриватимете Minecraft Education, ви використаєте одну спробу.",
    // "The Shield will block incoming damage. The Shield can be equipped in the offhand slot as well as the hotbar. Press :_input_key.sneak: or press :_gamepad_stick_right: to toggle block with the Shield.=Щит блокуватиме вхідні пошкодження. Щит може бути на озброєнні в слоті під рукою та на панелі швидкого доступу. Натисніть :_input_key.sneak: або :_gamepad_stick_right:, щоб прикритися щитом або відставити його.",
    // "This is your final trial of Minecraft Education.%1%1After this session, your school or organization will need to purchase a license for you to continue to use all the features of Minecraft Education.=Це ваша остання спроба зіграти в Minecraft Education.%1%1Після цього сеансу ваш навчальний заклад або організація має придбати ліцензію для вас, щоб продовжити використовувати всі функції Minecraft Education.",
    // "Anyone with this link can become a member of your Realm. Be careful who you share it with. You may want to download a backup of your world first. You can remove members from Realm settings.=Усі, хто має це посилання, можуть стати учасниками вашого реалму. Слідкуйте за тим, з ким ви ділитеся посиланням. Ви можете спочатку завантажити резервну копію свого світу. Учасників можна видалити з параметрів реалму.",
    // "Certain commands like teleport are only available with cheats ON. Cheats can also be turned on through the Game menu under Game Settings. If you choose to turn cheats on, achievements will be disabled in this world.=Деякі команди, як-от телепорт, доступні лише за ввімкнутих чітів. Чіти також можна ввімкнути в меню гри в параметрах гри. Якщо ви вирішите ввімкнути чіти, досягнення в цьому світі вимкнуться.",
    // "Classroom Mode is an external application that provides educators with features designed to facilitate interaction with students. You can download Classroom Mode from the Minecraft Education website.=\"Режим класу\" – це зовнішня програма, завдяки якій викладачі отримують функції, створені задля спрощення взаємодії з учнями. Ви можете завантажити програму \"Режим класу\" на веб-сайті Minecraft Education.",
    // "Realms Plus members enjoy unlimited access to over 150+ great Minecraft worlds, texture packs, skin packs, and mash-ups, until either the subscription expires, or a pack leaves the catalog.=Учасники Realms Plus мають необмежений доступ до понад 150 відмінних світів, пакетів текстур, пакетів скінів і збірних пакетів Minecraft, доки термін дії їхньої підписки не завершиться або пакет не зникне з каталогу.",
    // "§eTerracotta§f - This is found naturally in Badlands biomes or can be crafted and dyed from Clay that is found underwater. Terracotta can be made into Glazed Terracotta by smelting it in a Furnace.=§eКераміка§f — у природі зустрічається в біомах пустища. Її можна виготовити з глини, яка зустрічається під водою, і пофарбувати. Кераміку можна перетворити на глазуровану кераміку, якщо переплавити в печі.",
    // "Pictures you have taken appear in the Portfolio. Press :_input_key.use: to view the Portfolio. When viewing the Portfolio, you can add captions to pictures, delete pictures, and export pictures as a PDF.=Зроблені знімки з’являються в портфоліо. Натисніть :_input_key.use:, щоб переглянути портфоліо. Переглядаючи портфоліо, ви можете додати підписи до знімків, видалити або експортувати їх у форматі PDF.",
    // "This Microsoft Account will not be the primary account for this device if you do not sync this device's purchases to this account. You will not automatically sign in when you start Minecraft.=Цей обліковий запис Microsoft не буде основним для цього пристрою, якщо ви не синхронізуєте покупки, зроблені для пристрою, з цим обліковим записом. Вхід не буде відбуватись автоматично під час запуску Minecraft.",
    // "A social hub for you and all the members of the Realm. Share your adventures and creations by posting stories to the Story Feed, like and comment to celebrate stories posted by other members.=Соціальний хаб для вас і всіх членів Realm. Діліться своїми пригодами та творіннями, публікуючи історії в стрічці історій, ставте вподобайки та коментуйте, щоб відзначити історії, опубліковані іншими учасниками.",
    // "While exploring the world you may encounter a Pillager encampment or patrol. Pillagers are always looking for villages to raid. Taking their Banners will get their attention, and they may choose to attack a nearby village.=Досліджуючи світ, ви можете натрапити на табір або патруль мародерів. Мародери завжди шукають села для рейдів. Якщо захопити стяги мародерів, вони можуть напасти на найближче село.",
    // "You can §ebreak blocks§f with your bare hands to gather resources like dirt and wood. Aim at a block, then §epress and hold§f :_input_key.attack:  until it breaks and the resources drop. =Ви можете §eрозбивати блоки§f голими руками, щоб зібрати такі ресурси, як земля і деревина. Наведіть ціль на блок, потім §eнатисніть і утримуйте,§f :_input_key.attack: поки він не зламається і ресурси не впадуть.",
    // "You can §ebreak blocks§f with your bare hands to gather resources like dirt and wood. Aim at a block, then §eclick and hold§f :_input_key.attack:  until it breaks and the resources drop. =Ви можете §eрозбивати блоки§f голими руками, щоб зібрати такі ресурси, як земля і деревина. Наведіть ціль на блок, потім §eклацніть і утримуйте,§f :_input_key.attack: поки він не зламається і ресурси не впадуть.",
    // "In order to keep your livestock growing, you have to make baby animals. Adult animals must enter Love Mode for this to happen. Feed the animals their preferred food to get them to enter Love Mode.=Щоб поголів’я худоби збільшувалося, мають народжуватися нові тваринки. Для цього дорослі тварини повинні перейти в режим кохання. Годуйте тварин їхньою улюбленою їжею, щоб вони перейшли в режим кохання.",
    // "Press :_input_key.use: while looking at a Minecart to hop in and ride. Push :_gamepad_stick_left: forward to roll forward. Press :_input_key.jump: or :_input_key.sneak: to get out.=Щоб заскочити на вагонетку та їхати, натисніть :_input_key.use:, дивлячись на неї. Щоб котитися вперед, штовхайте :_gamepad_stick_left: уперед. Щоб зіскочити з неї, натисніть :_input_key.jump: або :_input_key.sneak:.",
    // "No. Marketplace Pass is a catalog of over 150+ packs for you to enjoy. Realms Plus is a 10 player Realm with Marketplace Pass included. We suggest that you subscribe to the one that’s right for you.=Ні. Marketplace Pass — це каталог із понад 150 пакетів для вас. Realms Plus — це Realm для 10 гравців із включеним Marketplace Pass. Ми пропонуємо вам підписатися на той, який підходить саме вам.",
    // "This Microsoft Account will not be the primary account for this device if you do not transfer this device's purchases to this account. You will not automatically sign in when you start Minecraft.=Цей обліковий запис Microsoft не буде основним для цього пристрою, якщо ви не передасте покупки з пристрою до цього облікового запису. Вхід не буде відбуватись автоматично під час запуску Minecraft.",
    // "We're having trouble verifying that you own Minecraft on this device. Make sure you have downloaded and installed Minecraft from the store. Or simply reconnect to the internet and try again.=Не вдалося підтвердити, що ви придбали Minecraft, на цьому пристрої. Переконайтеся, що ви завантажили й інсталювали Minecraft із Магазину. Або просто перепідключіться до Інтернету та спробуйте ще раз.",
    // "The Shield will block incoming damage. The Shield can be equipped in the offhand slot as well as the hotbar. Press :_input_key.sneak: or click :rift_X: to toggle block with the Shield.=Щит блокуватиме вхідні пошкодження. Щит може бути на озброєнні в слоті під рукою та на панелі швидкого доступу. Натисніть :_input_key.sneak: або клацніть :rift_X:, щоб прикритися щитом або відставити його.",
    // "Pictures you have taken appear in the Portfolio. Tap and hold to view the Portfolio. When viewing the Portfolio, you can add captions to pictures, delete pictures, and export pictures as a PDF.=Зроблені знімки з’являються в портфоліо. Торкніться й утримуйте, щоб переглянути портфоліо. Переглядаючи портфоліо, ви можете додати підписи до знімків, видалити або експортувати їх у форматі PDF.",
    // "Your device is almost out of the space that Minecraft can use to save worlds and settings on this device. Why not delete some old stuff you don't need so that you can keep saving new stuff?=На вашому пристрої майже скінчилося місце, яке Minecraft може використовувати для збереження світів і параметрів. Чому б вам не видалити щось старе й непотрібне, щоб мати змогу й далі зберігати нове?",
    // "Minecarts are ridable carts that roll on Rails, which you can build to go anywhere. Just place multiple Rails next to each other, place a Minecart on it, and you're ready to ride.=Вагонетки — це їздові візки, що котяться залізницею, яку ви можете побудувати, щоб поїхати куди завгодно. Просто розмістіть кілька рейок поруч одна з одною, поставте на них вагонетку, і ви готові до подорожі.",
    // "A Banner can also have multiple layers, allowing you to have more than one pattern on your Banner. If you don't like the last pattern you put on a Banner, you can wash the last layer off in a Cauldron.=Крім того, стяг може мати кілька шарів, тому на ньому може бути кілька візерунків. Якщо вам не подобається останній візерунок, який ви додали на стяг, останній шар можна змити в казані.",
    // "The original Minecraft experience: collect resources to craft tools and build structures, find and farm food to manage your hunger, battle dangerous mobs, and explore a vast world.=Звична всім гра Minecraft: збирайте ресурси, щоб крафтити інструменти й будувати споруди, шукайте й вирощуйте їжу, щоб вгамовувати свій голод, бийтеся з небезпечними мобами та досліджуйте величезний світ.",
    // "When using the D-Pad control scheme, tap :touch_left: or :touch_right: to turn left or right, or tap and hold both to move forward. Tap \"Leave Boat\" to get out.=Використовуючи хрестовину, натисніть :touch_left: або :touch_right:, щоб повернути ліворуч чи праворуч, або натисніть та утримуйте обидва елементи управління, щоб рухатися вперед. Натисніть «Зійти з човна», щоб вибратися.",
    // "Enables Education Edition chemistry features. This cannot be disabled after your world is created. Please note these features are best experienced on desktop devices with moderate to high memory.=Активує хімічні функції в Education Edition. Вони не відключаються після створення світу. Зверніть увагу, що для їх оптимальної роботи потрібен ПК із середнім або великим об’ємом пам’яті.",
    // "Press :_input_key.use: while looking at a Minecart to hop in and ride. Press :_input_key.forward: to roll forward. Press :_input_key.jump: or :_input_key.sneak: to get out. =Щоб заскочити на вагонетку та їхати, натисніть :_input_key.use:, дивлячись на неї. Щоб котитися вперед, натисніть :_input_key.forward:. Щоб зіскочити з неї, натисніть :_input_key.jump: або :_input_key.sneak:.",
    // "If a Dropper is facing a Chest or another type of container, the item will be placed into that instead. Long chains of Droppers can be constructed to transport items over a distance.=Якщо виштовхувач направлено в сторону скрині або контейнера іншого типу, предмет поміститься в такий контейнер. Для транспортування предметів на відстані можна спорудити довгі ланцюги виштовхувачів.",
    // "Place your crafting table in the world, then right-click it to open it. The larger crafting grid will let you make bigger and better things, including tools, beds, and doors.=Розмістіть сітку для крафтингу в світі, потім клацніть її правою кнопкою миші, щоб відкрити. Більша сітка для крафтингу дозволить вам створювати більші та кращі речі, включаючи інструменти, ліжка та двері.",
    // "%s per month. Add infinite members, play online with 10 other players at the same time. Plus, enjoy over 150 pieces of Marketplace content from the Marketplace Pass catalog for free.=%s на місяць. Додавайте безкінечну кількість учасників і грайте онлайн із 10 іншими гравцями одночасно. Також безкоштовно користуйтеся понад 150 пакетами вмісту з ринку з каталогу Marketplace Pass.",
    // "A Brewing Stand has three slots for creating different potions. One ingredient can be used over all three bottles, so always brew three potions at the same time to best use your resources.=Варильна стійка має три слоти для створення різного зілля. Один інгредієнт можна використати на всі три пляшки, тому завжди варіть три зілля одночасно, щоб найкраще використати свої ресурси.",
    // "This Realm contains resource or behavior packs that have expired from Realms Plus. You will need to either deactivate these packs or purchase them from the marketplace in order to play on the Realm.=Цей Realm містить пакети ресурсів або поведінки, термін дії яких у Realms Plus минув. Щоб грати в цьому Realm, вам знадобиться або деактивувати ці пакети, або придбати їх на ринку.",
    // "When powered by Redstone, Droppers will drop a single random item contained within. Tap the Dropper to open it and then you can load the it with items from your inventory.=Після активації за допомогою редстоуну виштовхувачі виштовхують один довільний предмет, який міститься всередині. Торкніться виштовхувача, щоб відкрити його, а потім завантажте його предметами з інвентарю.",
    // "Llamas can be equipped with chests, giving it 3-15 slots of inventory space depending on the strength of the Llama. They can also be equipped with carpets. Each carpet color yields a different pattern.=Лам можна оснастити скринями, додаючи таким чином 3-15 слотів для інвентаря залежно від сили лами. Їх також можна оснастити килимами. Колір кожного килима дає інший візерунок.",
    // "The experience that the creator of this template wants you to have might be broken if you unlock these settings. You might not be able to return to that intended experience if you continue.=Механіка гри, яку задумав творець цього шаблону, може зламатися в разі розблокування цих параметрів. Якщо продовжити, є ймовірність, що вам не вдасться повернутися до задуманої механіки.",
    // "You do not have enough iCloud space free to save your worlds properly. They might not be here next time you play Minecraft. Free up space on your iCloud account to make sure all of your worlds get saved.=Вам не вистачає місця в iCloud, щоб зберегти свої світи. Ви можете не застати їх у наступній грі. Звільніть трохи місця в обліковому записі iCloud, щоб зберегти свої світи.",
    // "*Minecoins require a version of Minecraft: Bedrock Edition with Minecraft Marketplace. Minecoins are not compatible on PlayStation®. For compatibility information see minecraft.net/minecoins=*Для Minecoins потрібна версія Minecraft: Bedrock Edition із ринком Minecraft. Minecoins несумісні із PlayStation®. Інформацію про сумісність див. за посиланням minecraft.net/minecoins",
    // "Get creative and customize the look of your armor with Armor Trims. You'll need an Armor Trim Smithing Template to get started, which you can find throughout the world.=Проявіть креативність і налаштуйте зовнішній вигляд своїх обладунків за допомогою оздоблень. Для початку роботи вам знадобиться ковальський шаблон «Оздоблення обладунку»‎, який можна знайти по всьому світу.",
    // "When a structure with Structure Void blocks is loaded into the world, any block that would have been removed where the structure void block is loading into, will instead stay in the world.=Якщо у світ завантажується структура з блоками структурної пустоти, то будь-який блок, який було б вилучено на місці завантаження блоку структурної пустоти, натомість залишиться у світі.",
    // "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack. These packs in your world apply on top of your global pack(s).=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього. Ці пакети у вашому світі застосовуються поверх ваших глобальних пакетів.",
    // "Your friends don’t need to purchase a Realms Plus subscription to play on your Realm. You can invite any friend (that has their multiplayer permissions enabled) to join your Realm for free.=Вашим друзям не потрібно купляти Realms Plus, щоб грати у вашому Realm. Ви можете запросити свого друга (у якого дозволено гру в мультиплеєрі) приєднатися до вашого Realm безкоштовно.",
    // "A Map lets you see the area you've explored. Put it in your offhand slot to use it like a mini-map. You can increase its size by adding more paper to the edges in a Crafting Table.=На карті можна переглянути територію, яку ви вже дослідили. Помістіть її в слот під рукою, щоб використовувати як міні-карту. Ви можете збільшити її розмір, додавши папір до країв на верстаку.",
    // "You are not connected to Microsoft services. Your friends with Gamertags will not be able to join your multiplayer world. Sign in to your Microsoft Account to play with your friends.=Ви не підключені до служб Microsoft. Ваші друзі з псевдонімами гравців не зможуть приєднатися до вашого мультиплеєрного світу. Увійдіть у свій обліковий запис Microsoft, щоб грати з друзями.",
    // "Pressing the Detect button in Save mode will find all of the Corner Blocks with the same name and create a selection area so that it will save everything inside of the volume those Corner Blocks make.=Якщо натиснути кнопку \"Визначити\" в режимі збереження, система знайде всі кутові блоки з однаковим ім’ям і створить область вибору, щоб зберегти весь вміст цієї області.",
    // "You have been %s from playing multiplayer in Minecraft due to \"%s\". You won't be able to play on servers, join realms, host or join multiplayer games or use the marketplace.=Вас було %s в мультиплеєрі Minecraft через «%s». Ви не зможете грати на серверах, приєднуватися до реалмів, створювати ігри в мультиплеєрі або приєднуватися до них, а також використовувати ринок.",
    // "Ready to take your crafting to the next level? Place four planks in a square in your crafting grid, and you'll get a §ecrafting table§f :crafting_table: - a whole new way to craft.=Готові вивести крафтинг на новий рівень? Розмістіть чотири дошки в квадрат у вашій сітці для крафтингу, щоб скористатися §eверстаком§f :crafting_table: — абсолютно новим способом крафтингу.",
    // "Some raw metals will need to be smelted using a §efurnace§f:furnace: . Place a fuel like coal or wood logs in the fuel slot, then add raw ore to smelt it into something useful.=Деякі необроблені метали потрібно переплавляти у §eпечі§f:furnace:. Покладіть у слот для палива вугілля, деревні колоди або інше паливо і додайте сиру руду, щоб переплавити її на щось корисне.",
    // "Saddles can be bought from villagers, found inside Chests hidden in the world, or acquired by fishing. While riding a horse, open your inventory and put a saddle in the horse's saddle slot.=Сідла можна придбати у селян, знайти у скринях, захованих у світі, або виловити з води. Сидячи верхи на коні, відкрийте свій інвентар і помістіть сідло у слот для кінського сідла.",
    // "The Bow is the primary ranged weapon in Minecraft. Press and hold :_input_key.use: to draw the bow back. Release :_input_key.use: to fire an arrow. The bow requires arrows to fire. =Лук – це основна дистанційна зброя в Minecraft. Натисніть і утримуйте :_input_key.use:, щоб натягнути тятиву. Відпустіть :_input_key.use:, щоб вистрілити. Стрільба з луку потребує стріл.",
    // "Worlds in the Minecraft Marketplace Minecraft levels where our partners have altered the terrain and placed new blocks to create amazing structures and terrain for you to explore and enjoy.=Світи на ринку Minecraft – це рівні Minecraft, де наші партнери змінили місцевість і розмістили нові блоки, щоб створити дивовижні споруди та місцевість для досліджень і розваг.",
    // "§eTools§f help you get things done faster. Some, like the §epickaxe§f:wood_pickaxe: , let you mine stone and various ores. Others, like the §esword§f:wood_sword: , help you keep enemies at bay.=§eІнструменти§f допоможуть робити все швидше. Наприклад, §eкирка§f:wood_pickaxe: дає змогу видобувати камінь і різні руди, а §eмеч§f:wood_sword: допомагає відганяти ворогів.",
    // "There is an error with your account. You will be unable to use the marketplace until we have resolved the issue. If this issue persists for several days please contact support.=З вашим обліковим записом сталася помилка. Ви не зможете користуватися ринком, доки ми не вирішимо цю проблему. Якщо ця проблема не зникне через кілька днів, зверніться до служби підтримки.",
    // "Place paper into the first slot to craft a Map. If you add a compass into the second slot you can craft a Locator Map. Adding Paper or a blank Map will let you expand or copy your Map.=Розмістіть папір у першому слоті, щоб скрафтити карту. Якщо додати компас у другий слот, можна створити карту шукача. Додайте папір або пусту карту, щоб розширити або скопіювати її.",
    // "This world has Behavior Packs applied to it that you must download to join and Resource Packs that you may optionally download before joining. What would you like to download before joining?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки, а також пакети ресурсів за бажанням. Що ви хочете завантажити перед приєднанням?",
    // "If you create, load, or save a world in Creative Mode, that world will have achievements and leaderboard updates disabled, even if it is then loaded in Survival Mode.=Якщо ви створюєте, завантажуєте або зберігаєте світ у творчому режимі, у такому світі буде вимкнуто досягнення й оновлення рейтингової таблиці, навіть якщо його потім завантажити в режимі виживання.",
    // "A §epickaxe§f:wood_pickaxe: helps you uncover all sorts of materials, such as stone, coal, iron, and precious ore - though you may need extra sturdy tools for some rarer materials!=§eКиркою§f:wood_pickaxe: можна добувати всі види матеріалів, як-от камінь, вугілля, залізо й дорогоцінна руда — але на більш рідкісні матеріали знадобляться особливо міцні інструменти!",
    // "Your worlds are not getting saved properly. They might not be here next time you play Minecraft. Go to your Apple TV settings and turn on iCloud to make sure all of your worlds get saved.=Ви зберігаєте свої світи недостатньо надійно. Ви можете не застати їх у наступній грі. Перейдіть до параметрів Apple TV й увімкніть iCloud, щоб надійно зберегти всі свої світи.",
    // "The following content is dependent on this %s and may not continue to work correctly if you delete \"%s\":%s Do you still want to delete \"%s\"? This %s will be lost forever! (A long time!)=Цей вміст залежить від %s і не зможе працювати належним чином, якщо видалити \"%s\":%s Ви справді хочете видалити \"%s\"? Вміст %s буде втрачено назавжди! (Це дууууже довго!)",
    // "Your Realms Plus subscription has expired. To regain access to your Realm and the packs or skins you received from Realms Plus you need to renew your subscription. =Термін дії вашої передплати на Realms Plus завершився. Щоб відновити доступ до свого Realm й пакетів або скінів, отриманих у рамках передплати на Realms Plus, вам потрібно подовжити свою передплату.",
    // "Touch and drag to find controls on the screen, and double tap controls to select. To scroll on a screen, double tap and hold while swiping up or down.=Торкніться й перетягніть, щоб знайти елементи керування на екрані; двічі торкніться елементів керування, щоб вибрати їх. Щоб прокрутити екран, двічі торкніться й утримуйте його, проводячи пальцем вгору або вниз.",
    // "A full body skin that is placed on the character. Classic skins cannot be modified piece by piece. You can also import your own full body skin that you created or downloaded.=Скін на все тіло безпосередньо на персонажі. Класичні скіни не можна змінити за окремими деталями. Ви також можете імпортувати свій власний скін на все тіло, який створили чи завантажили.",
    // "Corner Mode is used with the Detect button in Save Mode to define the area to save. It will only detect Corner Blocks with the same name as the structure being saved.=Кутовий режим використовується разом із кнопкою \"Визначити\" в режимі збереження, щоб визначити область збереження. Визначаються лише кутові блоки, названі за ім’ям структури, яка зберігається.",
    // "This world was created using a template that you have not unlocked. You must purchase the template to unlock this world. Would you like to purchase the template used by this world?=Цей світ створено на основі шаблону, який у вас не розблоковано. Щоб розблокувати цей світ, вам потрібно придбати шаблон. Хочете придбати шаблон, що використовується в цьому світі?",
    // "Tap :tip_virtual_button_sprint: to fly faster. To fly up tap and hold :tip_virtual_button_fly_up:, and to fly down tap and hold :tip_virtual_button_fly_down:.=Щоб літати швидше, натисніть :tip_virtual_button_sprint:. Щоб злетіти вгору, натисніть та утримуйте :tip_virtual_button_fly_up:, а щоб злетіти вниз, натисніть та утримуйте :tip_virtual_button_fly_down:.",
    // "You'll slowly get hungry during your adventures - fortunately the Overworld is full of food! You can gather apples from trees, meat from animals, or why not grow your own crops using a hoe?=Під час пригод ви поступово зголоднієте. На щастя, Верхній світ повний їжі! Можна збирати яблука з дерев, м’ясо у тварин або виростити власний урожай за допомогою мотики.",
    // "Many blocks, like wood, can be turned into useful items by crafting. To do this, you'll find a simple §ecrafting grid§f on the right-hand side of your inventory screen.=Багато блоків, як-от деревину, можна перетворити в корисні предмети за допомогою крафтингу. Для цього використовується проста §eсітка для крафтингу§f в правій частині екрана вашого інвентаря.",
    // "Access to Marketplace Pass requires an active subscription, and a compatible version of Minecraft: Bedrock Edition with Minecraft Marketplace. Requires Microsoft Account sign-in.=Доступ до Marketplace Pass потребує активної підписки й сумісної версії Minecraft: Bedrock Edition із ринком Minecraft. Окрім того, також потрібен вхід в обліковий запис Microsoft.",
    // "To eat a food, select it in your hotbar, then click and hold the right mouse button. Keep the §ehunger bar§f:shank: full to regain health when you take damage.=Щоб їсти їжу, виберіть її на панелі доступу, потім клацніть та утримуйте праву кнопку миші. Якщо отримаєте пошкодження, підтримуйте §eіндикатор голоду§f:shank: заповненим, щоб відновлювати здоров’я.",
    // "It looks like you are signed into a different Microsoft Account from the one that first downloaded the Minecraft Trial. Try again after signing in with that account.=Схоже, ви ввійшли не під тим обліковим записом Microsoft, з якого було вперше завантажено ознайомлювальну версію Minecraft. Спробуйте ще раз, після того як увійдете під цим обліковим записом.",
    // "You need an internet connection to save your worlds properly. They might not be here next time you play Minecraft. Reconnect to the internet to make sure all of your worlds get saved.=Щоб надійно зберегти світи, потрібне підключення до Інтернету. Ви можете не застати їх у наступній грі. Перевірте підключення до Інтернету, щоб надійно зберегти свої світи.",
    // "Your hotbar will fill up as you gather more resources. Press :_input_key.inventory: to access your §einventory§f, where you'll have more space for everything you've collected.=Панель доступу буде заповнюватися зібраними ресурсами. Натисніть :_input_key.inventory:, щоб отримати доступ до §eінвентаря§f, де у вас буде більше місця для всього, що ви зібрали.",
    // "During online editing you may be exposed to chat messages or other types of user generated content that has not been rated, and may not be suitable for all ages.=Під час гри онлайн ви можете зіткнутися з повідомленнями в чаті чи іншим вмістом користувачів, який не проходить рецензування та може не підходити для користувачів, які не досягли певного віку.",
    // "An Allow block with a Deny block somewhere below it prevents players from building in the space between the two blocks. Above the Allow block, players can place and destroy blocks.=Якщо розташувати блок дозволу над блоком заборони, простір між ними буде захищено від будівництва, а в області над блоком дозволу можна буде розташовувати та знищувати блоки.",
    // "Redstone can be used to activate a Structure Block. This will cause it to either save a structure out or load a structure into the world, depending on the mode of the block and its settings.=Структурний блок можна активувати за допомогою редстоуну. При цьому він або збереже структуру або завантажить її у світ залежно від режиму блоку та його параметрів.",
    // "Place your crafting table in the world, then tap it to open it. The larger crafting grid will let you make bigger and better things, including tools, beds, and doors.=Розмістіть сітку для крафтингу в світі, потім торкніться її, щоб відкрити. Більша сітка для крафтингу дозволить вам створювати більші та кращі речі, включаючи інструменти, ліжка та двері.",
    // "Your hotbar will fill up as you gather more resources. Press :windowsmr_left_grab: to access your §einventory§f, where you'll have more space for everything you've collected.=Панель доступу буде заповнюватися зібраними ресурсами. Натисніть :windowsmr_left_grab:, щоб отримати доступ до §eінвентаря§f, де у вас буде більше місця для всього, що ви зібрали.",
    // "Using the right tool for the job will not only mine that block faster, but will also lose less durability. More complex tools must be created in order to mine rarer resources.=Використовуючи правильний інструмент, ви не лише видобудете блок швидше, а й зазнаєте менших втрат. Для видобування рідкісніших ресурсів необхідно крафтити складніші інструменти.",
    // "Most blocks you will have to find in the world, but some can only be crafted such as combining other blocks on a crafting table like a Redstone Block or smelted in a furnace like Glass.=Більшість блоків ви знайдете у світі, але деякі з них можна лише скрафтити, поєднуючи блоки на верстаку, як-от блок редстоуну, або переплавляючи їх у печі, як-от скло.",
    // "Mules and Donkeys may be equipped with saddlebags (for transporting items) by attaching a Chest. These saddlebags can then be accessed whilst riding or sneaking.=На мулів і ослів можна почепити сідельні в’юки (для транспортування предметів), прикріпивши скриню. Користуватися цими сідельними в’юками можна і під час верхової їзди, і під час прокрадання.",
    // "When equipped with Elytra, a player can press :_input_key.jump: while falling to start gliding. Note that you need to be quite high to really get the full effect!=Гравець, споряджений надкриллям, може натиснути :_input_key.jump: під час падіння, щоб почати планерувати в повітрі. Зауважте, що вам потрібно бути досить високо, щоб досягти повного ефекту!",
    // "Explore, craft, build, and have fun! In this trial you will have 90 minutes of play time. Unlock the full game to play an infinite amount of worlds for as long as you want!*=Досліджуйте, крафтіть, будуйте та розважайтеся! У цій ознайомлювальній версії у вас 90 хвилин ігрового часу. Розблокуйте повну гру, щоб грати в безлічі світів скільки забажаєте!*",
    // "Your hotbar will fill up as you gather more resources. Tap :tip_touch_inventory: to access your §einventory§f, where you'll have more space for everything you've collected.=Панель доступу буде заповнюватися зібраними ресурсами. Натисніть :tip_touch_inventory:, щоб отримати доступ до §eінвентаря§f, де у вас буде більше місця для всього, що ви зібрали.",
    // "To eat a food, select it in your hotbar, then press and hold :_input_key.use:. Keep the §ehunger bar§f:shank: full to regain health when you take damage.=Щоб їсти їжу, виберіть її на панелі доступу, потім натисніть й утримуйте :_input_key.use:. Якщо отримаєте пошкодження, підтримуйте §eіндикатор голоду§f:shank: заповненим, щоб відновлювати здоров'я.",
    // "A Locator Map will show you where you are and what direction you are facing in relation to the Locator Map's origin. It will also show you the location of other players in the same world.=Карта шукача покаже вам, де ви та в яку сторону дивитеся відносно відправної точки карти шукача. Вона також покаже місцезнаходження інших гравців у цьому ж світі.",
    // "Your device is not compatible with advanced lighting and texture features so you will see the world without these advanced effects. Would you like to download them before you join?   =Ваш пристрій несумісний із покращеними функціями освітлення й текстур, тож ви бачитимете світ без цих найсучасніших ефектів. Хочете завантажити їх перед приєднанням?",
    // "Servers offer some of the most creative ways to play Minecraft! We just need you to sign in so that we can make sure you have permission to play online with new people.=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Вам лише потрібно ввійти в обліковий запис, щоб ми могли перевірити ваш дозвіл на гру в мережі з новими людьми.",
    // "Enemies appear every night, and even the best of us can be caught off guard. If your §ehealth bar§f:heart: runs out, you'll die - and then respawn right where you started!=Вороги з'являються щоночі, і навіть найкращих із нас можна застати зненацька. Якщо ваша §eшкала здоров'я§f:heart: вичерпається, ви загинете, а потім відродитеся там, де почали!",
    // "You have unlimited lives, but you drop all items in your inventory when you die. If you're quick enough, you can pick your items back up right where you dropped them.=Ви маєте необмежене життя, але в разі вашої смерті ви залишаєте всі предмети зі свого інвентаря. Якщо ви досить швидкі, ви можете забрати свої предмети прямо там, де ви їх залишили.",
    // "You cannot save your worlds to your Xbox profile because of how your account is set up. This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете зберегти свої світи у вашому профілі Xbox через налаштування вашого облікового запису. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
    // "By wearing Armor, you can protect yourself from incoming damage. Your Armor level is represented by :armor: on the HUD, the higher the level, the less damage you will take.=Носячи обладунок, ви можете захистити себе від пошкоджень. Рівень вашого обладунку представлено значенням :armor: на HUD: що більший рівень, то менше пошкоджень ви отримаєте.",
    // "Corner mode is used with save mode's detect button to automatically set the area you want to save. See the Corner Mode section below for more details.=Кутовий режим використовується разом з кнопкою визначення режиму збереження, щоб автоматично встановити область, яку ви хочете зберегти. Докладні відомості див. в розділі \"Кутовий режим\" нижче.",
    // "You have been %s from playing multiplayer in Minecraft. You won't be able to play on servers, join realms, host or join multiplayer games or use the marketplace.=Вас було %s в мультиплеєрі Minecraft. Ви не зможете грати на серверах, приєднуватися до реалмів, створювати ігри в мультиплеєрі або приєднуватися до них, а також використовувати ринок.",
    // "Your device is not compatible with advanced lighting and texture features so you will see the world without these advanced effects. Would you like to download them before you join?=Ваш пристрій несумісний із покращеними функціями освітлення й текстур, тож ви бачитимете світ без цих найсучасніших ефектів. Хочете завантажити їх перед приєднанням?",
    // "Your Elytra will slowly lose durability while flying, and if they break mid-flight you'll fall. You can repair them by combining them with Phantom Membrane at an Anvil.=Під час польоту надкрилля поступово втрачатиме міцність, і якщо воно зламається посеред польоту, ви впадете. Ви можете відновити його, поєднавши з мембраною фантома на ковадлі.",
    // "If you have not already, you will need a place to take shelter from the dark and what lurks within it. This can be as simple as a hole in the side of a hill or a small cabin in the forest.=Вам знадобиться місце, де ви зможете сховатися від темряви та того, що блукає в ній. Це може бути проста дірка з боку пагорба або невеличка хатинка в лісі.",
    // "Enables an extra large version of the new UI menus as an additional accessibility option. This setting might cause visual glitches to appear in some menu screens.=Це додатковий параметр адаптивності, що дає змогу значно збільшити меню нового інтерфейсу користувача. Це налаштування може спричинити появу візуальних збоїв на деяких екранах меню.",
    // "The Shield will block incoming damage. The Shield can be equipped in the offhand slot as well as the hotbar. Press and hold :_input_key.sneak: to block with the Shield.=Щит блокуватиме вхідні пошкодження. Щит може бути на озброєнні в слоті під рукою та на панелі швидкого доступу. Натисніть і утримуйте :_input_key.sneak:, щоб прикритися щитом.",
    // "Switching this from on to off will require a restart of the game. It may cause instability when using multiple Add-ons or Resource Packs with many textures.=Якщо вимкнути цей параметр, то потрібно перезапустити гру. Така дія може спричинити нестабільну роботу під час використання кількох доповнень або пакетів ресурсів із багатьма текстурами.",
    // "Minecarts are ridable carts that roll on Rails. You can make the Rails go wherever you want by placing them next to each other. Place a Minecart on the Rails and you are ready to ride.=Вагонетки — це їздові візки, що котяться залізницею. Ви можете побудувати її, щоб поїхати куди завгодно. Поставте вагонетку на рейки, і ви готові до подорожі.",
    // "We could not create a copy of this project. This may be caused by a lack of storage space or another issue. See https://aka.ms/MCStorage for more information. =Не вдалося створити копію цього світу. Це може бути спричинено нестачею вільного місця на пристрої або іншою проблемою. Додаткові відомості див. на вебсайті https://aka.ms/MCStorage.",
    // "When using a Joystick control scheme, drag :tip_virtual_joystick: up to start moving forward and build momentum, and tap :tip_virtual_button_dismount: to get out.=Використовуючи джойстик, потягніть :tip_virtual_joystick: угору, щоб почати рухатися вперед і нарощувати швидкість, а потім натисніть :tip_virtual_button_dismount:, щоб вибратися.",
    // "Be sure to block off all entrances, you may want to use a door so you can go in and out. If you have made a bed this is a good place to put it along with your Crafting Table and Furnace.=Не забудьте заблокувати всі виходи. А встановивши двері, ви зможете заходити й виходити. Якщо у вас є ліжко, його доречно розмістити біля верстака та печі.",
    // "When equipped with Elytra, tap :touch_jump: or :tip_virtual_button_fly_up: while falling to start gliding. Make sure you're high up to get the full effect!=Якщо у вас є надкрилля, натисніть :touch_jump: або :tip_virtual_button_fly_up:, щоб почати планерувати під час падіння. Переконайтеся, що ви високо в повітрі, щоб отримати повний ефект!",
    // "The Sword, Bow, Crossbow, and Trident have specific enchantments that you can get from the Enchanting Table or Anvil that will improve damage, durability and even light mobs on fire!=Меч, лук, арбалет і тризуб можна певним чином зачарувати на столі зачарувань або на ковадлі, щоб збільшити шкоду, зміцнити зброю або навіть підпалювати мобів!",
    // "To eat a food, select it in your hotbar, then tap the screen and hold. Keep the §ehunger bar§f:shank: full to regain health when you take damage.=Щоб їсти їжу, виберіть її на панелі доступу, потім торкніться екрана й утримуйте палець. Якщо отримаєте пошкодження, підтримуйте §eіндикатор голоду§f:shank: заповненим, щоб відновлювати здоров’я.",
    // "Brewing potions requires a Brewing Stand. Every potion starts off with a bottle of water, which is made by filling a Glass Bottle with water from a Cauldron or water source.=Для зіллєваріння потрібна варильна стійка. Кожне зілля починається з пляшки води, яка з’являється, коли ви наповнюєте скляну пляшку водою з казана або водного джерела.",
    // "The Bow is the primary ranged weapon in Minecraft. Press and hold the Screen to draw the bow back. Release the press to fire an arrow. The bow requires arrows to fire.=Лук – це основна дистанційна зброя в Minecraft. Натисніть і утримуйте ділянку на екрані, щоб натягнути тятиву. Відпустіть її, щоб вистрелити. Стрільба з луку потребує стріл.",
    // "Redstone Dust comes from Redstone that transmits an electrical signal. When it has power it lights up and transmits its signal to other Redstone items that are next to it.=Пил редстоуну утворюється на редстоуні, який передає електричний сигнал. Коли він активований, він загоряється та передає свій сигнал на інші суміжні предмети редстоуну.",
    // "Someone started renewing a realm with the billing account on this device.  Would you like to complete renewing that realm with this Microsoft Account as the owner?=Хтось почав поновлювати Realm на цьому пристрої під обліковим записом для платних служб. Хочете завершити поновлення цього Realm під цим обліковим записом Microsoft як власник?",
    // "If you have a Character Creator in world, this will switch to the Classic Skin. You can still switch back to the Character Creator in Dressing room. Would you like to equip it?=Якщо у вас є Створювач персонажів у світі, ви перемкнетеся на класичний скін. Ви можете повернутися до Створювача персонажів у роздягальні. Бажаєте його обладнати?",
    // "The skin that you have equipped is from a content pack that is not allowed in cross-platform multiplayer. Continuing will disable cross-platform multiplayer for this world.=Скін, який ви намагаєтеся використати з пакета вмісту, недоступний у крос-платформених мультиплеєрних іграх. Якщо продовжити, ви не зможете грати в них у цьому світі.",
    // "As a part of the full Minecraft experience, Servers offer some of the most creative ways to enjoy Minecraft! Play great mini-games, meet the Minecraft community and make new friends.=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Грайте в чудові міні-ігри, познайомтеся зі спільнотою Minecraft і заводьте собі друзів.",
    // "This option can only be edited while playing in a ray tracing capable world. Find one in the Marketplace, or create your own ray tracing capable resource pack.=Цю функцію можна змінювати лише під час гри у світах із підтримкою трасування променів. Знайдіть їх на Ринку або створіть власний пакет ресурсів із підтримкою трасування променів.",
    // "The custom java version used to launch Minecraft has a different architecture than the one used to run the launcher. Please make sure these are the same, either 32-bit or 64-bit for both.=Для запуску Minecraft і запускача використовувалися нестандартні Java-версії з різною архітектурою. Обидві версії мають бути або 32-, або 64-розрядні.",
    // "The content that you are trying to use is not allowed in cross-platform multiplayer games. If you continue you will not be able to play cross-platform multiplayer games.=Вміст, який ви намагаєтеся використати, недоступний в іграх у кросплатформенному мультиплеєрі. Якщо продовжити, ви не зможете грати в кросплатформенному мультиплеєрі.",
    // "The End is another dimension which can be accessed through an active End Portal. The End Portal can be found in a Stronghold, which is deep underground in the Overworld.=Енд – це ще один вимір, у який можна перейти через активний портал в Енд. Портал в Енд можна знайти у твердині, яка розташована глибоко під землею у верхньому світі.",
    // "Hostile mobs will do more damage, zombies will break through doors, and if your hunger level drops to zero, your health will drop and you could die.=Ворожі моби завдаватимуть більших пошкоджень, зомбі прориватимуться крізь двері, а якщо ваш рівень голоду опуститься до нуля, ваш рівень здоров’я почне знижуватись, і ви можете померти.",
    // "Sign in to a Microsoft Account to sync your Skins, Texture Packs, Worlds, and Mash-ups. They will be there for you on any device where you play Minecraft.=Увійдіть в обліковий запис Microsoft, щоб синхронізувати свої скіни, пакети текстур, світи та збірні пакети. Вони будуть доступні на всіх пристроях, з яких ви граєте в Minecraft.",
    // "Editor extension packs can only be used on Editor projects. Your world will still load, however we recommend deactivating or deleting the extension packs.=Пакети розширень редактора можна використовувати лише в редакторських проєктах. Ваш світ все одно завантажиться, однак ми рекомендуємо деактивувати або видалити пакети розширень.",
    // "There are many tools in Minecraft that will allow you mine blocks faster than your fist. Tools can be crafted from Wood, Stone, Iron, Gold, Diamond, or Netherite.=У Minecraft є багато інструментів, якими добувати блоки швидше, ніж голими руками. Інструменти можна виготовляти з деревини, каменю, заліза, золота, алмазів або незериту.",
    // "Want to move something between your §ehotbar§f and your inventory? Open your inventory, click the item of your choice, then drag it to the empty item slot you'd like to move it to.=Хочете перемістити щось між §eпанеллю доступу§f та інвентарем? Відкрийте свій інвентар, клацніть потрібний предмет і перетягніть його на порожній слот.",
    // "Someone started creating a Realm with the billing account on this device. Would you like to complete creating that Realm with this Microsoft Account as the owner?=Хтось почав створювати реалм на цьому пристрої під обліковим записом для платних служб. Хочете завершити створення реалму під цим обліковим записом Microsoft як власник?",
    // "Press :_input_key.use: on a Jukebox with a Music Disc in your hand to play it. Press :_input_key.use: the Jukebox again to eject the Music Disc.=Щоб відтворити музичний диск, візьміть його в руку та натисніть :_input_key.use: на музичному автоматі. Щоб вийняти музичний диск, ще раз натисніть :_input_key.use: на музичному автоматі.",
    // "A Banner can have multiple layers allowing you to experiment with many different banner possibilities. Up to 6 patterns can be applied to a Banner to create a unique design.=Стяг може мати кілька шарів, завдяки чому у вас є багато можливостей для експериментів. На стяг можна нанести до 6 візерунків, щоб створити унікальний дизайн.",
    // "Disconnected due to an unexpected type of packet received which cannot be processed.  This could be due to a version mismatch or corruption at the networking level.=Відключено через непередбачений тип отриманого пакета, який неможливо обробити.  Це може бути пов’язано з невідповідністю версій або пошкодженням на мережевому рівні.",
    // "On the right side of the Structure Block screen, a preview of the area you have selected or the structure to load will appear depending on the mode the block is in.=Праворуч на екрані структурного блока з’явиться перегляд області, яку ви виділили, або структури, яку збираєтеся завантажити, залежно від активованого в блоці режиму.",
    // "A Fishing Rod lets you catch fish and other loot from water blocks. It can also be used to pull other players and mobs. Fishing Rods can also be enchanted!=Вудка дозволить виловлювати рибу та інші предмети з блоків води. Її також можна використовувати, щоб витягнути інших гравців або мобів. Нарешті, вудку також можна зачарувати!",
    // "Failed to sign in to %s sandbox. Please change sandboxes and restart Minecraft or sign in with a different account. Sandbox will be %s on restart. =Не вдалось увійти в пісочницю %s. Перейдіть в іншу пісочницю та перезапустіть Minecraft або ввійдіть під іншим обліковим записом. Після перезапуску ви потрапите в таку пісочницю: %s.",
    // "Your hotbar will fill up as you gather more resources. Press :rift_B: to access your §einventory§f, where you'll have more space for everything you've collected.=Панель доступу буде заповнюватися зібраними ресурсами. Натисніть :rift_B:, щоб отримати доступ до §eінвентаря§f, де у вас буде більше місця для всього, що ви зібрали.",
    // "Seed - the value entered here will determine which blocks to remove when using Integrity. Leave this field blank if you want the blocks to be chosen randomly.=Сід – введене тут значення визначатиме, які блоки вилучати, коли використовується цілісність. Залиште це поле пустим, якщо хочете, щоб блоки вибиралися випадковим чином.",
    // "In this trial you are limited to 90 minutes of play time. Craft, build, explore, and have fun! Your world will be preserved if you choose to purchase the full version.=У цій ознайомлювальній версії ігровий час обмежено 90 хвилинами. Крафтіть, будуйте, досліджуйте та розважайтеся! Щоб зберегти свій світ, придбайте повну версію.",
    // "You can §ebreak blocks§f with your bare hands to gather resources like dirt and wood. §eTouch and hold§f on the block until it breaks and the resources drop.=Ви можете §eрозбивати блоки§f голими руками, щоб зібрати такі ресурси, як земля і деревина. §eТоркніться й утримуйте§f блок, поки він не зламається і ресурси не впадуть.",
    // "Select \"All Player Data\" to delete absolutely all player data from the world. The next time any player enters the world, they will start with fresh, default data.=Виберіть \"Усі дані гравця\", щоб видалити зі світу абсолютно всі дані гравця. Коли гравець наступного разу зайде у світ, то почне з новими, стандартними даними.",
    // "You are not connected to the internet. Your friends will not be able to join your multiplayer worlds. Sign in to your Microsoft Account to play with your friends.=Немає підключення до Інтернету. Ваші друзі не зможуть приєднатися до ваших мультиплеєрних світів. Увійдіть у свій обліковий запис Microsoft, щоб грати з друзями.",
    // "Explore a world of possibility with Minecoins: Minecraft's in-game currency! Minecoins let you add variety to your gameplat across supported Minecraft games.=Досліджуйте світ можливостей із Minecoins – внутрішньоігровою валютою Minecraft! Minecoins дають змогу урізноманітнити ігровий процес у підтримуваних іграх Minecraft.",
    // "There are several places for you to explore. Find a village and look for a Cartographer. He will trade you Explorer Maps that will lead you to strange places very far away.=Є кілька місць, які можна дослідити. Знайдіть село та пошукайте картографа. Він продасть вам карти скарбів, які проведуть вас до далеких дивних місць.",
    // "The Sword is the primary melee weapon in Minecraft. It can be made from Wood, Stone, Iron, Gold, Diamond, or Netherite. Jump attacks do critical damage!=Меч — це основна зброя ближнього бою в Minecraft. Його можна зробити з дерева, каменю, заліза, золота, алмазів або незериту. Атаки в стрибку завдають критичних ушкоджень!",
    // "Your friends and their friends can see if you're online. your game clips, and your recent apps and games. You can change these on Xbox.com.=Ваші друзі та їхні друзі можуть бачити, чи ви в мережі, які ігрові кліпи маєте, а також які програми та ігри нещодавно отримали. Ви можете налаштувати ці параметри на сайті Xbox.com.",
    // "Are you sure you want to save and leave the game?%1Warning: If you do, this will end the multiplayer session for all players.%1We'll upload your world to the cloud too!=Дійсно зберегти гру та вийти?%1Увага! Якщо ви це зробите, цей сеанс мультиплеєра буде завершено для всіх гравців.%1Ми також завантажимо ваш світ у хмару!",
    // "Realms are available in Minecraft %s for all Realms subscribers for free! This is a new Realm that gives you the chance to try new features before their release.=Realms доступні в Minecraft %s для всіх передплатників Realms безкоштовно! Це нові Realm, які дадуть вам можливість випробувати останні функції ще до їх виходу.",
    // "Be careful! You're about to create a copy of your world with Experiments turned on. This new world might crash, break, or not work with future updates.=Будьте обережні! Ви створюєте копію світу з увімкнутими експериментальними функціями. Цей новий світ може \"впасти\", зламатися або не працювати з майбутніми оновленнями.",
    // "Your Realm has expired. Go ahead and extend it using the new auto-renewing subscription, that way you don't have to worry about keeping your Realm up and running ever again.=Термін дії вашого Realm сплив. Утім, не хвилюйтеся! Увімкніть автоматичне подовження передплати зараз, щоб більше не перейматися доступністю Realm.",
    // "To fill a Dispenser with items, press :_input_key.use: on the Dispenser, then move the items that you want to dispense from your inventory to the Dispenser.=Щоб наповнити розподілювач предметами, натисніть :_input_key.use: на розподілювачі, а потім перемістіть предмети, які потрібно викинути, з інвентарю в розподілювач.",
    // "It looks like you started renewing a realm with a different Microsoft Account.  Do you want to complete renewing that realm with this Microsoft Account as the owner?=Схоже, ви почали поновлювати Realm під іншим обліковим записом Microsoft. Хочете завершити поновлення Realm під цим обліковим записом Microsoft як власник?",
    // "150+ marketplace packs will be immediately available. Your first 30 days will be free and you can renew for 30 days at the price of %s afterwards.=Понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Перші 30 днів будуть безкоштовними, а потім ви можете оплачувати доступ на кожні наступні 30 днів за ціною %s.",
    // "It looks like you started creating a realm with a different Microsoft Account. Do you want to complete creating that realm with this Microsoft Account as the owner?=Схоже, ви почали створювати реалм під іншим обліковим записом Microsoft. Бажаєте завершити створення реалму під цим обліковим записом Microsoft як власник?",
    // "Explore, craft, build, and have fun! In this trial you will have 90 minutes of play time. Unlock the full game to continue playing as long as you want!=Досліджуйте, крафтіть, будуйте та розважайтеся! У цій ознайомлювальній версії у вас 90 хвилин ігрового часу. Якщо хочете продовжити грати, розблокуйте повну версію гри!",
    // "Load mode loads a structure into the world. Only structures saved to the world or included in a behavior pack that is applied to the world can be loaded.=Режим \"Завантаження\" завантажує структуру у світ. Завантажити можна лише структури, які збережено у світі або включено до пакета поведінки, застосованого до світу.",
    // "In order to upgrade your equipment, you'll need a Smithing Template. You can find a large variety throughout the world, which can be used for all kinds of upgrades.=Для модернізації обладнання вам знадобиться ковальський шаблон. Світ пропонує велику різноманітність, яку можна використовувати для всіляких модернізацій.",
    // "You are about to delete \"%s\". You will still own %s and if you wish to use %s again in the future, you can re-download it from the Marketplace.=Ви ось-ось видалите \"%s\". Вміст %s залишиться у вашій власності, тому якщо ви захочете знову використати %s у майбутньому, ви зможете повторно завантажити вміст із Ринку.",
    // "Want to move something between your §ehotbar§f and your inventory? Tap the item of your choice, then tap the empty item slot that you'd like to move it to.=Хочете перемістити щось між §eпанеллю швидкого доступу§f й інвентарем? Торкніться потрібного предмета, а потім порожнього слоту, до якого хочете його перемістити.",
    // "Enables Education Edition chemistry features. Education gameplay may break your world. If you continue we will make a copy of your world starting with [EDU].=Активує хімічні функції в Education Edition. Навчальний режим може зламати світ. Якщо ви вирішите продовжити, ми зробимо копію світу з префіксом [EDU] в імені.",
    // "By replacing your realm with this backup, you will erase all recent progress from your Realm. The Realm will restart and all active players will need to reconnect.=Якщо замінити Realm на резервну копію, ви видалите останні зміни в реалмі. Realm буде перезапущено, і всім активним гравцям доведеться перепідключитися.",
    // "Use it to make all kinds of changes, for example by upgrading Diamond equipment to Netherite, or by making cosmetic changes with Armor Trims.=Використовуйте його для проведення всіляких змін, наприклад модернізації алмазного обладнання до незеритового або внесення косметичних змін за допомогою оздоблень обладунків.",
    // "Structure Blocks give creators the ability to copy and save out sections of their world into structures. Saved structures can then be pasted back into the world.=Структурні блоки дають творцям змогу копіювати та зберігати частини свого світу у вигляді структур. Потім збережені структури можна знову вставити у світ.",
    // "Cross-platform play lets you connect with players on different platforms. Sign in to your Microsoft Account to play with all your Minecraft friends!=Кросплатформенна гра дає змогу грати людям, що використовують різні платформи. Увійдіть у свій обліковий запис Microsoft, щоб грати з усіма своїми друзями в Minecraft!",
    // "Your device lost connection to the store and we can't confirm this offer is still available. Please check your internet connection or try again later.=Ваш пристрій втратив зв’язок із магазином, і ми не можемо перевірити, чи ця пропозиція ще доступна. Перевірте підключення до Інтернету або спробуйте ще раз пізніше.",
    // "Are you sure you want to remove this player from the world? When you remove this player a new join code will be generated so that they will not be able to rejoin.=Ви справді хочете вилучити цього гравця зі світу? Якщо вилучити цього гравця, буде згенеровано новий код приєднання, щоб він не зміг приєднатися знову.",
    // "You will be able to see content in your subscription if you are already subscribed, but you will not be able to subscribe to Marketplace Pass from the Preview/BETA build.=Ви зможете переглядати вміст у своїй підписці, якщо ви вже підписані, але ви не зможете підписатися на Marketplace Pass зі збірки Preview/BETA.",
    // "Marketplace Pass is a monthly subscription service that gives you access to 150+ pieces of content from Minecraft Marketplace for %s. Your subscription allows you to:=Marketplace Pass — це послуга щомісячної підписки, яка дає вам доступ до понад 150 одиниць вмісту на ринку Minecraft за %s. Ваша підписка дозволяє:",
    // "To play with others, go to the §eFriends tab§f to see all available Realms, Friends, and LAN games. Just select any game to join it.=Щоб грати з іншими, перейдіть на §eвкладку «‎Друзі»§f, де відображаються всі доступні Realms, друзі та ігри в локальній мережі. Просто виберіть будь-яку гру, щоб приєднатися до неї.",
    // "The Shovel is good at breaking loose blocks like Dirt, Sand, and Gravel. Shovels can also create a path by pressing :_input_key.use: on grass blocks.=Лопатою добре розбивати розсипчасті блоки, як-от землю, пісок і гравій. Крім того, лопатою можна прокласти стежку, натискаючи :_input_key.use: на блоках із травою.",
    // "At least one of your resource or behavior packs failed to load. Try downloading this world from your Realm settings to see more details on the error.=Не вдалося завантажити принаймні один пакет ресурсів або поведінки. Спробуйте завантажити цей світ із параметрів Realm, щоб побачити більше відомостей про помилку.",
    // "Add-Ons are a content type available in the Minecraft Marketplace that lets you add custom blocks, items, mobs, recipes, and other game content to your world.=Доповнення – це тип вмісту, доступний на ринку Minecraft, який дає змогу додавати користувацькі блоки, предмети, мобів, рецепти й ігровий контент у світи.",
    // "Once redeemed, your Minecoins are linked to your Microsoft account, so you can access your coins and purchases on other supported devices, too!=Після активації Minecoins пов’язуються з обліковим записом Microsoft, відтак ви можете отримати доступ до своїх монет і покупок також і на інших підтримуваних пристроях!",
    // "When Scaffolding is broken it will also break every Scaffolding block that was being supported by it. This will let you quickly clean up your scaffolding by breaking the supporting blocks!=Якщо розбити блок риштування, також розіб’ються всі блоки над ним. Так можна швидко розібрати риштування після будівництва!",
    // "Integrity - the percentage of blocks to load in from the structure, accepted values are 0 to 100. Blocks will be chosen randomly if a Seed is not specified.=Цілісність – це відсоток блоків, які завантажуються зі структури в діапазоні значень від 0 до 100. Блоки вибираються випадковим чином, якщо не вказано сід.",
    // "Realms are servers run by us, just for you and your friends. Keep your Minecraft world online and always accessible, even when you log-off.=Realms – це наші сервери, які працюють лише для вас і ваших друзів. Нехай ваш світ Minecraft буде завжди онлайн і доступний для інших, навіть коли ви виходите із системи.",
    // "You and up to 10 friends get 24/7 access to a world that's always online. Explore, get creative, or try curated content from Marketplace.=Ви та максимум 10 друзів отримуєте цілодобовий доступ до світу, який завжди онлайн. Досліджуйте, проявляйте творчий підхід або спробуйте ретельно підібраний вміст на Ринку.",
    // "Write down any feedback and send it directly to the creator. Your message will not be posted to the Marketplace and the creator will not be able to respond.=Запишіть будь-який відгук і відправте його безпосередньо авторові. Ваше повідомлення не буде опубліковане на Ринку, і автор не зможе відповісти на нього.",
    // "Only certain crystals and ingots can be used for Armor Trims. Try different kinds like Iron, Gold, or Lapis to create unique designs!=Тільки певні кристали та злитки можуть бути використані для оздоблень обладунків. Спробуйте різні матеріали, такі як залізо, золото або лазурит, щоб створити унікальні дизайни!",
    // "To automatically select the area you want to save, you can place Corner Mode blocks around your structure and name them with the same name as the structure you want to save.=Щоб автоматично визначити розташування для збереження, розташуйте навколо споруди блоки в кутовому режимі та назвіть їх іменем споруди.",
    // "To hold an item in your hand, scroll the mouse wheel to select the item. You can also use a number key: 1 is the first hotbar slot and 9 is the last. =Щоб тримати предмет у руці, прокрутіть коліщатко миші та виберіть його. Ви також можете використовувати цифрову клавішу: 1 — перший слот панелі, 9 — останній.",
    // "In order for one of these items to be powered, it needs a power source such as a Lever, Button, or Pressure Plate. Experiment to find them all!=Щоб подати живлення на один із цих предметів, редстоуну потрібне джерело живлення, як-от важіль, кнопка або притискна пластина. Поекспериментуйте, щоб знайти їх усі!",
    // "When the bubbles touch the lure, it will bob up and down. Tap the Fish button again to reel in the lure. Be careful not to let your fish get away!=Коли бульбашки торкнуться наживки, вона підскочить. Торкніться кнопки \"Рибалити\" ще раз, щоб витягнути наживку. Слідкуйте за тим, щоб риба не зірвалася з гачка!",
    // "Firework Rockets that have no effects can be used to extend Elytra flight. You will be damaged if you use a Firework Rocket that has effects to extend flight.=Феєрверки без ефектів можна використовувати для подовження польоту з надкриллям. Але якщо ви використаєте феєрверк з ефектом, то зазнаєте пошкоджень.",
    // "The world of Minecraft is made from millions of blocks. Each one is breakable, collectable, and placeable. There are almost no limits to what you can build!=Світ Minecraft створений із мільйонів блоків. Кожен із них можна розбити, зібрати та розмістити. Ви можете будувати що завгодно практично без обмежень!",
    // "If you lose your system or uninstall Minecraft, your purchases will still be synced and accessible on any system when you use your Microsoft account.=У разі втрати системи або видалення Minecraft ваші покупки будуть синхронізовані та доступні на будь-якій системі за використання облікового запису Microsoft.",
    // "When using the D-Pad control scheme, tap and hold :touch_forward: to start moving forward and build momentum, and tap :touch_jump: to get out.=Використовуючи хрестовину, натисніть та утримуйте :touch_forward:, щоб почати рухатися вперед і нарощувати швидкість, а потім натисніть :touch_jump:, щоб вибратися.",
    // "Enchanted Books are used at the Anvil to apply enchantments to items. This gives you more control over which enchantments you would like on your items.=Книги чарів використовуються на ковадлі для накладання чарів на предмети. Так ви отримуєте більший контроль над тим, які чари потрібні для ваших предметів.",
    // "Hoppers are used to automatically move items. Hoppers can be attached to some other items like containers such as Chests or Jukeboxes. =Воронки використовуються для автоматичного переміщення предметів. Воронки можна прикріпити до деяких інших предметів, наприклад контейнерів (скринь чи музичних автоматів).",
    // "Every new world you create starts with multiplayer enabled. If you want to make it §eprivate§f, go to World Settings to turn off multiplayer.=У кожному новому світі, який ви створюєте, ввімкнуто мультиплеєр. Якщо ви хочете зробити світ §eприватним§f, перейдіть до параметрів світу, щоб вимкнути мультиплеєр.",
    // "Once you've gathered the required crafting ingredients, tap the recipe once more, then move it from the output slot to your hotbar or inventory.=Зібравши необхідні інгредієнти для крафтингу, торкніться рецепта ще раз, а потім перемістіть його зі слота продукції на панель швидкого доступу або до інвентаря.",
    // "There are multitudes of commands that will allow you to do amazing things. There are many sources out there that will provide you with all of the info that you'll ever need.=Є безліч команд, які дають змогу виконувати дивовижні речі. У світі є багато ресурсів, з яких ви отримаєте всю необхідну інформацію.",
    // "We couldn't confirm if your world uploaded properly. Please join your Realm to check, then try again if it hasn't been updated to the new world.=Не вдалося підтвердити правильність передачі вашого світу. Приєднайтеся до Realm для перевірки, а потім спробуйте ще раз, якщо його не оновлено до нового світу.",
    // "Unlinking your Microsoft Account from within this game will affect all Minecraft games on this platform that have used this Microsoft Account.=Від’єднання вашого облікового запису Microsoft від цієї гри вплине на всі ігри Minecraft на цій платформі, у яких використовується цей обліковий запис Microsoft.",
    // "There is a problem with one or more of your Realms subscriptions. Click OK to go to the Google Play subscription settings to fix your payment method.=Виникла проблема з однією або кількома підписками на Realms. Натисніть «ОК», щоб перейти до налаштувань підписки в Google Play ти виправити спосіб оплати.",
    // "The world is not fully synced or has been corrupted. Try playing the world on a console where it's in a good state and try migrating it again.=Світ не повністю синхронізовано або пошкоджено. Спробуйте запустити світ на консолі, де він перебуває в робочому стані, а потім спробуйте перенести його ще раз.",
    // "There was a problem connecting to the world. Please try again. If this error continues, check your internet connection or try restarting Minecraft.=Виникла проблема підключення до світу. Спробуйте ще раз. Якщо помилка не зникає, перевірте підключення до Інтернету або спробуйте перезапустити Minecraft.",
    // "Armor can be crafted from Leather, Iron, Gold, or Diamond. Chain Armor can be obtained through villager trading and loot from zombies and skeletons.=Обладунок можна крафтити зі шкіри, заліза, золота або алмазу. Кольчужний обладунок можна вторгувати в селян або отримати як трофей від зомбі та скелетів.",
    // "When using a Joystick control scheme, press :tip_virtual_button_jump: to climb up a column of scaffolding. Tap :tip_virtual_button_sneak: to climb down.=Використовуючи джойстик, натисніть :tip_virtual_button_jump:, щоб піднятися на риштування. Натисніть :tip_virtual_button_sneak:, щоб спуститися вниз.",
    // "You can also wear a Carved Pumpkin on your head. This won't give you any :armor: but will make it so Endermen won't get mad when you look at them.=Ви також можете вдягнути на голову вирізаний гарбуз. Він не додасть вам :armor:, але зробить так, що ендермени не злитимуться, коли ви дивитиметеся на них.",
    // "You are out of data storage space and Minecraft is unable to save your progress! Minecraft will return you to the Main Menu to clear up storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft не вдалося зберегти результати. Вас буде переспрямовано в головне меню для звільнення місця.",
    // "In Minecraft, the sun rises and sets as you adventure in your world. As the sun sets, you must take precautions. There are many dangers at night!=Поки ви насолоджуєтеся пригодами в Minecraft, сонце сходить і заходить. Коли сонце сідає, необхідно вжити запобіжних заходів. Ніч приховує чимало небезпек!",
    // "Dispensers are used to shoot out items. You will need to power each Dispenser with a redstone signal (for example, with a lever) to trigger it.=Розподілювачі використовуються для викидання предметів. Щоб запустити розподілювачі, потрібно пустити на кожний із них сигнал редстоуну (наприклад, важелем).",
    // "§eActivate Cheats§f: This setting allows players to use commands. When a world is created with this setting on, all achievements are disabled.=§eАктивувати чіти§f: цей параметр дозволяє гравцям використовувати команди. Якщо під час створення світу цей параметр увімкнуто, усі досягнення буде вимкнено.",
    // "You currently have no photos in your portfolio. Photos taken with the camera will show up here. You can also use the button below to add some.=Зараз у вашому портфоліо немає фотографій. Фотографії, зняті на камеру, з’являтимуться тут. Ви також можете додати інші фотографії за допомогою кнопки нижче.",
    // "Most blocks are not affected by gravity and can float in mid air, but some like Sand and Gravel, will fall if there is no block underneath them.=Більшість блоків не піддаються силі тяжіння та можуть висіти в повітрі, але деякі з них, як-от пісок і гравій, впадуть, якщо під ними не буде іншого блока.",
    // "Open the game menu to see a list of players currently in your world, then select the permissions icon to adjust that player's permissions.=Відкрийте меню гри, щоб переглянути список гравців, які перебувають у вашому світі, а потім виберіть значок дозволів, щоб встановити потрібні дозволи для гравця.",
    // "Once you've gathered the required crafting ingredients, click the recipe once more, then move it from the output slot to your hotbar or inventory.=Зібравши необхідні інгредієнти для крафтингу, натисніть на рецепт ще раз, а потім перемістіть його зі слота продукції на панель доступу або до інвентаря.",
    // "Otherwise, you can find it anytime in the Worlds tab of the Play screen. Edit it to change game modes or even upload any world to your Realm.=Або ви можете будь-коли знайти його на вкладці світів екрана гри. Відредагуйте його, щоб змінити режими гри або навіть передати до свого Realm будь-який світ.",
    // "This pack has a dependency (%s) that is incompatible with your device because your device doesn't have compatible hardware to support ray tracing=Цей пакет має залежний об’єкт (%s), несумісний із вашим пристроєм, тому що на вашому пристрої немає сумісного обладнання, що підтримує трасування променів",
    // "Changes made to your Realms subscription such as stacking time or turning off recurring billing will not be reflected until your next billing date.=Зміни, внесені до вашої підписки на Realms, такі як час накопичення або вимкнення повторюваних платежів, не набудуть чинності до дати наступної оплати.",
    // "You cannot access the Realms Feed because you do not have access to Clubs. See instructions for changing these settings at aka.ms/MCClubsHelp.=Ви не можете отримати доступ до стрічки Realms, оскільки у вас немає доступу до клубів. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCClubsHelp.",
    // "The invite link is either incorrect or deactivated. Ask the Realm's owner for an updated link and make sure you've entered it correctly.=Посилання на запрошення неправильне, або його було деактивовано. Зверніться до власника Realm за оновленим посиланням і переконайтеся, що ви ввели його правильно.",
    // "Tap :touch_forward: twice quickly to fly faster. To fly up tap and hold :touch_fly_up:, and to fly down tap and hold :touch_fly_down:.=Щоб літати швидше, натисніть :touch_forward:. Щоб злетіти вгору, натисніть та утримуйте :touch_fly_up:, а щоб злетіти вниз, натисніть та утримуйте :touch_fly_down:.",
    // "We could not sign you into your Microsoft Account. Access to Realms, Profiles, and your Marketplace items will be limited. Please try again later.=Не вдалося ввійти під вашим обліковим записом Microsoft. Доступ до Realms, профілів і ваших предметів із Ринку буде обмежено. Спробуйте ще раз пізніше.",
    // "You cannot play online multiplayer because you are not running the latest version. Please install the latest version to access online features.=Ви не можете грати в онлайновий мультиплеєр, оскільки у вас застаріла версія. Інсталюйте найновішу версію, щоб отримати доступ до онлайнових можливостей.",
    // "Once you've gathered the required crafting ingredients, select the recipe once more, then move it from the output slot to your hotbar or inventory.=Зібравши необхідні інгредієнти для крафтингу, виберіть рецепт ще раз, а потім перемістіть його зі слота продукції на панель доступу або до інвентаря.",
    // "A Command Block will also show you its previous output. This will help you figure out if a Command Block failed to execute its command and why.=Командний блок також покаже вам свій попередній результат. Він допоможе визначити, чи командному блоку вдалося виконати свою команду, і причину невдачі.",
    // "Scaffolding can help with building large structures by offering a way to reach higher places and safely descend without taking fall damage.=Риштування допомагає зводити величезні споруди, даючи можливість дістатися до більших висот і безпечно спуститися, не отримавши при цьому шкоди від падіння.",
    // "When the bubbles touch the lure, it will bob up and down. Press :_input_key.use: to reel in the lure. Be careful not to let your fish get away!=Коли бульбашки торкнуться наживки, вона підскочить. Натисніть :_input_key.use:, щоб витягнути наживку. Слідкуйте за тим, щоб риба не зірвалася з гачка!",
    // "You cannot post to the Realms Feed because you do not have access to Clubs. See instructions for changing these settings at aka.ms/MCClubsHelp.=Ви не можете публікувати в стрічці Realms, оскільки у вас немає доступу до клубів. Інструкції зі зміни цих параметрів див. на сайті aka.ms/MCClubsHelp.",
    // "Before you can broadcast Minecraft through Twitch, you will need to migrate your Minecraft account to a Mojang account. Would you like to do that now?=Щоб транслювати гру Minecraft через Twitch, потрібно перенести свій обліковий запис Twitch до облікового запису Mojang. Хочете зробити це зараз?",
    // "When you start or join an online game, your friends can see this in their Friends tab. If they join, it'll be visible to their friends as well.=Якщо ви почнете гру онлайн або приєднаєтеся до неї, ваші друзі бачитимуть це на вкладці «Друзі». Якщо вони приєднаються, це буде видно і їхнім друзям.",
    // "Any block you've picked up can placed back into the world. This way you can build a cozy §eshelter§f or anything else you can imagine!=Будь-який блок, який ви підібрали, можна повернути у світ. Таким чином ви можете побудувати затишний §eпритулок§f або що завгодно, що тільки можна собі уявити!",
    // "Adding an external server requires knowing the server name and server IP address. Once added, the server can be found in the server list for play.=Щоб додати зовнішній сервер, потрібно знати ім’я та IP-адресу сервера. Після додавання сервер стає доступним для пошуку в списку серверів для гри.",
    // "Makes entities ride other entities, stops entities from riding, makes rides evict their riders, or summons rides or riders.=Командує сутностям їздити верхи на інших сутностях, зупиняє їзду сутностей верхи, командує сутностям скинути своїх вершників або викликає їздові сутності або вершників.",
    // "The skin that you have equipped is from a content pack that is not allowed in multiplayer. Continuing will disable multiplayer for this world.=Скін, який ви намагаєтеся використати з пакета вмісту, недоступний у мультиплеєрних іграх. Якщо продовжити, мультиплеєр буде вимкнуто в цьому світі.",
    // "You can go to this world's resource and behavior pack settings and remove those packs to continue, but the world may no longer be playable.=Щоб продовжити, перейдіть до ресурсів цього світу та параметрів пакета поведінки, а потім видаліть ці пакети. Але після цього ви зможете грати у світі.",
    // "Survival mode has 4 different difficulty levels - Peaceful, Easy, Normal, and Hard. Or play Creative mode and get endless resources!=Режим виживання має 4 різні рівні складності: мирний, легкий, нормальний і складний. Також ви можете грати в творчому режимі й отримувати нескінченні ресурси!",
    // "When using a Joystick control scheme, drag :tip_virtual_joystick: up to move forward and tap :tip_virtual_button_dismount: to get out.=Використовуючи джойстик, потягніть :tip_virtual_joystick: угору, щоб почати рухатися вперед, а потім натисніть :tip_virtual_button_dismount:, щоб вибратися.",
    // "Something went wrong. We can't verify that the server you are trying to connect to is one that we trust. We recommend that you try again later.=Щось пішло не так. Ми не можемо перевірити, чи можна довіряти серверу, до якого ви намагаєтеся приєднатись. Рекомендуємо спробувати ще раз пізніше.",
    // "If you start hosting, we will create a code for you to give to other players so they can join your world. Would you like to start hosting?=Якщо ви станете хостом, ми створимо код, який вам потрібно повідомити іншим гравцям, щоб вони змогли приєднатися до вашого світу. Хочете стати хостом?",
    // "Some items, like buckets, fishing rods, and bows, can be used by tapping the build/use button :tip_virtual_button_action_build_or_use:.=Деякі предмети, такі як відра, вудки та луки, можна використовувати, натиснувши кнопку будівництва/використання :tip_virtual_button_action_build_or_use:.",
    // "Click '%s' below to view our community standards and how to submit a case review request if you feel you were %s in error.=Натисніть \"%s\" нижче, щоб переглянути стандарти нашої спільноти та інформацію про те, як надіслати запит на розгляд ситуації, якщо ви вважаєте, що вас %s помилково.",
    // "Your video card needs to support at least OpenGL version 3.0 or support Framebuffer Objects via an extension to use the integrated Twitch broadcasting.=Для інтегрованої трансляції Twitch ваша відеокарта має підтримувати OpenGL принаймні версії 3.0 або Framebuffer Objects через розширення.",
    // "The port number determines the specific server program to use. This will typically not need to be changed unless the server host specifies to do so.=Номер порту визначає конкретну програму сервера, яка використовується. Зазвичай його потрібно змінювати, лише якщо хост сервера вкаже на це.",
    // "Villagers will most likely be very grateful that you have saved them from the raiders. Be sure to check back with them, you might get a good deal.=Селяни майже напевно будуть дуже вдячні вам за порятунок від рейдерів. Обов’язково поверніться до них – на вас може чекати хороша пропозиція.",
    // "Structure Blocks have 4 modes that can be switched between with the Mode dropdown: Save, Load, Corner, and 3D Export.=Структурні блоки мають 4 режими, між якими можна перемикатися за допомогою розкривного списку \"Режим\": \"Збереження\", \"Завантаження\", \"Кутовий\" та \"3D-експорт\".",
    // "Unfortunately the integrated Twitch broadcasting requires a newer version of Windows than you are on. You must have at least Windows Vista or newer.=На жаль, для інтегрованої трансляції Twitch потрібна новіша від поточної версія Windows. Вам потрібна ОС Windows Vista або новішої версії.",
    // "When a Command Block has either executed or failed to execute its stored command, it sends a Redstone signal from the side where the arrow is pointing.=Якщо командний блок виконав або не зміг виконати свою збережену команду, він надсилає сигнал редстоуну зі сторони, у яку вказує стріла.",
    // "Now you can plant your seeds. Make sure your crops are protected as they can easily die from being trampled or lack of water or light.=Тепер можна посадити насіння. Переконайтеся, що врожай захищено, тому що його можуть легко затоптати або він може пропасти через нестачу води чи світла.",
    // "During online play you might see chat messages or other user generated content that might not be suitable for all ages.=Під час гри онлайн ви можете зіткнутися з повідомленнями в чаті або іншим користувацьким контентом, що може не підходити для користувачів, які не досягли певного віку.",
    // "Advanced Tip: An Add-On includes both a Behavior Pack and a Resource Pack. Make sure both packs are activated to ensure the Add-On works!=Корисна підказка: доповнення містить як пакет поведінки, так і пакет ресурсів. Переконайтеся, що обидва пакети активовані, щоб доповнення працювало!",
    // "This update makes your world higher and deeper. It adds more blocks and caves under your current world, so there's more to explore underground.=Це оновлення робить ваш світ вищим і глибшим. Воно додає більше блоків і печер під поточним світом, розширюючи досліджувану підземну область.",
    // "Be careful! You're activating features that are still under development. Your world might crash, break, or not work with future updates.=Будьте обережні! Ви активуєте функції, які ще перебувають у розробці. Ваш світ може \"впасти\", зламатися або не працювати з майбутніми оновленнями.",
    // "Packs purchased outside Minecraft Marketplace can only be synced once. They will continue to be available to anyone who plays on this device.=Пакети, придбані поза Ринком Minecraft, можна синхронізувати тільки один раз. Вони лишаться доступними всім людям, що грають на цьому пристрої.",
    // "The crossbow is a ranged weapon which requires an arrow to be loaded. Tap and hold anywhere on the screen to load the crossbow with an arrow.=Арбалет — це зброя дальнього бою, яка заряджається стрілами. Торкніться будь-якого місця на екрані та утримуйте, щоб зарядити арбалет стрілою.",
    // "This will remove all current applied resource and behavior packs from your Realm and replace it with the selected pack. Do you want to continue?=Усі пакети ресурсів і поведінки, застосовані на цей момент, буде вилучено з вашого Realm та замінено на вибраний пакет. Хочете продовжити?",
    // "Once you have crafted a Chest, you can place it in the world and then open it with :_input_key.use: to store items from your inventory.=Скрафтивши скриню, ви можете розмістити її у світі. Потім відкрийте її за допомогою :_input_key.use: і зберігайте там предмети зі свого інвентарю.",
    // "Use your tools a lot and they'll eventually break. As you gather new materials, such as stone, you'll be able to craft better tools.=Якщо багато користуватися інструментами, вони врешті решт зламаються. Збираючи нові матеріали, як-от камінь, ви зможете створювати кращі інструменти.",
    // "This world has Behavior and Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки та ресурсів. Хочете завантажити їх і приєднатися до світу?",
    // "A backup of your Realm is saved automatically, but to retain the backup indefinitely, download it locally to your device.=Резервна копія вашого Realm зберігається автоматично, але щоб зберігати резервну копію протягом невизначеного терміну, завантажте її локально на свій пристрій.",
    // "It appears you are unable to connect to your network, please connect to a Wi-Fi network or enable 'Use Mobile Data' in profile settings.=Схоже, не вдається підключитися до вашої мережі. Підключіться до мережі Wi-Fi або виберіть «Використовувати мобільні дані» в параметрах профілю.",
    // "Enable cross-platform play in the main menu to be able to join Realms, LAN Games, and play with all your Minecraft friends.=Увімкніть кросплатформенну гру в головному меню, щоб мати змогу приєднуватися до Realms, ігор у локальній мережі та грати з усіма своїми друзями в Minecraft.",
    // "External Storage has changed its location, and you could lose your worlds on some devices. Please visit the following page for details: %s=Змінилося розташування зовнішнього сховища, і ви можете втратити свої світи на деяких пристроях. Докладні відомості наведено на сторінці: %s",
    // "To place or use certain Minecraft Education blocks or items, a player must possess a special ability called 'World Builder'.=Щоб розміщати або використовувати окремі блоки чи елементи Minecraft Education, гравець повинен мати спеціальну можливість під назвою \"Творець світів\".",
    // "Are you sure you want to lock the difficulty of this world? This will set this world to always be %1$s, and you will never be able to change that again.=Ви справді хочете зафіксувати складність для цього світу? Буде встановлено складність %1$s, яку ви ніколи не зможете змінити.",
    // "Tools of higher tiers are more durable, more efficient, and able to gather more valuable resources. Go out into the world and find out for yourself!=Інструменти більш високих рівнів довговічніші, ефективніші та здатні збирати цінніші ресурси. Вирушайте у світ і дізнайтеся самі!",
    // "objective field in the score field must be a string. Example \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]=поле цілі в полі оцінки має бути рядком. Приклад \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]",
    // "Beacons need to be on top of a Pyramid of Iron, Gold, Emerald, Diamond, or Netherite blocks with an unobstructed view of the sky.=Маяки треба розміщувати на вершинах пірамід із залізних, золотих, смарагдових, алмазних або незеритових блоків так, щоб їх було добре видно з неба.",
    // "Code Builder allows players to explore, create, and play in Minecraft by writing code using familiar learn-to-code platforms.=Конструктор коду дає гравцям змогу досліджувати, створювати та грати в Minecraft, пишучи код за допомогою знайомих платформ для навчання програмуванню.",
    // "The Shovel is good at breaking loose blocks like Dirt, Sand, and Gravel. Shovels can also create a path by tapping on grass blocks.=Лопатою добре розбивати розсипчасті блоки, як-от землю, пісок і гравій. Крім того, лопатою можна прокласти стежку, торкаючись блоків із травою.",
    // "When using the \"D-Pad & tap to interact\" control scheme, tap :touch_sneak: to toggle blocking with the shield.=Застосовуючи схему керування «Використовуйте кнопку хрестовини й торкніться, щоб взаємодіяти», натисніть :touch_sneak:, щоб включити блокування за допомогою щита.",
    // "Before you can broadcast Minecraft through Twitch, you will need to link your Twitch account on mojang.com. Would you like to do that now?=Щоб транслювати гру Minecraft через Twitch, потрібно пов’язати свій обліковий запис Twitch на сайті mojang.com. Хочете зробити це зараз?",
    // "Are you sure you want to delete \"%1$s\" on this device?%2$sThe cloud version '%3$s' will not be affected and can be re-synced later.=Ви впевнені, що хочете видалити «%1$s» на цьому пристрої?%2$sХмарна версія «%3$s» не постраждає, і її можна пізніше повторно синхронізувати.",
    // "The template used to create this world is missing. That template contained an Add-On pack that you need to continue playing this world.=Відсутній шаблон, використаний для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі.",
    // "name field in the score field must be a string. Example \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]=поле імені в полі оцінки має бути рядком. Приклад \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]",
    // "§eWorld Type§f: This setting controls the way the world is created. Select Infinite or Flat from the drop down menu to change the world type.=§eТип світу§f: цей параметр керує створенням світу. У розкривному меню виберіть «Безкінечний» або «Плаский», щоб змінити тип світу.",
    // "We were unable to sign you out at this time. Please try again later. This will not prevent you from signing in with another account.=Наразі ми не змогли здійснити ваш вихід з облікового запису. Повторіть спробу пізніше. Це не завадить вам увійти з іншого облікового запису.",
    // "Choose a default player permission when creating your world to specify the permissions you want your classmates to have when they join.=Створюючи світ, виберіть стандартні дозволи для гравців, щоб указати дозволи, які ви хочете надати однокласникам, коли вони приєднаються.",
    // "The connection to the host was lost. If that world is still being hosted, please check your internet connection and try to connect again.=Втрачено зв’язок із хостом. Якщо цей світ все ще керується хостом, перевірте підключення до Інтернету та спробуйте підключитися ще раз.",
    // "To get a Structure Block you must use the /give slash command. To use a Structure Block, you must have Operator permissions.=Щоб отримати структурний блок, необхідно скористатися консольною командою /give. Щоб використати структурний блок, потрібно мати дозволи оператора.",
    // "After crafting a Banner, you can put it on a Crafting Table or Loom and add different dyes to create your own unique, cool design!=Скрафтивши стяг, ви можете покласти його на верстак або ткацький верстат і додати різні барвники, щоб створити свій унікальний крутий дизайн!",
    // "score field in rawtext must contain an object. Example \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]=поле оцінки в rawtext має містити об’єкт. Приклад \"rawtext\":[{\"score\": {\"name\": \"my_name\", \"objective\": \"my_objective\"}}]",
    // "You can't copy this world because your device doesn't have enough available storage space. Free up some space and try again.=Ви не можете скопіювати цей світ, оскільки на вашому пристрої недостатньо вільного місця для збереження даних. Звільніть місце і спробуйте ще раз.",
    // "To find the Port number, ask the host to pause their game. The IP Address and Port number can be found on the multiplayer tab of the Game menu.=Щоб дізнатися номер порту, попросіть хоста призупинити гру. IP-адресу й номер порту вказано на вкладці мультиплеєра в меню гри.",
    // "To fill a Dispenser, tap the Dispenser, then move the items that you want to dispense from your inventory into the Dispenser.=Щоб наповнити розподілювач предметами, торкніться розподілювача, а потім перемістіть предмети, які потрібно викинути, з інвентарю в розподілювач.",
    // "There are a variety of different crops that you can farm in Minecraft. Farming, while challenging, can provide an infinite food source.=Є безліч різних культур, які можна вирощувати в Minecraft. Фермерство, хоча це й непроста справа, може стати безкінечним джерелом їжі.",
    // "We were unable to sign you in. Please make sure you are signing in with your school or organizational account and try again.=Не вдалося ввійти в систему. Переконайтеся, що ви входите під навчальним обліковим записом або обліковим записом організації, і спробуйте ще раз.",
    // "Create a custom character in Minecraft piece by piece. Personalize your character's body, eyes, mouth, hairstyles, clothing, and more!=Створіть власного персонажа в Minecraft деталь за деталлю. Налаштуйте тіло, очі, рот, зачіски, одяг і багато інших рис свого персонажа!",
    // "After killing the Ender Dragon, an End Gateway will appear. Throwing an Ender Pearl into the portal will teleport you to the outer islands.=Після вбивства дракона Ендеру з’являться ворота Енду. Якщо кинути перлину Ендеру в портал, ви телепортуєтеся на зовнішні острови.",
    // "WARNING: You will no longer be able to store progression or purchases made on your PlayStation®4 console on your account %s after unlinking.=УВАГА! Ви більше не зможете зберігати прогрес і покупки, здійснені в консолі PlayStation®4, якщо від’єднаєте обліковий запис %s.",
    // "You can share the Connection ID if others have problems joining your world using the Join Code or shared link.=Ви можете поділитися ідентифікатором підключення, якщо інші гравці не можуть приєднатися до вашого світу за допомогою коду приєднання або спільного посилання.",
    // "Name should be in the format of \"name\" or \"namespace:name\". If not namespace is provided, the default one will be assigned.=Ім’я потрібно надавати у форматі \"name\" або \"namespace:name\". Якщо жодних namespace не надано, буде призначено значення за замовчуванням.",
    // "Local save successful but cloud sync failed due to quota. Free cloud space by deleting worlds from the settings menu.=Локальне збереження виконано успішно, але синхронізація з хмарою не відбулася через ліміт. Звільніть місце в хмарі, видаливши світи з меню налаштувань.",
    // "You can get world templates from the Minecraft Education Library, other Minecraft Education users, or education.minecraft.net=Шаблони світів можна отримати у бібліотеці Minecraft Education, в інших користувачів Minecraft Education або на сайті education.minecraft.net.",
    // "To find the IP Address, ask the host to pause their game. The IP Address and Port number can be found on the multiplayer tab of the Game menu.=Щоб дізнатися IP-адресу, попросіть хоста призупинити гру. IP-адресу й номер порту вказано на вкладці мультиплеєра в меню гри.",
    // "Adventure Mode is a gamemode for world builders. In Adventure Mode, players must use special tools to place or break blocks.=Режим пригод – це ігровий режим для творців світу. У режимі пригод гравцям потрібні спеціальні інструменти, щоб розміщати або розбивати блоки.",
    // "As the host of a world, use the command /classroommode to launch the Classroom Mode app and connect it to Minecraft Education.=Як розробник, ви можете використовувати команду /classroommode, щоб запустити програму Режим класу та підключити її до Minecraft Education.",
    // "To view the terms and conditions for Marketplace Pass, please visit https://aka.ms/MinecraftEULA in any web browser.=Щоб ознайомитися з положеннями й умовами для служби Marketplace Pass, перейдіть на сторінку https://aka.ms/MinecraftEULA в будь-якому вебпереглядачі.",
    // "Hostile mobs will do normal damage, and if your hunger level drops to zero your health will begin to drop, but you won't die.=Ворожі моби завдаватимуть нормальної шкоди і, якщо ваш рівень голоду опуститься до нуля, ваше здоров’я почне знижуватися, але ви не помрете.",
    // "§eEntities Drop Loot§f: Controls whether things like minecarts and armor stands will drop themselves when they are broken.=§eСутності викидають предмети§f: дає змогу встановити, чи випадатимуть з розбитих штук, як-от вагонетки і стійки для обладунків, ці самі штуки.",
    // "Editor Mode adds powerful tools for editing worlds. Intended for experienced creators on devices with a Mouse & Keyboard.=Режим редактора додає потужні інструменти для редагування світів. Призначений для досвідчених створювачів на пристроях із мишею та клавіатурою.",
    // "Reloads all function and script files from all behavior packs, or optionally restarts the client to reload all resources.=Перезавантажує всі файли функцій і сценаріїв з усіх пакетів поведінки або, за бажанням, перезапускає клієнт для перезавантаження всіх ресурсів.",
    // "The disk may be full or write-protected or the file may be in use. Please check to make sure the file is not open and try again.=Можливо, диск заповнено чи захищено від запису або файл зараз використовується. Переконайтеся, що файл не відкрито, і спробуйте ще раз.",
    // "Start by collecting some wood and dirt for a makeshift home to help you survive the first night! From there it's all up to you.=Для початку зберіть трохи деревини та землі для тимчасового прихистку, у якому ви зможете пережити першу ніч! А далі робіть що завгодно.",
    // "Do you want to continue exploring, crafting, and building? Unlock the full game to play an infinite amount of worlds for as long as you want!*=Хочете й надалі досліджувати, крафтити й будувати?! Розблокуйте повну гру, щоб грати в безлічі світів скільки забажаєте!*",
    // "Your trial of Minecraft Education is complete. To continue playing Minecraft Education, you will need to purchase a license.=Ви вже використали всі свої спроби зіграти в Minecraft Education. Щоб продовжити гру в Minecraft Education, знадобиться придбати ліцензію.",
    // "There was a problem connecting to OneDrive. Worlds saved in the cloud may not be up to date. Also, check your internet.=Виникла проблема з підключенням до OneDrive. Дані світів, збережені в хмарі, можуть бути застарілими. Також перевірте підключення до Інтернету.",
    // "All Realms screens and functions are available in %s except purchasing a new subscription or managing the subscriptions of existing Realms. =Всі екрани та функції Realms доступні в %s, за винятком придбання нової підписки або керування підписками наявних Realms.",
    // "Anyone with the invite code can join your Realm. Go to Game > Download World to download a backup of your world.=Усі, хто має код запрошення, можуть приєднатися до вашого Realm. Виберіть \"Гра\" > \"Завантажити світ\", щоб завантажити резервну копію свого світу.",
    // "Hoppers will continuously remove items out of a container placed above them and move them into the container they are pointing to.=Воронки постійно забиратимуть предмети з контейнера, розміщеного над ними, і переноситимуть їх у контейнер, на який вони вказують.",
    // "To view the terms and conditions for Minecraft Realms, please visit https://www.minecraft.net/eula in any web browser.=Щоб ознайомитися з положеннями й умовами для Minecraft Realms, перейдіть на сторінку https://www.minecraft.net/eula у будь-якому веб-браузері.",
    // "Animals will follow you when you hold their desired food item. This will help you lead them to your ranch or another animal.=Тварини слідуватимуть за вами, якщо у вас у руках буде їхня улюблена їжа. Так ви зможете провести їх на свою ферму або до іншої тварини.",
    // "Realms Plus includes Marketplace Pass content. We suggest that you cancel your Marketplace Pass subscription after signing up for Realms Plus.=Realms Plus включає вміст Marketplace Pass. Радимо скасувати підписку Marketplace Pass після реєстрації в Realms Plus.",
    // "Unfortunately the integrated Twitch broadcasting service requires Windows (Vista or newer) or Mac OS X (10.7/Lion or newer)=На жаль, для інтегрованої служби трансляції Twitch потрібна ОС Windows (Vista чи новіша версія) або Mac OS X (10.7/Lion чи новіша версія)",
    // "To get these special tools, you must use §e/give§f with §ecanplace§f or §ecandestroy§f parameters while in creative mode.=Щоб отримати ці спеціальні інструменти, використовуйте команду §e/give§f із параметрами §ecanplace§f або §ecandestroy§f у творчому режимі.",
    // "You are attempting to create a new realm but a prior purchase was found for renewing a realm. Would you like to apply that purchase now?=Ви намагаєтеся створити новий реалм, але раніше розпочато покупку для поновлення реалму. Хочете виконати ту покупку зараз?",
    // "Certain commands like teleport are only available with cheats ON. Cheats can also be turned on through the Game menu under Game Settings.=Деякі команди, як-от телепорт, доступні лише за ввімкнутих чітів. Чіти також можна ввімкнути в меню гри в параметрах гри.",
    // "This project has Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоби приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети ресурсів. Хочете завантажити їх і приєднатися до світу?",
    // "Thanks for testing Realms! The features are not final and you might run into bugs. Send us feedback! We're listening.=Дякуємо за тестування реалмів! Їхня функціональність ще не дороблена, і ви можете натрапити на баги. Надсилайте нам відгуки! Ми дослухаємося.",
    // "Dispensers can also be used to place items as well, such as Pumpkins on Iron Golems and equipment on Armor Stands.=Розподілювачі також можна використовувати для розміщення предметів, наприклад гарбузів на залізних големах і обладнання на стійці для обладунку.",
    // "To fly tap :tip_virtual_button_jump: twice quickly, and to stop flying tap :tip_virtual_button_fly_down: twice quickly.=Щоб літати, двічі швидко натисніть :tip_virtual_button_jump:, а щоб припинити політ, двічі швидко натисніть :tip_virtual_button_fly_down:.",
    // "Visitors can freely explore your world, but cannot interact with blocks, items, or entities. Trust Players Off.=Відвідувачі можуть вільно досліджувати ваш світ, але не можуть взаємодіяти з блоками, предметами та сутностями. Функція надійних гравців вимкнута.",
    // "Survival Spawns let you start playing in a custom-built world, while still enjoying the classic survival mechanics of Minecraft.=Карти для виживання дають змогу почати гру в спеціально створеному світі, насолоджуючись класичною механікою виживання Minecraft.",
    // "Deleting your Microsoft Account from this game will affect all Minecraft games that use this account.=Видалення вашого облікового запису Microsoft у цій грі вплине на всі ігри Minecraft на цій платформі, у яких використовується цей обліковий запис Microsoft.",
    // "§eCoarse Dirt§f - This is almost like a normal Dirt Block but Grass can't grow on it. It can be found in Savanna and Mega Taiga biomes.=§eКам'яниста земля§f — нагадує звичайний блок землі, але на ній не росте трава. Зустрічається в біомах савани й мегатайги.",
    // "This version of Minecraft can no longer access Minecraft Marketplace. Update to the latest version to restore Marketplace access.=У цій версії Minecraft більше не можна відкрити Ринок Minecraft. Оновіться до найновішої версії, щоб відновити доступ до Ринку.",
    // "This world has Behavior Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки. Хочете завантажити їх і приєднатися до світу?",
    // "The Hoe is required for tilling Dirt to plant crops. Press :_input_key.use: on Dirt or Grass blocks to turn them into Farmland.=Мотикою орють землю, щоб саджати там рослини. Натисніть :_input_key.use: на блоці землі або трави, щоб перетворити його на ґрунт.",
    // "While holding a torch, place it into the world by aiming at a nearby block and tapping :tip_virtual_button_action_build_or_use:.=Тримаючи смолоскип, розмістіть його у світі, націлившись на сусідній блок і натиснувши :tip_virtual_button_action_build_or_use:.",
    // "To set the powers of your Beacon you must use a Netherite Ingot, Emerald, Diamond, Gold Ingot, or Iron Ingot in the payment slot.=Щоб установити ефекти маяка, необхідно використати у слоті оплати злиток незериту, смарагд, алмаз, золотий або залізний злиток.",
    // "Behavior Packs are applied bottom to top. That means anything that is in two Behavior Packs will be overridden by the higher one.=Пакети поведінки застосовуються знизу догори. Це означає, що вміст верхнього пакета поведінки перезаписуватиме вміст нижнього.",
    // "This world has Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети ресурсів. Хочете завантажити їх і приєднатися до світу?",
    // "A lead can be attached to one, and when this happens, surrounding llamas (both tamed and un-tamed) will follow, making a caravan. =До однієї з лам можна прикріпити поводок, і тоді лами навколо (приручені й неприручені) послідують за нею, утворюючи караван.",
    // "This world uses features that are still under development. It might crash, break, or stop working at any time.=У цьому світі використовуються функції, які ще перебувають у розробці. Він у будь-який момент може \"впасти\", зламатися або перестати працювати.",
    // "Update to the latest version to access all the new features, play with friends online, or see what's new in the Marketplace.=Оновіться до найновішої версії, щоб отримати доступ до всіх нових функцій, грати з друзями онлайн або переглядати новинки на Ринку.",
    // "Something went wrong while preparing to upload your world. If this keeps happening, restarting your device may help.=Щось пішло не так під час підготовки вашого світу до передавання. Якщо помилка не зникне, допомогти може перезавантаження вашого пристрою.",
    // "Oops! Your account was disconnected. To access online features, please sign in at the Main Menu and restart your world.=На жаль, ваш обліковий запис відключено. Щоб отримати доступ до онлайнових функцій, увійдіть у головне меню та перезапустіть свій світ.",
    // "When using the D-Pad control scheme, tap :touch_jump: to climb up a column of scaffolding. Tap :touch_fly_down: to climb down.=Використовуючи хрестовину, натисніть :touch_jump:, щоб піднятися на риштування. Натисніть :touch_fly_down:, щоб спуститися вниз.",
    // "You are almost out of data storage space! Minecraft has restricted access to this feature until you clear up additional storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft заборонив доступ до цієї функції, доки ви не звільните місце.",
    // "In Minecraft, you can have your own ranch filled with livestock! Ranching provides lots of resources such as wool, eggs, and raw meat.=У Minecraft можна мати свою власну ферму з худобою! Скотарство дає багато ресурсів, наприклад вовну, яйця та сире м’ясо.",
    // "Realms, the safe, simple way to share a Minecraft world with friends, is not available while using beta versions of Minecraft.=У бета-версії Minecraft служба Realms (безпечний і простий спосіб спільного використання світу Minecraft із друзями) недоступні.",
    // "Once you have crafted a Chest, you can place it in the world and then tap to open it and store items from your inventory.=Скрафтивши скриню, ви можете розмістити її у світі. Потім торкніться її, щоб відкрити, і зберігайте там предмети зі свого інвентарю.",
    // "New Minecraft is the only place to receive future updates containing new features, mobs, items, blocks and much more!=Нова версія Minecraft – єдине місце, де можна отримувати майбутні оновлення з новими функціями, мобами, предметами, блоками і не тільки!",
    // "Llamas can be tamed the same as horses. However, even when tamed, the player can't control their movements when riding them. =Лам можна приручити так само, як коней. Але під час верхової їзди гравець не може керувати пересуванням навіть прирученої лами.",
    // "There are many potion effects to discover, experiment with different ingredients and combinations to become a true alchemist.=Зілля мають багато різних ефектів, тому експериментуйте з різними інгредієнтами та комбінаціями, щоб стати справжнім алхіміком.",
    // "At night, the Overworld is home to zombies, spiders, skeletons, and other dangerous creatures we call §ehostile mobs§f.=Вночі зомбі, павуки, скелети й інші небезпечні істоти, яких ми називаємо §eворожими мобами§f, почуваються у Верхньому світі як удома.",
    // "Tap a Jukebox with a Music Disc in your hand to play it. Tap the Jukebox again to eject the Music Disc.=Щоб відтворити музичний диск, візьміть його в руку та торкніться музичного автомата. Щоб вийняти музичний диск, ще раз торкніться музичного автомата.",
    // "This will disable the current link and generate a new one. Anyone who became a member already will still be able to join your Realm.=Буде вимкнуто поточне посилання та створено нове. Усі, хто вже став учасником, і далі зможуть приєднуватися до реалмів.",
    // "Someone started a purchase with the billing account on this device. Would you like to complete the purchase with this account?=Хтось почав покупку на цьому пристрої під обліковим записом для платних служб. Хочете завершити її під цим обліковим записом?",
    // "In the Beacon menu you can select one primary power for your Beacon. The more tiers your pyramid has the more powers you can have.=У меню маяка можна вибрати один основний ефект для маяка. Що більше шарів має піраміда, то більше ефектів ви можете мати.",
    // "This demo will last 5 in-game days (about 1 hour and 40 minutes of real time). Check the achievements for hints! Have fun!=На демо-режим відводиться 5 ігрових днів (десь 1 година 40 хвилин реального часу). Підказки шукайте в досягненнях. Розважайтеся!",
    // "It looks like you started a purchase with a different Microsoft Account. Do you want to complete the purchase with this account instead?=Схоже, ви почали покупку під іншим обліковим записом Microsoft. Хочете завершити її вже під цим обліковим записом?",
    // "During this test, everyone will need to sign in with a Microsoft Account so they can be sent invites and added to Realms.=Для участі в тестуванні увійдіть під обліковим записом Microsoft, щоб ми могли надсилати вам запрошення й додавати вас до Realms.",
    // "This world may not look or behave in the same way as non-modified worlds. You should save a copy of your world before continuing.=Цей світ може виглядати або поводитися не так, як немодифіковані світи. Збережіть копію свого світу, перш ніж продовжити.",
    // "You have extended your Realms subscription as long as possible. You cannot add this additional time right now. Try again later.=Ви вже максимально продовжили свою передплату на службу Realms. Зараз ви не можете додати ще часу. Спробуйте ще раз згодом.",
    // "The Shield blocks all kinds of incoming damage - even a Creeper explosion! It can be equipped in the offhand slot or the hotbar.=Щит блокує вхідну шкоду — навіть вибух кріпера! Його можна встановити в слоті ігрової руки або на панелі швидкого доступу.",
    // "Marketplace Pass is subscription service that gives you access to 150+ pieces of content from Minecraft Marketplace for %s/month.=Marketplace Pass — це послуга підписки, яка дає вам доступ до понад 150 одиниць вмісту з ринку Minecraft за %s на місяць.",
    // "Different colored dyes can be made from a variety of materials, cook cactus in a furnace to get green dye!=Різні кольорові барвники можна виготовити з різноманітних матеріалів. Наприклад, ви можете зварити в печі кактус, щоб отримати зелений барвник!",
    // "Anyone with the link can join your Realm. Go to Game > Download World to download a backup of your world.=Усі, хто має посилання, можуть приєднатися до вашого Realm. Виберіть \"Гра\" > \"Завантажити світ\", щоб завантажити резервну копію свого світу.",
    // "Reduces the delay between your input and what you see on your screen. This setting might use more battery power.=Зменшує затримку між введенням даних і їхньою появою на екрані. Для цього налаштування може використовуватися більше заряду акумулятора.",
    // "We're sorry, but this version of Minecraft Education is no longer supported. Please update to the latest version to continue playing.=На жаль, ця версія Minecraft Education більше не підтримується. Оновіться до найновішої версії, щоб продовжити гру.",
    // "§eDifficulty§f: This setting affects how difficult the world will be. You can choose Peaceful, Easy, Normal, or Hard.=§eСкладність§f: цей параметр впливає на те, наскільки складним буде світ. Можна вибрати «Мирно», «Легко», «Нормально» або «Важко».",
    // "To view the privacy policy for Marketplace Pass, please visit https://aka.ms/mcprivacy in any web browser.=Щоб переглянути політику конфіденційності для Marketplace Pass, перейдіть за посиланням https://aka.ms/mcprivacy в будь-якому вебпереглядачі.",
    // "Invalid bossbar ID. IDs should be of the form namespace:id or id (defaults to minecraft namespace).=Недійсний ідентифікатор смуги здоров’я босів. Ідентифікатори потрібно надавати у форматі namespace:id або id (стандарт для простору імен Minecraft).",
    // "Closing the realm will shut it down. Anyone currently playing on the realm will be disconnected. Are you sure you want to do this?=Якщо закрити Realm, гра в ньому припиниться. Усіх, хто зараз грає в Realm, буде відключено. Ви справді цього хочете?",
    // "Press right or left to cycle through emote buttons. Press the down arrow to access the Change Emotes button.=Натискайте стрілки вправо чи вліво, щоб переходити між кнопками емограм. Натисніть стрілку вниз, щоб відкрити кнопку \"Змінити емограми\".",
    // "All items can be renamed, although only items with durability can be repaired or enchanted with Books on the Anvil.=Перейменувати можна всі предмети, а ось відновити або зачарувати за допомогою книг на ковадлі можна лише предмети тривалого вжитку.",
    // "We're sorry to hear you didn't enjoy your pack at all. Use the button below to let the creator know how they can improve.=Нам шкода, що вам зовсім не сподобався цей пакет. Використайте кнопку нижче, щоб повідомити авторові, як можна зробити краще.",
    // "You are attempting to renew a realm but a prior purchase was found for creating a realm. Would you like to apply that purchase now?=Ви намагаєтеся поновити реалм, але раніше розпочато покупку для створення реалму. Хочете виконати ту покупку зараз?",
    // "Tap a block in your hotbar to select it, then tap :tip_virtual_button_action_build_or_use: to place it.=Торкніться блока на панелі швидкого доступу, щоб вибрати його, а потім натисніть :tip_virtual_button_action_build_or_use:, щоб розмістити його.",
    // "Players can place or destroy blocks above Allow blocks. Players cannot place or destroy blocks above Deny blocks.=Гравці можуть розміщати або знищувати блоки над блоками дозволу. Гравці не можуть розміщати або знищувати блоки над блоками заборони.",
    // "Bonemeal (crafted from a skeleton bone) can be used as a fertilizer and can make things grow instantly!=Кісткове борошно (виготовлене з кістки скелета) можна використовувати як добриво, за допомогою якого можна буде миттєво вирощувати все навколо!",
    // "The Blocks next to the water need to be converted to farmland, do this with the hoe. Water will saturate up to four block away.=Блоки біля води потрібно перетворити на ґрунт, зробіть це за допомогою мотики. Води вистачить максимум на чотири блоки.",
    // "An Armor Stand can change its pose, sneak and press :_input_key.use: on an Armor Stand to change the pose.=Стійка для обладунку може змінити своє положення, прокрадіться й натисніть :_input_key.use: на стійці для обладунку, щоб змінити положення.",
    // "Your Minecraft account lets you play online multiplayer with friends on PCs and mobile devices. And the best part? =Обліковий запис Minecraft дає змогу грати в мультиплеєрі з друзями на комп’ютерах і мобільних пристроях через Інтернет. І головне!",
    // "To view the privacy policy for Minecraft Realms, please visit https://aka.ms/mcprivacy in any web browser.=Щоб переглянути політику конфіденційності для Minecraft Realms, перейдіть за посиланням https://aka.ms/mcprivacy у будь-якому веб-браузері.",
    // "Making a new join code will not stop your multiplayer game. The new code will be used to invite additional players.=Створення нового коду приєднання не зупинить вашу гру в мультиплеєрі. За допомогою нового коду можна буде запросити інших гравців.",
    // "The Experience Points collected by picking up Experience Orbs can be used to enchant Weapons, Armor, Tools, and Books.=Одиниці досвіду, отримані за підбирання сфер досвіду, можна використати для зачарування зброї, обладунку, інструментів і книг.",
    // "You are attempting to renew a realm but a prior purchase was found for a different realm. Would you like to apply that purchase now?=Ви намагаєтеся поновити реалм, але раніше розпочато покупку для іншого реалму. Хочете виконати ту покупку зараз?",
    // "WARNING: You will no longer be able to protect progression or purchases made on your device after deleting your account %s.=УВАГА! Ви більше не зможете зберігати прогрес і покупки, здійснені на вашому пристрої, якщо видалите обліковий запис %s.",
    // "Simply tap your shiny new planks and they will appear in your hotbar. Now you're ready to place them into the world!=Просто торкніться нових блискучих дошок, і вони з’являться на вашій панелі швидкого доступу. Тепер їх можна розмістити в світі!",
    // "A player can ride any adult §eHorse§f, §eDonkey§f, §eMule§f, or §eCamel§f. Only Horses can be armored.=Гравець може їздити верхи на будь-якому дорослому §eконеві§f, §eослові§f, §eволові§f або §eверблюдові§f. Покривати бронею можна тільки коней.",
    // "We've detected that your account has \"Let games read to me\" enabled and have automatically enabled Minecraft's screen reader.=У вашій системі ввімкнуто функцію \"Let games read to me\", тому ми ввімкнули для вас невізуальний екран Minecraft.",
    // "Simply select your shiny new planks and they will appear in your hotbar. Now you're ready to place them into the world!=Просто виберіть нові блискучі дошки, і вони з’являться на вашій панелі швидкого доступу. Тепер їх можна розмістити в світі!",
    // "As you trade with villagers, they will get better at their profession and start to offer better and more valuable trades.=Коли ви торгуєте із селянами, їхні професійні навички покращуються, тож вони почнуть пропонувати кращі та цінніші товари.",
    // "Take caution when building structures made of wool out in the open, as lightning from thunderstorms can set wool on fire.=Будьте обережні, будуючи конструкції з вовни на відкритому повітрі, так як грозова блискавка може підпалити цей матеріал.",
    // "150+ marketplace packs will be immediately available. Your subscription will be available for 30 days at the price of %s.=Понад 150 пакетів вмісту з ринку стануть доступними відразу ж. Ваша підписка буде доступна протягом 30 днів за ціною %s.",
    // "Once you've loaded the crossbow it'll stay loaded until fired, even when you put it in your inventory.=Після того як ви зарядите арбалет, він залишатиметься зарядженим аж до самого пострілу, навіть якщо ви перемістите його до свого інвентарю.",
    // "Command Blocks are a powerful tool for map creators. They store and execute commands upon receiving a Redstone signal.=Командні блоки – це потужний інструмент для творців карт. Вони зберігають і виконують команди, отримавши сигнал редстоуну.",
    // "§eBonus Chest§f: If this setting is turned on, there will be a chest with some starting loot near your initial spawn location.=§eБонусна скриня§f: якщо ввімкнути цей параметр, біля першого місця призову буде скриня зі стартовим інструментом.",
    // "The host is using an older version of Minecraft. Everyone should update to the latest version of Minecraft and try again.=Хост використовує старішу версію Minecraft. Кожен повинен оновитися до найновішої версії Minecraft і спробувати ще раз.",
    // "Armor Stands will react to a Redstone signal, try giving it different signal strengths and see what happens.=Стійка для обладунку реагуватиме на сигнал редстоуну. Спробуйте подавати на неї сигнали різної сили та дивіться, що відбуватиметься.",
    // "For example, put a single wood log anywhere on the crafting grid, and several planks will appear in the §eoutput slot§f.=Наприклад, покладіть одну колоду деревини будь-де в сітці для крафтингу, і в §eслоті продукції§f з’явиться кілька дошок.",
    // "We were unable to connect to the app store. Maybe sign in to the app store or try checking your internet connection.=Не вдається підключитися до магазину програм. Можливо, слід зареєструватися в ньому або перевірити підключення до Інтернету.",
    // "The property '%s` must have a value set less than `%s`. To use a higher version, you need to use format version 2.=Для властивості \"%s\" має бути вказано значення менше ніж \"%s\". Щоб використовувати вищу версію, потрібна версія формату 2.",
    // "Some items, like buckets, fishing rods, and bows, can be used by tapping the build/use button :_input_key.use:.=Деякі предмети, такі як відра, вудки та луки, можна використовувати, натиснувши кнопку будівництва/використання :_input_key.use:.",
    // "Uploading your world files may take a few minutes. Do not turn off the game or leave this screen during the upload process.=Файли світу можуть передаватися кілька хвилин. Не вимикайте гру та не переходьте з цього екрана під час передавання.",
    // "Learn to code in Python! Use a notebook interface to explore computer science lessons, tutorials and challenges.=Вчіться програмувати на Python! Використовуйте інтерфейс у стилі блокнотів для огляду уроків, посібників і задач з інформатики.",
    // "Operators are members who can set player permissions and use commands to have more control over your world.=Оператори – це учасники, які можуть установлювати дозволи гравців і використовувати команди для розширеного керування вашим світом.",
    // "We're in the middle of moving your data to a new location on your device. Please press resume to finish the move.=Ми переміщаємо ваші дані до нового розташування на вашому пристрої. Натисніть кнопку продовження, щоб завершити переміщення.",
    // "Do you want to continue exploring, crafting, and building? Start a new trial world to continue playing!=Ви хочете продовжувати досліджувати, створювати та будувати? Відкривайте новий світ з ознайомлювальної версії, щоб продовжувати грати!",
    // "A purchase is already pending. You cannot make another purchase until it has been resolved. Please try again later.=Покупка вже очікує на обробку. Ви не можете здійснити ще одну покупку, поки не буде оброблено цю. Спробуйте ще раз згодом.",
    // "Our font for the language you have selected is not readable at a GUI scale that small. Do you want to increase your GUI scale?=Наш шрифт для вибраної вами мови не читається в такому дрібному інтерфейсі. Хочете збільшити розмір інтерфейсу?",
    // "Minecraft Marketplace is a place to find new skins, worlds, textures, and mash-up packs by various talented creators.=Ринок Minecraft – це місце, де можна знайти нові скіни, світи, текстури та збірні пакети від різних талановитих творців.",
    // "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack.=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього.",
    // "§eUnconditional§f - Executes the stored command even if the Command Block behind it failed to execute its command.=§eБезумовний§f — збережена команда виконується, навіть якщо попередньому командному блоку не вдалося виконати свою команду.",
    // "%s: Child controls must have unique names: %sIn the future this will be an error and this file won't load.=%s: Імена дочірніх елементів не мають повторюватися: %sУ майбутньому це призводитиме до помилки, а цей файл не завантажуватиметься.",
    // "The world of Minecraft is endlessly surprising. You'll find lots of different animals, plants, and even §f§k§a§b§r §f§k§a§b§r=Світ Minecraft сповнений сюрпризів. Тут ви знайдете багато різних тварин, рослин і навіть §f§k§a§b§r §f§k§a§b§r",
    // "When you see this icon, we are saving your game. Do not turn off your Nintendo Switch while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте Nintendo Switch, поки бачите цю піктограму на екрані.",
    // "If you're using Action Buttons, tap :tip_virtual_button_action_build_or_use: to fire a loaded crossbow.=Якщо ви використовуєте кнопки дій, натисніть :tip_virtual_button_action_build_or_use:, щоб зробити постріл із зарядженого арбалета.",
    // "The sun can also tell you what direction you are facing. Remember: the sun rises in the east and sets in the west!=Сонце також може підказати вам, у якому напрямку ви прямуєте. Пам’ятайте: сонце сходить на сході та заходить на заході.",
    // "§eMagma Block§f - This is found naturally in the Nether, it gives off a little light and will burn whoever steps on it.=§eБлок магми§f — у природі зустрічається в Незері. Вона трохи світиться й спалить будь-кого, хто на неї наступить.",
    // "Worlds and Add-ons are complex! While some work great together, you might get funky results with others.=Світи та доповнення – унікальні й складні! Хоча деякі з них чудово працюють разом, з деякими ви можете отримати дивні результати.",
    // "It looks like you do not own the Marketplace template this world is based on. You can purchase it from Minecraft Marketplace.=Схоже, у вас немає шаблону з Ринку, на якому базується цей світ. Ви можете придбати його на Ринку Minecraft.",
    // "Inventory recovered. Find a safe place, and we'll place a chest near you the next time you join the world.=Інвентар відновлено. Знайдіть безпечне місце, і наступного разу, коли ви приєднаєтеся до світу, ваша скриня з’явиться біля вас.",
    // "Press :_input_key.use: on a Cauldron while holding a Bucket of Water or a Potion to fill the Cauldron with its contents.=Натисніть :_input_key.use: на казані, утримуючи відро води або зілля, щоб наповнити казан відповідною речовиною.",
    // "Import an image file from your device to use as your skin. This will not sync between devices or games.=Імпортуйте файл зображення зі свого пристрою, щоб використати як ваш скін. Він не синхронізуватиметься між пристроями або іграми.",
    // "§eConditional§f - Only executes the stored command if the Command Block behind it succeeded in executing its command.=§eУмовний§f — збережена команда виконується, лише якщо попередньому командному блоку вдалося виконати свою команду.",
    // "A soft bed lets you sleep through the night. You'll need wool to craft one, as well as a safe spot to place it.=М’яке ліжко дозволяє спати всю ніч. Вам знадобиться вовна, щоб створити його, а також безпечне місце для його розміщення.",
    // "You need a specific device to use this feature, for more information see: http://aka.ms/ray-tracing-FAQ=Для використання цієї функції потрібне спеціальне обладнання. Додаткові відомості наведено в статті http://aka.ms/ray-tracing-FAQ",
    // "Members are active players in your world who can break and create blocks, and attack mobs and other players.=Учасники – це активні гравці у вашому світі, які можуть ламати й створювати блоки, а також атакувати мобів та інших гравців.",
    // "Add-Ons allow you to modify your existing worlds and Realms through the Edit World screen and the Create New World screen.=Доповнення дають змогу змінювати наявні світи та Realms на екранах «Редагувати світ» та «Створити новий світ».",
    // "Equip Armor by opening your inventory and moving pieces of Armor to the appropriate slot next to your player skin.=Щоб одягнути обладунок, відкрийте свій інвентар і перемістіть частини обладунку у відповідний слот біля скіну гравця.",
    // "Before you mine diamonds, redstone, or gold, make sure you're using an iron or diamond pickaxe or it won't work.=Перш ніж перейти до видобування алмазів, редстоуну або золота, візьміть залізну чи алмазну кирку, інакше це не спрацює.",
    // "This pack has a dependency (%s) that is incompatible with your device because your device doesn't have enough memory.=Цей пакет має залежний об’єкт (%s), несумісний із вашим пристроєм, тому що на вашому пристрої недостатньо пам’яті.",
    // "Not all crafting materials are on the surface - some may require you to dig underground or into a mountain.=Не всі крафтові матеріали знаходяться на поверхні — щоб знайти деякі з них, потрібно буде копати вглиб землі або крізь гору.",
    // "Download the Chemistry Journal from the Minecraft Education website for a comprehensive guide to chemistry in Minecraft.=Завантажте Хімічний журнал із веб-сайту Minecraft Education, щоб отримати повний посібник із хімії в Minecraft.",
    // "There's a brand new build challenge every month! Find them all in the Library under Monthly Build Challenges.=Щомісяця цілком нове завдання з будівництва! Знайдіть їх усі в бібліотеці в розділі \"Щомісячні завдання з будівництва\".",
    // "You are unable to join the world because your device doesn't have compatible hardware to support ray tracing=Ви не можете приєднатися до світу, тому що на вашому пристрої немає сумісного обладнання, що підтримує трасування променів",
    // "There's something wrong with your account info. Please sign in again to continue using multiplayer features.=З відомостями вашого облікового запису щось не так. Увійдіть ще раз, щоб продовжити користуватися функціями мультиплеєра.",
    // "Llamas are another ridable mob which can be tamed and used to transport large shipments of items. =Лами – це ще один моб, придатний для верхової їзди, якого можна приручити та використовувати для транспортування великих вантажів.",
    // "With cheats activated, the host can enable or disable the World Builder ability for any players in the world.=Коли чіти активовано, розробник може ввімкнути або вимкнути можливість \"Творець світу\" для будь-якого гравця у світі.",
    // "Your %s Realm will remain active for as long as you have the paid Realm subscription that your %s Realm is linked to.=Ваш %s Realm залишатиметься активним, доки у вас є платна підписка на Realm, до якого прив'язаний ваш %s Realm.",
    // "Could not spread %1$s players around %2$s,%3$s (too many players for space - try using spread of at most %4$s)=Не вдалося розсіяти %1$s гравців по %2$s,%3$s (забагато гравців для цієї території: спробуйте розсіяти не більше %4$s)",
    // "Firework Stars can be added to during the crafting of the Firework Rocket to give it many different colors and effects.=Іскри феєрверка можна додати під час крафтингу феєрверка, щоб у ньому було багато різних кольорів і ефектів.",
    // "This is bad. This server failed our verification test. Someone we don't trust might be pretending to be a trusted server.=Біда. Цей сервер не пройшов нашу перевірку. Можливо, він лише прикидається надійним. Ми не довіряємо йому.",
    // "While you are signed out of your Microsoft Account you will not have access to the Minecoins and items you bought in the store.=Поза обліковим записом Microsoft ви не зможете користуватися монетами Minecoins і речами з магазину.",
    // "To hold an item in your hand, use :_input_key.cycleItemLeft: and :_input_key.cycleItemRight: to select the item.=Щоб тримати предмет у руці, використайте :_input_key.cycleItemLeft: та :_input_key.cycleItemRight: і виберіть його.",
    // "Press :_input_key.use: on an Armor Stand while holding a piece of armor to place it on the Armor Stand.=Натисніть :_input_key.use: на стійці для обладунку, утримуючи частину обладунку, щоб розмістити її на стійці для обладунку.",
    // "Fishing must be done with a Fishing Rod and is an excellent way to catch some fish or other cool items from the sea!=Для риболовлі потрібна вудка, і це чудовий спосіб впіймати трохи риби або виловити інші круті предмети з моря!",
    // "If you stop hosting the world, the multiplayer session will end for all players. Are you sure you want to do this?=Якщо ви перестанете бути хостом світу, сеанс мультиплеєра завершиться для всіх гравців. Ви справді цього хочете?",
    // "A Conduit is crafted with Nautilus Shells and a Heart of the Sea. The Conduit draws power from Prismarine and Sea Lanterns.=Провідник створюється з мушлі наутилуса й серця моря. Він живиться від призмарина та морських ліхтарів.",
    // "The Realm you are attempting to access is a different version. Contact the owner of the Realm to address the issue.=Realm, у який ви хочете ввійти, працює в іншій версії. Зверніться до власника реалму, щоб вирішити цю проблему.",
    // "If you'd like to stop using the beta and access Realms, click below for instructions.=Якщо ви хочете припинити використовувати бета-версію та отримати доступ до служби Realms, клацніть нижче, щоб отримати відповідні інструкції.",
    // "Could not spread %1$s teams around %2$s,%3$s (too many players for space - try using spread of at most %4$s)=Не вдалося розсіяти %1$s команди по %2$s,%3$s (забагато гравців для цієї території: спробуйте розсіяти не більше %4$s)",
    // "Unlimited resources. No damage. Flying. No achievements even if you switch to survival later.=Необмежені ресурси. Ніяких ушкоджень. Можливість літати. Досягнення недоступні, навіть якщо згодом переключитися на режим виживання.",
    // "§eChain§f - Executes the stored command when the Command Block behind it has or has not executed its command. =§eЛанцюговий§f — збережена команда виконується, якщо попередній командний блок виконав або не виконав свою команду.",
    // "There was a problem connecting to Immersive Reader. Please restart Minecraft Education and try again.=Під час підключення до функції \"Занурення в текст\" виникла проблема. Перезапустіть Minecraft Education і спробуйте ще раз.",
    // "Dynamic Worlds allow you to explore the creative designs of our marketplace creators in a randomly generated map.=Динамічні світи дають змогу досліджувати креативні дизайни творців нашого ринку на випадково згенерованій карті.",
    // "When digging straight up, place a torch at your feet to break any sand or gravel that could potentially fall down on you.=Копаючи вгору, поставте смолоскип собі під ноги, щоб розбити пісок або гравій, які можуть впасти на вас.",
    // "Fireworks can be fired from a dispenser. This will shoot the Firework in the direction that the dispenser is facing.=Феєрверки можна запускати з розподілювача. Феєрверк запуститься в напрямку, у якому спрямовано розподілювач.",
    // "Cannot place blocks outside of the world. Try a value greater than %d for the Y component of <to: x y z>.=Не можна розмістити блоки за межами світу. Спробуйте значення %d або більше для компонента Y у координатах <to: x y z>.",
    // "A Compass will point in the direction of the first place you spawned into the world, an easy way to find where you started.=Компас вказує в напрямку першого місця, де ви призвались у світ, простий спосіб знайти, де ви почали.",
    // "Worlds can have new biomes, customized structures (randomly generated buildings), new blocks, textures, and mobs.=Світи можуть мати нові біоми, авторські споруди (випадково згенеровані будівлі), нові блоки, текстури та мобів.",
    // "Use mobile data for multiplayer when Wi-Fi is unavailable. This might incur additional data costs.=Використовуйте мобільні дані для мультиплеєра, коли Wi-Fi недоступний. Це може спричинити додаткові витрати на передачу даних.",
    // "This world's multiplayer setting is set to friends only. You must be friends with the host of this world to join.=Мультиплеєр у цьому світі відкрито лише для друзів. Ви маєте бути другом хазяїну світу, щоб приєднатися до гри.",
    // "You do not have enough Minecoins to unlock this item. You can buy Minecoins from your app store.=У вас недостатньо монет Minecoins, щоб розблокувати цей предмет. Ви можете придбати монети Minecoins у своєму магазині програм.",
    // "Break blocks, pick up resources. Use the crafting grid to make helpful items. Now you're crafting!=Розбивайте блоки, підбирайте ресурси. Використовуйте сітку для крафтингу, щоб створювати корисні предмети. Тепер ви крафтите!",
    // "There is an issue with your account. Try again soon, and contact support if this persists.=Виникла проблема з вашим обліковим записом. Повторіть спробу трохи згодом і зверніться до служби підтримки, якщо проблема не зникне.",
    // "Cannot place blocks outside of the world. Try a value of %d or lower for the Y component of <to: x y z>.=Не можна розмістити блоки за межами світу. Спробуйте значення %d або менше для компонента Y у координатах <to: x y z>.",
    // "Stacking, or adding multiple Add-Ons, can increase loading times, and could result in unexpected results.=Накопичення або додавання кількох доповнень може збільшити час завантаження та призвести до неочікуваних результатів.",
    // "To view licensed content, please visit https://minecraft.net/licensed-content/ in any web browser.=Щоб переглянути ліцензований вміст, перейдіть на сторінку https://minecraft.net/licensed-content/ у будь-якому веб-браузері.",
    // "Redstone allows for endless possibilities! Try creating something useful for yourself like an automatic farm!=Редстоун відкриває безмежні можливості! Спробуйте створити щось корисне для себе, наприклад автоматизовану ферму!",
    // "Hostile mobs spawn but deal less damage. Hunger bar depletes and drains health down to 5 hearts.=Ворожі моби з’являтимуться, але завдаватимуть менше шкоди. Індикатор голоду вичерпується, і втрачається здоров’я до 5 сердець.",
    // "When you see this icon, we are saving your game. Do not turn off your computer while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте комп’ютер, поки бачите цю піктограму на екрані.",
    // "Elytra cannot be crafted, but are found in Item Frames in rare End Ships, guarded by fearsome Shulkers.=Надкрилля не крафтиться, але його можна знайти в рамах на рідкісних кораблях Енду, які охороняють страхітливі шалкери.",
    // "You have previously downloaded content or used Minecoins in the Marketplace that are only available on this device.=Ви раніше завантажували вміст або використовували на Ринку Minecoins, які доступні лише на цьому пристрої.",
    // "World templates are blueprints. You can use them to create new worlds that always start out the same.=Шаблони світів — це креслення. Ви можете використовувати їх для створення нових світів, які завжди починаються однаково.",
    // "When Hearts appear around the horse, it has been tamed and will no longer attempt to throw the player off.=Якщо навколо коня з’явилися сердечка, це означає, що коня приручено, і він більше не намагатиметься скинути гравця.",
    // "Some items, like buckets, fishing rods, and bows, can be used by touching and holding anywhere on the screen.=Деякі предмети, такі як відра, вудки та луки, можна використовувати, торкаючись екрана будь-де й утримуючи його.",
    // "Anyone who opens this link will become a member of your Realm. You can disable a link by generating a new one.=Усі, хто відкриє це посилання, стануть учасниками вашого реалму. Ви можете вимкнути посилання, створивши нове.",
    // "Using firework rockets boosts elytra speed in mid air. Just... make sure they don't explode, otherwise it'll hurt BADLY!=Феєрверки-ракети прискорюють надкрилля в польоті. Головне – не допустити вибуху, бо це буде БОЛЯЧЕ!",
    // "Claim a new set of time-limited Character Creator items each month, which are yours to keep forever=Щомісяця протягом обмеженого часу отримувати новий набір предметів для створення персонажів, які стануть вашими назавжди",
    // "When you see this icon, we are saving your game. Do not turn off your device while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте пристрій, поки бачите цю піктограму на екрані.",
    // "You need to be signed in to a §eMicrosoft Account§f with an active internet connection to play multiplayer.=Щоб грати в мультиплеєрі, необхідно ввійти в §eобліковий запис Microsoft§f з активним підключенням до Інтернету.",
    // "There was a problem connecting to your course list. Check your internet connection and try again.=Під час підключення до вашого списку курсів виникла проблема. Перевірте своє підключення до Інтернету та спробуйте ще раз.",
    // "You need to sign in before unlocking items in the store so that we can remember what you have already unlocked.=Перш ніж намагатися розблокувати щось у магазині, потрібно ввійти в систему, щоб ми знали, що ви вже маєте.",
    // "If you edit or activate this world, you will kick all active players. Don't worry, they can rejoin.=Якщо ви зміните чи активуєте цей світ, усіх активних гравців буде викинуто. Не хвилюйтеся, вони зможуть зайти повторно.",
    // "You can build one with anything from dirt to stone, or even close up a cave for a makeshift lodging!=Його можна побудувати із чого завгодно, від землі до каменю, або навіть закрити печеру, створивши імпровізоване житло!",
    // "We've detected that your system has a screen reader enabled and have automatically enabled Minecraft's screen reader.=У вашій системі ввімкнуто невізуальний екран, тому ми ввімкнули для вас невізуальний екран Minecraft.",
    // "Resources you pick up will appear in your §ehotbar§f, which you'll find at the bottom of the screen.=Ресурси, які ви підбираєте, з’являться на вашій §eпанелі швидкого доступу§f, яка знаходиться в нижній частині екрана.",
    // "Sleeping in a bed will also set your §espawn point§f, meaning that if you die, you'll reappear right back home!=Сон у ліжку також встановить ваше §eмісце призову§f, тож якщо ви помрете, то знову з'явитеся просто вдома!",
    // "Move around the world using :_input_key.forward: :_input_key.left: :_input_key.back: :_input_key.right:.=Переміщайтеся світом, використовуючи :_input_key.forward: :_input_key.left: :_input_key.back: :_input_key.right:.",
    // "If once wasn't enough, add four Ender Crystals to the exit portal corners to reawaken the Ender Dragon.=Якщо одного разу замало, вставте чотири кристали Ендеру по кутках вихідного порталу, щоб пробудити дракона Ендеру.",
    // "We're in the middle of moving your data to a new location on your device, but you don't have enough free space.=Ми переміщаємо ваші дані до нового розташування на вашому пристрої, але у вас недостатньо вільного місця.",
    // "To find the IP Address, ask the host to pause the lesson. The IP Address can be seen on the right side of their screen.=Щоб знайти IP-адресу, попросіть хоста призупинити урок. IP-адресу видно праворуч на екрані хоста.",
    // "The text you entered contains words that others may find offensive and cannot be used. Please try again.=Введений текст містить слова, які можуть бути образливими для інших, тому їх не можна вживати. Спробуйте ще раз.",
    // "Navigation is an important skill that you will learn in Minecraft as it's not always easy to find your way home.=Навігація – це важливе вміння, яке ви опануєте в Minecraft, тому що дорогу додому знайти не так просто.",
    // "selector field in rawtext must contain a selector as a string. Example: \"rawtext\":[{\"selector\": \"@e\"}]=Поле selector у rawtext має містити selector як рядковий тип. Приклад: \"rawtext\":[{\"selector\": \"@e\"}]",
    // "This world may not look or behave in the same way as non-modified worlds and you cant earn achievements.=Цей світ може виглядати або функціонувати не так, як немодифіковані світи, і ви не можете заробляти досягнення.",
    // "Provided '%s' element is not SemVer (semver.org) compliant in pack manifest; Defaulting to '%s'.=Наданий елемент \"%s\" не відповідає вимогам SemVer (semver.org) у маніфесті пакета. Використовуємо стандартний \"%s\".",
    // "Place a Template into the leftmost slot of a Smithing Table to see which items you need for the upgrade.=Помістіть шаблон у крайній лівий слот ковальського столу, щоб побачити, які предмети потрібні для модернізації.",
    // "You can invite friends to your worlds, view your friends' creations, and craft in each other's worlds.=Ви можете запрошувати друзів до своїх світів, переглядати творіння друзів, а також крафтити у світах одне одного.",
    // "Show hints for commonly-used keyboard and mouse controls by pressing \"H\" on your keyboard.=Покажіть підказки для елементів керування клавіатурою та мишею, які часто використовуються, натиснувши \"H\" на клавіатурі.",
    // "Favorite friends go first on your friends list. You'll see when they go online or start broadcasting.=Улюблені друзі відображаються першими в списку. Ви бачитимете, коли вони виходять в онлайн і починають трансляції.",
    // "The Hoe is required for tilling Dirt to plant crops. Tap Dirt or Grass blocks to turn them into Farmland.=Мотикою орють землю, щоб саджати там рослини. Торкніться блока землі або трави, щоб перетворити його на ґрунт.",
    // "Just so you know, you already own the following packs: %s. Would you like to unlock the rest of the packs in this bundle?=Нагадуємо, що ви вже маєте такі пакети: %s. Бажаєте розблокувати решту пакетів у цьому наборі?",
    // "For more information, please visit https://aka.ms/MinecraftGeoSunsetting in any web browser.=Щоб переглянути додаткові відомості, перейдіть на сторінку https://aka.ms/MinecraftGeoSunsetting у будь-якому веб-браузері.",
    // "Jump from console to mobile to PC - play your Realm on any device with the Minecraft Marketplace=Переходьте з консолі на мобільний пристрій та ПК — грайте у своєму Realm на будь-якому пристрої завдяки Ринку Minecraft",
    // "The world may not look or behave in the same way as non-modified worlds and you cant earn achievements.=Цей світ може виглядати або функціонувати не так, як немодифіковані світи, і ви не можете заробляти досягнення.",
    // "We can't connect to the service you need right now. Please check your internet connection and try again.=Зараз не вдалося підключитися до потрібної вам служби. Перевірте підключення до Інтернету та спробуйте ще раз.",
    // "When you see this icon, we are saving your game. Do not turn off your Xbox while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте Xbox, поки бачите цю піктограму на екрані.",
    // "When using a \"Joystick\" control scheme, tap :tip_virtual_button_sneak: to toggle blocking with the shield.=Використовуючи джойстик, натисніть :tip_virtual_button_sneak:, щоб включити блокування за допомогою щита.",
    // "Some other items need content you are deleting to work properly. Do you want to risk breaking these items?=Для правильної роботи деяких інших елементів потрібен вміст, який ви збираєтеся видалити. Хочете ризикнути?",
    // "The Allay loves to collect items! If you give it a certain item it will try to collect more of it.=Служки люблять збирати предмети! Якщо ви дасте їм певний предмет, вони намагатимуться зібрати більше цих предметів.",
    // "To manage privacy settings, please visit https://account.xbox.com/Settings in any web browser.=Щоб налаштувати параметри конфіденційності, відкрийте в будь-якому браузері сторінку https://account.xbox.com/Settings.",
    // "Dive into story-driven adventures by downloading and playing one of the many themed worlds and mini-games=Поринути в сюжетні пригоди, завантаживши один із численних тематичних світів або зігравши в одну з міні-ігор",
    // "Press \"I\" on your keyboard or touch the Immersive Reader icon to read or translate in-game text.=Натисніть \"I\" на клавіатурі або торкніться піктограми занурення в текст, щоб читати або перекладати текст у грі.",
    // "Use the right tool for the job! Chopping wood with an axe is much faster than using your hands.=Використовуйте правильний інструмент для роботи! Рубати деревину сокирою набагато швидше, ніж подрібнювати її руками.",
    // "No hostile mobs will spawn except for shulkers and the Ender Dragon, but they won't do any damage to you.=Не призиватимуться ворожі моби, крім шалкерів і дракона Ендеру, але вони не завдаватимуть вам жодної шкоди.",
    // "Look at a block of water and tap the Fish button while holding a Fishing Rod to cast the lure into the water.=Подивіться на блок води та торкніться кнопки \"Рибалити\", тримаючи вудку, щоб закинути наживку у воду.",
    // "Press :_input_key.use: on an Armor Stand with an open hand to remove something from the Armor Stand.=Натисніть :_input_key.use: на стійці для обладунку з відкритою рукою, щоб прибрати щось зі стійки для обладунку.",
    // "§eRepeat§f - Once activated, this Command Block will continue executing its stored command as long as it exists.=§eЦиклічний§f — після активації цей командний блок не припинятиме виконувати свою збережену команду.",
    // "Adding or removing Packs after playing a world might break the world and cause you to lose what you created.=Якщо додати або видалити пакети після гри у світі, світ може поламатися, а ви втратите все, що створили.",
    // "This world uses a resource pack or template that cannot be used in cross-platform multiplayer.=Цей світ використовує пакет ресурсів або шаблон, який не можна використовувати в крос-платформеній мультиплеєрній грі.",
    // "The requested operation is estimated to take %d minutes to complete. Please do not turn off your device during this time.=Очікується, що запитувана операція займе %d хв. Не вимикайте пристрій протягом цього часу.",
    // "The Skin that you have equipped is from a content pack that is not allowed in cross-platform multiplayer games.=Застосований скін походить із пакета вмісту, який заборонено в крос-платформеній мультиплеєрній грі.",
    // "You have endless lives, but your items drop to the ground when you die. Hurry back to pick them up!=У вас нескінченна кількість життів, але ваші предмети падають на землю, коли ви помираєте. Поспішіть їх зібрати!",
    // "A Furnace allows you to cook or smelt items. For example, you can smelt Iron Ore into Iron Ingots.=У печі можна готувати або переплавляти предмети. Наприклад, ви можете переплавити залізну руду на залізні злитки.",
    // "Some items require you to place your crafting ingredients in a certain shape - also called a §erecipe§f.=Деякі предмети вимагають розміщення інгредієнтів для крафтингу в певній формі. Це називається §eрецептом§f.",
    // "To fly tap :touch_jump: twice quickly, and to stop flying tap :touch_stop_flying: twice quickly.=Щоб літати, двічі швидко натисніть :touch_jump:, а щоб припинити політ, двічі швидко натисніть :touch_stop_flying:.",
    // "Your Realm will be permanently deleted. You will not be able to access your world, your member list or the club.=Realm буде остаточно видалено. Ви не зможете отримати доступ до світу, списку учасників або клубу.",
    // "Note: Remix3D Upload service is no longer available, use Export to save locally instead.=Примітка. Служба завантаження Remix3D наразі недоступна, замість неї використовуйте \"Експорт\" для локального збереження.",
    // "Aim at a block of water and press :_input_key.use: while holding a fishing rod to cast the lure into the water.=Націльтеся на блок води та натисніть :_input_key.use:, тримаючи вудку, щоб закинути наживку у воду.",
    // "Pigs can be ridden as well, although they won't go where you want without a little incentive. =На свинях теж можна їздити верхи, однак вони не будуть іти туди, куди вам потрібно, якщо їх трохи не простимулювати.",
    // "For more information about how you can make the most out of Add-Ons, you can visit our FAQ page.=Докладніше про те, як використовувати доповнення максимально ефективно, відвідайте сторінку запитань і відповідей.",
    // "You are unable to join the world because your device doesn't have enough memory for the following packs: %s=Ви не можете приєднатися до світу, тому що на вашому пристрої недостатньо пам’яті для таких пакетів: %s",
    // "§eChat and other user generated text is not available on this realm right now. Please try again later.§f=§eНаразі чат та інший створюваний користувачем текст недоступні у цьому Realm. Повторіть спробу пізніше.§f",
    // "This pack contains information to allow ray tracing, but your device does not support this option.=Цей пакет містить інформацію для підтримки трасування променів, але ваш пристрій не підтримує такий функціонал.",
    // "For more information, please visit https://aka.ms/MinecraftSunsetting in any web browser.=Щоб переглянути додаткові відомості, перейдіть на сторінку https://aka.ms/MinecraftSunsetting у будь-якому веб-браузері.",
    // "A Potion will only partially fill a Cauldron so you will have to use multiple Potions to fill it up completely.=Зілля наповнить лише частину казана, тому вам знадобиться не одне зілля, щоб заповнити весь казан.",
    // "Dolphins can lead you to shipwrecks and underwater ruins, feed them cod and follow their trail!=Дельфіни можуть привести вас до уламків кораблів і підводних руїн. Просто нагодуйте їх тріскою та пливіть за ними!",
    // "Once set, the powers will emanate from the Beacon indefinitely. Powers are granted to all nearby players.=Після встановлення ефекти випромінюватимуться з маяка безкінечно. Ефекти надаються всім гравцям поблизу.",
    // "To view attributions, please visit https://minecraft.net/attribution in any web browser.=Щоб переглянути посилання на джерела, перейдіть на сторінку https://minecraft.net/attribution у будь-якому веб-браузері.",
    // "Command Input exceeds 500 characters. It is not possible to open the keyboard input on this device type.=Довжина команди перевищує 500 символів. Неможливо відкрити введення з клавіатури на цьому типі пристрою.",
    // "Players with custom skins will not be visible to you if the “Only Allow Trusted Skins” option is enabled=Гравці з власними скінами не будуть видимі вам, якщо ввімкнуто параметр \"Дозволити лише надійні скіни\"",
    // "Restarting will erase all your work and start the lesson over.%sAre you sure you want to restart?=У разі перезапуску всю вашу роботу буде стерто, а урок запуститься з початку.%sВи справді хочете перезапустити?",
    // "To view terms and conditions, please visit https://minecraft.net/terms in any web browser.=Щоб ознайомитися з положеннями й умовами, перейдіть на сторінку https://minecraft.net/terms у будь-якому веб-браузері.",
    // "Find classmates in the same lesson to join, or enter their IP address if they don't appear in the list.=Знайдіть однокласників у тому ж уроці, щоб приєднатися, або введіть IP-адресу, якщо їх не видно в списку.",
    // "Something went wrong. We could not add the players you selected to your Realm. Please try again later.=Щось пішло не так. Нам не вдалося додати вибраних вами гравців до вашого реалму. Спробуйте ще раз пізніше.",
    // "Just like in Survival mode you will have health and hunger, and need to fight dangerous mobs.=Так само, як і в режимі виживання, у вас буде здоров’я і голод, а також необхідність битися з небезпечними мобами.",
    // "There was a problem verifying your account. Please restart Minecraft Education and try again.=Під час перевірки вашого облікового запису виникла проблема. Перезапустіть Minecraft Education і спробуйте ще раз.",
    // "We fixed a few bugs in this release. We'll send you new patch notes when we have more to report.=У цьому випуску ми виправили кілька багів. Ми надішлемо вам нові примітки до виправлень, щойно вони з’являться.",
    // "The quiz will open in a new window. You may return to Minecraft after you have completed the quiz.=Опитування відкриється в новому вікні. Ви зможете повернутися в Minecraft, після того як пройдете опитування.",
    // "NPCs are non-player characters that can provide additional lesson information, hints, or instructions.=NPC – це неігрові персонажі, які можуть надавати додаткові навчальні відомості, підказки або інструкції.",
    // "To code in Minecraft, press \"C\" on your keyboard or touch the Agent icon at the top of your screen.=Щоб програмувати в Minecraft, натисніть \"C\" на клавіатурі або торкніться піктограми Agent угорі екрана.",
    // "Crops require light, water, and farmland to grow. You need a hoe, a water source, and seeds to farm.=Щоб вирощувати врожай, потрібні світло, вода та ґрунт. Для фермерства знадобляться мотика, вода й насіння.",
    // "§eStarting Map§f: If this setting is turned on, every player will start with a map in their hotbar.=§eПочаткова карта§f: якщо ввімкнути цей параметр, кожен гравець починатиме з карти на своїй панелі доступу.",
    // "Are you sure you want to delete the \"%s\" world template? This won't affect any worlds you created from this template.=Видалити шаблон світу «%s»? Це не вплине на світи, створені за допомогою цього шаблону.",
    // "Crafting some §etorches§f can help you see in the dark, while also keeping mobs from spawning too close.=Створивши §eфакели§f, ви зможете бачити в темряві, а також не давати мобам з’являтися занадто близько.",
    // "Your own Realm server to add infinite members and play online with up to 2 friends=Ваш власний сервер Realm, до якого можна додавати безкінечну кількість учасників і на якому можна грати онлайн із 2 друзями",
    // "Elytra are an item that can be equipped to allow gliding. Elytra are equipped in the chest armor slot.=Надкрилля – це предмет, який дає змогу планерувати в повітрі. Надкрилля вставляється в слот нагрудника.",
    // "Bows do more damage the further they are pulled back, make sure to pull it all the way back.=Що сильніше натягнута тятива, то більші пошкодження наносять стріли, тому намагайтеся натягувати її якомога далі.",
    // "Foals will grow into adult horses over time, although feeding them Wheat or Hay will speed this up.=Лошата з часом виростають у дорослих коней, а годуючи їх пшеницею або сіном, можна прискорити цей процес.",
    // "If you turn on Remove Texture Limit, you will need to restart the game in order to turn it off.=Якщо ви ввімкнете параметр «Зняти обмеження текстури», то для його вимкнення потрібно буде перезапустити гру.",
    // "text field in rawtext must contain a string. Example: \"rawtext\":[{\"text\": \"text to display\"}]=текстове поле в об’єкті rawtext має містити рядок. Приклад: \"rawtext\":[{\"text\": \"text to display\"}]",
    // "Provided '%s' element has an invalid value in pack manifest; Defaulting to resource pack.=Наданий елемент \"%s\" має неприпустиме значення в маніфесті пакета. Використовуємо стандартний із пакета ресурсів.",
    // "You need to be signed in to iCloud to play Minecraft. Go to your Apple TV settings and turn on iCloud.=Щоб грати в Minecraft, потрібно ввійти в iCloud. Перейдіть до параметрів Apple TV та ввімкніть iCloud.",
    // "An Armor Stand can change its pose, sneak and tap an Armor Stand to change the pose.=Стійка для обладунку може змінити своє положення, прокрадіться й торкніться стійки для обладунку, щоб змінити положення.",
    // "Choose up to three worlds to upload to your Realms server. Select a world to activate or edit it!=Виберіть до трьох світів і передайте на свій сервер Realms. Виберіть світ, щоб активувати чи змінити його!",
    // "Makes one or more entities play a one-off animation. Assumes all variables are setup correctly.=Запускає одноразову анімацію для однієї чи більше сутностей. Припускає, що всі змінні налаштовано правильно.",
    // "Awesome mini-games and new players are waiting for you! But first, '%s' would like to know who you are.=Відпадні міні-ігри та нові гравці чекають на вас! Але спочатку \"%s\" хоче дізнатися про вас більше.",
    // "These games are made with multiplayer in mind, letting you test your skills and have fun with your friends.=Ці ігри створені для мультиплеєра, що дає змогу перевірити свої вміння та розважитися з друзями.",
    // "Are you sure you want to delete the selected items? These items will be lost forever! (A long time!) %s%s%s=Ви точно хочете видалити вибрані елементи? Їх буде втрачено назавжди! (Це дууууже довго!) %s%s%s",
    // "A placement request has been queued and it will be executed when the specified area is fully loaded.=Запит на розміщення поставлено в чергу, його буде виконано після повного завантаження вказаної області.",
    // "Are you sure you want to delete the selected old world? This world will be lost forever! (A long time!)=Ви точно хочете видалити вибраний старий світ? Цей світ буде втрачено назавжди! (Це дууууже довго!)",
    // "translate field in rawtext must contain a language key. Example: \"rawtext\":[{\"translate\": \"gui.ok\"}]=поле перекладу в об’єкті rawtext має містити код мови: \"rawtext\":[{\"translate\": \"gui.ok\"}]",
    // "Sign in with a free Microsoft Account to play online with your friends across platforms=Увійдіть за допомогою безкоштовного облікового запису Microsoft, щоб грати в онлайні з друзями на різних платформах",
    // "If you are playing Multiplayer, everyone in the world must be in a Bed at the same time to pass the night.=Якщо ви граєте в мультиплеєрі, усі у світі мають бути в ліжку одночасно, щоб ніч пройшла швидко.",
    // "§7Some functionality may be overridden during Editing session, but are fully respected when exported=§7Деякі функції можуть бути змінені під час сеансу редагування, але повністю зберігаються при експорті",
    // "This high render distance could cause a low frame rate, crashes, or other unexpected behavior=Така висока дальність рендеру може призвести до низької частоти кадрів, збоїв чи іншої несподіваної поведінки",
    // "This alien new landscape must hide something interesting, and maybe something to bring back with you.=Ці чужорідні нові землі мають приховувати дещо цікаве, а може й дещо таке, що можна забрати із собою.",
    // "Tap a block in your hotbar to select it, then tap somewhere in the world to place it.=Торкніться блоку на панелі доступу, щоб вибрати його, а потім торкніться того місця у світі, де його слід розмістити.",
    // "Simply drag your shiny new planks to your hotbar. Now you're ready to place them into the world!=Просто перетягніть нові блискучі дошки на свою панель швидкого доступу. Тепер їх можна розмістити в світі!",
    // "  §eFlat worlds§f do not have any hills or trees, just an infinite flat area to fill with your creations.=  У §eпласких світах§f немає пагорбів і дерев — просто нескінченна пласка поверхня для творіння.",
    // "Enables Fancy Bubble Columns. Fancy Bubble Columns may lower performance on some devices.=Вмикає стовпи строкатих бульбашок. Стовпи строкатих бульбашок можуть знизити продуктивність на деяких пристроях.",
    // "To quickly toggle your own World Builder ability, run either of the following commands:=Щоб швидко вмикати й вимикати можливість \"Творець світу\" для себе, використовуйте одну з наведених нижче команд:",
    // "Try placing two planks above each other to create some sticks. Useful for all sorts of things!=Спробуйте розмістити дві дошки одну над одною, щоб створити декілька палиць. Вони корисні для різних речей!",
    // "Settings are currently locked. Unlock Template World Options in the Game Settings menu to change them.=Параметри наразі заблоковано. Щоб змінити їх, розблокуйте параметри шаблону світу в параметрах гри.",
    // "You have the maximum number of active subscriptions on this platform and cannot create a new one right now.=Ви вичерпали ліміт активних передплат на цій платформі, тому зараз не можете створити ще одну.",
    // "Adjust how dark the screen can get during the Darkness effect (caused by mobs and other sources)=Виберіть, наскільки може затемнюватися екран, коли застосовується ефект темряви (викликаний мобами тощо)",
    // "Add data-driven blocks and item technology to customize block shape, rotation, damage and more=Додайте технології блоків і предметів із даними, щоб налаштувати форму блоків, обертання, пошкодження тощо",
    // "They are crafted with Glass, Obsidian, and Nether Stars (which is obtained by defeating the Wither).=Вони крафтяться зі скла, обсидіану та незерських зірок (щоб їх отримати, потрібно перемогти візера).",
    // "This is not the latest version of Minecraft, are you sure you want to launch the previous version of Minecraft?=Це не найновіша версія Minecraft, ви справді хочете запустити попередню версію Minecraft?",
    // "Cannot join world. The account you are signed in to is currently playing in this world on a different device.=Не вдалося приєднатися до світу. З цим обліковим записом уже хтось грає на іншому пристрої.",
    // "Achievements can be earned in this world, but you must sign in to a Microsoft Account to earn them.=У цьому світі можна заробляти досягнення, але для цього необхідно ввійти в обліковий запис Microsoft.",
    // "There was a problem with your connection. Multiplayer hosting has stopped and will need to be restarted.=Виникла проблема з підключенням. Мультиплеєрний хостинг перервався, його потрібно перезапустити.",
    // "Use Realms Stories to get social, keep up with your friends' progress, and organize playtime.=Використовуйте Realms Stories, щоб спілкуватися, стежити за прогресом друзів і організовувати ігровий час.",
    // "UI scaling is unsupported on this monitor, most likely because of a low resolution.=Масштабування інтерфейсу користувача не підтримується на цьому моніторі, ймовірно, через низьку роздільну здатність.",
    // "Would you like help importing your saves, settings, and content from the previous version of Minecraft?=Потрібна допомога з імпортом ваших збережень параметрів і вмісту з попередньої версії Minecraft?",
    // "Resetting a Realm permanently erases the world and starts over. Are you sure you want to do this?=Якщо скинути реалм, його світ зникне назавжди і доведеться починати спочатку. Ви справді цього хочете?",
    // "You do not own this template, and must purchase it to unlock it. Would you like to purchase the template?=Цей шаблон не належить вам. Його потрібно придбати, щоб розблокувати. Хочете придбати шаблон?",
    // "§eRedstone§f - There are two redstone settings, each will affect the behavior of the Command Block:=§eРедстоун§f — є два параметри редстоуну, кожен із яких впливатиме на властивості командного блока:",
    // "Some raw foods are better when cooked first on a campfire or in a furnace - your tummy will thank you!=Деякі сирі продукти краще спочатку приготувати на багатті або в печі — ваш животик вам подякує!",
    // "To quickly play your emotes in game, you can always press and hold %s for a quick menu=Щоб швидко запускати ваші емограми в грі, у будь-який момент натисніть і утримуйте %s для виклику швидкого меню",
    // "Some worlds are not available because they could not be moved. Restart Minecraft to try again.=Деякі світи недоступні, оскільки їх не вдалося перемістити. Перезапустіть Minecraft і спробуйте ще раз.",
    // "Authentication to Twitch failed. Please go to mojang.com and rebind your Twitch account.=Помилка автентифікації Twitch. Перейдіть на сайт mojang.com і повторно пов’яжіть свій обліковий запис Twitch.",
    // "There can only be one source entity. Please adjust your selector to limit selection to one entity.=Вихідна сутність може бути тільки одна. Відрегулюйте селектор, щоб була вибрана лише одна сутність.",
    // "Enable the deferred rendering pipeline. Requires a PBR-enabled resource pack and compatible hardware.=Увімкнути відкладений рендеринг. Потрібен пакет ресурсів із підтримкою PBR і сумісне обладнання.",
    // "Json value in rawtext array was not an object. Example: \"rawtext\": [{ \"text\" : \"my text\" }]=Значення Json у масиві rawtext не було об’єктом. Приклад: \"rawtext\": [{ \"text\" : \"my text\" }]",
    // "Experience Levels can be used to repair, enchant, or rename items with the Anvil.=Рівні досвіду можна використовувати для відновлення, зачарування або перейменування предметів за допомогою ковадла.",
    // "You can play on them even when the owner of the Realm is away and from any device running Minecraft!=Ви можете грати в Realm на будь-якому пристрої з Minecraft, навіть якщо власник Realm відсутній!",
    // "Don't worry if you place something in the wrong spot - simply break it again, then pick it back up!=Не хвилюйтеся, якщо розмістите щось не там. Просто зламайте блок ще раз, а потім підберіть знову!",
    // "You need to be signed in to a Microsoft Account to join a Realm. Please sign in and try again.=Щоб приєднатися до Realm, увійдіть під своїм обліковим записом Microsoft. Увійдіть і повторіть спробу.",
    // "Function %s could not be run. You must specify a min_engine_version in the behavior pack's manifest.json.=Неможливо виконати функцію %s. Укажіть min_engine_version у manifest.json пакета поведінки.",
    // "Share your great moments with the other players on this Realm by adding a story to the Story Feed.=Поділіться чудовими моментами з іншими гравцями цього Realm, додавши розповідь до стрічки історій.",
    // "Be careful when you swim. Stay under water for too long and you'll run out of air.=Будьте обережні під час плавання. Не залишайтеся під водою занадто довго, оскільки у вас може закінчитися повітря.",
    // "You are not connected to Wi-Fi. Do you want to download the %s to your device over your cellular network?=Ви не підключені до Wi-Fi. Хочете завантажити %s на свій пристрій через стільникову мережу?",
    // "Sign in with your school or organizational account to use Minecraft Education.=Увійдіть під навчальним обліковим записом або обліковим записом організації, щоб використовувати Minecraft Education.",
    // "If you are not an education user, go to the app store to download the standard version.=Якщо ви не маєте стосунку до навчального закладу, перейдіть до App Store, щоб завантажити стандартну версію.",
    // "%s is sleeping in a bed. To skip to dawn, %s more users need to sleep in beds at the same time.=%s спить у ліжку. Щоб швидко перейти до світанку, ще %s користувачів мають спати в ліжках одночасно.",
    // "Please sign in with your Microsoft Account to play with friends, earn gamerscore and achievements.=Щоб грати з друзями, заробляти бали й досягнення, увійдіть під своїм обліковим записом Microsoft.",
    // "You must purchase the skin pack to use that skin, and we can't connect to the Marketplace.=Щоб скористатися цим скіном, вам потрібно придбати пакет скінів, а нам не вдається підключитися до Ринку.",
    // "Max number of ticking areas (%1$d) has already been reached. Cannot add more ticking areas.=Уже досягнуто максимальної кількості зациклених областей (%1$d). Не можна додати інші зациклені області.",
    // "Your realm name cannot be blank, and you must accept the terms of service to create a realm.=Назва вашого Realm не може бути пустою, і ви повинні прийняти умови обслуговування, щоб створити Realm.",
    // "From the Play menu, you can join your friends' worlds or invite them to your worlds and Realms.=У меню гри ви можете приєднатися до світів своїх друзів або запросити їх до своїх світів чи Realms.",
    // "Provided '%s' element is not a valid UUID in pack manifest; Defaulting to '%s'.=Наданий елемент \"%s\" не є припустимим ідентифікатором UUID в маніфесті пакета. Використовуємо стандартний \"%s\".",
    // "Can I play Marketplace Pass Content if I have joined the Minecraft Beta on Windows or XBOX?=Чи можу я грати у вміст Marketplace Pass після приєднання до бета-версії Minecraft на Windows або Xbox?",
    // "The host can find the Connection ID on the multiplayer tab of their world's Game Menu.=На хост-комп’ютері ідентифікатор підключення можна знайти на вкладці мультиплеєра в меню гри у своєму світі.",
    // "§7Try out the upcoming redesign of this page. You can always switch back to the old experience.=§7Спробуйте майбутній новий дизайн цієї сторінки. Ви завжди можете повернутися до старого варіанта.",
    // "Editor Mode adds powerful tools for editing worlds. Intended for experienced creators.=Режим редактора включає потужні інструменти для редагування світів. Призначений для досвідчених створювачів.",
    // "Keep up to date with what's going on in your Realm by checking the Story Feed in Realms Stories.=Будьте в курсі того, що відбувається у вашому Realm, перевіряючи стрічку історій у Realms Stories.",
    // "Move with :_input_key.forward:, :_input_key.left:, :_input_key.back:, :_input_key.right:=Пересувайтеся за допомогою :_input_key.forward:, :_input_key.left:, :_input_key.back:, :_input_key.right:",
    // "Worlds can do so much, we've created several Sub-Categories to help describe what they can do:=Світи можуть так багато, що ми створили кілька підкатегорій, які допоможуть описати їх властивості:",
    // "Ticking area contains more than %1$d chunks, ticking area is too large and cannot be created.=Зациклена область містить більше %1$d чанків, зациклена область завелика, тому її не можна створити.",
    // "Screenshots and discussions in your Realm will show up here. Get started by pressing \"New post\"=Тут відображатимуться знімки й обговорення у вашому Realm. Для початку натисніть \"Новий допис\"",
    // "Every End Portal frame block is missing something mysterious to bring out the power within.=Кожному блоку рами для порталу в Енд бракує чогось загадкового, щоб вивільнити приховану в ньому силу.",
    // "Tip: Use the <tab> key while typing a command to auto-complete the command or its arguments=Підказка. Вводячи команду, натисніть клавішу Tab, щоб команда або її аргументи заповнились автоматично",
    // "Select the group you would like to join, or enter the IP address if it does not appear in the list.=Виберіть групу, до якої хочете приєднатися, або введіть IP-адресу, якщо її не видно в списку.",
    // "Unknown command: %s. Please check that the command exists and that you have permission to use it.=Невідома команда: %s. Перевірте, чи така команда існує та чи є у вас дозвіл на її використання.",
    // "To use a Firework, press :_input_key.use: on a block to send the Firework shooting into the sky. =Для використання феєрверка натисніть :_input_key.use: на блоці, щоб вистрелити феєрверк у небо.",
    // "You'll have to start over if you go back to the new design. Are you sure you want to continue?=Вам доведеться почати заново, якщо ви повернетеся до нового дизайну. Ви справді хочете продовжити?",
    // "Building a shelter is critical to surviving your first night, and it doesn't have to be hard.=Будівництво притулку має вирішальне значення для виживання в першу ніч, і це не повинно бути важко.",
    // "If you would like to return to the previous version of Minecraft, you can find it on the main menu=Якщо ви захочете повернутися до попередньої версії Minecraft, її можна знайти в головному меню",
    // "Filename: '%1$s'%2$sLast updated: %3$s%4$sTo download, click OK and then Download.%5$s=Ім’я файлу: %1$s%2$sОстаннє оновлення: %3$s%4$sЩоб завантажити, натисніть OK, а потім – «Завантажити».%5$s",
    // "You are not connected to Wi-Fi. Do you want to update the %s on your device over your cellular network?=Ви не підключені до Wi-Fi. Хочете оновити %s на своєму пристрої через стільникову мережу?",
    // "Texture packs visually transform the game's appearance, applying a fresh coat of paint to your Minecraft world.=Пакети текстур змінюють зовнішній вигляд гри, додаючи світу Minecraft нових барв.",
    // "While holding a torch, place it into the world by right-clicking a nearby free surface.=Тримаючи смолоскип, розмістіть його у світі, клацнувши правою кнопкою миші на сусідній вільній поверхні.",
    // "We were unable to connect to Microsoft account services. Maybe check your internet connection?=Не вдалося підключитися до служб облікового запису Microsoft. Перевірте підключення до Інтернету.",
    // "You can fill an empty bucket with water, lava, milk, powdered snow... and even some mobs.=Ви можете наповнити порожнє відро водою, лавою, молоком, порошковим снігом... і навіть деякими мобами.",
    // "To hold an item in your hand, use :rift_left_trigger: and :rift_left_grab: to select the item.=Щоб тримати предмет у руці, використайте :rift_left_trigger: та :rift_left_grab: і виберіть його.",
    // "You don't currently have a strong connection to the chosen server. Your experience may be impacted.=У вас наразі немає надійного підключення до вибраного сервера. Це може вплинути на вашу гру.",
    // "Server and Client have different values set for feature toggle 'Client Side Generation'=Сервер і клієнт мають різні значення, встановлені для перемикача функції «Генерація клієнтської сторони»",
    // "We need you to sign in to the store to view your purchase history before we can continue.=Перш ніж продовжити, ви маєте ввійти в обліковий запис магазину, щоб переглянути свій журнал покупок.",
    // "Marketplace is unavailable on Win32 builds. Consider building the UWP version of the game instead.=Ринок недоступний у збірках Win32. Натомість розгляньте можливість створення UWP-версії гри.",
    // "Please cancel your active Realms Plus subscription and then try purchasing.=Будь ласка, скасуйте активну підписку Realms Plus і дочекайтеся кінця платіжного циклу, а потім спробуйте придбати.",
    // "Template World Options are locked to the values set by this template's Creator. Unlock to change them.=Значення параметрів шаблону світу заблоковано його автором. Розблокуйте, щоб змінити їх.",
    // "Tap a Cauldron while holding a Bucket of Water or a Potion to fill the Cauldron with its contents.=Торкніться казана, тримаючи відро води або зілля, щоб наповнити казан відповідною речовиною.",
    // "§eBlock Type§f - There are three types of Command Blocks, each with their own color and behavior:=§eТип блоку§f — є три типи командних блоків, кожен зі своїм власним кольором і властивостями:",
    // "Sorry, we are still waiting for verification of your purchase. When it succeeds we will let you know!=На жаль, ми ще очікуємо підтвердження вашої покупки. Коли це вдасться, ми вас сповістимо!",
    // "Start enjoying 150+ adventures, mini-games, skin packs, textures and more now!=Почніть насолоджуватися пригодами, міні-іграми, наборами скінів, текстурами та іншим прямо зараз — їх понад 150!",
    // "Some plants like pumpkins and melons grow on stalks. Be careful not to harvest the stalks!=Деякі рослини, як-от гарбузи та кавуни, ростуть на стеблах. Слідкуйте за тим, щоб не зривати стебла!",
    // "Mod your world with Tynker! Build mini-games, create instant structures, and make your own mods with code.=Змінюйте свій світ із Tynker! Програмуйте власні міні-ігри, миттєві будівлі та моди.",
    // "There are many items that use a Redstone signal to do something, such as a Hopper or a Piston.=Сигнал редстоуну для різних дій використовують багато предметів, наприклад воронка або поршень.",
    // "Emerald ores are the rarest ores in Minecraft! They can only be found in mountains and meadows.=Смарагдові руди зустрічаються найрідше в Minecraft! Їх можна знайти тільки в горах і на лугах!",
    // "Note: Players indicates the number of players the creator intends for an optimal experience.=Увага! У полі \"Гравці\" вказано, скільки гравців пропонує запросити творець для оптимальної гри.",
    // "There is a chance that the Anvil will be damaged with each use and after enough usage it will be destroyed.=Ковадло може пошкоджуватися з кожним використанням і врешті-решт зовсім знищиться.",
    // "If you start playing with these settings, achievements will no longer be earnable in this world.=Якщо ви почнете грати з цими параметрами, досягнення в цьому світі більше не зароблятимуться.",
    // "Texture packs change the way that blocks, items, and even the menus look in game. Try them out!=Пакети текстур змінюють зовнішній вигляд блоків, предметів і навіть меню в грі. Спробуйте їх!",
    // "To add or change an NPC in your world, first make yourself a world builder with \"/wb\".=Щоб додати або змінити NPC у своєму світі, спочатку створіть собі творця світу за допомогою \"/wb\".",
    // "To have your peers connect to your world, pause your game and share your join code.=Щоб ваші знайомі підключилися до вашого світу, поставте гру на паузу та повідомте їм свій код приєднання.",
    // "Unable to connect to Realms and complete your purchase at this time. Please try again later.=Зараз не вдається підключитися до Minecraft Realms і завершити покупку. Спробуйте ще раз згодом.",
    // "The world is full of resources, including §ebuilding blocks§f, §ecrafting materials§f, and §efood§f.=Світ сповнений ресурсів, як-от §eбудівельні блоки§f, §eматеріали для крафту§f і §eїжа§f.",
    // "Even in Minecraft you'll get hungry, so try to find something to eat before that happens.=Навіть у Minecraft можна зголодніти, тому постарайтеся знайти щось поїсти до того, як це станеться.",
    // "Put on some fresh pixels and express yourself with a huge variety of inspired looks.=Додайте кілька свіжих пікселів і самовиражайтеся, користуючись величезним розмаїттям натхненних образів.",
    // "Use the command \"/setworldspawn\" to have new players begin playing where you are standing.=Використовуйте команду ''/setworldspawn'', щоб нові гравці приєднувалися до гри у вашій локації.",
    // "Continuing will remove all current packs and then add the pack you are trying to apply.=Якщо продовжити, буде видалено всі поточні пакети, а потім додано пакет, який ви хочете застосувати.",
    // "Press :_input_key.use: on a Cauldron with your Arrow in hand to create all kinds of different arrows!=Натисніть :_input_key.use: на казані зі стрілою в руці, щоб створити різні види стріл!",
    // "Could not spread %1$s players around %2$s,%3$s (no safe locations found after %4$s attempts)=Не вдалося розподілити %1$s гравців по %2$s,%3$s (безпечні місця не знайдено після %4$s спроб)",
    // "Get Minecraft, 1000 Minecoins, 4 skin packs, 2 texture packs, 3 maps, and 1 mash-up=Отримайте Minecraft, 1000 монет Minecoins, 4 пакети скінів, 2 пакети текстур, 3 карти й 1 збірний пакет",
    // "All you need is a paid Realms subscription. Why not try a free 30-day trial?=Вам потрібна лише платна підписка на Realms. Чому б не спробувати безкоштовну 30-денну ознайомлювальну версію?",
    // "Are you sure you want to kick %s from the world? They will not be able to rejoin this session.=Ви справді хочете викинути %s зі світу? Цей користувач не зможе повернутися до цього сеансу.",
    // "To grant World Builder ability to all players in the world, run the following command:=Щоб надати можливість \"Творець світу\" всім гравцям у світі, використовуйте наведену нижче команду:",
    // "Schedules an action to be executed once an area is loaded, or after a certain amount of time.=Заплановує одноразове виконання дії після завантаження області чи через певний проміжок часу.",
    // "Selector for NPCs was ambiguous and resulted in too many selected. Please select only one NPC.=Селектор для NPC був неоднозначним, через що вибрано забагато NPC. Виберіть лише одного NPC.",
    // "Deleting templates may cause worlds that are using them to no longer work as intended.=Якщо видалити шаблони, світи, у яких вони використовуються, можуть більше не працювати як задумано.",
    // "We're having trouble processing your subscription right now. Please try again later. Thank you!=Зараз у нас виникли проблеми з обробкою вашої підписки. Повторіть спробу пізніше. Дякуємо!",
    // "This resolution is incompatible with your device because your device doesn't have enough memory.=Ця роздільна здатність несумісна з вашим пристроєм, тому що на ньому недостатньо пам’яті.",
    // "Tap an Armor Stand while holding a piece of armor to place it on the Armor Stand.=Торкніться стійки для обладунку, утримуючи частину обладунку, щоб розмістити її на стійці для обладунку.",
    // "The property '%s' has a version of '%s' which is too high. The highest value we accept is '%s'.=Властивість \"%s\" має зависоку версію \"%s\". Найвище значення, яке ми приймаємо: \"%s\".",
    // "Are you sure you want to change the editor you are using? All unsaved work will be lost.=Ви справді хочете змінити редактор, який використовується? Усю незбережену роботу буде втрачено.",
    // "The property '%s' has a version of '%s' which is too low. The lowest value we accept is '%s'.=Властивість \"%s\" має занизьку версію \"%s\". Найнижче значення, яке ми приймаємо: \"%s\".",
    // "Horses and Donkeys can be bred like other animals using Golden Apples or Golden Carrots.=Коней і ослів можна розводити, як і інших тварин, за допомогою золотих яблук або золотої моркви.",
    // "To hold an item in your hand, use :windowsmr_left_touchpad_horizontal: to select the item.=Щоб тримати предмет у руці, використайте :windowsmr_left_touchpad_horizontal: і виберіть його.",
    // "Launch Code Builder by pressing :_input_key.codeBuilder: or by using the command /code.=Запустіть конструктор коду, натиснувши :_input_key.codeBuilder: або скориставшись командою /code.",
    // "it has already been successfully uploaded. Please get in touch with LiveOps for more information.=його вже успішно завантажено. Зв’яжіться з LiveOps для отримання додаткової інформації.",
    // "You will no longer be able to access Realms, including Realms subscriptions that are currently active.=Ви більше не матимете доступу до Realms, зокрема до активних передплат на Realms.",
    // "Unable to fetch Old Worlds. Clear up additional storage space in order to manage Old Worlds.=Не вдалось отримати старі світи. Очистьте місце, щоб зберегти старі світи й налаштувати їх.",
    // "Added ticking area centered at %1$d with a radius of %2$d chunks marked for preload.=Додано зациклену область із центром у %1$d з радіусом %2$d чанків, відмічено для передзавантаження.",
    // "You need to convert \"%s\" into the latest version of Minecraft to make it playable.=Вам потрібно перетворити світ «%s» на останню версію Minecraft, щоб зробити його доступним для гри.",
    // "Attacking a wolf will cause any wolves nearby to turn hostile and attack you. =Напад на вовка призведе до того, що будь-які вовки поблизу стануть ворожими і також нападатимуть на вас.",
    // "You can change how much of a structure is loaded in by changing the values for Integrity and Seed.=Ви можете змінити обсяг завантаження структури, змінивши значення цілісності й сіду.",
    // "Only disable this option if you are actively connecting to a known and safe application.=Вимикайте цей параметр, лише якщо ви власноруч підключаєтеся до відомої та безпечної програми.",
    // "Tap and hold :tip_virtual_button_action_attack_or_destroy:[LINEBREAK]to break blocks=Щоб розбити блоки, натисніть та утримуйте :tip_virtual_button_action_attack_or_destroy:[LINEBREAK]",
    // "one of the files is too big. Please get in touch with LiveOps if you want to try again.=розмір одного з файлів занадто великий. Зв’яжіться з LiveOps, якщо ви хочете спробувати ще раз.",
    // "§eImpulse§f - Only executes the stored command when the block receives a redstone signal.=§eІмпульсний§f — збережена команда виконується лише тоді, коли блок отримує сигнал редстоуну.",
    // "Flint & Steel allows you to light fires... be careful in densely wooded areas!=Використовуючи кресало, ви зможете добувати вогонь… але робіть це обережно, якщо навкруги багато дерева!",
    // "The Beacon is a powerful item that can only be crafted with a Nether star from the Wither!=Маяк – це могутній предмет, який можна створити лише за допомогою незерської зірки з Візеру!",
    // "I will no longer be able to access Realms, including Realms subscriptions that are currently active.=Я більше не матиму доступу до Realms, зокрема до активних наразі передплат на них.",
    // "Some settings are disabled because you selected hardcore mode when creating this world.=Деякі налаштування вимкнено, оскільки під час створення цього світу ви обрали хардкорний режим.",
    // "Advanced Tip: A Behavior Pack can change how a different items, entities, or blocks work.=Корисна підказка: пакет поведінки може змінити роботу різних об’єктів, сутностей або блоків.",
    // "When using a Joystick control scheme, tap :tip_virtual_button_dismount: to dismount an animal.=Використовуючи джойстик, натисніть :tip_virtual_button_dismount:, щоб злізти з тварини.",
    // "Join codes are not available right now. Ask your host for their IP Address to join their game.=Коди приєднання зараз недоступні. Щоб приєднати до гри хоста, запитайте його IP-адресу.",
    // "Press :_input_key.chat: to open Chat. Type your message and press the send button.=Щоб відкрити чат, натисніть :_input_key.chat:. Введіть повідомлення та натисніть кнопку надсилання.",
    // "Mob Events are now enabled. Individual events which are set to false will not run.=Події мобів тепер увімкнуто. Окремі події, для яких встановлено значення false, не запускатимуться.",
    // "Please update to the latest version to download your pack purchased in Minecraft Marketplace.=Оновіться до найновішої версії, щоб завантажити ваш пакет, придбаний на Ринку Minecraft.",
    // "Boats let you travel across water. Just place one on a water block and you're ready to go.=У човнах можна перетинати водойми. Просто помістіть човен на блок води — і можна вирушати.",
    // "Beds are great! Craft one to quickly pass the night and set your respawn point.=Ліжка просто чудові! Створіть одне для себе, щоб швидко скоротати ніч і встановити точку відродження.",
    // "Oops! We think you are disconnected from the internet. Check your connection and try again!=Ой! Здається, ви відключилися від Інтернету. Перевірте своє з’єднання та спробуйте знову!",
    // "Tame wolves show their health with the position of their tail. Feed them meat to heal them.=Ручні вовки показують своє здоров'я положенням хвоста. Годуйте їх м'ясом, щоб вилікувати.",
    // "Unable to connect to the world. Please check your connection to the internet and try again.=Не вдається підключитися до світу. Перевірте підключення до Інтернету і спробуйте ще раз.",
    // "The display name '%1$s' is too long for an objective, it can be at most %2$d characters long=Коротке ім’я \"%1$s\" задовге для об’єкта, його довжина не може перевищувати %2$d знаків",
    // "This device does not meet the recommended memory amount. Editors may not work as expected.=Цей пристрій не має рекомендованого обсягу пам’яті. Редактори можуть працювати некоректно.",
    // "\"quantity\" has an invalid input, must be an integer or range of integers.=Введено неприпустиме значення \"quantity\" (кількість), це має бути ціле число або діапазон цілих чисел.",
    // "Sign in with your %s to play online with friends and check out cool stuff in the store.=Увійдіть, використовуючи %s, щоб грати онлайн із друзями та зацінити круті штуки в магазині.",
    // ":solid_star: Can't Move Items can't be: moved, dropped, removed, crafted with=:solid_star: \"Не можна переміщати предмети\" не може бути: переміщено викинуто, вилучено, скрафчено з",
    // "Iron, Chain, and Gold Armor can be smelted into Iron or Gold Nuggets in a Furnace.=Залізний, кольчужний і золотий обладунок можна переплавити в залізні або золоті самородки в печі.",
    // "it consists of too many files. Please get in touch with LiveOps if you want to try again.=він містить занадто багато файлів. Зв’яжіться з LiveOps, якщо ви хочете спробувати ще раз.",
    // "Cross-platform play allows you and friends on other platforms to connect and play together!=Кросплатформенна гра дає змогу вам і друзям з інших платформ з’єднуватися й грати разом!",
    // "Sign in with your Free Microsoft Account to experience the full world of Minecraft.=Увійдіть під безкоштовним обліковим записом Microsoft, щоб сповна насолодитися світом Minecraft.",
    // "It looks like we didn't finish things last time. Let's complete renewing your realm now.=Схоже, минулого разу ми зупинилися на півдорозі. Давайте зараз завершимо поновлення реалму.",
    // "You have too many controllers connected while in Local Network Mode to join this game.=У вас підключено забагато контролерів у режимі локальної мережі, щоб приєднатися до цієї гри.",
    // "We recommend that you save a copy of your world or Realm before adding or removing Add-Ons. =Рекомендуємо зберегти копію світу або Realm, перш ніж додавати або видаляти доповнення.",
    // "Oops! We think you are not connected to the internet. Check your connection and try again!=Ой! Здається, ви не підключені до Інтернету. Перевірте своє з’єднання та спробуйте знову!",
    // "This project has Resource Packs applied to it. Would you like to download them before you join?=До цього світу застосовано пакети ресурсів. Хочете завантажити їх перед приєднанням?",
    // "Launch Code Builder by tapping :code_builder_button: or by using the command /code.=Запустіть конструктор коду, торкнувшись :code_builder_button: або скориставшись командою /code.",
    // "Function has been queued and it will be executed when the specified area is fully loaded.=Функцію поставлено в чергу, її буде виконано після повного завантаження вказаної області.",
    // "It looks like we didn't finish things last time. Let's complete creating your realm now.=Схоже, минулого разу ми зупинилися на півдорозі. Давайте зараз завершимо створення реалму.",
    // "You cannot play online multiplayer because of how your Microsoft Account is set up.=Ви не можете грати в онлайн-мультиплеєрі через налаштування вашого облікового запису Microsoft.",
    // "The structure %s can't be found. Make sure the name was spelled correctly and try again.=Структуру %s не вдалося знайти. Перевірте, чи ім’я написано правильно, і спробуйте ще раз.",
    // "Limited resources, you'll need tools. You may get hurt. Watch out for Monsters.=Обмежені ресурси, вам знадобляться інструменти. Вам можуть завдати ушкоджень. Стережіться монстрів.",
    // "Done with your creation? Have others tour your world as visitors to protect your work.=Ваш витвір готовий? Щоб захистити свою роботу, дозвольте іншим оглядати ваш світ як гостям.",
    // "Realms are private Minecraft worlds that are always available for you and your friends.=Realms – це служба приватних світів Minecraft, які завжди доступні для вас і ваших друзів.",
    // "This world has Resource Packs applied to it. Would you like to download them before you join?=До цього світу застосовано пакети ресурсів. Хочете завантажити їх перед приєднанням?",
    // "To make a Hopper point to a particular block, place the Hopper against that block while sneaking.=Щоб воронка вказувала на певний блок, прокравшись, розмістіть її навпроти нього.",
    // "§7Try out features that are under development. Can't be turned off after world creation.=§7Спробуйте функції, які перебувають у розробці. Не можна вимкнути після створення світу.",
    // "Your own personal Realm server: a persistent world always online for you and your friends!=Ваш особистий сервер Realm: постійний світ, який завжди онлайн для вас і ваших друзів!",
    // "Sorry, we were unable to complete your realm purchase. Maybe check your internet connection?=На жаль, не вдалося виконати вашу покупку Realm. Перевірте підключення до Інтернету.",
    // "This pack is missing one or more dependencies. Would you like to apply it anyway?=Для цього пакета бракує одного або кількох залежних об’єктів. Все одно хочете його застосувати?",
    // "Don't stop with just one! You can load multiple Add-Ons onto a single world at once.=Не зупиняйтеся на одному! Ви можете завантажити кілька доповнень для одного світу одночасно.",
    // "Use Remote Connect for Microsoft Account Sign In (requires restart)=Використовуйте функцію віддаленого підключення для входу в обліковий запис Microsoft (потрібно перезапустити)",
    // "Sorry, hyperlinks are not allowed while in a world. Please exit world and try again.=Під час перебування у світі заборонені гіперпосилання. Вийдіть зі світу й спробуйте ще раз.",
    // "You can copy and paste from a text editor to a slate, poster, board, or into chat.=Ви можете копіювати та вставляти з текстового редактора на скрижаль, плакат, дошку або в чат.",
    // "Feeding an animal will keep it from despawning. Build a pen to keep your animals safe.=Годування тварини вбереже її від відкликання. Побудуйте загін, щоб зберегти своїх тварин.",
    // "You will no longer be able to access in-game store content when you play on other platforms.=Ви більше не матимете доступу до вмісту магазину у грі, граючи на інших платформах.",
    // "Choose a Default Game Mode when creating a world to specify the type of gameplay you want.=Під час створення світу виберіть стандартний ігровий режим, щоб указати тип геймплею.",
    // "That's no good. Use the button below to let the creator know how they can improve.=Це не дуже добре. Використайте кнопку нижче, щоб повідомити авторові, як можна зробити краще.",
    // "You're playing in a world with Add-Ons! This will add new features to your Minecraft world.=Ви граєте у світі з доповненнями! Це додасть нових можливостей у ваш світ Minecraft.",
    // "§eCondition§f - There are two conditions, each will affect the behavior of the Command Block:=§eУмова§f — є дві умови, кожна з яких впливатиме на властивості командного блока:",
    // "Choose how long messages like game invites and Marketplace offers are visible=Виберіть, як довго відображаються такі повідомлення, як-от запрошення на ігри та пропозиції Ринку",
    // "You do not have access to Realms in pre-production. To get access, reach out in=Ви не маєте доступу до Realms у підготовчому середовищі. Щоб отримати доступ, запросіть його на",
    // "Banners are a cool way to decorate your house or castle with custom patterns and colors.=Стяги – це чудовий спосіб прикрасити будинок або замок своїми візерунками й кольорами.",
    // "Rides were not summoned for the following entities that already have rides: %1$s=Їздові сутності не були викликані для наступних суб'єктів, які вже мають їздові сутності: %1$s",
    // "The display name '%1$s' is too long for a team, it can be at most %2$d characters long=Коротке ім’я \"%1$s\" задовге для команди, його довжина не може перевищувати %2$d знаків",
    // "There was a Realm Event. Check out the Story Feed in Minecraft to see what happened.=Відбулася подія Realm. Загляньте в стрічку історій в Minecraft, щоб дізнатися, що сталося.",
    // "Revision component provided in version '%s' will be ignored and treated as 0.=Переглянутий компонент, наданий у версії \"%s\", ігноруватиметься та вважатиметься за значення 0.",
    // "§eKeep Inventory§f: This setting allows players to keep their inventory when they die.=§eЗберігати інвентар§f: цей параметр дозволяє гравцям зберігати інвентар після загибелі.",
    // "If a Hopper is powered by Redstone, it will become inactive and stop moving items.=Якщо воронка активується редстоуном, вона стане неактивною та перестане переміщати предмети.",
    // "Join codes are not available right now. Try refreshing or use your IP address instead.=Коди приєднання зараз недоступні. Спробуйте оновити сторінку або використайте IP-адресу.",
    // "Feed a bone to a wolf to tame it. You can then make it sit or follow you.=Згодуйте кістку вовку, щоб приручити його. Потім ви можете змусити його сидіти або слідувати за вами.",
    // "Oops! There are no results for \"%s\" and the selected filters. Try broadening search...=Немає результатів за запитом \"%s\" і вибраними фільтрами. Спробуйте розширити пошук…",
    // "Enable cross-platform play in the main menu to invite friends on other platforms.=Увімкніть кросплатформенну гру в головному меню, щоб запрошувати друзів на інших платформах.",
    // "Please let us know where the incident took place. This will help us in researching your case.=Повідомте нам, де стався інцидент. Це допоможе нам у дослідженні вашого випадку.",
    // "Provided UUID '%s' element already exists in pack manifest; Defaulting to '%s'.=Наданий елемент UUID \"%s\" вже наявний у маніфесті пакета. Використовуємо стандартний \"%s\".",
    // "Unlock Template World Options from Game Settings to change the packs for this world.=Розблокуйте параметри шаблону світу в параметрах гри, щоб змінити пакети для цього світу.",
    // "Items in the Chest will be stored there for you to put into your inventory later.=Предмети в скрині будуть зберігатися там, щоб пізніше ви могли додати їх до свого інвентаря.",
    // "Enable cross-platform play in the main menu to play with friends on other platforms.=Увімкніть кросплатформенну гру в головному меню, щоб грати з друзями на інших платформах.",
    // "Checking too many blocks. Max block count: %1$s. Current block count: %2$s.=Забагато блоків для перевірки. Максимальна кількість блоків: %1$s. Поточна кількість блоків: %2$s.",
    // "Sorry, you've been blocked! Ask the Realm's owner to remove you from the Blocked list.=На жаль, вас заблоковано! Попросіть власника Realm видалити вас зі списку заблокованих.",
    // "World sizes can be large. Please connect to WiFi to avoid using mobile data.=Світи можуть бути великого розміру. Підключіться до Wi-Fi, щоб не використовувати мобільні дані.",
    // "Enter a seed to generate the same terrain again. Leave blank for a random world.=Введіть сід, щоб створити таку саму місцевість. Не заповнюйте, щоб створити випадковий світ.",
    // "Microsoft MakeCode lets you code Minecraft in Blocks, Python or JavaScript!=Microsoft MakeCode дає змогу програмувати в Minecraft за допомогою блоків, Python або JavaScript!",
    // "Explore thrilling themed worlds, parceled up with matching skins, textures and more!=Досліджуйте захоплюючі тематичні світи, доповнені відповідними скінами, текстурами тощо!",
    // "The block at %1$d,%2$d,%3$d is not a tile entity and cannot support tag matching.=Блок за координатами %1$d,%2$d,%3$d не є блоковою сутністю й не підтримує узгодження тегів.",
    // "I will no longer be able to access any in-game Store content when I play on other platforms.=Я більше не матиму доступу до вмісту Магазину в грі, граючи на інших платформах.",
    // "They will no longer have Operator level permissions by lowering their permission level.=Вони більше не матимуть дозволів рівня оператора, якщо зменшать свій рівень дозволів.",
    // "The Skin that you have equipped is from a content pack that is not allowed in multiplayer games.=Ви вибрали скін із пакета вмісту, який не дозволено в мультиплеєрних іграх.",
    // "Tap an Armor Stand with an open hand to remove something from the Armor Stand.=Торкніться стійки для обладунку з відкритою рукою, щоб прибрати щось зі стійки для обладунку.",
    // "Place it in the world, then press :_input_key.use: on the Crafting Table to use it.=Розмістіть верстак у світі, а щоб скористатися ним, натисніть на ньому :_input_key.use:.",
    // "Mob Events are enabled. Individual events which are set to false will not run.=Події мобів увімкнуто. Окремі події, для яких встановлено значення false, не запускатимуться.",
    // "Radius cannot be larger than %1$d, ticking area is too large and cannot be created.=Радіус не може перевищувати %1$d, зациклена область завелика, тому її не можна створити.",
    // "The Pickaxe is good at breaking hard blocks like Cobblestone, Iron, or Furnaces.=Кайло чудово підходить для розбивання твердих блоків, наприклад кругляків, заліза та печей.",
    // "When danger comes lurking, a sturdy §eshelter§f can protect you from the threats outside.=Коли стає небезпечно, міцний §eпритулок§f може захистити вас від зовнішніх загроз.",
    // "Advanced Tip: A Resource Pack can change the textures of different blocks and entities.=Корисна підказка: пакет ресурсів може змінювати текстури різних блоків і сутностей.",
    // "This pack may not have skins for items/blocks released after its latest update=Цей пакет може не містити скіни для предметів чи блоків, випущені після останнього оновлення",
    // "Invite your friends by their Gamertag to see their worlds when they are online.=Запрошуйте своїх друзів за псевдонімами гравців, щоб бачити їхні світи, коли вони в мережі.",
    // "Your client is incompatible or out of date. Update your client to connect to realms.=Ваш клієнт несумісний або застарілий. Щоб підключитися до Realms, оновіть свій клієнт.",
    // "Ray Tracing enabled resource packs are not yet compatible with Editor projects.=Пакети ресурсів із підтримкою трасування променів ще не сумісні з редакторськими проєктами.",
    // "Tap the chat button to open Chat. Type your message and tap the send button.=Щоб відкрити чат, торкніться кнопки чату. Введіть повідомлення й торкніться кнопки надсилання.",
    // "You can manage your Realm subscription in the platform store where you originally purchased it.=Передплатою на Realm можна керувати з магазину платформ, де ви її придбали.",
    // "of an unknown error. Please try again or get in touch with LiveOps. (Error code: %s)=сталася невідома помилка. Повторіть спробу або зв’яжіться з LiveOps. (Код помилки: %s)",
    // "This will invalidate the old invite code and create a new one. Do you wish to continue?=Поточний код запрошення стане недійсним, і буде створено новий. Бажаєте продовжити?",
    // "The demo time has expired, start a new world to continue playing the trial!=Час демо-версії вичерпано. Створіть новий світ, щоб продовжити грати в ознайомлювальній версії!",
    // "Place some Redstone Dust next to a power source and turn it on to power it.=Розмістіть пил редстоуну біля джерела живлення та ввімкніть його, щоб подати на нього живлення.",
    // "This content is not compatible with your device. Check https://aka.ms/MinecraftSunsetting=Цей вміст несумісний із вашим пристроєм. Див. https://aka.ms/MinecraftSunsetting",
    // "Eyes of Ender are mysteriously connected to the End and will behave strangely when used.=Очі Ендеру загадково пов’язані з Ендом і мають дивний ефект, якщо їх використати.",
    // "Remember that to use slash commands, you need to enable cheats in your world.=Не забувайте, що для використання консольних команд потрібно активувати чіти у своєму світі.",
    // "Boats let you travel across water. Place one on a water block and you are ready to go.=У човнах можна перетинати водойми. Помістіть човен на блок води — і можна вирушати.",
    // "Choose a block in your hotbar, then press :_input_key.use: to place it.=Виберіть блок на панелі швидкого доступу, а потім натисніть :_input_key.use:, щоб розмістити його.",
    // "You are about to clear all projects. This operation can't be undone. Are you sure?=Ви збираєтесь очистити всі проекти. Цю дію не можна скасувати. Ви справді хочете цього?",
    // "Unable to load the libraries needed for the integrated Twitch broadcasting service.=Не вдається завантажити бібліотеки, необхідні для інтеграції служби трансляцій Twitch.",
    // "Manage your privacy settings for sharing your real name in the Xbox app.=Налаштуйте параметри конфіденційності щодо відображення вашого справжнього імені в програмі Xbox.",
    // "Content active in this world cannot be used in cross-platform multiplayer.=Вміст, активний у цьому світі, не можна використовувати в крос-платформеній мультиплеєрній грі.",
    // "Mini-Games are smaller worlds that include new game mechanics, challenges, or rules.=Мініігри – це менші світи, які містять нові ігрові механіки, випробування чи правила.",
    // "Cobblestone is resistant to Ghast fireballs, making it useful for guarding portals.=Кругляк стійкий до вогняних куль Ґаста, що робить його корисним для охорони порталів.",
    // "A structure's size cannot be smaller than (%1$d, %2$d, %3$d), it was (%4$d, %5$d, %6$d)=Розмір структури не має бути менше (%1$d, %2$d, %3$d), він був (%4$d, %5$d, %6$d)",
    // "You will no longer have Operator level permissions by lowering your permission level.=Ви більше не матимете дозволів рівня оператора, якщо зменшите свій рівень дозволів.",
    // "A structure's size cannot be larger than (%1$d, %2$d, %3$d), it was (%4$d, %5$d, %6$d)=Розмір структури не має бути більше (%1$d, %2$d, %3$d), він був (%4$d, %5$d, %6$d)",
    // "You do not have any photos in your inventory. Try using the camera to take a picture.=У вашому інвентарі немає фотографій. Спробуйте за допомогою камери зробити знімок.",
    // "This world isn't compatible with this device. Claim it on a supported device.=Цей світ несумісний із цим пристроєм. Надішліть запит на нього на підтримуваному пристрої.",
    // "The property '%s' is not used for this type of content. The field will be ignored.=Властивість \"%s\" не використовується для вмісту такого типу. Поле ігноруватиметься.",
    // "All of these tools can accept enchantments, either from the Enchanting Table or Anvil.=Усі ці інструменти можна зачаровувати за допомогою стола зачарування або ковадла.",
    // "Gets transform, name, and id information about the given target entity or entities.=Отримує ім’я, ідентифікатор і відомості про перетворення заданих цільових сутностей.",
    // "I will no longer be able to play cross-platform games with my friends on other platforms.=Я більше не зможу грати в кросплатформенні ігри з друзями на інших платформах.",
    // "Looks for worlds from an older version of Minecraft. This might take a while to finish.=Виконується пошук світів зі старої версії Minecraft. Це може зайняти деякий час.",
    // "Equip a pig with a Saddle and point a Carrot on a Stick in the direction you want to go.=Оснастіть свиню сідлом і вказуйте морквою на паличці в потрібному вам напрямку.",
    // "\"slot\" has an invalid input, must be an integer or range of integers.=Введено неприпустиме значення \"slot\" (слот), це має бути ціле число або діапазон цілих чисел.",
    // "Download failed. The world size exceeds the maximum downloadable limit of %s.=Помилка завантаження. Розмір світу перевищує максимально можливий для завантаження (%s).",
    // "We detected that your user settings have become corrupted but failed to recover them.=Ми виявили пошкодження ваших параметрів користувача, але не змогли відновити їх.",
    // "You need a Nintendo Switch Online membership to join an event in Minecraft.=Щоб приєднатися до події в Minecraft, потрібно оформити членство в Nintendo Switch Online.",
    // "Sorry, we were unable to restore your purchases. Maybe check your internet connection?=На жаль, не вдалося відновити ваші покупки. Перевірте підключення до Інтернету.",
    // "The actual enchantment applied is randomly selected based on the cost displayed.=Фактичні чари, що застосовуються, випадково вибираються на основі відображених вимог.",
    // "Failed to find a place to upload your world. Maybe check your internet connection?=Не вдалося знайти місце, щоб передати ваш світ. Перевірте підключення до Інтернету.",
    // "Do you want to revoke access for this player? You can undo this at any time.=Хочете відкликати доступ для цього гравця? Ви можете скасувати цю дію в будь-який момент.",
    // "You started your subscription in the %s. You can only extend your subscription there.=Ви почали використовувати передплату в %s. Продовжити передплату можна лише там.",
    // "We couldn't pack your world file for upload. Maybe your hard drive is full?=Не вдалося запакувати файл вашого світу для передавання. Можливо, жорсткий диск заповнено?",
    // "Multiple conflicting modules detected in pack manifest; Defaulting to '%s'.=У маніфесті пакета виявлено кілька конфліктних модулів. Використовуємо стандартний \"%s\".",
    // "Want to get the most out of your equipment? You'll need a Smithing Table.=Хочете отримати максимальну віддачу від свого обладнання? Вам знадобиться ковальський стіл.",
    // "If you want to wash the dye off, dip the dyed item into a Cauldron of undyed Water.=Щоб змити барвник, опустіть пофарбований предмет у казан із непофарбованою водою.",
    // "Sorry, we were unable to complete your purchase. Maybe check your internet connection?=На жаль, не вдалося виконати вашу покупку. Перевірте підключення до Інтернету.",
    // "This pack is currently selected! You are about to delete %s forever. Are you sure?=Цей пакет зараз вибрано! Ви ось-ось видалите %s назавжди. Ви справді хочете цього?",
    // "You understand the above and you would like to continue with deleting your account.=Ви розумієте вищесказане і хотіли б продовжити видалення свого облікового запису.",
    // "Get Minecraft, 700 Minecoins, 2 skin packs, 1 texture pack and 1 mash-up=Отримайте Minecraft, 700 монет Minecoins, 2 пакети скінів, 1 пакет текстур і 1 збірний пакет",
    // "The name '%1$s' is too long for an objective, it can be at most %2$d characters long=Ім’я \"%1$s\" задовге для об’єкта, його довжина не може перевищувати %2$d знаків",
    // "Phantoms are dangerous mobs that appear during the night. Make sure to sleep regularly!=Фантоми – це небезпечні моби, які з’являються вночі. Не забувайте висипатися!",
    // "Use \"/spawnpoint\" to change your spawn point. It's just like you slept in a bed!=За допомогою \"/spawnpoint\" можна змінити місце призову. Ви наче поспали в ліжку!",
    // "To query your World Builder ability, run the following command:=Щоб дізнатися, чи ввімкнута ваша можливість \"Творець світу\", використовуйте наведену нижче команду:",
    // "While holding a torch, place it into the world by tapping a nearby free surface.=Тримаючи смолоскип, розмістіть його у світі, торкнувшись сусідньої вільної поверхні.",
    // "This content is available in most geographic regions, but restricted in a few.=Цей вміст доступний у більшості географічних регіонів, але обмежений у деяких із них.",
    // "You can smelt 20 items in a furnace by using a block of dried kelp as fuel.=У печі можна розплавити 20 елементів, використовуючи блок висушених ламінарій як паливо.",
    // "Test out some new features by turning on Experimental Gameplay in the settings menu!=Випробуйте нові функції, увімкнувши експериментальний режим у меню налаштувань!",
    // "Checks if a previous save-all has finished and lists the files involved.=Перевіряє, чи попередня операція \"Зберегти все\" була завершена, і наводить список файлів.",
    // "Are you sure you want to delete \"%s\"? This world will be lost forever! (A long time!)=Дійсно видалити \"%s\"? Цей світ буде втрачено назавжди! (Це дууууже довго!)",
    // "You can toggle Auto Jump on or off in the Settings menu under Controls.=Ви можете вмикати й вимикати автострибок у меню параметрів у розділі ''Елементи керування''.",
    // "Unlike Signs, you can edit Slates, Posters, and Boards over and over again.=На відміну від знаків, скрижалі, плакати й дошки можна змінювати скільки завгодно разів.",
    // "Spreading %1$s players %2$s blocks around %3$s,%4$s (min %5$s blocks apart)=Розсіювання %1$s гравців по %2$s блоках %3$s,%4$s (мін. кількість блоків між ними: %5$s)",
    // "A Hopper can put a Music Disc in for you, and take it out when it's done playing.=Воронка може вставляти диск замість вас і виймати його, коли він дограє до кінця.",
    // "You do not own this item you are trying to provide feedback for. (Error Code: %d)=Ви не є власником товару, до якого намагаєтеся залишити відгук. (Код помилки: %d)",
    // "You can only fall asleep when it's cozy, like when it's nighttime or during a thunderstorm.=Заснути можна тільки, коли затишно, наприклад, вночі або під час грози.",
    // "Only one entity is allowed, but the provided selector allows more than one=Допускається лише один елемент, але цей селектор дає можливість використовувати декілька",
    // "Minecraft has varying levels of difficulty so you can tailor the game to your level.=Minecraft має різні рівні складності, тож ви можете підлаштувати гру під себе.",
    // "Playing over mobile networks may incur additional charges with your carrier.=За гру в мобільних мережах оператор мобільного зв'язку може стягувати додаткову плату.",
    // "Sorry, you can't change your skin in-game. Access Options from the main menu.=На жаль, ви не можете змінити скін із гри. Перейдіть до параметрів із головного меню.",
    // "Enable cross-platform play in the main menu to add or join Servers.=Увімкніть кросплатформенну гру в головному меню, щоб додавати сервери або приєднуватися до них.",
    // "A Bucket will allow you to collect things like Water, Milk, Lava, and even Fish.=Відро дасть змогу збирати певні ресурси, як-от воду, молоко, лаву або навіть рибу.",
    // "Baby turtles will drop scutes when they grow - these can be crafted into turtle shells.=Черепашата ростимуть і скидатимуть пластини, з яких можна складати панцирі.",
    // "You cannot play online multiplayer because your account is suspended.=Ви не можете грати в мультиплеєрі онлайн, оскільки дію вашого облікового запису призупинено.",
    // "Not enough successes: %s out of %s attempts. Required successes: %s. Max attempts: %s.=Недостатньо успіхів: %s із %s спроб. Потрібно успіхів: %s. Макс. спроб: %s.",
    // "Are you sure you want to save and leave the game?%sWe’ll upload your world to the cloud too!=Дійсно зберегти гру та вийти?%sМи також завантажимо ваш світ у хмару!",
    // "Our font for the language you have selected is not readable at a GUI scale that small.=Наш шрифт для вибраної вами мови не читається в такому дрібному інтерфейсі.",
    // "Specifying a \"slot\" is invalid if a \"location\" is not given.=Вказувати значення \"slot\" (слот) не можна, якщо не надано значення \"location\" (розташування).",
    // ":hollow_star: Can't Drop Items can't be: dropped, removed, crafted with=:hollow_star: \"Не можна викидати предмети\" не може бути: викинуто, вилучено, скрафчено з",
    // "An unknown error occured which is preventing online play. Please try again later.=Сталася невідома помилка, яка заважає онлайн-грі. Будь ласка, спробуйте пізніше.",
    // "Are you sure you want to ban %s from the world? They will not be able to rejoin.=Ви справді хочете забанити %s у цьому світі? Цей користувач не зможе повернутися.",
    // "§eStar Shaped§f - Adding a Gold Nugget will make a star pattern in the sky.=§eУ формі зірки§f — якщо додати золотий самородок, феєрверк у небі матиме форму зірки.",
    // "Be sure to defend your village, the attack will stop if you defeat all the raiders.=Захищайте своє село. Якщо ви впораєтеся з усіма рейдерами, напади припиняться.",
    // "Sorry! Marketplace Pass isn’t available for purchase on Amazon devices at this time.=Вибачте! Наразі Marketplace Pass недоступний для покупки на пристроях Amazon.",
    // "The demo time has expired, buy the game to continue or start a new world!=Час демо-версії вичерпано. Придбайте гру, щоб продовжити грати, або створіть новий світ!",
    // "Function with title '%s' is invalid, character '%s' is not allowed in function names.=Функція під назвою '%s' недійсна, символ '%s' неприпустимий у назві функцій.",
    // "An active Conduit gives you powers when you are underwater and when it rains.=Активний провідник надає вам енергію, коли ви перебуваєте під водою та під час дощу.",
    // "Oh no! You have sent too many reviews, please try again later. (Error Code: %d)=О ні! Ви надіслали забагато відгуків, спробуйте ще раз пізніше. (Код помилки: %d)",
    // "%1$s was obliterated by a sonically-charged shriek whilst trying to escape %2$s=%1$s був знищений криком, зарядженим ультразвуком, під час спроби втекти від %2$s",
    // "This pack is a required dependency of another pack that is currently applied.=Цей пакет є необхідним залежним об’єктом для іншого пакета, який зараз застосовано.",
    // "§eColor§f - Adding dye of any color will make an explosion of that color.=§eКолір§f — якщо додати барвник будь-якого кольору, феєрверк буде відповідного кольору.",
    // "Press :_input_key.use: on a Bed to go to sleep. This can only be done at night.=Щоб піти спати, натисніть :_input_key.use: на ліжку. Це можна зробити лише вночі.",
    // "Spreading %1$s teams %2$s blocks around %3$s,%4$s (min %5$s blocks apart)=Розсіювання %1$s команд по %2$s блоках %3$s,%4$s (мін. кількість блоків між ними: %5$s)",
    // "Provided '%s' element is not SemVer (semver.org) compliant in pack manifest.=Наданий елемент \"%s\" не відповідає вимогам SemVer (semver.org) у маніфесті пакета.",
    // "Wow this server is popular! Check back later to see if space opens up.=Ого, цей сервер такий популярний! Поверніться трохи згодом, може, якраз звільниться місце.",
    // "You are about to delete this resource/behavior pack forever. Are you sure?=Ви ось-ось видалите цей пакет ресурсів чи поведінки назавжди. Ви справді хочете цього?",
    // "You are unable to join the world because you have the following incompatible packs: %s=Ви не можете приєднатися до світу, тому що маєте такі несумісні пакети: %s",
    // "The instrument played by a note block depends on the material beneath it.=Інструмент, на якому грає нотний блок, залежить від матеріалу, що знаходиться під ним.",
    // "Warning: If you continue, this will end the multiplayer session for all players.=Увага! Якщо продовжити, цей сеанс мультиплеєра буде завершено для всіх гравців.",
    // "Reloads configuration files relating to variables, secrets, permissions, etc.=Перезавантажує файли конфігурації, що стосуються змінних, секретів, дозволів тощо.",
    // "Upload failed. The world size exceeds the maximum uploadable limit of %s.=Помилка передавання. Розмір світу перевищує максимально можливий для передавання (%s).",
    // "You should only connect to servers you trust! Do you still wish to join?=Ви повинні підключатися лише до серверів, яким довіряєте! Ви все ще хочете приєднатися?",
    // "Too many riders were specified. Only one is allowed at a time for teleport_ride.=Указано забагато вершників. За раз можна вказати лише одного для teleport_ride.",
    // "Frogs pick a variant based on the temperature of the biome the tadpole grow up in.=Жаби обирають варіант залежно від температури біому, у якому росте пуголовок.",
    // "Press :_input_key.chat: to open Chat. Type your message and press ENTER.=Щоб відкрити чат, натисніть :_input_key.chat:. Введіть повідомлення та натисніть ENTER.",
    // "More than one ticking areas were found with the name %s. Please use a single area.=Знайдено кілька зациклених областей з іменем %s. Використовуйте одну область.",
    // "Can't find any coal for your torches? Try putting some logs in a furnace.=Не можете знайти вугілля для своїх смолоскипів? Спробуйте покласти в піч кілька колод.",
    // "Hold :_input_key.sneak: to sneak![LINEBREAK]Can't fall off edges now   =Утримуйте :_input_key.sneak:, щоб крастися![LINEBREAK]Зараз ви не можете впасти з країв",
    // "The name '%1$s' is too long for a team, it can be at most %2$d characters long=Ім’я \"%1$s\" задовге для команди, його довжина не може перевищувати %2$d знаків",
    // "§eGlass§f - This is a transparent block that is made by smelting Sand in a Furnace.=§eСкло§f — це прозорий блок, який виготовляють, переплавляючи пісок в печі.",
    // "The feature to load a structure in an unloaded area hasn't been implemented yet=Функцію завантаження структури в ще не завантаженій області поки не реалізовано",
    // "A Cartography Table can help you create, expand, copy and even name maps.=На столі картографа можна створювати, розширювати, копіювати й навіть називати карти.",
    // "Traveling one block in the Nether is equal to traveling eight blocks in the Overworld.=Пройти один блок у Незері – це як пройти вісім блоків у Верхньому світі.",
    // "Worlds can also include new items, mobs, blocks and even custom gameplay.=Світи також можуть містити нові предмети, мобів, блоки та навіть авторський геймплей.",
    // "All of the content in the Marketplace is created by our professional commiunity creators.=Весь контент на ринку створений творцями нашої професійної спільноти.",
    // "Unfortunately you cannot broadcast to Twitch at this time. And we don't know why :'(=На жаль, наразі не вдається транслювати на Twitch. І ми не знаємо чому :'(",
    // "Cannot submit your review at this time, please try again later. (Error Code: %d)=Наразі не можна надіслати відгук, спробуйте ще раз пізніше. (Код помилки: %d)",
    // "%s per month for a 10-player server and access to 150+ marketplace packs.=%s на місяць для сервера на 10 гравців і доступ до понад 150 пакетів вмісту з ринку.",
    // "All Realms have been updated. You need to update your game to continue playing Realms.=Усі Realms оновлено. Щоб далі грати в Realms, вам потрібно оновити гру.",
    // "Compasses always point to the world spawn - craft one to find your way!=Компас завжди вказує на точку призову у світі. Змайструйте свій, щоб знаходити дорогу!",
    // "When the crops are fully grown they change in appearance and can be harvested.=Коли врожай повністю дозрів, він змінює зовнішній вигляд, і його можна зібрати.",
    // "Looks for worlds from the retail version of Minecraft. This might take a while to finish.=Виконується пошук світів із версії Minecraft для продажу. Зачекайте.",
    // "Oops! Maybe check your internet connection? We can't find your friends' worlds.=Ой! Перевірте підключення до Інтернету. Не вдається знайти світи ваших друзів.",
    // "The Axe is good at breaking wooden blocks like Logs, Planks, or Crafting Tables.=Сокирою зручно розбивати дерев’яні блоки, наприклад колоди, дошки й верстаки.",
    // "Appearance is taking a long time to load. Proceeding with world generation...=Завантаження візуальної форми займає багато часу. Продовжуємо генерацію світу...",
    // "Recovering %2 files (%3).%1%1Progress: %4%% complete%1Files copied: %5 / %2=Відновлення %2 файлів (%3).%1%1Прогрес: %4%% завершено%1Файли скопійовано: %5 / %2",
    // "Building a portal will allow you to travel to another dimension called the Nether.=Створення порталу дозволить вам перенестися в інший вимір під назвою Незер.",
    // "You cannot play on Realms because of how your Microsoft Account is set up.=Ви не можете грати в Realms через налаштування вашого облікового запису Microsoft.",
    // "The join code you entered does not match any worlds that are currently available.=Введений код приєднання не відповідає жодному світу з доступних на цю мить.",
    // "Be careful when using a Bed in the Nether, it's usually too hot to sleep.=Будьте обережні, використовуючи ліжко в Незері, там зазвичай занадто жарко для сну.",
    // "Unlock Template World Options from Game Settings to be able to change permissions.=Розблокуйте параметри шаблону світу в параметрах гри, щоб змінити дозволи.",
    // "A Realm is always online, so you and your friends can play here whenever you want.=Realm завжди онлайн, так що ви з друзями можете грати тут, коли побажаєте.",
    // "This Microsoft Account does not have permission to join multiplayer games.=Цей обліковий запис Microsoft не має дозволу на приєднання до ігор у мультиплеєрі.",
    // "Missing '%s' element in pack manifest; Defaulting to resource pack.=У маніфесті пакета бракує елемента \"%s\". Використовуємо стандартний із пакета ресурсів.",
    // "The pack you are trying to apply can't be applied with other packs. %s=Пакет, який ви намагаєтеся застосувати, не можна використовувати з іншими пакетами. %s",
    // "Select content refreshes each month so there’s always something new to explore.=Вибирайте контент, який оновлюється щомісяця, щоб постійно вивчати щось нове.",
    // "This will invalidate the old link and create a new one. Do you wish to continue?=Поточне посилання стане недійсним, і буде створено нове. Бажаєте продовжити?",
    // "Follow %s. After you both are friends, you can invite them to your game.=Слідкуйте за %s. Коли ви станете друзями, то зможете запрошувати один одного до гри.",
    // "Counts entities (players, mobs, items, etc.) matching specified conditions.=Лічить сутності (гравців, мобів, предмети тощо), які відповідають заданим умовам.",
    // "There appears to be a problem with your App Receipt, please sign in to continue.=Виявлено проблему у вашій квитанції для програми. Увійдіть, щоб продовжити.",
    // "If you have received a Realm Invite Link, enter the code to join.=Якщо ви отримали посилання із запрошенням до Realm, введіть код, щоб приєднатися до нього.",
    // "Applies shaking to the players' camera with a specified intensity and duration.=Застосовує трясіння до камери гравця з указаною інтенсивністю та тривалістю.",
    // "Do you want to switch accounts? Your current account will stay signed in.=Хочете змінити обліковий запис? Ваш поточний обліковий запис залишиться в системі.",
    // "§eWeather Cycle§f: The weather will not change when this setting is turned off.=§eПогодний цикл§f: погода не змінюватиметься, якщо вимкнути це налаштування.",
    // "§eMob Spawning§f: This prevents all mobs from spawning when this setting is off.=§eПоява мобів§f: запобігає появі всіх мобів, коли це налаштування вимкнено.",
    // "Your accounts were not able to be unlinked. Maybe check your internet connection?=Не вдалося від’єднати облікові записи. Перевірте підключення до Інтернету.",
    // "Fireworks are a fun way to create your own unique celebration in Minecraft!=Феєрверки – це веселий спосіб влаштувати своє унікальне святкування в Minecraft!",
    // "Take care of your villagers, they need to rest, work, and eat to thrive.=Піклуйтеся про своїх селян. Їм потрібно відпочивати, працювати та їсти, щоб вижити.",
    // "Two Chests placed next to each other will be combined to form a Large Chest.=Якщо розмістити поруч дві скрині, вони об’єднаються та утворять велику скриню.",
    // "You decide what people can do in your world by changing §eplayer permissions§f.=Ви вирішуєте, що можна робити у вашому світі, змінюючи §eдозволи гравців§f.",
    // "Required '%s' element is empty in pack manifest; Defaulting to '%s'.=Потрібний елемент \"%s\" пустий у маніфесті пакета. Використовуємо стандартний \"%s\".",
    // "Max number of volumes %1$d has already been reached. Cannot add more volumes.=Макс. кількість просторів %1$d уже досягнуто. Неможливо додати нові простори.",
    // "Unable to connect to the world. Please check your join code and try again.=Не вдається підключитися до світу. Перевірте код приєднання та спробуйте ще раз.",
    // "*Buys %s Minecoins for %s and redeems this pack for %s Minecoins leaving %s left over.=* купує %s монет за %s і активує цей пакет за %s монет, залишок: %s.",
    // "If your Bed is broken you will return to where you first spawned into the world.=Якщо ваше ліжко зламане, ви повернетеся туди, де вперше призвались у світ.",
    // "Most monsters only come out at night. During the day you're safe... probably.=Більшість монстрів виходять лише вночі. Протягом дня ви... напевно в безпеці.",
    // "To use a Firework, tap on a block to send the Firework shooting into the sky. =Для використання феєрверка торкніться блока, щоб вистрелити феєрверк у небо.",
    // "It looks like we didn't finish things last time. Let's complete your purchase now.=Схоже, минулого разу ми зупинилися на півдорозі. Завершімо вашу покупку.",
    // "You need to be signed-in to the PlayStation®Plus to join an event in Minecraft.=Щоб приєднатися до заходу в Minecraft, потрібно увійти в PlayStation®Plus.",
    // "No ticking areas containing the block position %1$d exist in the current dimension.=У поточному вимірі немає зациклених областей із положенням блока %1$d.",
    // "Shrinking world border to %1$s blocks wide (down from %2$s blocks) over %3$s seconds=Звуження кордону світу до %1$s блоків (раніше: %2$s блоків) за %3$s с",
    // "This server has %s disabled. You can switch to a different skin in the dressing room.=Цей сервер %s неактивний. Можна встановити інший скін у роздягальні.",
    // "The server was shut down due to an unhandled scripting watchdog exception.=Сервер було деактивовано через необроблений виняток у сценарії служби контролю.",
    // "§eCreeper Shaped§f - Adding a Head will make a creeper pattern in the sky.=§eУ формі кріпера§f — якщо додати голову, феєрверк у небі матиме форму кріпера.",
    // "Set world border damage amount to %1$s per block (from %2$s per block)=Для кордону світу встановлено розмір ушкодження %1$s на блок (раніше: %2$s на блок)",
    // "Try posting again in a few minutes. Realms is trying to catch up.=Спробуйте опублікувати ще раз через кілька хвилин. Realms намагається надолужити згаяне.",
    // "The nearest %1$s is at block %2$s, %3$s, %4$s (%5 blocks away)=Найближча структура %1$s розташована на координатах %2$s %3$s %4$s (на відстані %5 блоків)",
    // "In Creative Mode, players can freely choose to build from any of the blocks in Minecraft.=У творчому режимі гравцям доступні всі види блоків у Minecraft.",
    // "Bad public key given. Expected 120 byte key after PEM formatting.=Надано неправильний відкритий ключ. Після форматування PEM очікувався ключ на 120 байт.",
    // "Failed to load character %s. You can reload it from your Profile.=Не вдалося завантажити персонажа %s. Ви можете завантажити йогу знову зі свого профілю.",
    // "A new iCloud account has signed in. You will need to restart Minecraft to play.=Увійшов новий обліковий запис iCloud. Перезапустіть Minecraft, щоб грати.",
