//     "Your use of Minecraft Earth Early Access is governed by the Microsoft Services Agreement (\"MSA\") and Microsoft Privacy Statement (aka.ms/privacy). While the Code of Conduct (aka.ms/terms) section of the Microsoft Services Agreement (aka.ms/terms) applies to all Microsoft products as well as the Xbox Community Standards (aka.ms/xboxcommunitystandards), the Minecraft Earth Early Access offers many new ways to play that require additional terms. By clicking ACCEPT below, you agree to the following terms:=Використання Minecraft Earth із раннім доступом регулюється умовами Угоди про використання служб Microsoft (\"MSA\") і Декларації про конфіденційність Microsoft (aka.ms/privacy). Хоча розділ Правила поведінки (aka.ms/terms) в Угоді про використання служб Microsoft (aka.ms/terms) уже застосовується до всіх продуктів Microsoft, як і Стандарти спільноти Xbox (aka.ms/xboxcommunitystandards), Minecraft Earth із раннім доступом має багато нових способів гри, що потребують додаткових умов. Натискаючи \"ПРИЙМАЮ\", ви погоджуєтеся з такими умовами:",
//     "Welcome to the grassy plains! For the next two weeks we are celebrating the breathtaking wonder of this fabulous biome. So dance through the trees, pick a challenge path and complete the tasks to win some amazing prizes. The deeper into the plains you go, the better the rewards. Can you make it all the way to the end and win the season-exclusive character customizations? Only time will tell and you don't have long, so what are you waiting for? Let's go!=Ласкаво просимо на трав’янисті рівнини! Протягом наступних двох тижнів ми святкуємо захоплююче диво цього казкового біому. Тож танцюйте між деревами, оберіть шлях випробувань і виконайте завдання, щоб виграти дивовижні призи. Чим глибше ви зайдете, тим кращі будуть нагороди. Чи зможете ви пройти весь шлях до кінця та виграти ексклюзивні налаштування персонажів, якi доступні тільки в цьому сезоні? Час покаже, а його залишилося не так уже й багато. То на що ви чекаєте? Погнали!",
//     "Welcome to Season 1: Nature! For the next two weeks, we are celebrating the beauty of our world, and we are giving away amazing prizes to adventurers who can meet the challenge. It's easy, simply choose your challenge path, complete the tasks and collect your rewards. The further you progress, the better the prizes are. Journey down through the challenges to discover season-exclusive Dressing Room rewards. Grab these rewards while you can, and most of all have fun!=Ласкаво просимо до сезону 1: Природа! Наступні два тижні ми святкуватимемо красу світу та даруватимемо неймовірні призи шукачам пригод, котрі подужають випробування. Все просто: виберіть свій шлях випробування, виконайте завдання та заберіть винагороди. Що далі ви пройдете, то кращі будуть призи. Пройдіть шляхом випробувань, щоб відкрити ексклюзивні в сезоні нагороди для роздягальні. Заберіть винагороди, поки можете, а найголовнішою з них будуть розваги!",
//     "Welcome to the grassy plains! For the next two weeks we are celebrating the breathtaking wonder of this fabulous biome. So, dance through the trees, pick a challenge path and complete the tasks to win some amazing prizes. The deeper into the plains you go, the better the rewards. Can you make it all the way to the end and win the season-exclusive character customizations? Only time will tell, and you don't have long, so what are you waiting for? Let's go!=Ласкаво просимо на трав’янисті рівнини! Наступні два тижні ми святкуємо захоплююче диво цього казкового біому. Тож танцюйте між деревами, оберіть шлях випробувань і виконайте завдання, щоб виграти прекрасні призи. Що глибше ви зайдете, то кращі будуть призи. Чи зможете ви пройти весь шлях до кінця та виграти налаштування персонажів, доступні тільки в цьому сезоні? Час покаже, а його залишилося не так уже й багато. То на що ви чекаєте? Погнали!",
//     "Welcome to the Cooking! For the nest 2 weeks we are celebrating all different ways to cook in the world and discover some rewards along the way. Come along and have some fun! Simply pick your path and complete the challenges to win some amazing prizes. There are tales of untold riches, and if you're lucky you may even discover exclusive character customizations. Dive in to all the fun and unique ways there are to cook.  What are you waiting for? Let's go!=Вітаємо на святі кулінарії! Наступні 2 тижні ми відмічатимемо найрізноманітніші кухні світу та шукатимемо винагороди на цьому шляху. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Ходять чутки про нечуване багатство, а якщо вам пощастить, то зможете знайти ексклюзивні налаштування персонажів. Долучайтеся до веселих і незвичних способів приготування. На що ви чекаєте? Погнали!",
//     "Welcome to the snowy tundra!  We are heading out on a 2 week adventure to discover the treasures the snowy tundra has to offer. Come along and have some fun! Simply pick your path and complete the challenges to win some amazing prizes. There are untold riches buried in the snow, and if you’re lucky you may even discover exclusive character customizations along with a rare creature not seen in these parts for some time. What are you waiting for? Let's go!=Ласкаво просимо до засніженої тундри! Ми вирушаємо у двотижневу пригоду на пошуки скарбів, які приховує засніжена тундра. Ходімо разом із нами – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Під снігом поховані нечувані багатства, а якщо пощастить, можна навіть знайти ексклюзивні налаштування персонажів разом із рідкісною істотою, яку вже давненько не бачили в цих краях. На що ви чекаєте? Уперед!",
//     "Welcome to the dark forest! We are heading out on a 2-week adventure to find treasure deep within the darkness. Come along and have some fun! Simply pick your path and complete the challenges to win some amazing prizes. There are tales of untold riches, and if you're lucky you may even discover exclusive character customizations. So be brave and travel far to discover the treasure of the trees. What are you waiting for? Let's go!=Ласкаво просимо до темного лісу! Ми вирушаємо у двотижневу пригоду на пошуки скарбів у цілковитій темряві. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Ходять чутки про нечуване багатство, а якщо вам пощастить, то зможете знайти ексклюзивні налаштування персонажів. Тож наберіться хоробрості та вирушайте в далеку подорож, щоб знайти скарб дерев. На що ви чекаєте? Уперед!",
//     "Welcome to the dark forest! We are heading out on a 2 week adventure to find treasure deep within the woods. Come along and have some fun. Simply pick your path and complete the challenges to win some amazing prizes. There are tales of untold riches, and if you're lucky you may even discover exclusive character customizations. So be brave and travel far to discover the treasure of the trees. What are you waiting for? Let's go!=Ласкаво просимо до темного лісу! Ми вирушаємо у двотижневу пригоду на пошуки скарбів у гущавині лісу. Ходімо разом із нами – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Ходять чутки про нечуване багатство, а якщо вам пощастить, то зможете знайти ексклюзивні налаштування персонажів. Тож наберіться хоробрості та вирушайте в далеку подорож, щоб знайти скарб дерев. Чого ви чекаєте? Уперед!",
//     "Welcome to Boo! Spooky! For the next 2 weeks, we will explore the spooky depths of the world and discover treasures along the way. Come along and have some fun! Pick your path and complete the challenges to win some amazing rewards.  Discover all the creepy crawlies, along with some new spooky things to encounter.  If you’re lucky you may even discover exclusive character customizations.  What are you waiting for? Let's go!=Вас вітає \"Кріпота!\" Наступні 2 тижні ми досліджуватимемо моторошні глибини світу та збиратимемо скарби на цьому шляху. Приєднуйтеся до нас – буде весело! Оберіть свій шлях і пройдіть випробування, щоб виграти чудові винагороди. Зустріньте всіх моторошних істот і всякі кріпові штуки. Якщо вам пощастить, ви зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Погнали!",
//     "Welcome to season 3: Adventure! For the next two weeks we will be heading out on a grand journey to discover the amazing treasures of our world. Join in, pick your path, and complete the challenges to win amazing prizes. Are you brave enough to reach the end and discover the season-exclusive character customizations? Only time will tell and you don't have long, so what are you waiting for? Let's go!=Ласкаво просимо до сезону 3: пригода! На наступні два тижні ми вирушимо у велику мандрівку, щоб знайти неймовірні скарби нашого світу. Долучайтеся, оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Чи вистачить вам сміливості дійти до кінця та відкрити налаштування персонажів, доступні тільки в цьому сезоні? Час покаже, а його залишилося не так уже й багато. То на що ви чекаєте? Погнали!",
//     "Welcome to our workshop, creator, where we harness the power of redstone! Let's embark on 2 weeks' worth of adventures and discovery using many wonderful redstone contraptions! Are you ready to learn to use this versatile material?  Simply pick your path and complete the challenges to win some amazing prizes. With redstone helping you out, you are sure to power through to find some great stuff!=Вітаю творців у нашій майстерні, де ми приборкуємо силу редстоуну! На вас чекають 2 тижні пригод і відкриттів неймовірних хитромудрощів із редстоуну! Ви готові дізнатися, як використовувати цей універсальний матеріал? Просто оберіть свій шлях і пройдіть випробування, щоб отримати чудові призи. За допомогою редстоуну ви, напевно, знайдете багато корисних речей!",
//     "Welcome to the winter wonderland! During the next 2 weeks we will set out on adventures in the wintery wonderland of the world.  Come along and have some fun!  Pick your path and complete the challenges to win some amazing prizes.  This wonderland contains untold riches buried beneath the snow, and if you’re lucky you may even discover exclusive character customizations.  What are you waiting for? Let's go!  =Вас вітає зимова країна! Наступні 2 тижні ми шукатимемо пригод у цій засніженій місцині. Приєднуйтеся до нас – буде весело! Оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. Глибоко під снігом сховане нечуване багатство, а якщо вам пощастить, то зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Погнали!",
//     "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack. Packs in your worlds will apply on top of these global packs. These resources are just for you. No one else will see the resources you set here. Resource Packs in your worlds or worlds you join will apply on top of these global resources.=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього. Пакети у ваших світах застосовуються поверх глобальних пакетів. Ці ресурси лише для вас. Більше ніхто не бачитиме ресурси, які ви тут установите. Пакети ресурсів у ваших світах або світах, до яких ви приєдналися, застосовуються поверх цих глобальних ресурсів.",
//     "Welcome to the snowy tundra!  We are heading out on a 2-week adventure to discover the treasures the snowy tundra has to offer.  Come along and have some fun!  Simply pick your path and complete the challenges to win some amazing prizes including a rare creature not seen for some time along with exclusive character customizations.  What are you waiting for? Let's go!=Ласкаво просимо до засніженої тундри! Ми вирушаємо у двотижневу пригоду на пошуки скарбів, які приховує засніжена тундра. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи, зокрема рідкісну істоту, яку давно ніхто не бачив, а також ексклюзивні налаштування персонажів. На що ви чекаєте? Погнали!",
//     "Important! You have purchased packs and/or Minecoins that are only available on this device and might be lost due to a device malfunction, loss, or uninstalling Minecraft! Sign in with a Xbox Live account (free) and transfer your pack entitlements and Minecoins to that account to protect and access them on any device that you sign in on.=Важливо! Ви придбали пакети або Minecoins, які доступні лише на цьому пристрої, – їх можна втратити, якщо пристрій загублено або на ньому видалено Minecraft! Увійдіть в обліковий запис Xbox Live (безкоштовно) і перемістіть у нього пакети обслуговування та Minecoins, щоб захистити їх і мати доступ до них із будь-якого пристрою, на якому ви ввійдете в обліковий запис.",
//     "Welcome to biomes!  During the next 2 weeks we will set out on adventures throughout different biomes of the world.  Come along and have some fun!  Pick your path and complete the challenges to win some amazing prizes.  Biomes contain untold riches, and if you’re lucky you may even discover exclusive character customizations.  What are you waiting for? Let's go!=Ласкаво просимо до біомів! Наступні 2 тижні ми шукатимемо пригод у різних біомах світу. Приєднуйтеся до нас – буде весело! Оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. У біомах сховане нечуване багатство, а якщо вам пощастить, то зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Погнали!",
//     "Welcome to the badlands!  Let's head out on a 2 week adventure to explore the depths of the badlands.  Come along and have some fun!  Simply pick your path and complete the challenges to win some amazing prizes.  The badlands contain untold riches, and if you’re lucky you may even discover exclusive character customizations.  What are you waiting for? Let's go!=Ласкаво просимо до пустища! Вирушаймо на двотижневу пригоду в нетрях пустища. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти дивовижні призи. У пустищах сховане нечуване багатство, а якщо вам пощастить, ви зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Уперед!",
//     "Welcome to the badlands!  Let's head out on a 2-week adventure to explore the depths of the badlands.  Come along and have some fun!  Simply pick your path and complete the challenges to win some amazing prizes.  The badlands contain untold riches, and if you’re lucky you may even discover exclusive character customizations.  What are you waiting for? Let's go!=Ласкаво просимо до пустища! Вирушаймо на двотижневу пригоду в нетрях пустища. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти дивовижні призи. У пустищах сховане нечуване багатство, а якщо вам пощастить, ви зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Уперед!",
//     "Welcome to the badlands! Let's head out on a 2-week adventure to explore the depths of the badlands. Come along and have some fun! Simply pick your path and complete the challenges to win some amazing prizes. The badlands contain untold riches, and if you’re lucky you may even discover exclusive character customizations. What are you waiting for? Let's go!=Ласкаво просимо до пустища! Вирушаймо на двотижневу пригоду в нетрях пустища. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти дивовижні призи. У пустищах сховане нечуване багатство, а якщо вам пощастить, ви зможете знайти ексклюзивні налаштування персонажів. На що ви чекаєте? Уперед!",
//     "Welcome to the Super Season! This monster of an adventure is filled with amazing mobs, riches and exclusive character customization rewards. Are you looking for a mob you are missing? Do you want to dress up as a Muddy Pig? Well come on, jump in and complete the challenges. Are you bold enough to get all the way to the end? You can do it!=Вітаємо в суперсезоні! Ця надзвичайна пригода наповнена неймовірними мобами, багатствами й ексклюзивними налаштуваннями персонажа. Шукаєте моба, якого загубили? Хочете вдягтися як брудна свиня? Тоді долучайтеся до подорожі й проходьте випробування. Ви достатньо сміливі, щоб пройти весь шлях до кінця? Ви впораєтеся!",
