//     "We're unable to connect to the store to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Reconnect to the internet and download the template to continue.=Не вдалося підключитися до Магазину, щоб завантажити шаблон, який використовувався для створення цього світу. Цей шаблон містив набір доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, повторно підключіться до Інтернету та завантажте шаблон.",
//     "Welcome to the farm to table! For the next 2 weeks we will explore all the wonderful ways to farm in Minecraft. Come along and have some fun! Simply pick your path and complete the challenges to win some amazing prizes. What are you waiting for? Let's go!=Ласкаво просимо на ферму! Наступні 2 тижні ми досліджуватимемо всі чудові способи фермерства в Minecraft. Приєднуйтеся до нас – буде весело! Просто оберіть свій шлях і пройдіть випробування, щоб виграти чудові призи. На що ви чекаєте? Уперед!",
//     "Until that time, this update includes a whole host of new content including 9 new mobs to collect, super-fast crafting and smelting times, low-cost buildplates, and an amazing final Super Season with 6 exclusive character customizations.=До цього часу це оновлення пропонує цілу купу нового контенту, зокрема 9 нових мобів, яких можна збирати, супершвидкий карфтинг і плавлення, недорогі будівельні плити та фінальний \"Суперсезон\" із 6 ексклюзивними налаштуваннями персонажів.",
//     "  b.  After removing data identifying the person and device, the location information (including GPS coordinates, data about nearby Wi-Fi access points and Bluetooth beacons) is collected and sent to Microsoft to power the ASA service.= b. Після вилучення даних, що ідентифікують особу й пристрій, відомості про розташування (зокрема координати GPS, дані про найближчі точки доступу Wi-Fi і маячки Bluetooth) збираються на надсилаються до Майкрософт для роботи служби ASA.",
//     "Welcome to the season of color! For the next 2 weeks we are celebrating the vibrant colors of the Minecraft world. Join in and have some fun! Simply pick a path and complete the challenges to win amazing prizes. What are you waiting for? Let's go!=Ласкаво просимо до сезону кольорів! Наступні 2 тижні ми святкуємо яскраві кольори світу Minecraft. Долучайтесь і розважайтеся! Просто оберіть шлях і пройдіть випробування, щоб виграти чудові призи. На що ви чекаєте? Уперед!",
//     "Thank you for your help my friend. We have explored different biomes of the world and found amazing treasures. Feel free to keep searching if you think there are other treasures to discover. Have fun and I hope to play with you again soon.=Дякую за допомогу, друже. Ми дослідили різні біоми світу та знайшли дивовижні скарби. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби. Бажаю гарно провести час і сподіваюся пограти з вами знову.",
//     "Xbox Live achievements are only available in worlds set to survival mode with cheats off.  If you continue, no one will earn achievements while playing in this world ever again even if you switch back before playing.=Досягнення Xbox Live доступні лише у світах, для яких установлено режим виживання та вимкнуто чіти. Якщо ви продовжите, жоден гравець більше ніколи не зможе заробляти досягнення в цьому світі, навіть якщо ви зміните своє рішення перед грою.",
//     "Summons an epic Adventure. It is large, hard, and will require the best weapons, tools, food and survival skills. If you can finish it, there will be great reward. Don't blame yourself if you die and lose your stuff.=Створює епічну пригоду. Вона велика, складна, тут потрібна найкраща зброя, їжа, інструменти та навички з виживання. Якщо ви пройдете її, то отримаєте достойну винагороду. Але не картайте себе, якщо ваш персонаж загине й втратить всі речі.",
//     "Well done! You’ve explored the snow landscapes of this winter wonderland and found real rewards. Feel free to keep searching if you think there other treasures to discover. Have fun and I hope to play with you again soon.=Чудова робота! Ви дослідили вкриті снігом землі цієї зимової країни та знайшли цінні винагороди. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби. Бажаю гарно провести час і сподіваюся пограти з вами знову.",
//     "Thank you for sending us a copy of your world and helping us find bugs! We are hard at work fixing things and won't be able to get back to you about this specific world. Here's your receipt confirming that we received it: %s=Дякуємо за надсилання нам копії вашого світу та допомогу в пошуку багів! Ми активно працюємо над виправленнями, тому не зможемо поділитися з вами новинами щодо саме цього світу. Ось підтвердження, що ми отримали ваш запит: %s",
//     "Adventures activated from crystals are  private experiences that no one else can see. Make sure you have plenty of safe space to play. Don't forget to take weapons, tools and food supplies! Have fun!=Пригоди, активовані з кристалів, стають вашими особистими \"світами\", які ніхто інший не може побачити. Прослідкуйте за тим, щоб було вдосталь безпечного місця для гри. Не забудьте взяти вдосталь зброї, інструментів та їжі! Розважайтесь!",
//     "Legendary crystals contain the most challenging Adventures. Enter only if you have the best weapons and food. Be prepared lose all of them. It is almost certain you will perish before completing it. Bring lots of friends.=Легендарні кристали містять найскладніші пригоди. Входьте в них, тільки маючи найкращу зброю та їжу. Будьте готові втратити їх повністю. Ви майже точно загинете до завершення пригоди. Візьміть із собою багато друзів.",
//     "Want added security for your coins and packs? Sign in to Xbox Live to save your Minecoins, Skins, Texture Packs, Worlds, and Mash-ups. They will be there for you on any device where you play Minecraft.=Хочете підвищити захист своїх монет і пакетів? Увійдіть в Xbox Live, щоб зберегти свої монети Minecoins, скіни, пакети текстур, світи та збірні пакети. Вони будуть доступні для вас на будь-якому пристрої, з якого ви граєте в Minecraft.",
//     "You do not have enough space to download the template used to create this world.  That template contained an Add-On pack that you need to continue playing this world.  Clear up space on your device to continue.=Недостатньо вільного місця, щоб завантажити шаблон, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, очистьте місце на пристрої.",
//     "You will not be able to add new friends to play on your realm with you because of how your Xbox Live account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.  Do you want to continue?=Ви не зможете додавати нових друзів до гри в реалмі через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com. Хочете продовжити?",
//     "Your Xbox Live settings do not allow multiplayer games. Check your privacy & online safety settings on Xbox.com to make sure you have Xbox Live Gold and that your settings allow multiplayer.=Ваші параметри Xbox Live не дозволяють ігри в мультиплеєрі. Перевірте свої параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com, щоб переконатися, що ви маєте статус Xbox Live Gold, а ваші параметри дозволяють мультиплеєр.",
//     "We have been on an amazing adventure together, bringing the wonder of Minecraft into the real world. We have built masterpieces, collected amazing new mobs, and even dug deep into the ground on incredible Epic adventures.=Ми разом насолоджувалися неймовірною пригодою, привносячи диво Minecraft у реальний світ. Ми будували шедеври, збирали дивовижних нових мобів і навіть глибоко вкопувались у землю в епічних пригодах.",
//     "We're having trouble verifying that you own Minecraft Earth on this device. Make sure you have downloaded and installed Minecraft Earth from the store. Or simply reconnect to the internet and try again.=Нам не вдається підтвердити те, що ви володієте Minecraft Earth на цьому пристрої. Перевірте, чи ви завантажили й інсталювали Minecraft Earth із магазину Або просто перепідключіться до Інтернету та спробуйте ще раз.",
//     "Certain commands like teleport are only available with cheats ON.  Cheats can also be turned on through the pause menu under Game Settings.  If you choose to turn cheats on, achievements will be disabled in this world.=Деякі команди, як-от телепорт, доступні лише за ввімкнутих чітів. Чіти також можна ввімкнути в меню паузи під параметрами гри. Якщо ви вирішите ввімкнути чіти, досягнення в цьому світі вимкнуться.",
//     "Continuing will remove all current packs and then add the pack you are trying to apply. This will remove all behavior packs from the world which can break the world and cause you to lose what you created.=Якщо продовжити, буде видалено всі поточні пакети, а потім додано пакет, який ви хочете застосувати. Усі пакети параметрів буде видалено зі світу. Це може зламати світ, і ви втратите все, що створили раніше.",
//     "Wow! You've found the treasure trove, well done! I'm heading back now, but feel free to keep searching, if you've seen other treasure nearby. Good luck, and I hope to adventure again with you soon.=Ого! Та ви знайшли справжній скарб! Гарна робота! Я вже буду повертатися, а ви можете продовжити пошуки, якщо бачили ще щось вартісне неподалік. Нехай щастить! Сподіваюся, що це наша не остання спільна пригода.",
//     "This Xbox Live account will not be the primary account for this device if you do not transfer this device's purchases to this account. You will not automatically sign in when you start Minecraft.=Цей обліковий запис Xbox Live не буде основним для цього пристрою, якщо ви не передасте покупки, зроблені для пристрою, до цього облікового запису. Вхід не буде відбуватись автоматично під час запуску Minecraft.",
//     "Well done! You’ve explored the snowy tundra and found a real treasure. Feel free to keep searching if you think there are other treasures to discover. Have fun and I hope to play with you again soon.=Чудова робота! Ви дослідили засніжену тундру та знайшли справжній скарб. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби. Бажаю гарно провести час і сподіваюся пограти з вами знову.",
//     "This Xbox Live account will not be the primary account for this device if you do not sync this device's purchases to this account. You will not automatically sign in when you start Minecraft.=Цей обліковий запис Xbox Live не буде основним для цього пристрою, якщо ви не синхронізуєте покупки, зроблені для пристрою, з цим обліковим записом. Вхід не буде відбуватись автоматично під час запуску Minecraft.",
//     "Well done! You’ve explored the badlands and found some real rewards. Feel free to keep searching if you think there are other treasures to discover. Have fun and I hope to play with you again soon.=Чудова робота! Ви дослідили пустище та знайшли кілька цінних винагород. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби. Бажаю гарно провести час і сподіваюся пограти з вами знову.",
//     "The jolly llama is a very festive animal only seen during the holidays. It loves to seek out and eat ferns that fill it with joy, causing it to jump around the environment jingling its bells. Jingle Jangle.=Весела лама – дуже святкова тварина, яку можна побачити лише на свята. Вона любить шукати та їсти папороть, від чого дуже радіє та починає стрибати довкола й калатати дзвіночками. Дзень-дзелень.",
//     "Like sand, gravel falls if unsupported, but since it's not craftable it's not quite as useful. And gravel is quite ugly, too, so you're unlikely to use it for decoration.=Як і пісок, гравій падає, якщо нічим не підтримується, але оскільки з нього нічого не можна скрафтити, то він не настільки корисний. Крім того, гравій доволі потворний, тому ви навряд захочете використовувати його для декору.",
//     "Share a snapshot of your buildplate for anyone to view and play! Place items or mobs on the hotbar for them to use. Don't worry, it's safe. Any changes they make won't save!=Поділіться копією своєї будівельної плити, щоб інші могли її бачити та грани на ній! Розмістіть предмети й мобів на панелі швидкого доступу для таких гравців. Не хвилюйтеся, це безпечно. Жодні їхні зміни не збережуться!",
//     "Well done! You’ve explored the badlands and found real rewards. Feel free to keep searching if you think there are other treasures to discover. Have fun and I hope to play with you again soon.=Чудова робота! Ви дослідили пустище та знайшли справжні винагороди. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби. Бажаю гарно провести час і сподіваюся пограти з вами знову.",
//     "We're having trouble verifying that you own Minecraft on this device. Make sure you have downloaded and installed Minecraft from the store. Or simply reconnect to the internet and try again.=Не вдалося підтвердити, що ви придбали Minecraft, на цьому пристрої. Переконайтеся, що ви завантажили й інсталювали Minecraft із Магазину. Або просто перепідключіться до Інтернету та спробуйте ще раз.",
//     "Brrrrr it's cold in the Tundra biome, but the wooly cow has a beautifully shaggy coat that keeps it all snug and warm.  The wooly cow's coat can be sheared for gorgeous brown wool that can be used to craft.=Бр-р-р, а в тундрі холодно, але волохату корову зігріває її розкішна кудлата шуба. Зістригши шубу волохатої корови, можна отримати чудову коричневу вовну, що згодиться для крафтингу.",
//     "Tough against blasts, cobblestone is your most basic building material. It may not look particularly attractive, but it can be used for everything from emergency shelters to finished houses.=Стійкий до вибухів кругляк – ваш основний будівельний матеріал. Можливо, він виглядає не дуже привабливо, але його можна використовувати для будь-чого: від аварійного укриття до готових будинків.",
//     "Some years ago, far-flung explorers discovered a rare strange chicken covered in mushrooms. The cluckshroom, as it has come to be named, is an odd subspecies of chicken. Is it delicious? Only time will tell.=Кілька років тому дослідники, яких далеко занесло, виявили рідкісну дивну курку, вкриту грибами. Це незвичайний підвид курки, який назвали кургрибом. Чи він смачний? Час покаже.",
//     "The furnace golem is a fierce mob, smashing its enemies into the air and scorching the earth with its fiery attacks. Don't be scared though! It will protect you from hostile mobs that lurk in the darkness.=Голем із печі – це лютий моб, який трощить своїх ворогів і випалює землю своїми полум’яними атаками. Але не бійтеся! Він захистить вас від ворожих мобів, що ховаються в темряві.",
//     "Enables Education Edition chemistry features. This cannot be disabled after your world is created. Please note these features are best experienced on desktop devices with moderate to high memory.=Активує хімічні функції в Education Edition. Вони не відключаються після створення світу. Зверніть увагу, що для їх оптимальної роботи потрібен ПК із середнім або великим об’ємом пам’яті.",
//     "The bone spider is a vicious and scary beast, hiding in the darkest recesses of caves. It sneaks up on its enemy spitting out sharp shards of bones causing high levels of damage. Yuk!=Кістковий павук – страшне й лихе чудовисько, яке ховається в найтемніших заглибленнях печер. Він підкрадається до ворога та плюється гострими осколками кісток, що завдають значних пошкоджень. Фу!",
//     "The mighty door. Way better than using dirt to seal up a wall. Interact with your door when placed and it'll open and close, stopping mobs from getting in and letting you get out!=Могутні двері. Це куди краще, ніж замазувати стіну землею. Взаємодійте з дверима після розміщення, і вони відкриватимуться й закриватимуться, не пускаючи всередину мобів, але дозволяючи вам вийти!",
//     "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack. These packs in your world apply on top of your global pack(s).=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього. Ці пакети у вашому світі застосовуються поверх ваших глобальних пакетів.",
//     "Glass might be easy to make, but it's one of the world's loveliest materials. By simply building a wall of glass you can bring the beauty of the natural world into the comfort of your own home.=Виготовляти скло нескладно, але це один із найпрекрасніших матеріалів у світі. Просто збудувавши стіну зі скла, ви зможете насолоджуватися красою природи в затишку власного дому.",
//     "Hey there explorer, welcome to the winter wonderland! Let's adventure through the snowy world together, where we might find some awesome rewards! Choose your path and let's see what we can find.=Вітаю дослідників у зимовій країні! Вирушаймо разом на пошуки пригод у засніженому світі, де ми знайдемо фантастичні винагороди! Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "Thanks for playing Minecraft Earth! We have made the difficult discussion to end support for Minecraft Earth on June 30th 2021. Thanks for playing and we hope to see you in Minecraft!=Дякуємо, що граєте в Minecraft Earth! Ми прийняли важке рішення про припинення підтримки Minecraft Earth із 30 червня 2021 року. Дякуємо, що грали, і сподіваємося побачити вас у Minecraft!",
//     "So fresh, so clean! Experience Minecraft in a whole new light! Collect tappables for resources, craft weapons and explore adventure crystals to find amazing and unique treasures!=Усе таке нове, таке свіже! Погляньте на Minecraft із геть нового боку! Збирайте ресурси з предметів, створюйте зброю та досліджуйте кристали пригоди, щоб знайти неймовірні та унікальні скарби!",
//     "Hey there adventurer, welcome to the grassy plains!  I'm going on a treasure hunt, do you want to come with me? Let's explore these paths and see what amazing things we can find!=Привiт шукачу пригод, ласкаво прошу до трав’янистих рівнин! Я вирушаю на полювання за скарбами, хочеш приєднатися? Давай дослідим ці стежки та дізнаємося, які дивовижні речі ми зможемо знайти!",
//     "Enables beta features. Experimental gameplay may break your world. If you continue we will make a copy of your world starting with [EX] with this feature turned on.=Таким чином активуються функції в бета-версії. Експериментальний режим може зламати світ. Якщо ви вирішите продовжити, ми зробимо копію світу з префіксом [EX] в імені, для якого буде ввімкнуто цю функцію.",
//     "This world has Behavior Packs applied to it that you must download to join and Resource Packs that you may optionally download before joining. What would you like to download before joining?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки, а також пакети ресурсів за бажанням. Що ви хочете завантажити перед приєднанням?",
//     "The following content is dependent on this %s and may not continue to work correctly if you delete \"%s\":%s Do you still want to delete \"%s\"? This %s will be lost forever! (A long time!)=Цей вміст залежить від %s і не зможе працювати належним чином, якщо видалити \"%s\":%s Ви справді хочете видалити \"%s\"? Вміст %s буде втрачено назавжди! (Це дууууже довго!)",
//     "This world was created using a template that you have not unlocked. You must purchase the template to unlock this world.  Would you like to purchase the template used by this world?=Цей світ створено на основі шаблону, який у вас не розблоковано. Щоб розблокувати цей світ, вам потрібно придбати шаблон. Хочете придбати шаблон, що використовується в цьому світі?",
//     "Wood planks are a great building material. They're nice to look at, coming in six different shades of brown depending on which type of wood they're made from, and they're easily obtained!=Дошки – чудовий будівельний матеріал. Вони гарно виглядають, мають один із шести відтінків коричневого залежно від того, з якої деревини їх виготовлено, і їх легко отримати!",
//     "Summons an uncommon Adventure; be cautious, there might be monsters or challenging puzzles. Make sure to have good space to play, big room or backyard.=Створює незвичайну пригоду. Будьте обережні, адже на вас можуть чекати монстри або складні головоломки. Грайте там, де багато місця (у великій кімнаті чи на задньому дворі, якщо живете у приватному будинку).",
//     "Your device is almost out of the space that Minecraft can use to save worlds and settings on this device.  Why not delete some old stuff you don't need so that you can keep saving new stuff?=На вашому пристрої майже закінчилося місце, яке Minecraft може використовувати для збереження світів і настройок! Видаліть старі непотрібні файли, щоб зберігати нові.",
//     "Hey there fearless explorer, welcome to Boo! Spooky! Let's explore this area together, we might find some awesome treasure! Choose your path and let's see what we can find.=Ей, безстрашні дослідники, зустрічайте \"Кріпота!\" Будемо досліджувати цю територію разом, можливо, вдасться знайти неймовірні скарби! Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "It looks like you are signed into a different Microsoft Account from the one that first downloaded the Minecraft Trial. Try again after signing in with that account.=Схоже, ви ввійшли не під тим обліковим записом Microsoft, з якого було вперше завантажено ознайомлювальну версію Minecraft. Спробуйте ще раз, після того як увійдете під цим обліковим записом.",
//     "You cannot play online multiplayer through Xbox Live because of how your account is set up. This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете грати онлайн із кількома гравцями на Xbox Live через налаштування вашого облікового запису. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "Summons a large, challenging Adventure. Bring  good tools, food and all your senses. Invite friends to play it with you, otherwise there's a good chance you won't make it out alive.=Створює велику, складну пригоду. Візьміть якісні інструменти, їжу та свої навички. Запросіть друзів до гри разом, тому що з дуже високою вірогідністю наодинці ви не виживете.",
//     "We did it! We found the treasure. That was fun! If you've seen other treasures in the area, feel free to keep searching. Thanks again, and I hope to see you for another adventure soon.=У нас вийшло! Ми знайшли скарб. Було весело! Якщо десь ще виднілися скарби, можна продовжити пошуки. Дякую ще раз, сподіваюся незабаром зустріти тебе в наступній пригоді.",
//     "As a thank you for being a part of the amazing community, we are awarding all players with a set of 4 very exclusive character customizations, which you can bring into Bedrock.=На знак подяки за те, що ви є частиною дивовижної спільноти, ми нагороджуємо всіх гравців набором із 4 найексклюзивніших налаштувань персонажів, які ви можете взяти в Bedrock.",
//     "Hey there adventurer, welcome to the grassy plains! I'm going on a treasure hunt, do you want to come with me? Let's explore these paths and see what amazing things we can find!=Вітаю мандрівників на трав’янистих рівнинах! Я вирушаю на полювання за скарбами, хочеш приєднатися? Підемо цими доріжками та дізнаємося, які дивовижні речі тут можна знайти!",
//     "You cannot chat with other players because of how your Xbox Live account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете спілкуватися з іншими гравцями в чаті через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "Servers offer some of the most creative ways to play Minecraft! We just need you to sign in so that we can make sure you have permission to play online with new people.=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Вам лише потрібно ввійти в обліковий запис, щоб ми могли перевірити ваш дозвіл на гру в мережі з новими людьми.",
//     "A  natural  partner  to  the  hopper,  this block  can  take  items  out  of  blocks  with  inventories  and  drop  them  when  powered  with  a  switch  or  redstone circuit.=Природний партнер воронки, цей блок може отримувати предмети з блоків з інвентарем і надавати їх, якщо подати на нього живлення за допомогою перемикача або кола редстоуну.",
//     "Hey there adventurer, welcome to the snowy tundra! Let's explore this area together, we might find some awesome treasure! Choose your path and let's see what we can find.=Вітаю шукача пригод у засніженій тундрі! Будемо досліджувати цю територію разом, можливо, вдасться знайти неймовірні скарби! Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "Sign in to Xbox Live to sync your Minecoins, Skins, Texture Packs, Worlds, and Mash-ups. They will be there for you on any device where you play Minecraft. =Увійдіть в Xbox Live, щоб синхронізувати свої Minecoins, скіни, пакети текстур, світи та збірні пакети. Вони будуть доступні для вас на будь-якому пристрої, з якого ви граєте в Minecraft.",
//     "Hey there adventurer, welcome to the badlands! Let's explore this area together, we might find some awesome riches! Choose your path and let's see what we can find.=Вітаю шукача пригод у пустищі! Давайте дослідим цю територію разом, можливо, нам вдасться знайти неймовірні багатства! Оберіть свій шлях, і давайте побачимо, що ми зможемо знайти.",
//     "Buttons are a type of switch that turn on for a short period before switching off. They can trigger simple actions like opening doors, or delivering a redstone current for short periods.=Кнопки – це перемикачі, що вмикаються та швидко вимикаються. Вони можуть запускати прості дії, наприклад ненадовго відкривати двері або підключати редстоун.",
//     "Hey there creator, welcome to the redstone workshop!  Redstone has so many different uses, and will surely help you find treasure. Choose your path and let's see what we can find.=Вітаємо творців у майстерні редстоуну! Редстоун має безліч застосувань, і він точно допоможе вам знайти скарби. Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "The skin that you have equipped is from a content pack that is not allowed in cross-platform multiplayer. Continuing will disable cross-platform multiplayer for this world.=Скін, який ви намагаєтеся використати з пакета вмісту, недоступний у крос-платформених мультиплеєрних іграх. Якщо продовжити, ви не зможете грати в них у цьому світі.",
//     "This clever block is vital to many redstone circuits because of its multiple abilities. So what can it do? It can boost or delay redstone signals, that's what!=Цей розумний блок життєво необхідний для багатьох схем із редстоуну через величезну кількість умінь. Що ж він може? Він може прискорити або затримати сигнали редстоуну, ось що!",
//     "Congratulations, you've found the main treasure trove! Feel free to look for any treasure you might have missed. Thanks for your help and let's play again soon!=Вітаємо! Ви знайшли основний дорогоцінний скарб! Але можете пошукати ще й інші скарби, які ви могли пропустити. Дякуємо за допомогу та сподіваємося скоро знову зіграти разом!",
//     "Minecraft Earth needs access to your device's location in order to enable map based gameplay. Please note that the game does not save your location information.=Minecraft Earth потребує доступу до географічного розташування вашого пристрою для роботи з картою. Зауважте, що гра не зберігає відомості про ваше географічне розташування.",
//     "Tiny but handy, buttons are a type of switch that can be used to open doors or deliver redstone currents. They turn off after a brief period, so keep that in mind!=Крихітні, але зручні кнопки можна використовувати як перемикач для відкриття дверей або підключення схем із редстоуну. Тільки не забувайте, що вони швидко вимикаються!",
//     "There are lots of fun challenges for you to try. Simply select a challenge and complete the task to win the prize. Complete more challenges for even greater rewards.=На вас чекає безліч веселих випробувань. Просто виберіть випробування і виконайте завдання, щоб виграти приз. Виконайте більше випробувань для ще крутіших винагород.",
//     "Summons a common Adventure. Make sure you have plenty of floor space. You should be able to play it alone, provided you bring a shovel, pickaxe and some weapons.=Створює звичайну пригоду. Прослідкуйте за тим, щоб було вдосталь місця для пересування. Ви маєте бути здатні грати наодинці, тут достатньо лопати, кайла та якоїсь зброї.",
//     "The world you are trying to enter requires your device to run scripts.  Your device doesn't support scripting at this time, so you can't join from this device.=Для світу, до якого ви намагаєтеся ввійти, потрібен пристрій із підтримкою сценаріїв. Ваш пристрій не підтримує сценарії, тому ви не зможете приєднатися з нього до світу.",
//     "You cannot save your worlds to Xbox Live because of how your account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете зберегти свої світи в Xbox Live через налаштування вашого облікового запису. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "Failed to sign in to %s sandbox. Please change sandboxes and restart Minecraft or sign in with a different account. Sandbox will be %s on restart. =Не вдалось увійти в пісочницю %s. Перейдіть в іншу пісочницю та перезапустіть Minecraft або ввійдіть під іншим обліковим записом. Після перезапуску ви потрапите в таку пісочницю: %s.",
//     "Thank you for your help my friend. We have created a wonderful farm together and found amazing treasures. Feel free to keep exploring if you have other treasures to find.=Дякую за допомогу, друже. Ми разом створили чудову ферму та знайшли дивовижні скарби. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби.",
//     "Hey there adventurer, welcome to the dark forest! Let's explore together, we might find a hoard of awesome treasure! Choose your path and let's see what we can find.=Вітаю шукача пригод у темному лісі! Будемо досліджувати разом, можливо, вдасться знайти купу неймовірних скарбів! Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "Hey there adventurer! Our village is celebrating the beauty of our world with some fun activities. Join in and you can earn lots of amazing, exclusive prizes.=Егей, шукачі пригод! У нашому селі святкують красу світу, тож ми проводимо веселі заходи. Приєднуйтеся до нас і виграйте купу чудових призів, які більше ніде не знайти.",
//     "Thank you for your help my friend. We have explored many ways to cook in the world and found amazing treasures. Feel free to keep exploring if you have other treasures to find.=Дякую за допомогу, друже. Ми дослідили різні кухні світу та знайшли дивовижні скарби. Ви вільні продовжити пошуки, якщо хочете знайти більше скарбів.",
//     "The moobloom is a beautiful cow adorning itself with yellow scented flowers. You can shear it and if you're lucky you might find a beautiful new buttercup.=Квіткорова – прекрасна корова, яка прикрашає себе жовтими пахучими квітами. Ви можете її стригти, а якщо пощастить, то, може, навіть знайдете дуже гарний новий жовтець.",
//     "You cannot perform this action because of how your Xbox Live account is setup. This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете виконати цю дію через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "Adventures are how you gather resources, encounter mobs and play with friends! Make sure you take some tools in with you as your inventory won't be accessible.=Пригоди – це коли ви збираєте ресурси, зустрічаєте мобів і граєте з друзями! Не забудьте взяти із собою якісь інструменти, оскільки ваш інвентар буде недоступний.",
//     "Well done! You've found a real treasure. Feel free to keep searching if you think there is more to discover. Have fun and I hope to play with you again soon.=Чудова робота! Ви знайшли справжній скарб. Ви вільні продовжити пошуки, якщо вважаєте, що знайдете ще щось цінне. Розважайтеся, а я сподіваюся пограти з вами знову.",
//     "Your friends and their friends can see if you're online. your game clips, and your recent apps and games. You can change these on Xbox.com.=Ваші друзі та їхні друзі можуть бачити, чи ви в мережі, які ігрові кліпи маєте, а також які програми та ігри нещодавно отримали. Ви можете налаштувати ці параметри на сайті Xbox.com.",
//     "If you want a door that stays open or closed, a lever is perfect. The main use for levers is for situations in which you want on/off states.=Якщо ви хочете, щоб двері залишалися відкритими або закритими, вам потрібен важіль. Важелі головним чином використовуються в ситуаціях, коли мають бути стани ввімкнуто та вимкнуто.",
//     "Hey there adventurer, welcome to biomes! Let's explore the different biomes of the world and discover their untold riches! Choose your path and let's see what we can find.=Вітаю шукача пригод у біомах! Вирушаймо досліджувати різні біоми світу в пошуках нечуваних багатств! Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "You cannot play on Realms because of how your Xbox Live account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете грати в реалмах через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "Andesite is one of the three stone variants, alongside diorite and granite. It can be found underground and at surface level in extreme hills biomes.=Андезит належить до одного з трьох видів каменю разом із діоритом і гранітом. Його можна знайти під землею та на поверхневому рівні в біомах з екстремальними пагорбами.",
//     "Enables Education Edition chemistry features. Education gameplay may break your world. If you continue we will make a copy of your world starting with [EDU].=Активує хімічні функції в Education Edition. Навчальний режим може зламати світ. Якщо ви вирішите продовжити, ми зробимо копію світу з префіксом [EDU] в імені.",
//     "Looks like you have an active Adventure crystal. If you choose to build on a Buildplate now, that Adventure will be closed.  Are you sure you want to continue?=Схоже, у вас є активний кристал пригоди. Якщо ви вирішите будувати на будівельній плиті просто зараз, ту пригоду буде втрачено. Ви справді хочете продовжити?",
//     "You cannot add friends because of how your Xbox Live account is set up.  This can be changed in your privacy & online safety settings on Xbox.com.=Ви не можете додавати друзів через налаштування вашого облікового запису Xbox Live. Ви можете змінити параметри конфіденційності й безпеки в Інтернеті на сайті Xbox.com.",
//     "You are about to delete \"%s\". You will still own %s and if you wish to use %s again in the future, you can re-download it from the store.=Ви ось-ось видалите \"%s\". Вміст %s залишиться у вашій власності, тому якщо ви захочете знову використати %s у майбутньому, ви зможете повторно завантажити вміст із магазину.",
//     "At least one of your resource or behavior packs failed to load.  Try downloading this world from your Realm settings to see more details on the error.=Не вдалося завантажити принаймні один пакет ресурсів або поведінки. Спробуйте завантажити цей світ із параметрів реалму, щоб побачити більше відомостей про помилку.",
//     "Despite the name, redstone torches aren't a great source of light – they're only half as bright as a regular torch and they won’t stop mobs from spawning.=Незважаючи на назву, смолоскипи з редстоуну – не дуже хороші джерела світла, тому що вони вдвічі тьмяніші за звичайні смолоскипи та не зупиняють призов мобів.",
//     "Thank you for your help my friend. We have explored the dark forest and found amazing treasures. Feel free to keep exploring if you have other treasures to find.=Дякую за допомогу, друже. Ми дослідили темний ліс і знайшли дивовижні скарби. Ви вільні продовжити пошуки, якщо вважаєте, що знайшли ще не всі скарби.",
//     "Fence blocks can defend you against an army of mobs. Build a fence around a well-lit area and you'll be safe because mobs can't jump over it.=Блоки паркану можуть захистити вас від армії мобів. Поставте паркан навколо добре освітленої території та почувайтеся в безпеці, адже моби не зможуть його перестрибнути.",
//     "Thank you for your help my friend. We have explored the spooky areas and found amazing treasures. Feel free to keep exploring if you have other treasures to find.=Дякую за допомогу, друже. Ми дослідили моторошні місця та знайшли дивовижні скарби. Ви вільні продовжити пошуки, якщо хочете знайти більше скарбів.",
//     "Wow! You're doing great! You've reached the super special prizes. Complete more challenges to earn season-exclusive character customizations. Good luck!=Вау! У вас чудово виходить! Ви дійшли до суперспеціальних призів. Виконайте більше випробувань, щоб заробити сезонні налаштування персонажів. Нехай щастить!",
//     "Amazing! Look at all the treasures you’ve found deep inside this winter wonderland. Let’s keep going, I bet there is so much more for us to discover.=Дивовижно! Погляньте на всі скарби, які ви знайшли в глибині зимової країни. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна відкрити ще стільки всього.",
//     "The content that you are trying to use is not allowed in cross-platform multiplayer games.  If you continue you will not be able to play cross-platform multiplayer games.=Вміст, який ви намагаєтеся використати, недоступний у крос-платформених мультиплеєрних іграх. Якщо продовжити, ви не зможете грати в них.",
//     "No, your eyes don't deceive you. Tropical fish live inside tropical slimes. They love to bounce around and possess an irrational fear of buckets.=Ні, ваші очі вас не обманюють. Ви дійсно бачите тропічних рибок, які живуть у тропічних слизнях. Вони люблять бовтатися туди-сюди та невиправдано бояться відер.",
//     "For Boost Minis to work, you need to update your OS to the latest version. To upgrade go to Settings > General > Software Update.=Щоб мініпідсилювачі працювали, потрібно оновити вашу ОС до останньої версії. Для оновлення перейдіть до розділу \"Параметри > Загальні > Оновлення програмного забезпечення\".",
//     "The world is not fully synced or has been corrupted. Try playing the world on a console where it's in a good state and try migrating it again.=Світ не повністю синхронізовано або пошкоджено. Спробуйте запустити світ на консолі, де він перебуває в робочому стані, а потім спробуйте перенести його ще раз.",
//     "Sandstone's soft yellow color and smooth appearance make it an attractive building material, but keep in mind that sandstone is very weak against explosions.=Через м’який жовтий колір і гладкий вигляд піщаник став привабливим будівельним матеріалом, але не забувайте, що він геть не стійкий до вибухів.",
//     "Amazing! Look at all the treasures you've found by creating your farm. Let's keep looking, I bet there are even more incredible treasures to discover.=Дивовижно! Погляньте на всі ці скарби, які ви знайшли, коли створювали ферму. Варто продовжити шукати, тут точно сховано ще більше неймовірних скарбів.",
//     "You are out of data storage space and Minecraft is unable to save your progress! Minecraft will return you to the Main Menu to clear up storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft не вдалося зберегти результати. Вас буде переспрямовано в головне меню для звільнення місця.",
//     "You did it! Wow what an amazing accomplishment, you are truly the best! Don't forget to keep playing if there is other treasure still to find. Well done!=Ви впоралися! Ух, яке неймовірне звершення, а ви дійсно найкращі! Ви можете продовжити грати, якщо залишилося знайти інші скарби. Чудова робота!",
//     "with field in rawtext must contain a array. Example: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]=з полем в об’єкті rawtext має містити масив. Приклад: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]",
//     "Hey there adventurer! I'm going on a treasure hunt, do you want to come with me? Let's explore these paths and see what amazing things we can find!=Егей, шукачі пригод! Я вирушаю на полювання за скарбами, хочете приєднатися? Підемо цими доріжками та дізнаємося, які дивовижні речі тут можна знайти!",
//     "Amazing! Look at all the treasures you’ve found deep in the snowy tundra.  Let's keep going, I bet there is so much more for us to find.=Дивовижно! Погляньте на всі скарби, які ви знайшли в глибині засніженої тундри. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна знайти ще стільки всього.",
//     "Amazing! Look at all the treasures you’ve found deep in the snowy tundra.  Let’s keep going, I bet there is so much more for us to find.=Дивовижно! Погляньте на всі скарби, які ви знайшли в глибині засніженої тундри. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна знайти ще стільки всього.",
//     "Every adventurer has met one of these frightening beasts in their travels. Silent, deadly, and sad, the creeper is a mobile threat of destruction.=Кожен шукач пригод у своїх мандрах зустрічав хоча б одну з цих страхітливих потвор. Мовчазний, убивчий, сумний кріпер – це мобільна загроза знищення.",
//     "Well done! You've harnessed the power of redstone and found so many rewards! Feel free to keep tinkering if you still have other treasures to unlock.=Чудова робота! Ви приборкали силу редстоуну і знайшли численні винагороди! Ви вільні продовжити майструвати, якщо хочете відкрити більше скарбів.",
//     "If you play without signing in you won't be able to see your friends list, earn achievements, join Realms, or play online on Xbox Live.=Якщо ви гратимете без облікового запису, ви не зможете бачити список своїх друзів, заробляти досягнення, приєднуватися до реалмів і грати онлайн на Xbox Live.",
//     "Our next exciting season with a ton of exciting new challenges and unique rewards! Stay tuned and check back regularly to find out more!=Наш наступний захоплюючий сезон із купою неймовірних нових випробувань і унікальних винагород! Залишайтеся з нами та слідкуйте за новинами, щоб знати більше!",
//     "Something went wrong.  We can't verify that the server you are trying to connect to is one that we trust.  We recommend that you try again later.=Щось пішло не так. Ми не можемо перевірити, чи можна довіряти серверу, до якого ви намагаєтеся приєднатись. Рекомендуємо спробувати ще раз пізніше.",
//     "Redstone lamps are great for lighting your home. Just be careful if you switch the lamps off in any rooms, as mobs will spawn there when it gets dark.=Лампи з редстоуну чудово підходять для освітлення оселі. Просто будьте обережні, вимикаючи лампи в кімнатах, тому що мобів приваблює темрява.",
//     "The skin that you have equipped is from a content pack that is not allowed in multiplayer. Continuing will disable multiplayer for this world.=Скін, який ви намагаєтеся використати з пакета вмісту, недоступний у мультиплеєрних іграх. Якщо продовжити, мультиплеєр буде вимкнуто в цьому світі.",
//     "You can go to this world's resource and behavior pack settings and remove those packs to continue, but the world may no longer be playable.=Щоб продовжити, перейдіть до ресурсів цього світу та параметрів пакета поведінки, а потім видаліть ці пакети. Але після цього ви зможете грати у світі.",
//     "Well done! We hope you had a great time. Please feel free to complete any of the tasks you might have missed. Thank you and we hope to see you again soon!=Чудова робота! Сподіваємося, вам сподобалося. Ви можете доробити всі завдання, які пропустили. Дякуємо та сподіваємося побачитися знову!",
//     "Looks a bit like a cross between cobblestone and quartz, and sounds like something you'd yell while hacking at a zombie invading your house? Diorite!=На вигляд це щось середнє між кругляком і кварцом, а на слух як викрики під час бою із зомбі, що вдерлися до вашого будинку. Що це? Діорит!",
//     "You can only sync packs purchased outside of the Minecraft Marketplace once. They will continue to be available to anyone who plays on this device.=Ви можете синхронізувати пакети скінів, придбані поза Ринком Minecraft, лише один раз. Вони будуть доступні всім користувачам цього пристрою.",
//     "Smooth red sandstone stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із гладкого червоного піщанику зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
//     "Minecraft Earth requires access to the camera for the augmented reality part of the game. Enable camera access from your device settings to play.=Minecraft Earth потребує доступу до камери для гри в доповненій реальності. Дозвольте доступ до камери в параметрах свого пристрою, щоб грати.",
//     "What is squishy, has lots of arms and glows in the darkness? No it's not a neon spider, it's the glow squid of course.  So pretty and glowy!=Що це таке хирляве, має багато рук і світиться у темряві? Ні, це не неоновий павук, це сяючий кальмар, звісно ж. Він такий гарний, і так світиться!",
//     "Baa, baa, rainbow colored sheep, have you any wool? This wool makes a fantastic building material. Just remember that it's flammable.=Бе-е, бе-е, вівце кольорів веселки, у тебе лишилося трохи вовни? Ця вовна є відмінним будівельним матеріалом. Просто не забувайте, що вона легкозаймиста.",
//     "This handy item can perform all sorts of different functions within a circuit, but its most obvious purpose is to compare signals. Oooh, signals!=Цей зручний предмет може виконувати найрізноманітніші функції в схемі, але найочевидніше його призначення – порівняння сигналів. Ох, сигнали!",
//     "Amazing! Look at all the treasures you’ve found deep inside the badlands.  Let’s keep going, I bet there is so much more for us to find.=Дивовижно! Погляньте на всі скарби, які ви знайшли в глибині пустища. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна знайти ще стільки всього.",
//     "Amazing! Look at all the treasures you’ve found deep inside the badlands. Let’s keep going, I bet there is so much more for us to find.=Дивовижно! Погляньте на всі скарби, які ви знайшли в глибині пустища. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна знайти ще стільки всього.",
//     "Hey there adventurer, welcome to the farm to table! There are so many ways to create farms in Minecraft. Choose your path and let's see what we can find.=Вітаю шукача пригод на фермі! У Minecraft стільки різних способів створити ферму. Оберіть свій шлях, і подивимося, що ви знайдете.",
//     "Amazing! Look at all the treasures you’ve found in the different biomes.  Let’s keep going, I bet there is so much more for us to find.=Дивовижно! Погляньте на всі скарби, які ви знайшли в різних біомах. Продовжуймо в тому ж дусі, б’юсь об заклад, тут можна знайти ще стільки всього.",
//     "Sign in with a Xbox Live account (free) and transfer your pack entitlements to that account to protect your purchased packs and Minecoins.=Увійдіть під обліковим записом Xbox Live (безкоштовним) і передайте йому права на пакети, щоб захистити свої придбані пакети й монети Minecoins.",
//     "Mossy stone brick stair blocks are handy for forming stepped roofs and for creating the appearance of a curved surface or edge. Stairs are wonderful!=З блоків сходів із моховитої кам’яної цегли зручно формувати ступінчасті дахи та створювати хвилясті поверхні або краї. Сходи чудові!",
//     "The template used to create this world is missing.  That template contained an Add-On pack that you need to continue playing this world.=Бракує шаблону, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі.",
//     "This world has Behavior and Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки та ресурсів. Хочете завантажити їх і приєднатися до світу?",
//     "Glass might be easy to make, but it's one of the world's loveliest materials. Get some dye and craft yourself some fluorescent glass.=Виготовляти скло нескладно, але це один із найпрекрасніших матеріалів у світі. Роздобудьте трохи барвників і власноруч скрафтіть флуоресцентне скло.",
//     "Glass might be easy to make, but it's one of the world's loveliest materials. Get some dye and craft yourself some fancy glass.=Виготовляти скло нескладно, але це один із найпрекрасніших матеріалів у світі. Роздобудьте трохи барвників і власноруч скрафтіть власноруч вишукане скло.",
