//     "Hey there adventurer, welcome to the cooking! Let's explore all the ways there are to cook in the world! We might find some awesome treasure!=Вітаю шукача пригод у кулінарії! Спробуймо дослідити різні кухні світу! А може, ще й знайдено неймовірні скарби!",
