//     "When this option is turned on, the game will save battery life on the map screen when you turn your device upside down.=Коли цей параметр увімкнуто, гра економитиме заряд акумулятора на екрані карти, коли ви повертаєте пристрій догори дриґом.",
//     "For Boost Minis to work, you need to update your OS to the latest version. Update from your device settings to play.=Щоб мініпідсилювачі працювали, потрібно оновити вашу ОС до останньої версії. Оновіть у параметрах свого пристрою, щоб грати.",
//     "We were unable to connect to the app store. Maybe sign in to the app store or try checking your internet connection.=Не вдається підключитися до магазину програм. Можливо, слід зареєструватися в ньому або перевірити підключення до Інтернету.",
//     "One last thing: don't forget you have an Adventure Crystal to play and challenges to complete. Go have fun! =І ще дещо: не забувайте, що ви маєте кристал пригоди, у яку можна зіграти, а також випробування, які потрібно пройти. Розважайтесь!",
//     "The muddy pig is a mud bath connoisseur. You wouldn't know it at first glance, but they have a great sense of style too.=Брудна свиня – цінитель грязьових ванн. Може, це й непомітно з першого погляду, але у них також відмінне почуття стилю.",
//     "Oooh wow, presents! Let's walk and collect %s tappables to see what we can find. Be careful, don't trespass!=Круто, подарунки! Пройдімось і зберімо %s предметів. Цікаво, що нам вдасться знайти. Будьте обережні та не заходьте, куди не можна!",
//     "Hey there adventurer, welcome to the dark forest! Let's explore this area together, we might find some awesome treasure!=Вітаю шукача пригод у темному лісі! Будемо досліджувати цю територію разом, можливо, вдасться знайти неймовірні скарби!",
//     "Welcome to Minecraft Earth! If you want to have the full game experience, we'll need camera and location access.=Ласкаво просимо до Minecraft Earth! Якщо хочете грати на повну, нам знадобиться доступ до камери та географічного розташування.",
//     "These dastardly creations are made from a handful of basic ingredients, but are perfect for setting up traps for mobs.=Ці підступні творіння зроблені з кількох основних інгредієнтів, але ідеально підходять, щоб влаштувати пастки для мобів.",
//     "Our font for the language you have selected is not readable at a GUI scale that small.  Do you want to increase your GUI scale?=Наш шрифт для вибраної вами мови не читається в такому дрібному інтерфейсі. Хочете збільшити розмір інтерфейсу?",
//     "Operators are members who can set player permissions and use commands to have more control over your world.=Оператори – це учасники, які можуть установлювати дозволи гравців і використовувати команди для розширеного керування вашим світом.",
//     "Add a friend to see when they are online and to play online multiplayer without the hassle of IP addresses and ports.=Додавайте друзів, щоб знати, коли вони в мережі, і грати онлайн у мультиплеєрі, не заморочуючись з IP-адресами й портами.",
//     "%s: Child controls must have unique names: %sIn the future this will be an error and this file won't load.=%s: Імена дочірніх елементів не мають повторюватися: %sУ майбутньому це призводитиме до помилки, а цей файл не завантажуватиметься.",
//     "Stone is the trustiest source of building materials. Smelting cobblestone creates this strong, solid block.=Камінь – один із найнадійніших джерел будівельних матеріалів. Щоб створити цей міцний і твердий блок, потрібно розплавити кругляк.",
//     "Resource packs are applied bottom to top. This means any asset that is in two packs will be overridden by the higher pack.=Пакети ресурсів застосовуються знизу догори. Це означає, що вміст верхнього пакета перезаписуватиме вміст нижнього.",
//     "This sword is not in a stone. Aren't you glad? Seriously though, this sword is much better than its wooden counterpart. Slash away!=Цей меч не в камені. Хіба ви не раді? Якщо серйозно, цей меч кращий за дерев’яний. Порубайте всіх ворогів!",
//     "When you see this icon, we are saving your game. Do not turn off your Nintendo Switch while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте Nintendo Switch, поки бачите цю піктограму на екрані.",
//     "When given a charge through a redstone circuit, a random item you've stored inside will pop out. Such a clever contraption.=Коли ви приєднаєте редстоун, з’явиться випадковий предмет, який ви зберегли всередині. Як хитромудро придумано.",
//     "Inventory recovered.  Find a safe place, and we'll place a chest near you the next time you join the world.=Інвентар відновлено. Знайдіть безпечне місце, і наступного разу, коли ви приєднаєтеся до світу, ваша скриня з’явиться біля вас.",
//     "This pack has a dependency (%s) that is incompatible with your device because your device doesn't have enough memory.  =Цей пакет має залежний об’єкт (%s), несумісний із вашим пристроєм, тому що на вашому пристрої недостатньо пам’яті.",
//     "Wow! You're doing great! We've found more amazing rewards! Let's keep going, there is so much more to find.=Ого! У вас чудово виходить! Ми знайшли ще відмінних винагород! Продовжуймо в тому ж дусі, тут можна знайти ще стільки всього.",
//     "Members are active players in your world who can break and create blocks, and attack mobs and other players.=Учасники – це активні гравці у вашому світі, які можуть ламати й створювати блоки, а також атакувати мобів та інших гравців.",
//     "Is that slime on the piston? Gross! But don't let that sticky substance fool you; these pistons can pull other blocks.=То слизень на поршні? Гидота! Але не дайте цій липкій речовині вас обдурити; ці поршні можуть тягнути інші блоки.",
//     "Using the most versatile of all materials, use this tool to clear land for farming and paths.=Використовуйте цей інструмент, зроблений із найуніверсальнішого з усіх матеріалів, щоб очищати землю для фермерства або прокладання доріг.",
//     "Adding or removing Behavior Packs after playing a world might break the world and cause you to lose what you created.=Якщо додати або видалити пакети поведінки після гри у світі, світ може поламатися, а ви втратите все, що створили.",
//     "You already have an active Adventure. Do you want to delete it and activate a new one? You won't get the deleted one back.=У вас уже є активна пригода. Хочете видалити її й активувати нову? До видаленої пригоди не можна повернутися.",
//     "No bones about it, this wolf is scary. Its menacing howl empowers its skeletal brethren when they are on the prowl.=Цей вовк страшніший страшного. Його страхітливе виття посилює його побратимів-скелетів, коли вони полюють на здобич.",
//     "Hey there adventurer, welcome to the Super Season! Let's explore together and see what amazing treasure we can find!=Вітаю шукача пригод у суперсезоні! Підемо на дослідження разом і дізнаємося, які неймовірні речі тут можна знайти!",
//     "Dirt has a ruder, less friendly cousin called \"coarse dirt\" that won't grow grass under any circumstances.=У землі є грубіший і менш симпатичний родич, що зветься \"кам’яниста земля\", на якій за жодних обставин не ростиме трава.",
//     "Your gamertag was signed in on another device. You will be signed out of that device when you sign in here.=Ваш псевдонім гравця ввійшов на іншому пристрої. Якщо ви ввійдете в систему тут, то вас викине із системи на тому пристрої.",
//     "The observer is a block that likes...watching stuff. It emits a redstone signal when it detects a block update.=Спостерігач – це блок, якому подобається… спостерігати. Він відправляє сигнал редстоуну, коли виявляє оновлення блока.",
//     "Whether one is in need of leather, a full belly, relief from afflictions, or simply companionship, a cow can provide.=Якщо комусь потрібна шкіра, багато їжі, звільнення від страждань або просто товариство, усе це може дати корова.",
//     "Wow! You're doing great! We've found some amazing rewards! Let's keep going, there is so much more to find.=Ого! У вас чудово виходить! Ми знайшли відмінні винагороди! Продовжуймо в тому ж дусі, тут можна знайти ще стільки всього.",
//     "This is bad.  This server failed our verification test.  Someone we don't trust might be pretending to be a trusted server.=Біда. Цей сервер не пройшов нашу перевірку. Можливо, він лише прикидається надійним. Ми не довіряємо йому.",
//     "Timelessly tasteful, quartz blocks are used by the best builders and are the mark of the classiest houses.=Кварцеві блоки, що ніколи не вийдуть із моди, використовуються найкращими будівниками та є відзнакою найрозкішніших домів.",
//     "Could not spread %1$s players around %2$s,%3$s (too many players for space - try using spread of at most %4$s)=Не вдалося розсіяти %1$s гравців по %2$s,%3$s (забагато гравців для цієї території: спробуйте розсіяти не більше %4$s)",
//     "Jungle pressure plates can be used to create traps, befuddle enemies, or simply open doors.=Притискні пластини з тропічної деревини можуть використовуватися для створення пасток, обдурювання ворогів і просто для відкриття дверей.",
//     "Looks like your hotbar is empty! Make sure you take some items with you for your Adventure. Better be prepared!=Схоже, ваша панель швидкого доступу пуста! Не забудьте взяти із собою в пригоду якісь предмети. Краще підготуватися!",
//     "Could not spread %1$s teams around %2$s,%3$s (too many players for space - try using spread of at most %4$s)=Не вдалося розсіяти %1$s команди по %2$s,%3$s (забагато гравців для цієї території: спробуйте розсіяти не більше %4$s)",
//     "Using the most abundant of all materials, use this tool to clear land for farming and paths.=Використовуйте цей інструмент, зроблений із найпоширенішого з усіх матеріалів, щоб очищати землю для фермерства або прокладання доріг.",
//     "You have a chance of finding common crystals in Tappables and Adventures or get them as a Daily Login reward!=Ви маєте шанс знайти типові кристали при зборі предметів або в пригодах чи отримати їх у винагороду за щоденний вхід!",
//     "If regular sandstone is too boring for you, try chiseled red sandstone. That's one fancy building material!=Якщо звичайний піщаник занадто нудний для вас, спробуйте висічений червоний піщаник. Фантастичний будівельний матеріал!",
//     "Polar bears are perfectly adapted to their frozen homelands and fiercely defend their young when angered. =Полярні ведмеді прекрасно пристосовані до своїх замерзлих територій і люто захищають своїх дитинчат, якщо їх розгнівати.",
//     "Wheat is rich source of proteins, sugars, vitamins of the B group and minerals such as iron, manganese, magnesium and zinc.=Пшениця багата на протеїни, цукри, вітаміни групи B і мінерали, як-от залізо, марганець, магній і цинк.",
//     "Oops! We weren't able to receive your world. Try checking your internet connection or sending it again later.=Ой! Не вдалось отримати ваш світ. Спробуйте перевірити своє підключення до Інтернету або надіслати світ трохи згодом.",
//     "Slimes inhabit the dank, dark spaces of the world, and attack with a speed unparalleled in its non gelatinous peers.=Слизні живуть у вологому темному середовищі й атакують зі швидкістю, що не має аналогів у недраглистих істот.",
//     "Your Adventure Crystals slots are all full. Play an Adventure before you redeem this gift for maximum fun!=Усі ваші слоти кристалів пригоди заповнено. Буде веселіше, якщо ви зіграєте в пригоду, перш ніж отримати цей подарунок!",
//     "  a.  Do not trespass or access or attempt to access any area where you do not have the legal right to be;= a. Не заходьте без дозволу та не намагайтеся зайти в будь-яку область, на перебування в якій не маєте законного права.",
//     "Spruce pressure plates can be used to create traps, befuddle enemies, or simply open doors.=Притискні пластини з хвойного дерева можуть використовуватися для створення пасток, обдурювання ворогів і просто для відкриття дверей.",
//     "We can't connect to the service you need right now. Check your network connection or try this again later.=Зараз не вдалося підключитися до потрібної вам служби. Перевірте своє з’єднання з мережею або спробуйте ще раз пізніше.",
//     "This world's multiplayer setting is set to friends only. You must be friends with the host of this world to join.=Мультиплеєр у цьому світі відкрито лише для друзів. Ви маєте бути другом хазяїну світу, щоб приєднатися до гри.",
//     "Dark oak pressure plates can be used to create traps, befuddle enemies, or simply open doors.=Притискні пластини з темного дуба можуть використовуватися для створення пасток, обдурювання ворогів і просто для відкриття дверей.",
//     "During this test, everyone will need to sign into Xbox Live so that you can be sent invites and added to Realms.=Для тестування вам потрібно ввійти в Xbox Live, щоб ми могли надсилати вам запрошення й додавати вас до реалмів.",
//     "You do not have enough Minecoins to unlock this item. You can buy Minecoins from your app store.=У вас недостатньо монет Minecoins, щоб розблокувати цей предмет. Ви можете придбати монети Minecoins у своєму магазині програм.",
//     "A type of rail that can \"activate\" certain minecarts. Use it as a regular rail or as a redstone component!=Тип колії, яка може \"активувати\" певні вагонетки. Використовуйте її як звичайну колію або як компонент редстоуну!",
//     "We fixed a few bugs in this release.  We'll send you new patch notes when we have more to report.=У цьому релізі ми виправили кілька помилок. Коли ми внесемо більше удосконалень, то надішлемо вам нові примітки до виправлень.",
//     "If regular sandstone is too boring for you, try smooth red sandstone. That's one fancy building material!=Якщо звичайний піщаник занадто нудний для вас, спробуйте гладкий червоний піщаник. Фантастичний будівельний матеріал!",
//     "When you see this icon, we are saving your game. Do not turn off your computer while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте комп’ютер, поки бачите цю піктограму на екрані.",
//     "Using the most versatile of all materials, use this tool to cut down trees and strip bark from logs.=Використовуйте цей інструмент, створений із науніверсальнішого з усіх матеріалів, щоб рубати дерева та знімати з них кору.",
//     "Beds are one of the first things you'll want to make for your new house because they are brilliant. Who doesn't like a bed?=Для нового будинку ви в першу чергу захочете зробити ліжко, бо воно незамінне. Хто не любить ліжок?",
//     "  a.  ASA improves the accuracy of your location and the placement of Minecraft Earth adventures in the world.= a. ASA покращує точність визначення вашого розташування та розміщення елементів пригод Minecraft Earth у світі.",
//     "Using the shiniest of all materials, use this tool to clear land for farming and paths.=Використовуйте цей інструмент, зроблений із найблискучішого з усіх матеріалів, щоб очищати землю для фермерства або прокладання доріг.",
//     "You just finished the season but it's not over yet! There's a bunch of awesome things to unlock. Keep playing!=Ви щойно завершили сезон, але це ще не кінець! Ви ще можете відкрити кілька дивовижних штук. Продовжуйте грати!",
//     "A floor door. A door for the floor. If you want to create an opening in a floor or ceiling you'll need a trapdoor.=Підлогові двері. Двері для підлоги. Якщо ви хочете зробити прохід у підлозі чи стелі, вам знадобиться люк.",
//     "You can smelt all sorts of amazing things like Iron Ore to make Iron Ingots and even cook food!=Ви можете виплавляти всілякі пречудові речі, як-то залізну руду для виготовлення залізного злитка чи навіть приготування їжі!",
//     "Jackpot! Diamonds are strong and used to make powerful tools, resilient armor, and your friends jealous.=Джекпот! Алмази міцні й використовуються для виготовлення потужних інструментів і стійкої броні на заздрість друзям.",
//     "Using the simplest of all materials, use this tool to clear land for farming and paths.=Використовуйте цей інструмент, зроблений із найпростішого з усіх матеріалів, щоб очищати землю для фермерства або прокладання доріг.",
//     "When you see this icon, we are saving your game. Do not turn off your device while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте пристрій, поки бачите цю піктограму на екрані.",
//     "Stripes are often used to hide animals that group together. I think these stripes make this rabbit stand out.=Смуги часто присутні, щоб ховати тварин, які живуть у групах. Думаю, ці смуги навпаки виділяють цього кролика.",
//     "That is a LOT of iron there! The anvil feels like it has a purpose. Surely it might be good for fixing stuff someday?=Там БАГАТО заліза! Здається, ковадло тут не просто так. Може, воно якось допоможе відремонтувати щось?",
//     "Using the strongest of all materials, use this tool to clear land for farming and paths.=Використовуйте цей інструмент, зроблений із найміцнішого з усіх матеріалів, щоб очищати землю для фермерства або прокладання доріг.",
//     "If regular sandstone is too boring for you, try cut red sandstone. That's one fancy building material!=Якщо звичайний піщаник занадто нудний для вас, спробуйте тесаний червоний піщаник. Фантастичний будівельний матеріал!",
//     "Get creative with color! Cocoa beans can be made into dye for wool, terracotta, beds and many other items.=Пограйтеся кольорами! З какао-бобів можна зробити барвник для вовни, кераміки, ліжок і багатьох інших предметів.",
//     "You need to sign in before unlocking items in the store so that we can remember what you have already unlocked.=Перш ніж намагатися розблокувати щось у магазині, потрібно ввійти в систему, щоб ми знали, що ви вже маєте.",
//     "So monochrome! Brighten up your buildings and give them a homely feel. Remember though: carpets are flammable.=Така однотонність! Освіжіть свої будівлі та створіть домашній затишок. Але пам’ятайте: килими легкозаймисті.",
//     "Buildplates are your personal building space in Minecraft Earth. Level up to unlock new biomes!=Будівельні плити створюють ваші особисті будівельні майданчики в Minecraft Earth. Підвищте рівень, щоб відкрити нові біоми!",
//     "Don't have a Gamertag? Create one to earn achievements, play online with friends and join Realms!=Не маєте псевдоніма гравця? Створіть його, щоб заробляти досягнення, грати онлайн із друзями та приєднуватися до реалмів!",
//     "Not enough space on your device to finish downloading required content. Please free some space and try again.=Для завантаження потрібного вмісту на вашому пристрої недостатньо місця. Звільніть місце та спробуйте ще раз.",
//     "Xbox Live achievements can be earned in this world, but you must sign in to Xbox Live to earn them.=У цьому світі можна заробляти досягнення Xbox Live, але для цього вам потрібно ввійти у свій обліковий запис Xbox Live.",
//     "Using the most abundant of all materials, use this tool to cut down trees and strip bark from logs.=Використовуйте цей інструмент, створений із найпоширенішого з усіх матеріалів, щоб рубати дерева та знімати з них кору.",
