//     "So neutral! Brighten up your buildings and give them a homely feel. Remember though: carpets are flammable.=Така нейтральність! Освіжіть свої будівлі та створіть домашній затишок. Але пам’ятайте: килими легкозаймисті.",
//     "The most efficient way to make glass walls! Start using some of these fluorescent glass panes today.=Найефективніший спосіб зробити скляні стіни! Почніть використовувати ці панелі із флуоресцентного скла вже сьогодні.",
//     "The text you entered contains words that others may find offensive and cannot be used. Please try again.=Введений текст містить слова, які можуть бути образливими для інших, тому їх не можна вживати. Спробуйте ще раз.",
