//     "Whenever you see a witch hut, you can be sure that a witch and their black cat companions won't be far away. They can be found in swamps.|[space]|Witches are too busy brewing their potions to bother involving themselves in the conflicts of the Overworld. Occasionally, they will offer their loyalty to those willing to pay their price. Listen for a witches cackle to know when you can summon them.|[space]|When active, interact with the witch hut to spawn witches for the following resource costs:|[newline]||*[style.paperBold]|-15 diamond|+[key.item.diamond]||*[style]||[newline]||*[style.paperBold]|-10 coal|+[key.item.coal]||*[style]||[newline]||*[style.paperBold]|-15 lapis|+[key.item.emerald]||*[style]||[newline]||*[style.paperBold]|-1 Flame of Creation|+[key.item.allegianceFlame]||*[style]|=Усякий раз коли ви бачите відьомську хатину, будьте впевнені, що відьма та чорні кішки, її супутники, десь неподалік. Їх можна зустріти на болотах.|[space]|Відьми занадто зайняті варінням свого зілля, щоб турбуватися про участь у конфліктах Верхнього світу. Час від часу вони пропонують вірно служити тим, хто готовий щедро платити. Прислухайтеся до відьомського гоготіння, щоб знати, коли ви можете їх призвати.|[space]|Коли відьомська хатина активна, взаємодійте з нею, щоби призвати відьом за такі ресурси:|[newline]||*[style.paperBold]|— 15 алмазів|+[key.item.diamond]||*[style]||[newline]||*[style.paperBold]|— 10 од. вугілля|+[key.item.coal]||*[style]||[newline]||*[style.paperBold]|— 15 од. лазуриту|+[key.item.emerald]||*[style]||[newline]||*[style.paperBold]|— 1 полум’я творення|+[key.item.allegianceFlame]||*[style]|",
//     "Whenever you see a witch hut, you can be sure that a witch and their black cat companions won't be far away.|[space]|Ensure that you keep witch huts protected and at full health, or you won't be able to call any witches to your aid should you need them.|[space]|Interact with the witch hut to spawn witches for the following resource costs:|[newline]||*[style.paperBold]|-2 gold|+[key.item.gold]||*[style]||[newline]||*[style.paperBold]|-2 prismarine|+[key.item.prismarine]||*[style]||[newline]||*[style.paperBold]|-5 lapis|+[key.item.emerald]||*[style]||[newline]||*[style.paperBold]|-1 Flame of Creation|+[key.item.allegianceFlame]||*[style]|=Усякий раз, коли ви бачите відьомську хатину, будьте впевнені, що відьма та чорні кішки, її супутники, десь неподалік.|[space]|Переконайтеся, що відьомські хатини у вас захищені й повністю здорові, інакше ви не зможете призвати відьом на допомогу, коли вони вам знадобляться.|[space]|Взаємодійте з відьомською хатиною, щоби призвати відьом за такі ресурси:|[newline]||*[style.paperBold]|— 2 од. золота|+[key.item.gold]||*[style]||[newline]||*[style.paperBold]|— 2 од. призмарину|+[key.item.prismarine]||*[style]||[newline]||*[style.paperBold]|— 5 од. лазуриту|+[key.item.emerald]||*[style]||[newline]||*[style.paperBold]|— 1 полум’я творення|+[key.item.allegianceFlame]||*[style]|",
//     "The piglins cobbled together this collection of blades to blow nether spores into every corner of the Overworld. The piglin medic atop the air chopper keeps the spore bin filled and the blades whirling.|[space]|Those blades aren't just for spreading spores, though. The piglins use the strong gusts created by the air choppers to knock their enemies around on the battlefield and heal friendly piglins with fresh puffs of nether spores. It's best to approach an air chopper when it's in between air bursts, as these crude machines need time to recharge after every blast.=Піґліни змайстрували цей пристрій із лопатями, щоб розносити отруйники в усі куточки Верхнього світу. Піґлін-медик, що сидить на верхівці розпорошувача, стежить за тим, щоб контейнер з отруйниками був наповнений, а лопаті крутилися.|[space]|Проте ці лопаті призначені не лише для поширення отруйників. Піґліни використовують сильні вихори, що створюються розпорошувачами, щоб збивати ворогів з ніг на полі бою та зцілювати дружніх піґлінів за допомогою свіжих отруйників Незеру. Найкраще наближатися до розпорошувача, коли він перебуває в перерві між поривами вітру, оскільки цим грубим машинам потрібен час, щоб перезарядитися після кожного дмухання.",
//     "You have a|*[style.bold]|gathering hotbar|+[key.item.hotbar1]||*[style]|, a|*[style.bold]|spawning hotbar|+[key.item.hotbar2]||*[style]|, a|*[style.bold]|structure hotbar|+[key.item.hotbar3]||*[style]|, and an|*[style.bold]|upgrade hotbar|+[key.item.hotbar4]||*[style]|. Press|$[key.toolbarCategory1]||$[key.toolbarCategory2]||$[key.toolbarCategory3]||$[key.toolbarCategory4]|to change your hotbar selection. Each hotbar is able to be customized in your|*[style.bold]|Songbook|+[key.item.songbook]||*[style]||$[key.songbookScreen]|.=Ви маєте|*[style.bold]|панель швидкого доступу до збирання|+[key.item.hotbar1]||*[style]|, |*[style.bold]|панель швидкого доступу до призову|+[key.item.hotbar2]||*[style]|, |*[style.bold]|панель швидкого доступу до споруд|+[key.item.hotbar3]||*[style]| і |*[style.bold]|панель швидкого доступу до модернізації|+[key.item.hotbar4]||*[style]|. Натисніть|$[key.toolbarCategory1]||$[key.toolbarCategory2]||$[key.toolbarCategory3]||$[key.toolbarCategory4]|для вибору іншої панелі швидкого доступу. Кожну панель можна змінити у вашому |*[style.bold]|пісеннику|+[key.item.songbook]||*[style]||$[key.songbookScreen]|.",
//     "To build warriors|+[key.item.vindicatorSpawner]|, ensure you have the|*[style.bold]|Improvement: Gather Redstone|+[key.item.unlock_redstone_tech]||*[style]|&|*[style.bold]|Improvement: Gather Iron|+[key.item.unlock_iron_tech]||*[style]|structures built. Each warrior spawned requires|*[style.bold]|Flames of Creation|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|redstone|+[key.item.redstone]||*[style]|,|*[style.bold]|iron|+[key.item.iron]||*[style]|, and|*[style.bold]|lapis|+[key.item.lapis]||*[style]|.=Щоб отримати воїнів|+[key.item.vindicatorSpawner]|, переконайтеся, що ви маєте збудоване|*[style.bold]|удосконалення: збирання редстоуну|+[key.item.unlock_redstone_tech]||*[style]|й|*[style.bold]|удосконалення: збирання заліза|+[key.item.unlock_iron_tech]||*[style]|. Для призову кожного воїна необхідно|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|редстоун|+[key.item.redstone]||*[style]|,|*[style.bold]|залізо|+[key.item.iron]||*[style]|та|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "To build witches|+[key.item.unlock_spawer_witch]|, ensure you have the|*[style.bold]|Improvement: Gather Diamond|+[key.item.unlock_diamond_tech]||*[style]|&|*[style.bold]|Improvement: Gather Coal|+[key.item.unlock_coal_tech]||*[style]|structures built. Each witch spawned requires|*[style.bold]|Flames of Creation|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|diamond|+[key.item.diamond]||*[style]|,|*[style.bold]|coal|+[key.item.coal]||*[style]|, and|*[style.bold]|lapis|+[key.item.lapis]||*[style]|.=Щоб отримати відьом|+[key.item.unlock_spawer_witch]|, переконайтеся, що ви маєте збудоване|*[style.bold]|удосконалення: збирання алмазів|+[key.item.unlock_diamond_tech]||*[style]|й|*[style.bold]|удосконалення: збирання вугілля|+[key.item.unlock_coal_tech]||*[style]|. Для призову кожної відьми необхідно|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|алмази|+[key.item.diamond]||*[style]|,|*[style.bold]|вугілля|+[key.item.coal]||*[style]|та|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "You can regain your health by backing out of combat and resting, spawning a|*[style.bold]|mossy golem|+[key.item.supportGolemSpawner]||*[style]|, or locating a|*[style.bold]|regeneration stone|+[key.item.regenStone]||*[style]|in the world. You will also heal when you are near the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]|, a|*[style.bold]|village fountain|+[key.item.village]||*[style]|, or a|*[style.bold]|wellhouse|+[key.item.headquarter]||*[style]|.=Ви можете відновити своє здоров’я, вийшовши з бою та відпочивши, призвавши|*[style.bold]|замшілого голема|+[key.item.supportGolemSpawner]||*[style]| або розташувавши|*[style.bold]|камінь відновлення|+[key.item.regenStone]||*[style]|у світі. Ви також зцілитеся, коли будете біля|*[style.bold]|колодязя долі|+[key.item.wellOfFate]||*[style]|,|*[style.bold]|сільського фонтана|+[key.item.village]||*[style]|або|*[style.bold]|дома-колодязя|+[key.item.headquarter]||*[style]|.",
//     "Reach Action with a|*[style.bold]|ramp|+[key.item.platform]||*[style]||[space]|1.|$[key.toolbarCategory3]|Press to navigate to the|*[style.bold]|building hotbar|+[key.item.hotbar3]||*[style]||[newline]|2.|$[key.build]|Hold to enter build view|[newline]|3.|$[key.confirmPlacement]|Press to start placement|[newline]|4.|$[key.cameraMove]|Drag the ramp up to Action|[newline]|5.|$[key.confirmPlacement]|Press to build your ramp=Доберіться до Дії за допомогою|*[style.bold]|пандуса|+[key.item.platform]||*[style]||[space]|1.|$[key.toolbarCategory3]|Натисніть, щоб відкрити|*[style.bold]|панель швидкого доступу до функцій будування|+[key.item.hotbar3]||*[style]||[newline]|2.|$[key.build]|Утримуйте, щоб перейти в режим перегляду споруд|[newline]|3.|$[key.confirmPlacement]|Натисніть, щоб почати розміщення|[newline]|4.|$[key.cameraMove]|Перетягніть пандус до місця дії|[newline]|5.|$[key.confirmPlacement]|Натисніть, щоб побудувати пандус",
//     "Fast travel allows you to travel instantly to any|*[style.bold]|village|+[key.item.village]||*[style]|you've visited, any|*[style.bold]|wellhouses|+[key.item.headquarter]||*[style]|you've created, and the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]|. Open up your|*[style.bold]|map|+[key.item.map]||*[style]||$[key.mapScreen]|, highlight the location you want to fast travel to, and press|$[key.fastTravel]|to instantly travel there.=Швидке переміщення дозволяє миттєво потрапити у будь-яке відвідане|*[style.bold]|село|+[key.item.village]||*[style]|, до будь-яких створених вами|*[style.bold]|криниць|+[key.item.headquarter]||*[style]| і |*[style.bold]|Колодязя долі|+[key.item.wellOfFate]||*[style]|. Відкрийте|*[style.bold]|карту|+[key.item.map]||*[style]||$[key.mapScreen]|, виберіть місце, куди хочете потрапити, і натисніть|$[key.fastTravel]|, щоб миттєво перенестися туди.",
//     "The mobs of the Overworld prefer to live peacefully in their|*[style.bold]|homesteads|+[key.item.waypointZombie]||+[key.item.waypointSkeleton]||+[key.item.waypointCreeper]||*[style]|, but the bravery they showed in defeating the night beacon have made them a target for the|*[style.bold]|piglins|+[key.item.piglin]||*[style]|. Destroy nearby|*[style.bold]|Portals|+[key.item.piglinPortal]||*[style]|to keep the homesteads from being overrun.=Моби Верхнього світу воліють мирно жити в своїх|*[style.bold]|садибах|+[key.item.waypointZombie]||+[key.item.waypointSkeleton]||+[key.item.waypointCreeper]||*[style]|, але хоробрість, яку вони проявили, здобувши перемогу над нічним маяком, зробила їх мішенню для|*[style.bold]|піґлінів|+[key.item.piglin]||*[style]|. Знищуйте|*[style.bold]|портали|+[key.item.piglinPortal]||*[style]| неподалік, щоб вороги не заполонили садиби.",
//     "Iron is required to spawn the|*[style.bold]|grindstone golems|+[key.item.cavalryGolemSpawner]||*[style]|,|*[style.bold]|mossy golems|+[key.item.supportGolemSpawner]||*[style]|, and other advanced mobs or structures. To unlock this melody, build the|*[style.bold]|Improvement: Gather Iron|+[key.item.unlock_iron_tech]||*[style]|structure near an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|.=Залізо необхідне для генерування|*[style.bold]|точильних големів|+[key.item.cavalryGolemSpawner]||*[style]|,|*[style.bold]|замшілих големів|+[key.item.supportGolemSpawner]||*[style]|та інших удосконалених мобів або споруд. Щоб розблокувати цю мелодію, побудуйте|*[style.bold]|удосконалення: збирання заліза|+[key.item.unlock_iron_tech]||*[style]|біля|*[style.bold]|центру удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "These piglins stand out from the horde with their tall stature and their enthusiasm for playing their crude instruments. The powerful sounds they emit at close range are strong enough to stun nearby units for a long duration. Disruptors don't deal any damage on their own, so they're dependent on the rest of their piglin buddies to do the cleanup work. Disruptors can be countered by direct player attacks or by attacking them beyond their range.=Ці піґліни вирізняються з-поміж орди високим зростом і захопленням грою на своїх грубих інструментах. Потужні звуки, які вони видають на близькій відстані, досить сильні, щоб надовго оглушити сусідніх юнітів. Руйнівники не завдають шкоди самі, тому залежать від інших товаришів-піґлінів, які виконують зачистку. Руйнівникам можна протистояти прямими атаками гравців або атакувати їх за межами їхньої дальності.",
//     "|*[style.bold]|Prismarine|+[key.item.prismarine]||*[style]|is a precious resource that is key to upgrading your tools and unlocking amazing abilities. Make sure to gather it after destroying|*[style.bold]|piglin|+[key.item.piglin]||*[style]|structures, and use it at the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]|to build|*[style.bold]|Improvement Structures|+[key.item.unlock_iron_tech]||*[style]|.=|*[style.bold]|Призмарин|+[key.item.prismarine]||*[style]| — це дорогоцінний ресурс, що є ключем до модернізації ваших інструментів і відкриття цінних здібностей. Обов’язково збирайте його після знищення |*[style.bold]|піґлінських|+[key.item.piglin]||*[style]|споруд і застосовуйте в |*[style.bold]|колодязі долі|+[key.item.wellOfFate]||*[style]| для будівництва |*[style.bold]|споруд покращення|+[key.item.unlock_iron_tech]||*[style]|.",
//     "These powerful alchemists have had enough of the piglins and they're ready to throw their potions into the fight. Earn their trust (and their spawners) by defending their village homes from a nighttime invasion.|[space]|How do the witches throw potions with their arms crossed? Only they know what tricks they have up their sleeves.|[space]||*[style.paperBold]|Strong vs|*[style]|groups|[newline]||*[style.paperBold]|Weak vs|*[style]|structures=Цим могутнім алхімікам так набридли піґліни, що вони готові кинути в бій свої зілля. Заслужіть їхню довіру (а також їхні генератори), захистивши їхні сільські будинки від нічного вторгнення.|[space]|Як відьми кидають зілля зі схрещеними руками? Тільки вони знають, які козирі мають у рукавах.|[space]||*[style.paperBold]|Сильні проти|*[style]|груп|[newline]||*[style.paperBold]|Слабкі проти|*[style]|споруд",
//     "|*[style.bold]|Improvement Structures|+[key.item.unlock_redstone_tech]||+[key.item.unlock_firsts_spawners]||*[style]|can enable you to spawn more mobs, or help you gather new resources, so you can build amazing new things. Building improvement structures requires|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|, which you can find by destroying piglin structures at their outposts|+[key.item.dbb]|.=|*[style.bold]|Споруди удосконалення|+[key.item.unlock_redstone_tech]||+[key.item.unlock_firsts_spawners]||*[style]|дозволяють призивати більше мобів або допомогти зібрати нові ресурси, щоб ви могли створювати дивовижні нові речі. Будування споруд удосконалення потребує|*[style.bold]|призмарину|+[key.item.prismarine]||*[style]|, який ви можете знайти після руйнування споруд піґлінів на їхніх заставах|+[key.item.dbb]|.",
//     "Redstone is required to spawn|*[style.bold]|zombies|+[key.item.zombieSpawner]||*[style]|,|*[style.bold]|warriors|+[key.item.vindicatorSpawner]||*[style]|, and other advanced mobs or structures. To unlock this melody, build the|*[style.bold]|Improvement: Gather Redstone|+[key.item.unlock_redstone_tech]||*[style]|structure near an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|.=Редстоун необхідний для генерування|*[style.bold]|зомбі|+[key.item.zombieSpawner]||*[style]|,|*[style.bold]|воїнів|+[key.item.vindicatorSpawner]||*[style]|та інших вдосконалених мобів або споруд. Щоб розблокувати цю мелодію, побудуйте|*[style.bold]|удосконалення: збирання редстоуну|+[key.item.unlock_redstone_tech]||*[style]|біля|*[style.bold]|центру удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
