//     "Iron unlocks advanced structures and can be used to spawn|*[style.bold]|grindstone golems|+[key.item.cavalryGolemSpawner]||*[style]|and|*[style.bold]|mossy golems|+[key.item.supportGolemSpawner]||*[style]|. The first upgrade grants|*[style.bold]|+25 iron|+[key.item.iron]||*[style]|and enables village chests located in forest and dry savanna, or allay chests in any biome to contain iron.=Залізо дає змогу будувати удосконалені споруди і призивати|*[style.bold]|точильних|+[key.item.cavalryGolemSpawner]||*[style]|і|*[style.bold]|замшілих големів|+[key.item.supportGolemSpawner]||*[style]|. Перша модернізація дає|*[style.bold]|+25 од. заліза|+[key.item.iron]||*[style]|, після чого залізо з’являтиметься у сільських скринях у лісах і сухій савані та у скринях служок у будь-якому біомі.",
//     "Type Select allows you to choose what type of mob you want to perform an action in banner view. You have tough|*[style.bold]|melee mobs|+[key.item.typeSelectUp]||*[style]|, fragile|*[style.bold]|ranged mobs|+[key.item.typeSelectLeft]||*[style]|, explosive|*[style.bold]|special mobs|+[key.item.typeSelectSpecial]||*[style]|, and|*[style.bold]|support mobs|+[key.item.typeSelectSupport]||*[style]|.=Вибір типу дає змогу вибрати тип моба в режимі перегляду стягів. Є такі варіанти: |*[style.bold]|моби ближнього бою|+[key.item.typeSelectUp]||*[style]|, вразливі|*[style.bold]|моби дальнього бою|+[key.item.typeSelectLeft]||*[style]|, вибухові|*[style.bold]|спеціальні моби|+[key.item.typeSelectSpecial]||*[style]| та|*[style.bold]|моби підтримки|+[key.item.typeSelectSupport]||*[style]|.",
//     "To unlock creepers|+[key.item.creeperSpawner]|, ensure you have the|*[style.bold]|Improvement: Gather Coal|+[key.item.unlock_coal_tech]||*[style]|structure built. Each creeper that is spawned requires a single|*[style.bold]|Flame of Creation|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|coal|+[key.item.coal]||*[style]|, and|*[style.bold]|lapis|+[key.item.lapis]||*[style]|.=Щоб розблокувати кріперів|+[key.item.creeperSpawner]|, переконайтеся, що ви маєте збудоване |*[style.bold]|удосконалення: збирання вугілля|+[key.item.unlock_coal_tech]||*[style]|. Призов кожного кріпера потребує одного |*[style.bold]|полум'я лояльності|+[key.item.allegianceFlame]||*[style]|, |*[style.bold]|вугілля|+[key.item.coal]||*[style]| та |*[style.bold]|лазуриту|+[key.item.lapis]||*[style]|.",
//     "Villages are important ally settlements and fast travel points that the piglins target at night. As long as you keep them safe, villagers will collect resources for you in the fountain chest. Fortify them with structures like walls and towers to make them easier to defend.|[space]|Empty village chest? The residents might be too busy dodging piglin maces and blaze arrows.=Села є важливими місцями проживання союзників і вузлами системи швидкого переміщення, саме тому піґліни так часто атакують їх уночі. Поки ви дбаєте про безпеку селян, ті будуть збирати для вас ресурси до скринь фонтану. Укріпіть їх спорудами на кшталт стін і веж, щоб їх було легше захищати.|[space]|Сільська скриня порожня? Можливо, жителі надто зайняті ухилянням від булав і вогняних стріл піґлінів.",
//     "The damage dealt by piglins invading villages, homesteads and wellhouses when there is no player character there.|[space]|Auto-resolve is calculated by taking a flat damage value which is modified by the damage and health of piglin units and player structures. This setting modifies the flat value, while the other values can be modified by other custom game options.=Шкода, якої завдають піґліни, що вторгаються в села, садиби та доми-колодязі, коли там немає жодного персонажа гравця.|[space]|Авторозв’язання розраховується на основі фіксованого значення шкоди, яке змінюється залежно від шкоди та здоров'я юнітів піґлінів і споруд гравців. Цей параметр змінює фіксоване значення, тоді як інші значення можна змінити за допомогою інших користувацьких параметрів гри.",
//     "Interact with the structure to spawn them, each mob requires the following resource costs:|[newline]||*[style.bold]|-1 gold|+[key.item.gold]||*[style]||[newline]||*[style.bold]|-1 prismarine|+[key.item.prismarine]||*[style]||[newline]||*[style.bold]|-5 lapis|+[key.item.emerald]||*[style]||[newline]||*[style.bold]|-1 Flame of Creation|+[key.item.allegianceFlame]||*[style]|=Взаємодійте з цією спорудою, щоби призвати їх; кожен моб коштує таку кількість ресурсів:|[newline]||*[style.bold]|— 1 од. золота|+[key.item.gold]||*[style]||[newline]||*[style.bold]|— 1 од. призмарину|+[key.item.prismarine]||*[style]||[newline]||*[style.bold]|— 5 од. лазуриту|+[key.item.emerald]||*[style]||[newline]||*[style.bold]|— 1 полум’я творення|+[key.item.allegianceFlame]||*[style]|",
//     "Gather rare|*[style.bold]|resources|+[key.item.iron]||+[key.item.diamond]||+[key.item.redstone]||+[key.item.coal]||*[style]|to unlock new structures, spawn new allies, and build amazing defenses. To be able to gather these resources, make sure to build Gather Improvements near your|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|.=Збирайте рідкісні|*[style.bold]|ресурси|+[key.item.iron]||+[key.item.diamond]||+[key.item.redstone]||+[key.item.coal]||*[style]|, щоб відкривати доступ до нових споруд, призивати нових союзників і будувати ефективну оборону. Щоб мати можливість збирати ці ресурси, будуйте споруди покращення збирання поблизу свого|*[style.bold]|Центру вдосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "The number of power towers of this type scattered throughout the Overworld. There are between 2-5 in regular campaigns. This setting cannot be changed once the world has been generated.|[space]|You'll still need to build Improvement: Power Towers to collect and construct them. To avoid having to collect them, grant yourself tower cores directly in the starting resources custom settings.=Кількість силових веж цього типу, розповсюджених по Верхньому світу. У звичайних кампаніях їх від 2 до 5. У згенерованому світі цей показник змінювати не можна.|[space]|Щоб збирати, а потім будувати їх, вам все одно потрібне удосконалення: силові вежі. Якщо ви хочете пропустити етап збору, надайте собі одразу ядра веж у користувацьких налаштуваннях початкових ресурсів.",
//     "The number of power towers of this type scattered throughout the Overworld. There are between 2-5 in regular campaigns. This setting cannot be changed once the world has been generated.|[space]|You'll still need to build Improvement: Power Towers to collect and construct them. To avoid having to collect them, grant yourself tower cores directly in the starting resources custom settings.=Кількість силових веж цього типу, розповсюджених по Верхньому світу. У звичайних кампаніях їх від 2 до 5. У згенерованому світі цей показник змінювати не можна.|[space]|Щоб збирати, а потім будувати їх, вам все одно потрібне удосконалення: силові вежі. Якщо ви хочете пропустити етап збору, надайте собі одразу ядра веж у користувацьких налаштуваннях початкових ресурсів.",
//     "The number of power towers of this type scattered throughout the Overworld. There are between 2-5 in regular campaigns. This setting cannot be changed once the world has been generated.|[space]|You'll still need to build Improvement: Power Towers to collect and construct them. To avoid having to collect them, grant yourself tower cores directly in the starting resources custom settings.=Кількість силових веж цього типу, розповсюджених по Верхньому світу. У звичайних кампаніях їх від 2 до 5. У згенерованому світі цей показник змінювати не можна.|[space]|Щоб збирати, а потім будувати їх, вам все одно потрібне удосконалення: силові вежі. Якщо ви хочете пропустити етап збору, надайте собі одразу ядра веж у користувацьких налаштуваннях початкових ресурсів.",
//     "Powerful golem that spawns mobs to fight its enemies.|[divider]|Requires:|[newline]||*[style.bold]|+ Wake the Firsts|*[style]||[newline]||*[style.bold]|+ gold|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ coal|+[key.item.coal]||*[style]||[divider]|This ancient giant once carried the inhabitants of the Overworld across great distances to live in their new homes.=Потужний голем, який призиває мобів для боротьби зі своїми ворогами.|[divider]|Потрібно:|[newline]||*[style.bold]|+ Пробудити Перших|*[style]||[newline]||*[style.bold]|+ золото|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ вугілля|+[key.item.coal]||*[style]||[divider]|Цей древній велетень колись перевозив жителів Верхнього світу на величезні відстані — до їхніх нових домівок.",
//     "Interact with the structure to spawn them, each mob requires the following resource costs:|[newline]||*[style.bold]|-3 redstone|+[key.item.redstone]||*[style]||[newline]||*[style.bold]|-3 iron|+[key.item.iron]||*[style]||[newline]||*[style.bold]|-5 lapis|+[key.item.emerald]||*[style]||[newline]||*[style.bold]|-1 Flame of Creation|+[key.item.allegianceFlame]||*[style]|=Взаємодійте з цією спорудою, щоби призвати їх; кожен моб коштує таку кількість ресурсів:|[newline]||*[style.bold]|— 3 од. редстоуну|+[key.item.redstone]||*[style]||[newline]||*[style.bold]|— 3 од. заліза|+[key.item.iron]||*[style]||[newline]||*[style.bold]|— 5 од. лазуриту|+[key.item.emerald]||*[style]||[newline]||*[style.bold]|— 1 полум’я творення|+[key.item.allegianceFlame]||*[style]|",
//     "Brave|*[style.bold]|warriors|+[key.item.vindicatorSpawner]||*[style]|have taken up arms against the|*[style.bold]|piglins|+[key.item.piglin]||*[style]|. They will protect their|*[style.bold]|villages|+[key.item.village]||*[style]|and will help you if|*[style.bold]|rallied|+[key.item.heroRally]||*[style]|into battle, however you cannot spawn them so they must be rallied from villages.=Хоробрі|*[style.bold]|воїни|+[key.item.vindicatorSpawner]||*[style]|взялися за зброю проти|*[style.bold]|піґлінів|+[key.item.piglin]||*[style]|. Вони захистять свої|*[style.bold]|села|+[key.item.village]||*[style]|та допоможуть вам, якщо вони|*[style.bold]|скликані|+[key.item.heroRally]||*[style]|до бою, однак ви не можете призвати їх, тому їх треба скликати із сіл.",
//     "Mace Runts are the weakest piglins, but they make up for this with their numbers and their ferocious determination to rise up the ranks. Their maces are only dangerous in close combat, and they are susceptible to ranged attacks.|[space]|They’re pretty cute when they’re not pillaging or setting things on fire. Unfortunately, most of the time they're pillaging and setting things on fire.=Коротуни з булавами — найслабші піґліни, але вони компенсують це своєю чисельністю і лютою рішучістю піднятися вгору в ієрархії. Їхні булави небезпечні лише в ближньому бою, і вони вразливі до атаки здалеку.|[space]|Вони можуть навіть здаватися милими, коли не грабують і не підпалюють усе підряд. На жаль, більшу частину часу вони саме грабують і підпалюють.",
//     "You cannot build First spawners without this upgrade.|[space]|Firsts will require|*[style.bold]|lapis|+[key.item.lapis]||*[style]|plus either|*[style.bold]|iron|+[key.item.iron]||*[style]|,|*[style.bold]|redstone|+[key.item.redstone]||*[style]|,|*[style.bold]|diamond|+[key.item.diamond]||*[style]|, or|*[style.bold]|coal|+[key.item.coal]||*[style]|when you spawn them.=Ви не можете побудувати генератори Перших без цієї модернізації.|[space]|Для призову Перших необхідний|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|, а також|*[style.bold]|залізо|+[key.item.iron]||*[style]|,|*[style.bold]|редстоун|+[key.item.redstone]||*[style]|,|*[style.bold]|алмази|+[key.item.diamond]||*[style]|або|*[style.bold]|вугілля|+[key.item.coal]||*[style]|.",
//     "|*[style.bold]|Improvement hubs|+[key.item.unlock_prismarine_upgrades]||*[style]|create a zone that allows Improvement Structures to be placed nearby. Improvement hubs must be built near your|*[style.bold]|base|+[key.item.headquarter]||*[style]|, and require|*[style.bold]|wood|+[key.item.wood]||*[style]|and|*[style.bold]|stone|+[key.item.stone]||*[style]|to be built.=У прилеглій до |*[style.bold]|Центрів вдосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|зоні можна будувати споруди покращення. Центри вдосконалення слід будувати біля вашої|*[style.bold]|бази|+[key.item.headquarter]||*[style]|. Для цього вам знадобиться |*[style.bold]|дерево|+[key.item.wood]||*[style]|та|*[style.bold]|камінь|+[key.item.stone]||*[style]|.",
//     "When playing with friends in Versus mode, you will be sharing|*[style.bold]|resources|+[key.item.wood]||+[key.item.stone]||+[key.item.lapis]||+[key.item.allegianceFlame]||*[style]|. However, you will command your own allays to|*[style.bold]|build structures|+[key.item.buildAllay]||*[style]|and|*[style.bold]|gather resources|+[key.item.gatherAllay]||*[style]|.=Граючи з друзями в режимі протистояння, ви будете ділитися з ними|*[style.bold]|ресурсами|+[key.item.wood]||+[key.item.stone]||+[key.item.lapis]||+[key.item.allegianceFlame]||*[style]|. Однак вам потрібно буде командувати власними служками для|*[style.bold]|будування споруд|+[key.item.buildAllay]||*[style]|і|*[style.bold]|збираня ресурсів|+[key.item.gatherAllay]||*[style]|.",
//     "Important! You have purchased packs and/or Minecoins that are only available on this device and might be lost due to a device malfunction, loss, or uninstalling Minecraft! Sign in with a Microsoft Account (free) and transfer your pack entitlements and Minecoins to that account to protect and access your them on any device that you sign in on.=Увага! Ви придбали пакети та/або монети Minecoins, які доступні лише на цьому пристрої та можуть бути втрачені через несправність чи втрату пристрою або видалення Minecraft! Увійдіть під обліковим записом Xbox Live (безкоштовним) і передайте йому права на пакети й монети Minecoins, щоб захистити їх і мати доступ до них на будь-якому пристрої, на якому ви ввійдете під цим обліковим записом.",
//     "When off, redstone improvement structures cannot be constructed by player characters|[space]|These improvements allow allays to collect redstone. They also increase the max amount you can carry, enables the resource to be found in chests and can grant passive income. Without them, you will lose access to all structures and units that require redstone.=Коли вимкнено, персонажі гравців не можуть будувати споруди удосконалення для редстоуна.|[space]|Ці удосконалення надають служкам можливість збирати редстоун. Вони також збільшують максимальну кількість, яку можна носити, дозволяють знаходити ресурс у скринях і можуть приносити пасивний дохід. Без них ви втратите доступ до всіх споруд і юнітів, для яких потрібен редстоун.",
//     "Build a|*[style.bold]|golem spawner|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]||[space]||$[key.toolbarCategory2]|Press to select the|*[style.bold]|combat hotbar|+[key.item.hotbar2]||*[style]||[newline]||$[key.build]|Hold to enter build view|[newline]||$[key.confirmPlacement]|Press to confirm placement of a spawner=Побудуйте|*[style.bold]|генератор големів|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]||[space]||$[key.toolbarCategory2]|Натисніть, щоб вибрати|*[style.bold]|бойову панель швидкого доступу|+[key.item.hotbar2]||*[style]||[newline]||$[key.build]|Утримуйте, щоб перейти в режим перегляду споруд|[newline]||$[key.confirmPlacement]|Натисніть, щоб підтвердити розміщення генератора",
//     "To gain the Firsts help, build the|*[style.bold]|Improvement: Build the Firsts|+[key.item.unlock_firsts_spawners]||*[style]|. You will then need to build the First spawners at your Base. Spawners will require either|+[key.item.iron]|,|+[key.item.diamond]|,|+[key.item.redstone]|, or|+[key.item.coal]|to build them and a lot of lapis|+[key.item.lapis]|.=Щоб отримати допомогу Перших, побудуйте|*[style.bold]|удосконалення: будування Перших|+[key.item.unlock_firsts_spawners]||*[style]|. Потім вам потрібно буде побудувати на своїй базі генератори Перших. Для будівництва генераторів знадобиться|+[key.item.iron]|,|+[key.item.diamond]|,|+[key.item.redstone]|або|+[key.item.coal]|, а також багато лазуриту|+[key.item.lapis]|.",
//     "When off, diamond improvement structures cannot be constructed by player characters|[space]|These improvements allow allays to collect diamond. They also increase the max amount you can carry, enables the resource to be found in chests and can grant passive income. Without them, you will lose access to all structures and units that require diamond.=Коли вимкнено, персонажі гравців не можуть будувати споруди удосконалення для алмазів.|[space]|Ці удосконалення надають служкам можливість збирати алмази. Вони також збільшують максимальну кількість, яку можна носити, дозволяють знаходити ресурс у скринях і можуть приносити пасивний дохід. Без них ви втратите доступ до всіх споруд і юнітів, для яких потрібні алмази.",
