//     "The number of small bases that the Horde of the Spore will start with. This setting cannot be changed once the world has been generated.|[space]|The invasion system will attempt to place all bases but may fail if the value is too large - especially if you've set the world size to be smaller than normal. Setting the world size to \"large\" may help.=Кількість маленьких баз, із якою починає гру Орда отруйників. У згенерованому світі цей параметр змінювати не можна.|[space]|Система вторгнення спробує розмістити всі бази, але може зазнати невдачі, якщо значення занадто велике — особливо якщо ви встановили розмір світу меншим, ніж звичайний. Встановлення параметра «Великий» для розміру світу може допомогти.",
