//     "The number of outposts that the Horde of the Bastion will start with. This setting cannot be changed once the world has been generated.|[space]|The invasion system will attempt to place all bases but may fail if the value is too large - especially if you've set the world size to be smaller than normal. Setting the world size to \"large\" may help.=Кількість застав, із якою починає гру Орда укріпників. У згенерованому світі цей параметр змінювати не можна.|[space]|Система вторгнення спробує розмістити всі бази, але частина може не вміститися, якщо їх забагато, особливо якщо ви встановили розмір світу менше звичайного. Встановлення параметра «Великий» для розміру світу може допомогти.",
//     "Use your gathering melodies by holding|$[key.build]|and then pressing|$[key.confirmPlacement]|to gather specific resources. Enemies will attack your placed gather melodies and smash them, so keep an eye on them. You will find all of your gather melodies on your|*[style.bold]|gathering hotbar|+[key.item.hotbar1]||*[style]||$[key.toolbarCategory1]|.=Застосовуйте мелодії збирання, утримуючи|$[key.build]|, а потім натискаючи|$[key.confirmPlacement]|, щоб зібрати певні ресурси. Вороги можуть нападати на ваші мелодії збирання й розбивати їх, тож стежте за ними. Ви знайдете всі свої мелодії збирання на |*[style.bold]|панелі збирання|+[key.item.hotbar1]||*[style]||$[key.toolbarCategory1]|.",
//     "The number of outposts that the Horde of the Spore will start with. This setting cannot be changed once the world has been generated.|[space]|The invasion system will attempt to place all bases but may fail if the value is too large - especially if you've set the world size to be smaller than normal. Setting the world size to \"large\" may help.=Кількість застав, із якою починає гру Орда отруйників. У згенерованому світі цей параметр змінювати не можна.|[space]|Система вторгнення спробує розмістити всі бази, але частина може не вміститися, якщо їх забагато, особливо якщо ви встановили розмір світу менше звичайного. Встановлення параметра «Великий» для розміру світу може допомогти.",
//     "Damages and knocks back piglins in an area.|[divider]|Requires:|[newline]||*[style.bold]|+ Collect Power Towers|*[style]||[newline]||*[style.bold]|+ gold|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ redstone|+[key.item.redstone]||*[style]||[divider]|A Host relic created as a lighting rod to protect the Overworld from fires.=Завдає шкоди піґлінам поблизу та відкидає їх назад.|[divider]|Потрібно:|[newline]||*[style.bold]|+ Заберіть Силові вежі|*[style]||[newline]||*[style.bold]|+ Золото|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ Редстоун|+[key.item.redstone]||*[style]||[divider]|Реліквія Хранителя, створена як блискавичник для захисту Верхнього світу від пожеж.",
//     "Coal is required to spawn the|*[style.bold]|creeper|+[key.item.creeperSpawner]||*[style]|and other advanced mobs or structures. To unlock this melody, build the|*[style.bold]|Improvement: Gather Coal|+[key.item.unlock_coal_tech]||*[style]|structure near an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|.=Вугілля необхідне для генерування|*[style.bold]|кріперів|+[key.item.creeperSpawner]||*[style]|та інших удосконалених мобів або споруд. Щоб розблокувати цю мелодію, побудуйте|*[style.bold]|удосконалення: збирання вугілля|+[key.item.unlock_coal_tech]||*[style]|біля|*[style.bold]|центру удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "Powerful golem that throws stones that damage buildings.|[divider]|Requires:|[newline]||*[style.bold]|+ Wake the Firsts|*[style]||[newline]||*[style.bold]|+ gold|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ stone|+[key.item.stone]||*[style]||[divider]|This ancient giant once plowed the earth and shaped the mountains of the Overworld.=Потужний голем, який кидає камені, що пошкоджують будівлі.|[divider]|Потрібно:|[newline]||*[style.bold]|+ Пробудити Перших|*[style]||[newline]||*[style.bold]|+ золото|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ камінь|+[key.item.stone]||*[style]||[divider]|Колись цей древній велетень орав землю і ліпив гори Верхнього світу.",
//     "The|*[style.bold]|piglins|+[key.item.piglin]||*[style]|will begin attacking at night.|*[style.bold]|Build Defenses|+[key.item.wall]||+[key.item.gate]||+[key.item.arrowTower]||*[style]|in villages to protect against their attacks if you can't defend in person. Actively defending|*[style.bold]|villages|+[key.item.village]||*[style]|will help keep the piglins away.=|*[style.bold]|Піґліни|+[key.item.piglin]||*[style]|нападуть цієї ночі.|*[style.bold]|Побудуйте оборонні споруди|+[key.item.wall]||+[key.item.gate]||+[key.item.arrowTower]||*[style]|для захисту сел без вашої участі. Активний захист|*[style.bold]|сіл|+[key.item.village]||*[style]|допоможе стримувати атаки піґлінів.",
//     "The amount of this resource players start with. This setting cannot be changed once the world has been generated.|[space]|Each resource can build a single frost tower, powerful host structures that slow enemies in the area of impact. Improvement: Power Towers is still required to construct them, unless you have Unlock All enabled.=Кількість цього ресурсу, з якою починають гру гравці. У згенерованому світі цей показник змінювати не можна.|[space]|Кожен ресурс може побудувати одну морозну вежу — потужну споруду, яка уповільнює ворога в області ураження. Для їхнього будівництва все ще потрібно удосконалення: силові вежі, якщо у вас не ввімкнено параметр «Розблокувати все».",
//     "Created by the hosts, this core contains the essence of the|*[style.bold]|Blast Tower|*[style]|, enabling its unique properties.|[space]|Upon collecting a tower found in the world or deconstructing one you've placed, you will receive its core. The more you collect, the more you can build. If a tower is destroyed, the core will be lost.=Це ядро створено Хранителями і містить сутність|*[style.bold]|артилерійської вежі|*[style]|, що пояснює його унікальні властивості.|[space]|Забравши вежу, знайдену десь у світі, або розібравши вежу, яку ви встановили, ви отримаєте її ядро. Чим більше ви збираєте, тим більше зможете побудувати. Якщо вежу зруйновано, її ядро буде втрачено.",
//     "Created by the hosts, this core contains the essence of the|*[style.bold]|Stun Tower|*[style]|, enabling its unique properties.|[space]|Upon collecting a tower found in the world or deconstructing one you've placed, you will receive its core. The more you collect, the more you can build. If a tower is destroyed, the core will be lost.=Це ядро створено Хранителями і містить сутність|*[style.bold]|оглушувальної вежі|*[style]|, що пояснює його унікальні властивості.|[space]|Забравши вежу, знайдену десь у світі, або розібравши вежу, яку ви встановили, ви отримаєте її ядро. Чим більше ви збираєте, тим більше зможете побудувати. Якщо вежу зруйновано, її ядро буде втрачено.",
//     "|[divider]|Most common resources: Stone |+[key.item.stone]|and Wood |+[key.item.wood]| |[divider]| Home to the well of fate, the landscape is composed of gentle rolling hills blanketed by colorful wildflowers, lush green trees and anomalous rock formations. The fatelands are a good place to find wood and stone.=|[divider]|Найпоширеніші ресурси: камінь |+[key.item.stone]|і деревина |+[key.item.wood]| |[divider]| Ця місцевість, де розташована криниця долі, представляє собою чарівну композицію із пологих пагорбів, вкритих барвистими польовими квітами, пишної зелені дерев і незвичайних скелястих утворень. Доленосні землі — це те місце, де можна знайти деревину й камінь.",
//     "Improvement: Gather Coal unlocks the following:|[newline]||*[style.bold]|creepers|+[key.item.creeperSpawner]||*[style]|,|*[style.bold]|scatter tower|*[style]|,|*[style.bold]|kaboomery|*[style]|,|*[style.bold]|stun tower|+[key.item.stunTower]||*[style]|, &|*[style.bold]|First of Diorite|+[key.item.spawnerFirstDiorite]||*[style]|.=Удосконалення: збирання вугілля розблоковує таке:|[newline]||*[style.bold]|кріперів|+[key.item.creeperSpawner]||*[style]|,|*[style.bold]|розкидну вежу|*[style]|,|*[style.bold]|вибухів’ярню|*[style]|,|*[style.bold]|оглушувальну вежу|+[key.item.stunTower]||*[style]|та|*[style.bold]|Першого з діориту|+[key.item.spawnerFirstDiorite]||*[style]|.",
//     "Created by the hosts, this core contains the essence of the|*[style.bold]|Frost Tower|*[style]|, enabling its unique properties.|[space]|Upon collecting a tower found in the world or deconstructing one you've placed, you will receive its core. The more you collect, the more you can build. If a tower is destroyed, the core will be lost.=Це ядро створено Хранителями і містить сутність|*[style.bold]|морозної вежі|*[style]|, що пояснює його унікальні властивості.|[space]|Забравши вежу, знайдену десь у світі, або розібравши вежу, яку ви встановили, ви отримаєте її ядро. Чим більше ви збираєте, тим більше зможете побудувати. Якщо вежу зруйновано, її ядро буде втрачено.",
//     "Use Type Select to give an order to a specific group of mobs or a specific mob type|[newline]|Use|$[key.typeSelectNavigationHorizontal]|to select the mob group, and then use|$[key.typeSelectNavigationVertical]|to select the type of mob from that group. Then give them a Charge|$[key.attackMove]|or a Focus Target|$[key.forceMove]|order.=Вибір типу дає змогу віддати наказ певній групі мобів або мобам певного типу.|[newline]|Використовуйте|$[key.typeSelectNavigationHorizontal]|, щоб вибрати групу мобів, а потім|$[key.typeSelectNavigationVertical]| — тип мобів із цієї групи. Потім віддайте їм наказ «Атака»|$[key.attackMove]|або «Фокусування цілі»|$[key.forceMove]|.",
//     "Build improvements|+[key.item.unlock_redstone_tech]|around your|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]||[space]|Improvements cost|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|which is found at destroyed piglin structures in their Outposts|+[key.item.piglinCamp]|=Будуйте споруди удосконалення|+[key.item.unlock_redstone_tech]|навколо вашого|*[style.bold]|центру удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]||[space]|Для цього витрачайте|*[style.bold]|призмарин|+[key.item.prismarine]||*[style]|, який можна знайти біля зруйнованих споруд піґлінів поблизу їхніх застав|+[key.item.piglinCamp]|",
//     "These powerful alchemists are ready to join you on the battlefield and throw their potions into the fight.|[space]|How do the witches throw potions with their arms crossed? Only they know what tricks they have up their sleeves.|[space]||*[style.paperBold]|Strong vs|*[style]|groups|[newline]||*[style.paperBold]|Weak vs|*[style]|structures.=Ці могутні алхіміки готові приєднатися до вас на полі бою і кинути свої зілля у гущавину битви.|[space]|Як відьми кидають зілля зі схрещеними руками? Тільки вони знають, які хитрощі у них напоготові.|[space]||*[style.paperBold]|Сильні проти|*[style]|групи|[newline]||*[style.paperBold]|Слабких проти|*[style]|структур.",
//     "You are limited in the amount of mobs you can spawn. Increase the number of mobs you can spawn by upgrading your|*[style.bold]|Flames of Creation|+[key.item.allegianceFlame]||*[style]|at the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]|by building an|*[style.bold]|Improvement: Flames of Creation|+[key.item.allegianceFlame]||*[style]|structure.=Ви можете призвати обмежену кількість мобів. Модернізуйте своє|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|біля|*[style.bold]|колодязя долі|+[key.item.wellOfFate]||*[style]|, побудувавши|*[style.bold]|удосконалення: полум’я творення|+[key.item.allegianceFlame]||*[style]|.",
//     "The amount of this resource players start with. This setting cannot be changed once the world has been generated.|[space]|Each resource can build a single blast tower, powerful host structures that deal damage to the area of impact. Improvement: Power Towers is still required to construct them, unless you have Unlock All enabled.=Кількість цього ресурсу, з якою починають гру гравці. У згенерованому світі цей параметр змінювати не можна.|[space]|Кожен ресурс може побудувати одну артилерійську вежу — потужну споруду, яка завдає ушкоджень по області. Якщо вимкнено параметр «Розблокувати все», для їхнього будівництва потрібне удосконалення: силові вежі.",
//     "The amount of this resource players start with. This setting cannot be changed once the world has been generated.|[space]|Each resource can build a single stun tower, powerful host structures that stun enemies in a wide area. Improvement: Power Towers is still required to construct them, unless you have Unlock All enabled.=Кількість цього ресурсу, з якою починають гру гравці. У згенерованому світі цей показник змінювати не можна.|[space]|Кожен ресурс може побудувати одну оглушувальну вежу — потужну споруду, яка оглушує ворога в області ураження. Якщо вимкнено параметр «Розблокувати все», для їхнього будівництва потрібне удосконалення: силові вежі.",
//     "The blast tower zaps piglins within its range, stopping them in their tracks and dealing significant damage. To collect these mysterious towers, you must build a special improvement.|[space]|Knowledge built the Blast Tower a long time ago to combat forest fires, but never found a use for all that energy… until now.=Артилерійська вежа підпалює піґлінів у радіусі дії, зупиняючи їх рух і завдаючи значної шкоди. Щоб зібрати ці загадкові вежі, необхідно побудувати спеціальну споруду удосконалення.|[space]|Дуже давно Знання побудувало вибухову вежу для боротьби з лісовими пожежами, але до недавніх пір усій цій енергії не вдавалося знайти застосування.",
//     "|*[style.bold]|Walls|+[key.item.wall]||*[style]|and|*[style.bold]|arrow towers|+[key.item.arrowTower]||*[style]|provide a physical barricade to enemies, while|*[style.bold]|gates|+[key.item.gate]||*[style]|allow you to enter and exit your base easily. You can unlock additional structures as you gather resources.=|*[style.bold]|Стіни|+[key.item.wall]||*[style]|та|*[style.bold]|стрілецькі вежі|+[key.item.arrowTower]||*[style]|створюють фізичну перешкоду для ворогів, а|*[style.bold]|ворота|+[key.item.gate]||*[style]|дають вам змогу швидко входити на територію своєї бази та виходити з неї. Ви можете розблокувати додаткові споруди, збираючи ресурси.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement speeds up the masonry's effect and increases the aura of the carpenter, masonry, kaboomery, battle drums and spyglass. Without it, masonry's will be slower and you'll have to place more aura based structures to cover an area.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення прискорює ефект каменярні й збільшує радіус дії аур теслярні, каменярні, вибухів’ярні, бойових барабанів та підзорної труби. Без нього каменярство сповільниться, і вам доведеться розміщувати більше споруд з аурами, щоб охопити всю місцевість.",
//     "As you explore the Overworld, you will discover and befriend new mounts. Once you have their Friendship, they will wait for you at|*[style.bold]|village fountains|+[key.item.village]||*[style]|ready for when you need them again. You can also change your mounts in the wild if you find them there.=Досліджуючи Верхній світ, ви будете знаходити нових транспортних мобів і дружити з ними. Як тільки ви завоюєте їхню дружбу, вони чекатимуть на вас біля|*[style.bold]|сільських фонтанів|+[key.item.village]||*[style]|на той випадок, коли вони вам знову знадобляться. Ви також можете змінити свого транспортного моба у дикій природі, якщо знайдете його там.",
//     "The Journal Screen tells you about everything you've come across on your journey. Press|$[key.songbookScreen]|to open the|*[style.bold]|Songbook Screen|+[key.item.songbook]||*[style]|, then use|$[key.menuTabLeft]|and|$[key.menuTabRight]|to switch between the different Songbook pages and access the Journal tab on the right side.=На екрані журналу можна побачити всі записи, які ви робили під час мандрів. Натисніть|$[key.songbookScreen]|, щоб відкрити|*[style.bold]|екран пісенника|+[key.item.songbook]||*[style]|, а потім натискайте|$[key.menuTabLeft]|та|$[key.menuTabRight]|, щоб гортати сторінки пісенника та відкрити вкладку «Журнал» праворуч.",
//     "Improves your lute to direct more allays at one time. Gives|*[style.bold]|+1 build allay|+[key.item.buildAllay]||*[style]|&|*[style.bold]|+1 gather allay|+[key.item.gatherAllay]||*[style]|to each player on your team. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Покращує вашу лютню, щоби спрямувати більше служок за раз. Дає|*[style.bold]|+1 служку-будівника|+[key.item.buildAllay]||*[style]|та|*[style.bold]|+1 служку-збирача|+[key.item.gatherAllay]||*[style]|кожному гравцеві вашої команди. Потрібний |*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "When a structure is selected, press|$[key.customizeHotbar]|to access Hotbar Customization. use|$[key.menuMovement]|and press|$[key.menuSelect]|to place the structure on your hotbar. You can also add a structure to the quick build slot on your hotbar by pressing|$[key.customizeQuickBuild]|.=Вибравши потрібну споруду, натисніть|$[key.customizeHotbar]|для налаштування панелі швидкого доступу. Натисніть|$[key.menuMovement]|, потім натисніть|$[key.menuSelect]|, щоб розмістити споруду на панелі швидкого доступу. Ви також можете додати споруду до слота швидкого будування на своїй панелі швидкого доступу, натиснувши|$[key.customizeQuickBuild]|.",
//     "At each village fountain you will find a|*[style.bold]|chest|+[key.item.fateChest]||*[style]|where villagers store resources for you, including|*[style.bold]|lapis|+[key.item.lapis]||*[style]|. Villagers are eager to help you against the piglins, and a well defended village can gather more resources for the fight.=Біля кожного сільського фонтану ви знайдете|*[style.bold]|скриню|+[key.item.fateChest]||*[style]|, де жителі села зберігають для вас ресурси, в тому числі|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|. Селяни прагнуть допомагати вам в боротьбі з піґлінами, а добре захищене село може зібрати більше ресурсів для цього.",
//     "We've expanded custom games to include a ton of new options. Some examples include: being able to change the number of piglin bases, what actions the piglins take in campaign, and the amount of resources in chests. You can even turn all the water in the world into lava! For the full list of new options, start or continue a custom game.=Ми додали у спеціальні ігри масу нових опцій. Ось деякі приклади: можливість змінювати кількість баз піґлінів, дії піґлінів у кампанії та кількість ресурсів у скринях. Ви навіть можете перетворити всю воду в світі на лаву! Щоб переглянути повний список нових опцій, почніть або продовжте власну гру.",
