//     "The frost tower freezes piglins in their tracks – at least for some time. To collect these mysterious towers, you must build a special improvement.|[space]|Knowledge can’t remember why they created this tower, but they definitely did not have freezing piglins in mind. A very welcome surprise indeed.=Морозна вежа на деякий час заморожує піґлінів, які кудись прямують. Щоб зібрати ці загадкові вежі, необхідно побудувати спеціальне удосконалення.|[space]|Знання навіть не памʼятає, навіщо воно створило цей тип веж, але заморожування піґлінів серед цілей точно не було. Утім, це виявилося дуже приємним сюрпризом.",
//     "Improves your Lantern of Creation to let you have more|*[style.bold]|Flames|+[key.item.allegianceFlame]||*[style]|. Each mob costs a|*[style.bold]|Flame of Creation|+[key.item.allegianceFlame]||*[style]|to spawn. When a mob dies, its|*[style.bold]|Flame|+[key.item.allegianceFlame]||*[style]|is returned.=Покращує ваш ліхтар творення, щоб у вас було більше|*[style.bold]|полум’я|+[key.item.allegianceFlame]||*[style]|. Призов кожного моба коштує|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|. Коли моб помирає, його|*[style.bold]|полум’я|+[key.item.allegianceFlame]||*[style]|повертається.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows allays to collect coal. It also increases the max amount you can carry and enables the resource to be found in chests. Without it, you will lose access to all structures and units that require coal.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає служкам можливість збирати вугілля. Воно також збільшує максимальну кількість, яку можна носити, і дозволяє знаходити ресурс у скринях. Без нього ви втратите доступ до всіх споруд і юнітів, для яких потрібне вугілля.",
//     "If the|*[style.bold]|piglins|+[key.item.piglin]||*[style]|are successful at destroying the|*[style.bold]|Allegiance Flame|+[key.item.allegianceStructure]||*[style]|, you will lose the ability to spawn those mobs in battle. You will have to restore the Flame to reaffirm your allegiance with the mob to spawn them.=Якщо|*[style.bold]|піґлінам|+[key.item.piglin]||*[style]|вдасться зруйнувати|*[style.bold]|полум’я лояльності|+[key.item.allegianceStructure]||*[style]|, ви втратите здатність призивати цих мобів у бою. Вам потрібно буде відновити полум’я, щоб підтвердити свою лояльність мобам і призвати їх.",
//     "Unique identifier for each world generation. Before a world has been generated, enter a seed to replicate that world's generation. Terrain will be the same, but not dynamically generated objects like structures.|[space]|This setting cannot be changed once the world has been generated.=Унікальний ідентифікатор кожної генерації світу. Перш ніж світ буде згенеровано, введіть значення світу-потомка, який буде створено за зразком цього. Рельєф місцевості буде таким самим, але динамічно згенеровані об'єкти, такі як споруди, відрізнятимуться.|[space]|У згенерованому світі цей показник змінювати не можна.",
//     "Unlink your Microsoft Account from your account for PlayStation™Network. You will no longer be able to play with friends on other platforms unless you link your Microsoft Account again. Note that you are not allowed to link this Microsoft Account to a different account for PlayStation™Network.=Від’єднайте обліковий запис Microsoft від облікового запису PlayStation™Network. Ви зможете грати з друзями на інших платформах, лише якщо знову прив’яжете свій обліковий запис Microsoft. Зверніть увагу, що ви не можете прив’язати цей обліковий запис Microsoft до іншого облікового запису PlayStation™Network.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows allays to collect iron. It also increases the max amount you can carry and enables the resource to be found in chests. Without it, you will lose access to all structures and units that require iron.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу служкам збирати залізо. Також збільшується максимальна кількість цього ресурсу, яку ви можете носити і зберігати у скринях. Без нього ви втратите доступ до всіх споруд і юнітів, для яких потрібне залізо.",
//     "Redstone unlocks advanced structures and can be used to spawn|*[style.bold]|zombies|+[key.item.zombieSpawner]||*[style]|. The first upgrade grants|*[style.bold]|+25 redstone|+[key.item.redstone]||*[style]|and enables village chests located in swamp or allay chests in any biome to contain redstone.=Редстоун дає змогу будувати кращі споруди і призивати|*[style.bold]|зомбі|+[key.item.zombieSpawner]||*[style]|. Перша модернізація дає|*[style.bold]|+25 од. редстоуну|+[key.item.redstone]||*[style]|, після чого редстоун з’являтиметься у сільських скринях на болоті та скринях служок у будь-якому біомі.",
//     "Spawn 3|*[style.bold]|golems|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]||[space]||$[key.bsharpInteract]|Hold to spawn golems while standing near a spawner|[space]|Each spawned mob takes up a|*[style.bold]|Flame of Creation|+[key.item.allegianceFlame]||*[style]|as long as they exist=Призвіть 3|*[style.bold]|големів|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]||[space]||$[key.bsharpInteract]|Утримуйте, щоб призвати големів, стоячи біля генератора|[space]|Кожен призваний моб витрачає|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]|,|*[style]|поки існує",
//     "Freezes piglins in an area.|[divider]|Requires:|[newline]||*[style.bold]|+ Collect Power Towers|*[style]||[newline]||*[style.bold]|+ gold|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ diamond|+[key.item.diamond]||*[style]||[divider]|A Host relic that was used to create the tundra.=Заморожує піґлінів поблизу.|[divider]|Потрібно:|[newline]||*[style.bold]|+ Забирання силових веж|*[style]||[newline]||*[style.bold]|+ Золото|+[key.item.gold]||*[style]||[newline]||*[style.bold]|+ Алмази|+[key.item.diamond]||*[style]||[divider]|Реліквія Хранителя, яка використовувалася для створення тундри.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Gather Redstone grants additional storage capacity, but you need at least one to gather redstone and collect it from chests. Setting this to a higher value removes the need to construct additional improvements.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Збирання редстоуну» розширює можливості зберігання, але потрібно принаймні одне, щоб збирати редстоун і знаходити його в скринях. Встановлення більшого значення усуває необхідність створення додаткових удосконалень.",
//     "The tundra-native skeletons are excellent archers that are best suited to the far edges of the battlefield.|[space]|Why do skeletons wear armor? Some say they have felt a war coming for a long time. Others say it’s the result of a particularly rattling blow to the head. One is more likely than the other.=Тундрові скелети — відмінні лучники, які найкраще підходять для далеких країв поля бою.|[space]|Чому скелети носять броню? За словами одних, вони вже давно відчували, що наближається війна. За словами інших, це результат того, що їх добряче тріснули по голові. Одне більш імовірне, ніж інше.",
//     "Diamond unlocks advanced structures and can be used to spawn|*[style.bold]|skeletons|+[key.item.skeletonSpawner]||*[style]|. The first upgrade grants|*[style.bold]|+25 diamond|+[key.item.diamond]||*[style]|and enables village chests located in tundra or allay chests in any biome to contain diamond.=Алмази дають змогу будувати кращі споруди і призивати|*[style.bold]|скелетів|+[key.item.skeletonSpawner]||*[style]|. Перша модернізація дає|*[style.bold]|+25 алмазів|+[key.item.diamond]||*[style]|, після чого алмази з’являтимуться у сільських скринях у тундрі та скринях служок у будь-якому біомі.",
//     "Changes the types of invasion actions that piglins from this horde will prefer to do each night.|[space]|Horde of the Bastion like upgrading bases.|[newline]|Horde of the Hunt like attacking villages, mob homesteads and wellhouses.|[newline]|Horde of the Spore like to build new outposts or bases.=Змінює види дій, яким піґліни із цієї орди надаватимуть перевагу щоночі під час вторгнення.|[space]|Орді укріпників подобається модернізувати бази.|[newline]|Орда мисливців полюбляє нападати на села, садиби мобів і криниці.|[newline]|Орди споровиків люблять будувати нові оборонні застави або бази.",
//     "Changes the types of invasion actions that piglins from this horde will prefer to do each night.|[space]|Horde of the Bastion like upgrading bases.|[newline]|Horde of the Hunt like attacking villages, mob homesteads and wellhouses.|[newline]|Horde of the Spore like to build new outposts or bases.=Змінює види дій, яким піґліни з цієї орди надаватимуть перевагу щоночі під час вторгнення.|[space]|Орді укріпників подобається модернізувати бази.|[newline]|Орда мисливців полюбляє нападати на села, садиби мобів і криниці.|[newline]|Орди отруйників люблять будувати нові оборонні застави або бази.",
//     "Changes the types of invasion actions that piglins from this horde will prefer to do each night.|[space]|Horde of the Bastion like upgrading bases.|[newline]|Horde of the Hunt like attacking villages, mob homesteads and wellhouses.|[newline]|Horde of the Spore like to build new outposts or bases.=Змінює види дій, яким піґліни з цієї орди надаватимуть перевагу щоночі під час вторгнення.|[space]|Орді укріпників подобається модернізувати бази.|[newline]|Орда мисливців полюбляє нападати на села, садиби мобів і криниці.|[newline]|Орди споровиків люблять будувати нові оборонні застави або бази.",
//     "Lapis is what feeds the Flames of Creation, allowing you to spawn golems and mobs. It is obtained from roaming piglins and may also be stocked in village chests.|[newline]|Lapis is the main reason why you should give every piglin you see a good thwacking. Not that you needed more reasons.=Лазурит живить полум’я творення, дозволяючи генерувати големів і мобів. Його добувають із бродячих піґлінів, а ще його можна знайти у сільських скринях.|[newline]|Лазурит — це головна причина, по якій ви повинні добре мутузити кожного піґліна, якого бачите. Щоправда, вам навряд чи потрібно більше причин.",
//     "Improvement: Gather Diamond unlocks the following:|[newline]||*[style.bold]|skeletons|+[key.item.skeletonSpawner]||*[style]|,|*[style.bold]|frost tower|+[key.item.frostTower]||*[style]|,|*[style.bold]|First of Oak|+[key.item.spawnerFirstOak]||*[style]|, &|*[style.bold]|spyglass overlook|*[style]|.=Удосконалення: збирання алмазів розблоковує таке:|[newline]||*[style.bold]|скелетів|+[key.item.skeletonSpawner]||*[style]|,|*[style.bold]|морозну вежу|+[key.item.frostTower]||*[style]|,|*[style.bold]|Першого з дуба|+[key.item.spawnerFirstOak]||*[style]|та|*[style.bold]|підзорну трубу|*[style]|.",
//     "Certain|*[style.bold]|mobs|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||+[key.item.cavalryGolemSpawner]||*[style]|are better against specific|*[style.bold]|piglins|+[key.item.piglin]||*[style]|. Be sure to use the best mob for each situation to maximize their effectiveness.=Певні|*[style.bold]|моби|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||+[key.item.cavalryGolemSpawner]||*[style]|більш ефективні проти конкретних|*[style.bold]|піґлінів|+[key.item.piglin]||*[style]|. Обов’язково використовуйте найкращого моба для кожної ситуації, щоб максимально підвищити його ефективність.",
//     "This menacing tower fires huge spiked projectiles from very long distances. Shortly after impacting its target, it splits into several smaller bombs, making it effective against both units and structures. It can be countered by protector towers or by destroying it before it can detonate.=Ця загрозлива вежа випускає величезні снаряди з шипами з дуже великої відстані. Незабаром після удару по цілі снаряд розпадається на кілька менших бомб, що робить його ефективним як проти юнітів, так і проти споруд. Йому можна протистояти вежами захисту або знищити його, перш ніж він зможе здетонувати.",
//     "Lapis is what feeds the Flames of Creation, allowing you to spawn golems and mobs. It is obtained from roaming piglins and may also be stocked in village chests.|[space]|Lapis is the main reason why you should give every piglin you see a good thwacking. Not that you needed more reasons.=Лазурит живить полум’я творення, дозволяючи генерувати големів і мобів. Його добувають із бродячих піґлінів, а ще його можна знайти у сільських скринях.|[space]|Лазурит — це головна причина, з якої ви повинні добре мутузити кожного піґліна, якого бачите. Щоправда, вам навряд чи потрібно більше причин.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Scatter towers fire multiple arrows at close range, making them effective vs. mass units. Without them, it will be harder to push back large groups. If you turn off these and arrow towers, you're going to have a really rough time!=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Розкидні вежі з близької відстані випускають залп стріл, які ефективні проти багаточисельних юнітів. Без них буде важче відтіснити великі групи. Якщо ви вимкнете ці й стрілецькі вежі, вам доведеться несолодко!",
//     "Build a carpenter hut|+[key.item.carpenter]|near your base to repair it|[space]|Build defenses:|[newline]||+[key.item.arrowTower]|Shoots arrows at piglins|[newline]||+[key.item.wall]|Blocks piglin attacks|[newline]||+[key.item.gate]|Allows you to enter and exit your defenses=Побудуйте теслярню|+[key.item.carpenter]|біля вашої бази, щоб відремонтувати її|[space]|Побудуйте оборонні споруди:|[newline]||+[key.item.arrowTower]|Стріляє стрілами в піґлінів|[newline]||+[key.item.wall]|Блокує атаки піґлінів|[newline]||+[key.item.gate]|Дозволяє вам входити до оборонних споруд і виходити з них",
//     "The amount of gather allays players start the game with. This setting cannot be changed once the world has been generated.|[space]|Gather allays are required to gather resources. The more you have, the more resources you can gather. This can replace the need for the Improvement: Abundant Allays.=Кількість служок-збирачів, із якою починають гру гравці. У згенерованому світі цей параметр змінювати не можна.|[space]|Служки-збирачі потрібні для збирання ресурсів. Чим більше ви їх маєте, тим більше ви можете зібрати ресурсів за раз. Це може замінити потребу в удосконаленні: купа служок.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Gather Diamond grants additional storage capacity, but you need at least one to gather diamond and collect it from chests. Setting this to a higher value removes the need to construct additional improvements.=Максимальна кількість цього ресурсу, яку можна носити із собою.|[space]|Кожне вдосконалення: «Збирання алмазів» дає додаткове місце для зберігання, але потрібне принаймні одне, щоб збирати алмази та діставати їх зі скринь. Якщо встановити більше значення, зникає потреба у додаткових удосконаленнях.",
//     "The|*[style.bold]|piglins|+[key.item.piglin]||*[style]|will attack|*[style.bold]|Villages|+[key.item.village]||*[style]|, build new bases, and reinforce existing bases. Each action will be shown on your|*[style.bold]|map|+[key.item.map]||*[style]|. Keep an eye out so you can react accordingly.=|*[style.bold]|Піґліни|+[key.item.piglin]||*[style]|атакують|*[style.bold]|села|+[key.item.village]||*[style]|, будують нові бази та зміцнюють існуючі бази. Кожна дія буде показана на вашій|*[style.bold]|карті|+[key.item.map]||*[style]|. Слідкуйте за тим, щоб ви могли реагувати відповідно.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Gather Coal grants additional storage capacity, but you need at least one to gather coal and collect it from chests. Setting this to a higher value removes the need to construct additional improvements.=Максимальна кількість цього ресурсу, яку можна носити із собою.|[space]|Кожне вдосконалення: «Збирання вугілля» дає додаткове місце для зберігання, але потрібне принаймні одне, щоб збирати вугілля та діставати його зі скринь. Якщо встановити більше значення, зникає потреба у додаткових удосконаленнях.",
//     "Destroy the piglin pits and blaze rod towers|[newline]|Use|*[style.bold]|Cobblestone golems|+[key.item.stoneSpawner]||*[style]|to to destroy structures|[newline]|Make sure to use|*[style.bold]|bannerview|$[key.advancedDirect]||*[style]|to lead your allies from safety.=Зруйнуйте ями піґлінів і вежі з вогняними прутами|[newline]|Використовуйте|*[style.bold]|круглякових големів|+[key.item.stoneSpawner]||*[style]|, щоб руйнувати споруди|[newline]|Обов’язково використовуйте|*[style.bold]|стягове подання|$[key.advancedDirect]||*[style]|, щоб очолювати союзників з безпечного місця.",
//     "In order to build frost, stun or blast towers, you must first build the|*[style.bold]|Improvement: Build Power Towers|+[key.item.unlock_host_towers]||*[style]|. Towers also require either|+[key.item.diamond]|,|+[key.item.redstone]|, or|+[key.item.coal]|resources to build them.=Щоб побудувати морозні, оглушувальні або артилерійські вежі, необхідно спочатку побудувати|*[style.bold]|удосконалення: будівництво силових веж|+[key.item.unlock_host_towers]||*[style]|. Для їх будівництва також потрібні такі ресурси, як|+[key.item.diamond]|,|+[key.item.redstone]|або|+[key.item.coal]|.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Gather Iron grants additional storage capacity, but you need at least one to gather iron and collect it from chests. Setting this to a higher value removes the need to construct additional improvements.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Збирання заліза» дає додаткове місце для зберігання, але потрібне принаймні одне, щоб збирати залізо та діставати його зі скринь. Якщо встановити більше значення, зникає потреба у додаткових удосконаленнях.",
//     "The amount of build allays players start the game with. This setting cannot be changed once the world has been generated.|[space]|Build allays are required to construct buildings. The more you have, the more you can build at a time. This can replace the need for the Improvement: Abundant Allays.=Кількість служок-будівників, із якою починають гру гравці. У згенерованому світі цей параметр змінювати не можна.|[space]|Служки-будівники потрібні для будівництва. Чим більше ви їх маєте, тим більше ви можете побудувати за раз. Це може замінити потребу в удосконаленні: купа служок.",
//     "The First of Stone uses their great strength to fling large boulders at piglins. To assemble the Firsts, you must build a special improvement at the Well of Fate and collect the required resources. When a First is defeated, they will meet you at the nearest village fountain or beacon.=Перший із каменю використовує свою силу, жбурляючи великими валунами по піґлінах. Щоб зібрати Перших, необхідно побудувати спеціальне удосконалення біля колодязю долі й зібрати необхідні ресурси. Якщо Першого перемогли, ви зможете зустріти його біля найближчого сільського фонтану або маяка.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement grants the carpenter hut improved regeneration to nearby structures in addition to increasing construction speed. Without it, you will be unable to speed up construction and carpenter huts are less effective.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення покращує здатність теслярні до відновлення сусідніх споруд, а також збільшує швидкість будівництва. Без нього ви не зможете прискорити будівництво, а теслярні будуть менш ефективними.",
//     "The First of Oak’s powerful cannon can launch booming ranged attacks against the piglins. To assemble the Firsts, you must build a special improvement at the Well of Fate and collect the required resources. When a First is defeated, they will meet you at the nearest village fountain or beacon.=З потужної гармати Першого з дуба можна здалеку обстрілювати піґлінів. Щоб зібрати Перших, необхідно побудувати спеціальне вдосконалення біля колодязю долі й зібрати необхідні ресурси. Якщо Першого перемогли, ви зможете зустріти його біля найближчого сільського фонтану або маяка.",
//     "|[divider]|Most common resources: Coal|+[key.item.coal]|and Iron|+[key.item.iron]|and Wood|+[key.item.wood]| |[divider]| A lush landscape of open plains and low hills filled with snaking rivers and abundant plant life. The meadow is a good place to find iron, wood, and coal.=|[divider]|Найпоширеніші ресурси: вугілля,|+[key.item.coal]|залізо|+[key.item.iron]|та деревина|+[key.item.wood]| |[divider]| Розкішна місцевість просторих рівнин і невисоких пагорбів, вкритих звивистими ріками й багатою рослинністю. Луг — це те місце, де можна знайти залізо, деревину та вугілля.",
//     "Building mob spawners will allow you to spawn mobs and build an army to attack piglin positions. Each spawner is found on the|*[style.bold]|spawners hotbar|+[key.item.hotbar2]||*[style]|. Hold|$[key.bsharpInteract]|while next to the spawner to spawn mobs.=Будівництво генераторів мобів дозволить вам призивати мобів і створити армію, щоб атакувати позиції піґлінів. Кожен генератор знаходиться на|*[style.bold]|панелі швидкого доступу до генераторів|+[key.item.hotbar2]||*[style]|. Для призову мобів утримуйте|$[key.bsharpInteract]|, коли перебуваєте поруч із генератором.",
//     "Lava Coils are a marvel of piglin engineering. They generate immense amounts of heat that then gets redirected onto the portals, shielding them from any damage.|[space]|In order to be able to destroy the portal, you'll have to find and destroy all lava coils in any base that has them.=Лавові котушки — це диво піґлінського машинобудування. Вони генерують величезну кількість тепла, яке потім перенаправляється на портали, захищаючи їх від будь-якої шкоди.|[space]|Щоб зруйнувати портал, вам доведеться знайти та знищити всі лавові котушки на будь-якій базі, яка їх має.",
//     "|[divider]|Most common resources: Iron |+[key.item.iron]|and Stone |+[key.item.stone]| and Wood |+[key.item.wood]| |[divider]| A landscape of sturdy, richly colored trees, winding streams and bubbling mud puddles. The mighty forests are a good source for wood, iron, and coal.=|[divider]|Найпоширеніші ресурси: залізо |+[key.item.iron]|, камінь |+[key.item.stone]| і деревина |+[key.item.wood]| |[divider]| На цій землі ростуть могутні дерева насичених кольорів, звивисто течуть струмки і бурлять болота. Могутні ліси — місцина, багата на деревину, залізо та вугілля.",
//     "Iron unlocks advanced structures and can be used to spawn|*[style.bold]|grindstone golems|+[key.item.cavalryGolemSpawner]||*[style]|and|*[style.bold]|mossy golems|+[key.item.supportGolemSpawner]||*[style]|.|[space]|Iron deposits can be found in the fatelands, forest and dry savanna.=Залізо дає змогу будувати удосконалені споруди і призивати|*[style.bold]|точильних|+[key.item.cavalryGolemSpawner]||*[style]| і|*[style.bold]|замшілих големів|+[key.item.supportGolemSpawner]||*[style]|.|[space]|Родовища заліза можна знайти в доленосних землях, лісі та сухій савані.",
//     "Enables an aura that makes your HQ and the structures around it invulnerable to damage for the selected period of time. Once it expires, they will take damage as normal.|[space]|Use this if you want to prevent rushing and gain some safe space to build up your defenses and army.=Створює ауру, яка робить ваш штаб і споруди навколо нього невразливими до пошкоджень протягом вибраного періоду. Після цього вони отримуватимуть пошкодження у звичайному режимі.|[space]|Використовуйте це, якщо хочете уникнути поспіху й отримати час на безпечну побудову оборони й армії.",
//     "Allays are required to build structures and gather resources. This upgrade increases both of your|*[style.bold]|gather allays|+[key.item.gatherAllay]||*[style]|&|*[style.bold]|build allays|+[key.item.buildAllay]||*[style]|which allows you to construct and resource more quickly.=Служки зобов’язані будувати споруди та збирати ресурси. Ця модернізація збільшує у вас кількість як|*[style.bold]|служок-збирачів|+[key.item.gatherAllay]||*[style]|, так і|*[style.bold]|служок-будівників|+[key.item.buildAllay]||*[style]|, що дозволяє швидше будувати та збирати ресурси.",
//     "The First of Diorite spawns other golems to fight by your side. To assemble the Firsts, you must build a special improvement at the Well of Fate and collect the required resources. When a First is defeated, they will meet you at the nearest village fountain or beacon.=Перший із діориту породжує інших големів, які потім можуть битися на вашому боці. Щоби збирати Перших, необхідно побудувати спеціальне удосконалення біля колодязю долі й зібрати необхідні ресурси. Якщо Першого перемогли, ви зможете знайти його біля найближчого сільського фонтану або маяка.",
//     "Spawns skeletons|+[key.item.skeletonSpawner]|, ranged mobs that are capable of shooting over walls|+[key.item.wall]|, but are susceptible to melee attacks. Costs|*[style.bold]|diamond|+[key.item.diamond]||*[style]|&|*[style.bold]|lapis|+[key.item.lapis]||*[style]|to build.=Призиває скелетів|+[key.item.skeletonSpawner]|— мобів дальнього бою, які здатні стріляти вище стін|+[key.item.wall]|, але вразливі до атак ближнього бою. Для будівництва потрібні |*[style.bold]|алмази|+[key.item.diamond]||*[style]|та|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Redstone launchers destroy structures from afar. Without them, you'll have to get up close to destroy your enemy. If these and stairs are turned off you will be unable to destory most Horde of the Spore bases.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Редстоуномети руйнують споруди здалеку. Без них вам доведеться підійти впритул, щоби знищити ворога. Якщо редстоуномети зі сходами вимкнені, ви не зможете знищити більшість баз орди отруйників.",
//     "Utility upgrade to the masonry, increasing the speed at which it converts structures and enhancing the auras of the masonry,|*[style.bold]|carpenter hut|*[style]|,|*[style.bold]|battle drum|*[style]|,|*[style.bold]|kaboomery|*[style]|and|*[style.bold]|spyglass overlook|*[style]|=Корисна модернізація каменярні, яка збільшує швидкість, з якою та перетворює споруди та посилює ауру каменярні, |*[style.bold]|теслярні|*[style]|, |*[style.bold]|бойового барабана|*[style]|, |*[style.bold]|вибухів'ярні|*[style]| та |*[style.bold]|підзорної труби|*[style]|",
//     "Charge and Focus Target: Charge tells mobs to rush forward, attacking any enemy they encounter. Focus Target sends them directly to a location or target enemy. Pressing either button sends one mob, Holding either button sends all mobs.=Атака та фокусування цілі: атака — це наказ мобам кинутися вперед, атакуючи будь-яку ціль, яку вони зустрінуть. Фокусування цілі відправляє їх прямо до якогось місця або вибраного ворога. Якщо натиснути якусь із цих кнопок, ви відправите лише одного моба; якщо ж утримувати кнопку, переміщуватися почнуть усі моби.",
//     "A powerful upgrade that improves your capability to spawn large armies of|*[style.paperBold]|grindstone golems|+[key.item.cavalryGolemSpawner]||*[style]|or|*[style.paperBold]|mossy golems|+[key.item.supportGolemSpawner]||*[style]|and build structures that cost iron.=Потужна модернізація, яке покращує вашу здатність створювати великі армії|*[style.paperBold]|точильних големів|+[key.item.cavalryGolemSpawner]||*[style]|або|*[style.paperBold]|замшілих големів|+[key.item.supportGolemSpawner]||*[style]|і будувати споруди, для яких потрібне залізо.",
//     "|+[key.item.errorMessageBuild]|Must be in zones:|*[style.bold]|%1$s|+[buildables.zone.%2$s]||*[style]|&|*[style.bold]|%3$s|+[buildables.zone.%4$s]||*[style]|&|*[style.bold]|%5$s|+[buildables.zone.%6$s]||*[style]|&|*[style.bold]|%7$s|+[buildables.zone.%8$s]||*[style]|=|+[key.item.errorMessageBuild]| Повинні бути в зонах: |*[style.bold]|%1$s|+[buildables.zone.%2$s]||*[style]|, |*[style.bold]|%3$s|+[buildables.zone.%4$s]||*[style]|, |*[style.bold]|%5$s|+[buildables.zone.%6$s]||*[style]| та |*[style.bold]|%7$s|+[buildables.zone.%8$s]||*[style]|",
//     "|[divider]|Most common resources: Redstone |+[key.item.redstone]| and Wood |+[key.item.wood]| |[divider]| A dense and vibrant place filled with high-canopied trees, bouncecaps and poison vine. The jungle is good source for wood and redstone.=|[divider]|Найпоширеніші ресурси: редстоун |+[key.item.redstone]| і деревина |+[key.item.wood]| |[divider]| Наповнена бурхливою енергетикою місцина, де під куполом, сплетеним густими кронами високих дерев й обвитим отруйними ліанами, гасають невгамовні стрибуни. Джунглі багаті на деревину та редстоун.",
//     "Allay chests contain rare resources like wood, iron, coal, redstone, and diamond.|[space]|When the piglins arrived, the allays harvested the Overworld's resources to safely store them in these chests that only they can open. Not that the piglins haven’t tried.=Скрині служок містять рідкісні ресурси, такі як деревина, залізо, вугілля, редстоун та алмази.|[space]|Коли прийшли піґліни, служки зібрали ресурси Верхнього світу, щоб безпечно зберігати їх у цих скринях, які можуть відкрити тільки вони. Звісно, піґліни теж намагалися їх відкрити.",
//     "Increases the amount of|*[style.bold]|Flames of Creation|+[key.item.allegianceFlame]||*[style]|for your team by|*[style.bold]|+20|*[style]|. Teams can only have 3 of these structures built at any given time with a|*[style.bold]|total mob cap of 100|*[style]|.=Збільшує кількість|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|для вашої команди на|*[style.bold]|+20|*[style]|. Команди можуть мати лише три з цих споруд, побудованих у будь-який момент часу, із|*[style.bold]|загальним лімітом мобів, рівним 100|*[style]|.",
//     "The Quick Build slot on your Hotbar can be filled with any melody in your Songbook. Highlight the melody you want, then press Quickbuild|$[key.customizeQuickBuild]|to place into your Quick Build slot. Only one melody can be in your Quick Build slot.=У слот швидкого будівництва на панелі швидкого доступу можна додати будь-яку мелодію з пісенника. Виберіть мелодію і натисніть «Швидке будівництво»|$[key.customizeQuickBuild]|, щоб перенести її у свій слот швидкого будівництва. Зверніть увагу, що в цьому слоті може бути тільки одна мелодія.",
//     "The number of mobs such as creepers, skeletons and zombies you'll find roaming around the Overworld. These are not mobs associated with homesteads or that players have spawned. Setting to 100% may affect performance.|[space]|Existing difficulties are set to:|[newline]|Storied =Кількість мобів, таких як кріпери, скелети та зомбі, що бродять по Верхньому світу. Це не моби, пов’язані із садибами або генеровані гравцями. Значення 100% може вплинути на продуктивність.|[space]|Наявні рівні складності мають такі значення:|[newline]|Сюжетний ",
//     "A powerful upgrade that improves your capability to sustain armies of|*[style.paperBold]|grindstone golems|+[key.item.cavalryGolemSpawner]||*[style]|or|*[style.paperBold]|mossy golems|+[key.item.supportGolemSpawner]||*[style]|or build structures that cost iron.=Потужна модернізація, яка покращує вашу здатність утримувати армії|*[style.paperBold]|точильних големів|+[key.item.cavalryGolemSpawner]||*[style]|або|*[style.paperBold]|замшілих големів|+[key.item.supportGolemSpawner]||*[style]|або будувати споруди, для яких потрібне залізо.",
//     "In your map, use|$[key.mapMovement]|to select the area where you want to place a|*[style.bold]|map marker|+[key.item.mapMarker]||*[style]|. Press|$[key.mapMarker]|to place a marker. Press|$[key.mapMarker]|again while highlighting the marker to remove it.=На карті використовуйте|$[key.mapMovement]|для виділення області, в якій потрібно розмістити|*[style.bold]|маркер карти|+[key.item.mapMarker]||*[style]|. Натисніть|$[key.mapMarker]|, щоб розмістити маркер. Натисніть|$[key.mapMarker]|при виділеному маркері ще раз, щоб видалити його.",
//     "If you are already using an existing Microsoft Account to access other Minecraft products on other devices, you may wish to use that account. You can only do this once per account on “PlayStation™Network”, so please choose your Microsoft Account carefully.=Якщо ви вже використовуєте наявний обліковий запис Microsoft для гри в Minecraft на іншому пристрої, можливо, ви схочете застосувати цей обліковий запис. Для облікового запису \"PlayStation™Network\" це можна зробити лише один раз, тому уважно обирайте обліковий запис Microsoft.",
//     "The number of buffs spread around the Overworld. Buffs include: speed wheat, bouncecaps and regeneration stones. The more of these there are, the quicker and more easily you'll be able to navigate the world. This setting cannot be changed once the world has been generated.=Кількість підсилень, розповсюджених по Верхньому світу. До підсилень відносяться швидка пшениця, гриби-стрибовики та каміння відновлення. Чим їх більше, тим швидше й легше ви зможете переміщуватися в світі. У згенерованому світі цей показник змінювати не можна.",
//     "To build a cobblestone golem|+[key.item.stoneSpawner]|, ensure you have a single|*[style.bold]|Flame of Creation|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|stone|+[key.item.stone]||*[style]|, and|*[style.bold]|lapis|+[key.item.lapis]||*[style]|.=Якщо ви хочете побудувати круглякового голема|+[key.item.stoneSpawner]|, переконайтеся, що ви маєте одне|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|камінь|+[key.item.stone]||*[style]|і|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "You cannot build power towers without this upgrade.|[space]|Power towers will require either|*[style.bold]|diamond|+[key.item.diamond]||*[style]|,|*[style.bold]|redstone|+[key.item.redstone]||*[style]|, or|*[style.bold]|coal|+[key.item.coal]||*[style]|when you build them.=Ви не можете будувати силові вежі без цієї модернізації.|[space]|Для будівництва силових веж потрібни|*[style.bold]|алмази|+[key.item.diamond]||*[style]|,|*[style.bold]|редстоун|+[key.item.redstone]||*[style]|чи|*[style.bold]|вугілля|+[key.item.coal]||*[style]|.",
//     "Destroy the piglin pits in order to destroy the outpost. Your|*[style.bold]|Cobblestone golems|+[key.item.stoneSpawner]||*[style]|are well equipped to do this|[newline]|Use|*[style.bold]|bannerview|$[key.advancedDirect]||*[style]|to lead your allies from safety.=Зруйнуйте ями піґлінів, щоб знищити заставу. |*[style.bold]|Круглякові големи|+[key.item.stoneSpawner]||*[style]|добре споряджені для цього.|[newline]||*[style.bold]|Режим перегляду стягів|$[key.advancedDirect]||*[style]| дає змогу керувати союзниками з безпечного місця.",
//     "Gather resources|+[key.item.wood]||+[key.item.stone]||[space]|Build defenses|+[key.item.wall]||+[key.item.arrowTower]|and upgrades|+[key.item.unlock_prismarine_upgrades]||+[key.item.unlock_redstone_tech]||[space]|Destroy the Enemy Base|+[key.item.headquarter]|=Зберіть ресурси|+[key.item.wood]||+[key.item.stone]||[space]|Побудуйте оборонні споруди|+[key.item.wall]||+[key.item.arrowTower]|та модернізації|+[key.item.unlock_prismarine_upgrades]||+[key.item.unlock_redstone_tech]||[space]|Зруйнуйте ворожу базу|+[key.item.headquarter]|",
//     "Spawns grindstone golems|+[key.item.cavalryGolemSpawner]|, fast-charging disruptors that stun enemies. Very effective against ranged mobs. Costs|*[style.bold]|iron|+[key.item.iron]||*[style]|&|*[style.bold]|lapis|+[key.item.lapis]||*[style]|to build.=Призиває точильних големів|+[key.item.cavalryGolemSpawner]|— швидких руйнівників, які приголомшують ворогів. Вони дуже ефективні проти мобів дальнього бою. Потребує|*[style.bold]|заліза|+[key.item.iron]||*[style]|та|*[style.bold]|лазуриту|+[key.item.lapis]||*[style]|для будівництва.",
//     "The|*[style.bold]|piglins|+[key.item.piglin]||*[style]|make plans during the day and execute those actions at night. Keep an eye on your|*[style.bold]|map|+[key.item.map]||*[style]||$[key.mapScreen]|to see what they're up to and listen to any warnings from the Hosts.=|*[style.bold]|Піґліни|+[key.item.piglin]||*[style]|планують вдень, а діють уночі. Поглядайте на свою|*[style.bold]|карту світу|+[key.item.map]||*[style]||$[key.mapScreen]|, щоб слідкувати за їхніми діями, та прислухайтеся до будь-яких попереджень з боку Хранителів.",
//     "The First of Brick's shields will protect your allies in battle. To assemble the Firsts, you must build a special improvement at the Well of Fate and collect the required resources. When a First is defeated, they will meet you at the nearest village fountain or beacon.=Щит Першого з цегли захистить ваших союзників у бою. Щоби зібрати Перших, необхідно побудувати спеціальне удосконалення біля колодязю долі й зібрати необхідні ресурси. Якщо Першого перемогли, ви зможете зустріти його біля найближчого сільського фонтану або маяка.",
//     "You will find|*[style.bold]|piglins|+[key.item.piglin]||*[style]|roaming around the world at night, looking for|*[style.bold]|Villages|+[key.item.village]||*[style]|to attack. They may use this time to improve their bases at night. Make sure you fight them back and keep an eye on them.=Вночі|*[style.bold]|піґліни|+[key.item.piglin]||*[style]|вештаються по світу, шукаючи|*[style.bold]|села|+[key.item.village]||*[style]|, на які можна напасти. Вночі вони можуть модернізувати свої бази. Давайте їм відсіч і стежте за їхніми діями.",
//     "|[divider]|Most common resources: Diamond |+[key.item.diamond]|and Wood |+[key.item.wood]| |[divider]| A frigid and contrasting landscape peppered with large, sweeping ice waves, and sunken hot springs. The frozen tundra is an excellent source for wood and diamond.=|[divider]|Найпоширеніші ресурси: алмаз |+[key.item.diamond]|і деревина |+[key.item.wood]| |[divider]| Холодний і контрастний край, густо встелений великими, розмашистими крижаними виступами хвилястої форми й гейзерами. Замерзла тундра багата на деревину й алмази.",
//     "When you die you will be returned to full health at the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]|, or your last visited|*[style.bold]|village|+[key.item.village]||*[style]|, or|*[style.bold]|wellhouse|+[key.item.headquarter]||*[style]|.=Після смерті ваше здоров’я буде повністю відновлено біля|*[style.bold]|колодязя долі|+[key.item.wellOfFate]||*[style]|, або в останньому відвіданому вами|*[style.bold]|селі|+[key.item.village]||*[style]|, або в|*[style.bold]|домі-колодязі|+[key.item.headquarter]||*[style]|.",
//     "Enables gather allays to collect redstone passively. Each additional improvement adds:|[newline]||*[style.paperBold]|+150 max redstone|+[key.item.redstone]||*[style]||[newline]||*[style.paperBold]|+15 redstone|+[key.item.redstone]| per minute|*[style]|=Дає можливість служкам-збирачам пасивно збирати редстоун. Кожне додаткове удосконалення додає:|[newline]||*[style.paperBold]|Максимум +150 од. редстоуну|+[key.item.redstone]||*[style]||[newline]||*[style.paperBold]|+15 од. редстоуну|+[key.item.redstone]| на хвилину|*[style]|",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Coal is used to spawn creepers and in the construction of advanced structures like the scatter tower, protector tower, kaboomery and stun tower.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Вугілля використовується для призову кріперів і будівництва вдосконалених споруд, як-от розкидна вежа, захисна вежа, вибухів’ярня та оглушувальна вежа.",
//     "|*[style.bold]|Quick Direct|+[key.item.heroDirect]||*[style]|is an ability that works on any friendly mob around you to send them marching forward. Press|$[key.heroDirect]|to direct nearby mobs to go in the direction you're facing.=|*[style.bold]|Швидке спрямування|+[key.item.heroDirect]||*[style]|— це здібність, яка діє на будь-якого дружнього моба поруч із вами та дозволяє відправити його вперед. Натисніть|$[key.heroDirect]|, щоб спрямувати мобів поблизу, віддавши їм команду рухатися в напрямку, в якому ви дивитеся.",
//     "|[divider]|Most common resources: Diamond |+[key.item.diamond]| and Stone |+[key.item.stone]|. |[divider]| An undulating rhythm of high craggy peaks and deep valleys. The jagged peaks are an excellent source for stone and, near the peaks, diamond.=|[divider]|Найпоширеніші ресурси: алмаз |+[key.item.diamond]| і камінь |+[key.item.stone]|. |[divider]| Височезні скелясті вершини і глибокі долини чергуються у хвилеподібному ритмі. Зубчасті піки багаті на камінь й алмази, що знаходяться при самісіньких гірських верхівках.",
//     "There is a limit to the number of structures that can be built by each team in the world. Before building more, your team should consider removing existing structures. Walk near a structure and hold|$[key.deconstruct]|to deconstruct it and regain their resources.=Існує обмеження на кількість споруд, які кожна команда може побудувати в світі. Перш ніж будувати ще, вашій команді слід подумати про видалення існуючих споруд. Підійдіть до споруди й утримуйте|$[key.deconstruct]|, щоб розібрати її та повернути свої ресурси.",
//     "The overall and initial strength of piglin attacks against villages, mob homesteads and wellhouses. The attacks naturally ramp up over time and stronger attacks feature higher tier piglins in larger quantities.|[space]|Existing difficulties are set to:|[newline]|Storied =Загальна й початкова сила нападів піґлінів на села, садиби мобів та криниці. Напади закономірно посилюються з часом, і в сильніших нападах беруть участь піґліни вищого рівня й більшої чисельності.|[space]|Наявні рівні складності:|[newline]|Сюжетний ",
//     "While in banner view, use|$[key.typeSelectNavigation]|to select the type of mob. Selected mob type will affect all banner view commands. Select|*[style.bold]|all mob types|+[key.item.typeSelectDown]||*[style]|to return to the default.=У режимі перегляду стягів використовуйте|$[key.typeSelectNavigation]|, щоб вибрати тип мобів. Вибраний тип мобів вплине на всі команди в режимі перегляду стягів. Виберіть|*[style.bold]|усі типи мобів|+[key.item.typeSelectDown]||*[style]|, щоб повернутися до параметрів за замовчуванням.",
//     "|[divider]|Most common resources: Iron |+[key.item.iron]|and Stone |+[key.item.stone]||[divider]| An arid landscape of dried grass, stone outcrops and small watering holes decorated with strange coral plants. The dry savanna is a good source for stone and iron.=|[divider]|Найпоширеніші ресурси: залізо |+[key.item.iron]|й камінь |+[key.item.stone]||[divider]| Посушливий ландшафт із сухої трави, кам'янистих виходів і джерел, прикрашених химерними кораловими рослинами. Суха савана багата на поклади каменю й заліза.",
//     "If the piglins destroy a|*[style.bold]|village fountain|+[key.item.village]||*[style]|, they will occupy that village. You can clear the occupation by defeating the and repairing the fountain with a|*[style.bold]|carpenter hut|+[key.item.carpenter]||*[style]|.=Якщо піґліни зруйнують|*[style.bold]|сільський фонтан|+[key.item.village]||*[style]|, вони зможуть захопити це село. Ви можете звільнити його, здобувши перемогу та відремонтувавши фонтан за допомогою|*[style.bold]|теслярні|+[key.item.carpenter]||*[style]|.",
//     "|*[style.bold]|Lapis|+[key.item.lapis]||*[style]|is used for spawning mobs. In Versus Mode, your base will automatically start generating lapis shortly after the match begins. Fighting|*[style.bold]|piglins|+[key.item.piglin]||*[style]|will also earn lapis.=|*[style.bold]|Лазурит|+[key.item.lapis]||*[style]|потрібен для призову мобів. У режимі суперництва ваша база почне автоматично генерувати лазурит невдовзі після початку гри. Бої з|*[style.bold]|піґлінами|+[key.item.piglin]||*[style]|також приносять лазурит.",
//     "Redstone is a rare resource found in small deposits around the Overworld and collected in village chests. It’s required to build the redstone launcher and the battle drums.|[space]|Don't worry, the allays will do all the redstone engineering for you.=Редстоун — рідкісний ресурс, який можна знайти в невеликих родовищах Верхнього світу або в сільських скринях. Він потрібен для створення редстоуномета та бойових барабанів.|[space]|Не хвилюйтеся, служки зроблять за вас усе проектування, яке стосується редстоуну.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure buffs nearby mobs, increasing their damage and adding a bit of knockback to their attacks.  Without it, you may find your army lacks a late game power boost.=Коли вимкнено, цю споруду не можуть збудувати персонажі гравців.|[space]|Ця споруда підсилює сусідніх мобів, збільшуючи шкоду від них і додаючи трохи відкидання до їхніх атак. Без неї ви можете помітити, що вашій армії бракує посилення потужності наприкінці гри.",
//     "When rung, the stun tower’s bell emits a sound that stops the piglins in their tracks. To collect these mysterious towers, you must build a special improvement.|[space]|Those chimes sure sound lovely... Makes you wonder what their original purpose was.=Дзвін оглушувальної вежі видає звук, який зупиняє піґлінів на їхньому шляху. Щоб зібрати ці загадкові вежі, ви маєте побудувати спеціальне удосконалення.|[space]|Ці дзвони звучать просто чудово... і це змушує замислитися, яким було їхнє початкове призначення.",
//     "Spawns zombies|+[key.item.zombieSpawner]|, melee mobs that are resistant to debuffs, but are susceptible to ranged attacks. Costs|*[style.bold]|redstone|+[key.item.redstone]||*[style]|&|*[style.bold]|lapis|+[key.item.lapis]||*[style]|to build.=Призиває зомбі|+[key.item.zombieSpawner]|— мобів ближнього бою, які стійкі до негативних ефектів, але вразливі до атак дальнього бою. Для будівництва потрібні|*[style.bold]|редстоун|+[key.item.redstone]||*[style]|і|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "To build a plank golem|+[key.item.woodSpawner]|, ensure you have a single|*[style.bold]|Flame of Creation|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|wood|+[key.item.wood]||*[style]|, and|*[style.bold]|lapis|+[key.item.lapis]||*[style]|.=Щоб побудувати дощатого голема|+[key.item.woodSpawner]|, переконайтеся, що у вас є одне|*[style.bold]|полум’я творення|+[key.item.allegianceFlame]||*[style]|,|*[style.bold]|дерево|+[key.item.wood]||*[style]|та|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "|*[style.bold]|Rally|+[key.item.heroRally]||*[style]|is an instant command that asks friendly mobs to follow you. Press|$[key.heroLure]|to rally nearby mobs to follow you. Hold|$[key.heroLure]|to tell mobs to stop following you.=|*[style.bold]|Скликати|+[key.item.heroRally]||*[style]|— це миттєва команда, за допомогою якої можна попросити дружніх мобів слідувати за вами. Натисніть|$[key.heroLure]|, щоб скликати мобів поруч і попросити їх слідувати за вами. Утримуйте|$[key.heroLure]|, щоб скасувати наказ.",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Redstone is used to spawn zombies and in the construction of advanced structures like the redstone launcher, battle drum and blast tower.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Редстоун використовується для призову зомбі й у будівництві просунутих споруд, таких як редстоуномет, бойовий барабан і артилерійська вежа.",
//     "Enables gather allays to collect diamond passively. Each additional improvement adds:|[newline]||*[style.paperBold]|+150 max diamond|+[key.item.diamond]||*[style]||[newline]||*[style.paperBold]|+15 diamond|+[key.item.diamond]| per minute|*[style]|=Дає можливість служкам-збирачам пасивно збирати алмази. Кожне додаткове удосконалення додає:|[newline]||*[style.paperBold]|Максимум +150 алмазів|+[key.item.diamond]||*[style]||[newline]||*[style.paperBold]|+15 алмазів|+[key.item.diamond]| на хвилину|*[style]|",
//     "Destroying piglin structures causes them to drop|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|. This resource is used to build Improvement Structures around an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|.=На руїнах споруд піґлінів з’являється|*[style.bold]|призмарин|+[key.item.prismarine]||*[style]|. Цей ресурс використовується для будівництва споруд покращення навколо|*[style.bold]|Центру вдосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "We're unable to connect to the Marketplace to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Reconnect to the internet and download the template to continue.=Не вдалося підключитися до Ринку, щоб завантажити шаблон, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, повторно підключіться до Інтернету та завантажте шаблон.",
//     "Unlocks the ability to gather redstone and increases the cap by|*[style.bold]|+125 redstone|+[key.item.redstone]||*[style]|with each structure built. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Відкриває можливість збирати редстоун і збільшує ліміт на|*[style.bold]|+125 одиниць редстоуну|+[key.item.redstone]||*[style]|з кожною побудованою спорудою. Потрібний |*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "Stone is essential for many structures. Make sure you keep your allay storage filled with stone.  To hold more stone, build one or more|*[style.bold]|Improvement: Allay Storage|+[key.item.allayStorage]||*[style]|at the Well of Fate.=Камінь необхідний для будівництва багатьох споруд, тому не забувайте поповнювати його запаси у сховищі служок. Якщо хочете зберігати більше каменю, побудуйте одне або кілька|*[style.bold]|удосконалень: сховищ служок|+[key.item.allayStorage]||*[style]|біля колодязя долі.",
//     "The number of hazards spread around the Overworld. Hazards include: redthorn, poison vines, tar pits and mud puddles. The more of these there are, the harder it will be to navigate the world. This setting cannot be changed once the world has been generated.=Кількість небезпек, розповсюджених по Верхньому світу. До небезпек належать червонотерник, отруйні ліани, смоляні ями та грязьові калюжі. Що їх більше, то важче буде переміщуватися у світі. У згенерованому світі цей показник змінювати не можна.",
//     "|*[style.bold]|Wellhouses|+[key.item.headquarter]||*[style]|are powerful structures that can be fast traveled to, just like villages. They also act as respawn points if you die near them. Make sure to defend them as piglins will attack them!=|*[style.bold]|Колодязі|+[key.item.headquarter]||*[style]|— це потужні споруди, до яких, як і до сел, можливе швидке переміщення. Вони також дають змогу воскреснути, якщо ви загинете поруч із ними. Обов’язково захищайте їх, тому що піґліни будуть їх атакувати!",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Diamond is used to spawn skeletons and in the construction of advanced structures like the ice trap, spyglass overlook and frost tower.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Алмази використовуються для призову скелетів і будівництва вдосконалених споруд, як-от крижана пастка, підзорна труба та морозна вежа.",
//     "Wood is essential for many structures. Make sure you keep your allay storage filled with wood. To hold more wood, build one or more|*[style.bold]|Improvement: Allay Storage|+[key.item.allayStorage]||*[style]|at the Well of Fate.=Деревина необхідна для будівництва багатьох споруд, тому не забувайте поповнювати її запаси у сховищі служок. Якщо хочете зберігати більше деревини, побудуйте одне або кілька|*[style.bold]|удосконалень: сховищ служок|+[key.item.allayStorage]||*[style]|біля колодязя долі.",
//     "Legendary. Recommended for one or more expert players seeking a greater challenge. Larger world size with more piglin bases. Enemy units are more resilient. Resources are much more scarce. Piglin attacks are stronger and more frequent.=Легендарний. Рекомендується для одного або декількох гравців-експертів, які шукають більшої складності. Більший розмір світу з більшою кількістю баз піґлінів. Ворожі підрозділи більш витривалі. Ресурси набагато більш дефіцитні. Напади піґлінів сильніші і частіші.",
//     "Build in your base zone to gain more|*[style.bold]|lapis|+[key.item.lapis]||*[style]|over time. Building more lapis flags|+[key.item.lapisFlag]|will increase the amount of|*[style.bold]|lapis|+[key.item.lapis]||*[style]|from your Base.=Побудуйте цю споруду в зоні бази, щоб отримувати більше|*[style.bold]|лазуриту|+[key.item.lapis]||*[style]|. Чим більше лазуритових прапорів|+[key.item.lapisFlag]|ви встановите, тим більше|*[style.bold]|лазуриту|+[key.item.lapis]||*[style]|генеруватиме ваша база.",
//     "Powerful golem that spawns mobs to fight its enemies.|[divider]|Cannot be assembled while the Well of Fate is under assault!|[divider]|This ancient giant once carried the inhabitants of the Overworld across great distances to live in their new homes.=Потужний голем, який призиває мобів для боротьби зі своїми ворогами.|[divider]|Не можна зібрати, коли колодязь долі атакується|[divider]|Цей древній велетень колись перевозив жителів Верхнього світу на величезні відстані — до їхніх нових домівок.",
//     "Defeat the waves of attacking piglins|[space]|Check your compass to see which direction the piglins are attacking from|[newline]||*[style.bold]|Plank golems|+[key.item.woodSpawner]||*[style]|are strong against mace runts, make sure you spawn some.=Долайте піґлінів, які атакують хвилями|[space]|Щоб дізнатися, звідки вони нападають, погляньте на компас|[newline]||*[style.bold]|Дощаті големи|+[key.item.woodSpawner]||*[style]|добре протистоять коротунам із булавами, тому не забудьте їх створити.",
//     "Insufficient resources to interact with the First of Diorite. Requires: 225|*[style.bold]|lapis|+[key.item.lapis]||*[style]|, 250|*[style.bold]|stone|+[key.item.stone]||*[style]|, 15|*[style.bold]|redstone|+[key.item.redstone]||*[style]|.=Бракує ресурсів для взаємодії з Першим із діориту. Потрібно: 225 одиниць|*[style.bold]|лазурита|+[key.item.lapis]||*[style]|, 250 одиниць|*[style.bold]|каміння|+[key.item.stone]||*[style]|, 15 одиниць|*[style.bold]|редстоуну|+[key.item.redstone]||*[style]|.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure increases the rate of lapis that your team earns. Without it, you will have to farm a lot more piglins and may not be able to sustain a big army as easily.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда збільшує кількість лазуриту, який заробляє ваша команда. Без неї вам доведеться фармити набагато більше піґлінів, і ви не зможете так легко утримувати велику армію.",
//     "Enables gather allays to collect coal passively. Each additional improvement adds:|[newline]||*[style.paperBold]|+150 max coal|+[key.item.coal]||*[style]||[newline]||*[style.paperBold]|+15 coal|+[key.item.coal]| per minute|*[style]|=Дає можливість служкам-збирачам пасивно збирати вугілля. Кожне додаткове удосконалення додає:|[newline]||*[style.paperBold]|Максимум +150 од. вугілля|+[key.item.coal]||*[style]||[newline]||*[style.paperBold]|+15 од. вугілля|+[key.item.coal]| на хвилину|*[style]|",
//     "Changes how many mobs players can spawn at the start of the match. |[space]|Adjusting this will change the max number of Improvement: Flames of Allegiance you can construct, as there is a cap of 100 mobs per team for performance reasons.=Змінює кількість мобів, яких гравці можуть призвати на початку матчу. |[space]|Це налаштування змінює максимальну кількість удосконалень: полум’я лояльності, яку ви можете створити, оскільки з міркувань продуктивності існує обмеження 100 мобів на команду.",
//     "Controls the day-night cycle. By default, there is a natural day-night cycle that affects the strength of piglin attacks and whether they're found roaming the Overworld. Change this setting to night to increase their presence or to day to decrease it.=Контролює цикл день-ніч. За замовчуванням існує природний цикл день-ніч, який впливає на силу атак піґлінів і на те, чи блукають вони Верхнім світом. Змініть цей параметр на ніч, щоб збільшити їхню присутність, або на день, щоб зменшити її.",
//     "Insufficient resources to interact with the First of Brick. Requires: 225|*[style.bold]|lapis|+[key.item.lapis]||*[style]|, 250|*[style.bold]|stone|+[key.item.stone]||*[style]|, 15|*[style.bold]|redstone|+[key.item.redstone]||*[style]|.=Бракує ресурсів для взаємодії з Першим із цегли. Потрібно: 225 одиниць|*[style.bold]|лазурита|+[key.item.lapis]||*[style]|, 250 одиниць|*[style.bold]|каміння|+[key.item.stone]||*[style]|, 15 одиниць|*[style.bold]|редстоуну|+[key.item.redstone]||*[style]|.",
//     "Enables gather allays to collect iron passively. Each additional improvement adds:|[newline]||*[style.paperBold]|+150 max iron|+[key.item.iron]||*[style]||[newline]||*[style.paperBold]|+30 iron|+[key.item.iron]| per minute|*[style]|=Дає можливість служкам-збирачам пасивно збирати залізо. Кожне додаткове удосконалення додає:|[newline]||*[style.paperBold]|Максимум +150 од. заліза|+[key.item.iron]||*[style]||[newline]||*[style.paperBold]|+30 од. заліза|+[key.item.iron]| на хвилину|*[style]|",
//     "Destroy the piglin pits|[space]||$[key.heroLure]|Press to rally your golems to the piglins|[newline]||$[key.heroDirect]|Press to direct your golems to destroy the pits|[newline]||$[key.meleeAttack]|Press to attack piglins with your sword=Знищте піґліньскі ями|[space]||$[key.heroLure]|Натисніть, щоб відправити своїх големів до піґлінів|[newline]||$[key.heroDirect]| Натисніть, щоб направити своїх големів знищувати ями|[newline]||$[key.meleeAttack]|Натисніть, щоб атакувати піґлінів мечем",
//     "Unlocks the ability to gather diamond and increases the cap by|*[style.bold]|+125 diamond|+[key.item.diamond]||*[style]|with each structure built. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Відкриває можливість збирати алмази та збільшує ліміт на|*[style.bold]|+125 алмазів|+[key.item.diamond]||*[style]|із кожною побудованою спорудою. Потрібний|*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "While exploring the Overworld, press|$[key.mapScreen]|to see where you are on your|*[style.bold]|map|+[key.item.map]||*[style]|. Move the cursor with|$[key.mapMovement]|to highlight points of interest and learn more about them.=Досліджуючи Верхній світ, натисніть|$[key.mapScreen]|, щоб побачити, де ви знаходитесь на своїй|*[style.bold]|карті|+[key.item.map]||*[style]|. Переміщуйте курсор за допомогою|$[key.mapMovement]|для виділення цікавих для вас місць і дізнавайтеся про них більше.",
//     "In Versus Mode, you need to destroy your enemy's|*[style.bold]|Base|+[key.item.headquarter]||*[style]|to win. You cannot destroy it on your own. You need to use mobs and structures to bring down their defenses in the fight towards their base.=У режимі суперництва для перемоги над ворогом потрібно знищити його |*[style.bold]|базу|+[key.item.headquarter]||*[style]|. Зробити це самостійно неможливо. Руйнуйте оборону ворога за допомогою мобів і споруд, щоб розчистити шлях до ворожої бази.",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Iron is used to spawn grindstone and mossy golems. It is also used to spawn advanced structures like the masonry and wellhouse.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Залізо використовується для призову точильних і замшілих големів, а також удосконалених споруд, як-от каменярня та дім-колодязь.",
//     "Unlocks the ability to gather coal and increases the cap by|*[style.bold]|+125 coal|+[key.item.coal]||*[style]|with each structure built. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Розблоковує можливість збирати вугілля та збільшує ліміт на|*[style.bold]|+125 одиниць вугілля|+[key.item.coal]||*[style]|з кожною побудованою спорудою. Потрібний|*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Carpenter Huts repair nearby structures, without them it will be harder to sustain attacks. You'll also be unable to recapture villages or mob alliances that have become occupied.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Теслярні ремонтують навколишні споруди, а без них буде важче витримати атаки. Ви також не зможете відбити села або союзних мобів, які потрапили під окупацію.",
//     "Pick up the|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|found at destroyed piglin structures|[space]|Use it to build improvements at a|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|=Збирайте|*[style.bold]|призмарин|+[key.item.prismarine]||*[style]|, знайдений біля зруйнованих споруд піґлінів|[space]|Використовуйте його для будівництва удосконалень біля|*[style.bold]|центру удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement connects village chests together, allowing access to all of them from any village. Without it, you will need to go to each village to collect their resources.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення пов'язує скрині сіл, що надає доступ до кожної з них з будь-якого села. Без нього вам доведеться йти до кожного села, щоб зібрати їхні ресурси.",
//     "Spawns mossy golems|+[key.item.supportGolemSpawner]|, support mobs that clear debuffs and heal allied mobs. Costs|*[style.bold]|iron|+[key.item.iron]||*[style]|&|*[style.bold]|lapis|+[key.item.lapis]||*[style]|to build.=Призиває замшілих големів|+[key.item.supportGolemSpawner]|— мобів підтримки, які лікують і очищають союзних мобів від негативних ефектів. Для будівництва потрібні|*[style.bold]|залізо|+[key.item.iron]||*[style]|та|*[style.bold]|лазурит|+[key.item.lapis]||*[style]|.",
//     "Unlocks the ability to gather iron and increases the cap by|*[style.bold]|+125 iron|+[key.item.iron]||*[style]|with each structure built. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Відкриває можливість збирати залізо та збільшує ліміт на|*[style.bold]|+125 одиниць заліза|+[key.item.iron]||*[style]|з кожною побудованою спорудою. Потрібний|*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "We're unable to connect to the Store to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Reconnect to the internet and download the template to continue.=Не вдалося підключитися до Магазину, щоб завантажити шаблон, за яким створювався цей світ. Цей шаблон містив набір доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, повторно підключіться до Інтернету та завантажте шаблон.",
//     "We're unable to connect to the Store to download the template used to create this world. That template contained an Add-On pack that you need to continue playing this world. Reconnect to the internet and download the template to continue.=Не вдалося підключитися до Магазину, щоб завантажити шаблон, за яким створювався цей світ. Цей шаблон містив набір доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, повторно підключіться до Інтернету та завантажте шаблон.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Frost towers are special power towers that fire a projectile that slows enemies in an area. Without them, your late game defense may feel lacking.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Морозні вежі — це спеціальні силові вежі, які стріляють снарядами, що уповільнюють ворогів у області ураження. Без них ваша оборона може бути недостатньо ефективною на пізній стадії гри.",
//     "Improves your lure to let you rally more mobs with you at a time. Increases the amount of mobs you can lure by|*[style.bold]|+10|*[style]|. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Покращує вашу приманку, щоб скликати до вас більше мобів за раз. Збільшує кількість мобів, яких можна приманити, на|*[style.bold]|+10|*[style]|. Потрібний |*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "%1$s: Can someone build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|, %14$d|+[key.item.%13$s]|)|*[style]|?=%1$s: Чи може хтось збудувати таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|, %14$d|+[key.item.%13$s]|)|*[style]|?",
//     "Insufficient resources to interact with the First of Stone. Requires: 225|*[style.bold]|lapis|+[key.item.lapis]||*[style]|, 250|*[style.bold]|stone|+[key.item.stone]||*[style]|, 15|*[style.bold]|redstone|+[key.item.redstone]||*[style]|.=Бракує ресурсів для взаємодії з Першим із каменю. Потрібно: 225 од.|*[style.bold]|лазурита|+[key.item.lapis]||*[style]|, 250 од.|*[style.bold]|каменю|+[key.item.stone]||*[style]|, 15 од.|*[style.bold]|редстоуну|+[key.item.redstone]||*[style]|.",
//     "Like any other piglin, the Unbreakable is a power-hungry and arrogant opportunist who wouldn't hesitate to take the throne from the Great Hog. However, no other piglin is as cutthroat and relentless in their pursuit of the highest rank.=Як і будь-який інший піґлін, Незламний — це жадібний до влади і зарозумілий пристосуванець, який не вагаючись відібрав би трон у Великого кабана. Однак жоден інший піґлін не є таким невпинним і невблаганним у жадобі піднятися на вершину влади.",
//     "There is a limit to the number of structures that can be built in the world. Before building more, you should consider removing existing structures. Walk near a structure and hold|$[key.deconstruct]|to deconstruct it and regain their resources.=Існує обмеження на кількість споруд, які можна побудувати в світі. Перш ніж будувати ще, вам слід подумати про видалення існуючих споруд. Підійдіть до споруди й утримуйте|$[key.deconstruct]|, щоб розібрати її та повернути свої ресурси.",
//     "When enabled, arrow towers, scatter towers and redstone launchers will perform as if they have been buffed by a nearby spyglass overlook, battle drum, or kaboomery.|[space]|You will no longer receive a benefit for building those structures.=Якщо ввімкнено, стрілецькі вежі, розкидні вежі та редстоуномети працюватимуть так, ніби їх підсилює розташована неподалік підзорна труба, бойовий барабан або вибухів’ярня.|[space]|Ви більше не отримаєте переваги за будівництво цих споруд.",
//     "The seekers’ explosive mushrooms cause devastating damage to anyone within their range – including themselves.|[space]|There’s not much you can do once a seeker is ready to explode. But you can destroy the barracks to prevent more from spawning.=Вибухонебезпечні гриби-шукачі завдають нищівної шкоди всім поблизу, включаючи їх самих.|[space]|Якщо шукач збирається вибухнути, ви вже мало що встигнете зробити. Але можна зруйнувати казарму, щоб більше не допустити їх генерування.",
//     "While exploring the Overworld, press|$[key.mapScreen]|to see where you are on your|*[style.bold]|map|+[key.item.map]||*[style]|. Use the cursor by moving|$[key.mapMovement]|to highlight the enemy base and piglin outposts.=Натисніть|$[key.mapScreen]|,досліджуючи Верхній світ, щоб побачити, де ви знаходитеся на|*[style.bold]|карті|+[key.item.map]||*[style]|. Щоб вибрати ворожу базу та застави піґлінів, використовуйте курсор, переміщуючи карту за допомогою|$[key.mapMovement]|.",
//     "After listening to your feedback, the campaign’s prologue has been revisited! It is now fast flowing and action packed. We added objectives to the map in campaign, and many features to make it easier to find your way and plan your next moves.=На основні ваших відгуків пролог кампанії було переглянуто! Тепер він протікає швидко й насичений подіями. Додано цілі на карту в кампанії, а також інші функції, що полегшить орієнтування на місцевості та планування наступних кроків.",
