//     "|[divider]|Most common resources: Coal|+[key.item.coal]| |[divider]| A high desert plateau dominated by sticky tar pits, steep buttes and deep valleys filled with vibrant plant life. The badlands are a good place to get coal.=|[divider]|Найпоширеніші ресурси: вугілля|+[key.item.coal]| |[divider]| На пустельному нагір'ї банато липких смоляних ям, крутих схилів і глибоких долинам, де буяє рослинність. Пустище — це те місце, де можна дістати вугілля.",
