//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement grants the ability to rally additional mobs around you. Without it, you can only control smaller groups of mobs at any given time.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає вам здатність згуртувати навколо себе додаткових мобів. Без нього ви зможете одночасно керувати лише малими групами мобів.",
