//     "|[divider]|Most common resources: Redstone |+[key.item.redstone]| and Wood |+[key.item.wood]|. |[divider]| A lush swampland of mangroves, redthorn and mushroom trees. The swamp is a good source for wood and redstone.=|[divider]|Найпоширеніші ресурси: редстоун |+[key.item.redstone]| і деревина |+[key.item.wood]|. |[divider]| Болотиста місцевість, густо засаджена манграми, тереном і грибними деревами. Болото багате на деревину й редстоун.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Allay Storage grants additional storage capacity. Setting this to a higher value can remove the need to construct that improvement.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Сховище служки» розширює можливості зберігання. Встановлення більшого значення може усунути необхідність створення цього вдосконалення.",
