//     "Storied. Recommended for players that want to experience the story and explore the world with less conflict. Player units are more resilient. Resources are more plentiful, and piglin attacks are less frequent and much weaker.=Сюжетний рівень складності. Рекомендується для гравців, які бажають дослідити сюжет з невеликою кількістю конфліктів. Юніти гравця більш стійкі. Ресурсів більше, а напади піґлінів менш часті та набагато слабкіші.",
//     "Building an Improvement Hub enables the building of improvements with|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|which can be obtained by destroying piglin structures. Must be built in your Base's zone.=Створення центру удосконалення дозволяє будувати удосконалення за допомогою|*[style.bold]|призмарину|+[key.item.prismarine]||*[style]|, який можна отримати за руйнування споруд піґлінів. Треба будувати в зоні вашої бази.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement gives you a slow but steady income of diamond. Without it, you will lose access to an additional passive diamond income.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення забезпечує повільний, але стабільний дохід алмазів. Без нього ви втратите доступ до додаткового пасивного джерела поповнення алмазів.",
//     "Unique and powerful structures that require a special core resource to construct. Each tower you find in the world can be collected, granting its unique core. The more of them you find, the more you can build.=Унікальні потужні споруди, для будування яких потрібен особливий основний ресурс. Кожну вежу, знайдену вами в світі, можна забрати собі, а разом із нею — її унікальне ядро. Чим більше ви знайдете, тим більше зможете побудувати.",
//     "Destroy the piglin pits and Nether spreaders in this outpost|[space]||+[key.item.stoneSpawner]|Cobblestone golems are great at smashing buildings|[newline]||+[key.item.woodSpawner]|Plank golems are good against piglins=Зруйнуйте піґлінські ями та поширювачі Незеру в цій заставі|[space]||+[key.item.stoneSpawner]|Круглякові големи чудово розбивають будівлі|[newline]||+[key.item.woodSpawner]|Дощаті големи добре справляються з піґлінами",
//     "You do not have enough space to download the template used to create this world.  That template contained an Add-On pack that you need to continue playing this world.  Clear up space on your device to continue.=Недостатньо вільного місця, щоб завантажити шаблон, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі. Щоб продовжити, очистьте місце на пристрої.",
//     "|+[key.item.errorMessageBuild]|Must be in zones:|*[style.bold]|%1$s|+[buildables.zone.%2$s]||*[style]|&|*[style.bold]|%3$s|+[buildables.zone.%4$s]||*[style]|&|*[style.bold]|%5$s|+[buildables.zone.%6$s]||*[style]|=|+[key.item.errorMessageBuild]| Повинні бути в зонах: |*[style.bold]|%1$s|+[buildables.zone.%2$s]||*[style]|, |*[style.bold]|%3$s|+[buildables.zone.%4$s]||*[style]| та |*[style.bold]|%5$s|+[buildables.zone.%6$s]||*[style]|",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Allay Storage grants additional storage capacity. Setting this to a higher value removes the need to construct additional improvements.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Сховище служки» дає додаткове місце для зберігання. Якщо встановити більше значення, зникає потреба у додаткових удосконаленнях.",
//     "After this amount of time + damage escalation 1, mobs and redstone launchers on both teams receive a 60% damage increase. The purpose of this is to help end games that have turned into stalemates more quickly.=Коли спливе цей час і перестане діяти «Зростання шкоди 1», моби та редстоуномети обох команд почнуть отримувати на 60% більше пошкоджень. Це зроблено для того, щоб допомогти швидше завершити гру, яка зайшла у патову ситуацію.",
//     "Direct your golems to Action|+[key.item.action]||[space]||$[key.heroDirect]|Press to send nearby |*[style.bold]|golems|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|in the direction you are facing=Відправте своїх големів до місця дії|+[key.item.action]||[space]||$[key.heroDirect]|Натисніть, щоб відправити |*[style.bold]|големів|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|поруч у напрямку вашого погляду",
//     "How often the witch hut will become active. For example, if set to 5, the witch hut will become active every 5 minutes +/- the variance value below.|[space]|If set to 0, it will always be active.=Те, як часто відьомська хатина буде ставати активною. Наприклад, якщо встановлено значення 5, відьомська хатина буде активною кожні 5 хвилин +/- значення варіативності нижче.|[space]|Якщо встановлено значення 0, вона завжди буде активною.",
//     "Gold is obtained from destroying piglin bases and some of their structures. It is required to build powerful improvements.|[space]|Taking the piglins’ gold after defeating them in battle is definitely adding insult to injury.=Золото можна отримати, руйнуючи бази піґлінів і деякі їхні споруди. Воно потрібне для будівництва потужних удосконалень.|[space]|Забираючи золото піґлінів після перемоги над ними, ви ображаєте їх ще сильніше.",
//     "Spawns grindstone golems|[newline]||*[style.bold]|Stuns piglins|*[style]||[newline]||*[style.bold]|Strong vs|*[style]|ranged and special units|[newline]||*[style.bold]|Weak vs|*[style]|melee units=Призиває точильних големів|[newline]||*[style.bold]|Приголомшує піґлінів|*[style]||[newline]||*[style.bold]|Сильні проти|*[style]|юнітів дальнього бою й особливих юнітів|[newline]||*[style.bold]|Слабкі проти|*[style]|юнітів ближнього бою",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns the First of Stone. Without it, you may find that your army is lacking a powerful long range mob that is effective against structures.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює Першого з каменю. Без неї вам бракуватиме потужного моба дальнього бою, який був би ефективним проти споруд.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to carry more wood, stone, lapis, prismarine and gold. Without it, you'll have a smaller pool of resources to draw from.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дозволяє зберігати більше дерева, каменю, лазуриту, призмарину й золота. Без нього у вас буде менший резерв ресурсів.",
//     "Gather resources to build the |*[style.bold]|carpenter hut|+[key.item.carpenter]||*[style]||[newline]|You need|*[style.bold]|150|+[key.item.wood]||*[style]||[newline]||*[style.bold]|150|+[key.item.stone]||*[style]|.=Зберіть ресурси, щоб побудувати |*[style.bold]|теслярню|+[key.item.carpenter]||*[style]||[newline]|Вам потрібно|*[style.bold]|150|+[key.item.wood]||*[style]||[newline]||*[style.bold]|150|+[key.item.stone]||*[style]|.",
//     "The witch hut will appear in the swamp. During the match you'll hear a witches' cackle, which means they can be spawned at their hut for a limited time. Be mindful though... the other team may have the same idea.=Відьомська хатина з’явиться на болоті. Під час матчу ви почуєте відьомське гоготіння, а це означає, що їх можна призивати у своїй хатині протягом обмеженого часу. Однак будьте уважні... інша команда може випередити вас.",
//     "Make sure to strategize how you're going to defeat the opposing team. Powerful tools like the redstone launcher and careful mob selection are key to breeching your opponents defenses and and destroying their base.=Не забудьте розробити стратегію того, як ви збираєтеся перемогти команду суперників. Потужні інструменти, такі як редстоуномет, і ретельний вибір мобів є ключем до проривання оборони супротивника та знищення його бази.",
//     "We’ve improved type select to look like the hotbar, so controlling each mob type is more intuitive. And remember, you can change bannerview to be on toggle instead of hold in the settings.=Ми вдосконалили вибір типу, щоб він виглядав як гаряча панель, тому керування кожним типом мобів є більш інтуїтивно зрозумілим. І пам'ятайте, що в налаштуваннях ви можете змінити вигляд банера, щоб його можна було перемикати, а не утримувати.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Allay Storage grants additional storage capacity. Setting this to a higher value removes the need to construct that improvement.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Сховище служки» розширює можливості зберігання. Встановлення більшого значення усуває необхідність створення цього вдосконалення.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement gives you a slow but steady income of iron. Without it, you will lose access to an additional passive iron income.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення забезпечує повільний, але стабільний дохід заліза. Без нього ви втратите доступ до додаткового пасивного джерела поповнення заліза.",
//     "As you explore the Overworld, occasionally you will be given context sensitive prompts to perform specific interactions. You'll see|$[key.bsharpInteract]|on your screen change text. Make sure to keep an eye out for it.=Коли ви досліджуєте Верхній світ, то іноді можете отримувати контекстні запити на виконання конкретних дій. Тоді на екрані, в області змінюваного тексту, відображатиметься|$[key.bsharpInteract]|. Будьте уважні.",
//     "%1$s: Can someone build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|)|*[style]|?=%1$s: Чи може хтось збудувати таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|)|*[style]|?",
//     "Spawns the First of Stone|+[key.item.spawnerFirstStone]|, powerful golems that attack with a powerful ranged boulder which can heavily damage structures. First of Stone Spawner can only by built in your base zone.=Генерує Першого з каменю|+[key.item.spawnerFirstStone]|— потужного голема, який здійснює потужну дальню атаку, що може значно пошкодити споруди. Генератор Першого з каменю можна побудувати тільки в зоні вашої бази.",
//     "Spawns the First of Brick|+[key.item.spawnerFirstBrick]|, powerful golems that produce a shield for your other mobs protecting them from ranged attacks. First of Brick Spawner can only by built in your base zone.=Призиває Першого з цегли|+[key.item.spawnerFirstBrick]|— потужного голема, який виготовить щит для ваших мобів для захисту від далекобійних атак. Генератор Першого з цегли можна побудувати тільки в зоні вашої бази.",
//     "Need help from your friends? Make sure that the houses inside your allies homesteads are not heavily damaged, or they won't spawn. Repair them with a carpenter hut to help keep their homestead well defended!=Потрібна допомога друзів? Переконайтеся, що будинки всередині садиб ваших союзників не сильно пошкоджені, інакше вони не будуть генеруватися. Відремонтуйте їх за допомогою теслярні, щоб їхня садиба була добре захищеною!",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement gives you a slow but steady income of redstone. Without it, you will lose access to an additional passive redstone income.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає повільний, але стабільний дохід редстоуну. Без нього ви втратите доступ до додаткового пасивного доходу редстоуну.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Stun towers are special power towers that stun enemies in a large area. Without them, your late game defense may feel lacking.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Оглушувальні вежі — це спеціальні силові вежі, які оглушують ворогів на великій площі. Без них вам може забракнути оборонних можливостей у пізній грі.",
//     "There is an error with your account. You will be unable to use the store until we have resolved the issue. If this issue persists for several days please contact support using the help button.=У вашому обліковому записі виникла помилка. Ви не зможете користуватися магазином, доки ми не вирішимо цю проблему. Якщо протягом кількох днів не вдасться усунути проблему, зверніться до служби підтримки за допомогою кнопки довідки.",
//     "There is an error with your account. You will be unable to use the store until we have resolved the issue. If this issue persists for several days please contact support using the help button.=У вашому обліковому записі виникла помилка. Ви не зможете користуватися магазином, доки ми не вирішимо цю проблему. Якщо протягом кількох днів не вдасться усунути проблему, зверніться до служби підтримки за допомогою кнопки довідки.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns the First of Brick. Without it, you may find that your army is lacking a powerful melee mob that can shield nearby allies.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює Першого з цегли. Без неї вам бракуватиме потужного моба ближнього бою, здатного захищати навколишніх союзників.",
//     "We added two new game modes: custom campaign and custom versus. Gain much more control over the world generation, resource amounts etc. In campaign, it also allows you to skip the prologue entirely.=Додано два нові режими гри: користувацьку кампанію й користувацький режим суперництва. У вас буде значно більше контролю над генерацією світу, кількістю ресурсів тощо. У кампанії це також дає змогу повністю пропустити пролог.",
//     "The max number of actions that piglins can make each night during an invasion. This starts off slower but ramps up depending on the pacing.|[space]|Existing difficulties are set to:|[newline]|Storied =Максимальна кількість дій, які піґліни можуть робити щоночі під час вторгнення. Спочатку вони діятимуть повільніше, але поступово будуть прискорюватися в міру просування.|[space]|Наявні рівні складності:|[newline]|Сюжетний",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Allay Storage grants additional storage capacity. Setting this to a higher value removes the need to construct that improvement.=Максимальна кількість цього ресурсу, яку можна носити із собою.|[space]|Кожне вдосконалення: «Сховище служки» дає додаткове місце для зберігання. Якщо встановити більше значення, зникає потреба у цьому вдосконаленні.",
//     "This powerful tower fires a spread of molten-hot blaze rods that damage and ignite anything they hit. The only way to take down a armored tower is to send in allies when it fires and the tower shield drops.=Ця потужна вежа стріляє залпом розпечених вогняних прутів, які пошкоджують і підпалюють усе, в що вони влучили. Єдиний спосіб знести броньовану вежу — відправити союзників, коли вона стріляє, а щит вежі прибирається.",
//     "The max amount of this resource that you can carry.|[space]|Each Improvement: Allay Storage grants additional storage capacity. Setting this to a higher value removes the need to construct that improvement.=Максимальна кількість цього ресурсу, яку можна носити з собою.|[space]|Кожне вдосконалення: «Сховище служки» дає додаткове місце для зберігання. Якщо встановити більше значення, зникає потреба у цьому вдосконаленні.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement grants you additional construction and gather allays. Without it, it will take longer to construct structures and gather resources.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення інтенсифікує будівництво та збирає служок. Без нього на будівництво споруд і збір ресурсів триватиме довше.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns the First of Diorite. Without it, you may find that your army is lacking a powerful mob that spawns lower tier mobs for free.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює Першого з діориту. Без неї вам бракуватиме потужного моба, який би безплатно призивав мобів нижчих рівнів.",
//     "Gather resources|+[key.item.wood]||+[key.item.stone]|frequently to ensure your team can build structures and spawn mobs|[space]|Resources|+[key.item.wood]||+[key.item.stone]|are shared with your teammates=Збирайте ресурси|+[key.item.wood]||+[key.item.stone]|часто, щоб ваша команда могла будувати конструкції та призивати мобів|[space]|Ресурси|+[key.item.wood]||+[key.item.stone]|поділяються з вашими товаришами по команді",
//     "Emits a sonic attack that stuns enemies within range. Cannot be buffed by other structures. Requires the|*[style.bold]|Improvement: Build Power Towers|*[style]||+[key.item.unlock_host_towers]|structure.=Виконує звукову атаку, яка приголомшує ворогів у радіусі своєї дії. Посилення за допомогою інших споруд неможливе. Потрібне|*[style.bold]|удосконалення: будівництво силових веж|*[style]||+[key.item.unlock_host_towers]|.",
//     "Witches can be spawned from the witch huts that are found in every village for a substantial cost of resources. If the witch hut is inactive, you will be unable to spawn witches until it is active again.=Відьом можна призивати у відьомських хатинах, які є в кожному селі, але для цього потрібно витратити чимало ресурсів. Якщо відьомська хатина неактивна, ви не зможете призивати відьом, поки вона знову не стане активною.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Masonry's turn nearby structures to stone, improving their resilience. Without them, attacks from higher tier units will be harder to defend against.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Каменярні перетворюють сусідні споруди на кам'яні, зміцнюючи їх. Без них буде важче відбивати атаки високорангових юнітів.",
//     "Big beaks can glide over long distances. The higher you start, the farther you'll glide.|[space]|They are flightless birds, maybe because of their undersized wings or oversized beaks. Probably both.=Великі дзьоби можуть планерувати на великі відстані. Чим вище ви почнете, тим далі ви зможете планерувати.|[space]|Ці птахи не літають, можливо, через занадто маленькі крила або занадто великі дзьоби. Напевно, і те й інше.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to spawn additional mobs for your army. Without it, it will be harder to assault bases and deal with piglin threats.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу створювати додаткових мобів. Без нього буде важче штурмувати бази й боротися з піґлінськими силами.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to spawn additional mobs for your army. Without it, it will be harder to assault bases and deal with piglin threats.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу створювати додаткових мобів. Без нього буде важче штурмувати бази й боротися з піґлінськими силами.",
//     "Return to the|*[style.bold]|Well of Fate|+[key.item.hotbar4]||*[style]||[space]||$[key.mapScreen]|Press to open the map. You can use fast travel on the map|+[key.item.map]|to get there instantly=Поверніться до|*[style.bold]|колодязя долі|+[key.item.hotbar4]||*[style]||[space]||$[key.mapScreen]|Натисніть, щоб відкрити карту. Ви можете застосувати швидке переміщення на карті|+[key.item.map]|, щоб миттєво потрапити туди",
//     "The carpenter hut affects most structures within the zone it creates. These structures will slowly repair any damage taken over time. If a building is destroyed, the carpenter hut cannot repair it.=Теслярня впливає на більшість споруд у межах створеної нею зони. Ці споруди будуть із часом повільно відновлюватися від будь-яких пошкоджень, яких вони зазнали. Якщо будівлю зруйновано, теслярня не зможе її відремонтувати.",
//     "The carpenter hut affects most structures within the zone it creates. These structures will slowly repair any damage taken over time. If a building is destroyed, the carpenter hut cannot repair it.=Теслярня впливає на більшість споруд у межах створеної нею зони. Ці споруди будуть із часом повільно відновлюватися від будь-яких пошкоджень, яких вони зазнали. Якщо будівлю зруйновано, теслярня не зможе її відремонтувати.",
//     "The Banner of Courage allows you to send mobs to a specific point. Hold|$[key.advancedDirect]|to enter into banner view. Use|$[key.cameraMove]|to position your target to where you want your mobs to go.=Стяг мужності дозволяє відправити мобів у певне місце. Утримуйте|$[key.advancedDirect]|, щоб перейти в режим перегляду стягів. Потім за допомогою|$[key.cameraMove]|виберіть місце, куди ви хочете відправити своїх мобів.",
//     "Despite their horticultural leanings, zombies will bravely fight in the frontlines to save their allies from the heavier blows.|[space]|It’s a good thing that the piglins haven’t caught onto why zombies wear hats.=Незважаючи на свої садівницькі нахили, зомбі будуть мужньо битися на передовій, щоб врятувати союзників від більш важких ударів.|[space]|Добре, що піґліни не стали допитуватися, чому зомбі носять капелюхи.",
//     "When you help mobs successfully defend their homesteads against attack, the|*[style.bold]|Allegiance Flame|+[key.item.allegianceStructure]||*[style]|will be lit allowing you to call upon the mobs help in battle.=Коли ви допомагаєте мобам успішно захищати свої садиби від нападу, буде запалено|*[style.bold]|полум’я лояльності|+[key.item.allegianceStructure]||*[style]|, що дозволить вам закликати мобів допомогти в бою.",
//     "Powerful golem that throws stones that damage buildings.|[divider]|Cannot be assembled while the Well of Fate is under assault!|[divider]|This ancient giant once plowed the earth and shaped the mountains of the Overworld.=Потужний голем, який кидає каміння, що пошкоджує будівлі.|[divider]|Не можна зібрати, поки колодязь долі під ударом!|[divider]|Цей древній велетень колись орав землю і ліпив гори Верхнього світу.",
//     "As you explore the Overworld, you will discover and befriend new mounts. Hold|$[key.bsharpInteract]|to ride them. You can always swap back to your previous mount as they'll be nearby.=Досліджуючи Верхній світ, ви будете знаходити новий транспорт і дружити з цими тваринами. Утримуйте|$[key.bsharpInteract]|, щоб їздити на них. Ви завжди можете повернутися до попереднього транспорту, оскільки він весь час буде поруч.",
//     "Spawns cobblestone golems|[newline]||*[style.bold]|Strong vs|*[style]|structures|[newline]||*[style.bold]|Resistant to|*[style]|fire and knockback|[newline]||*[style.bold]|Weak vs|*[style]|ranged units=Призиває круглякових големів|[newline]||*[style.bold]|Сильні проти|*[style]|споруд|[newline]||*[style.bold]|Стійкі до|*[style]|вогню та відкидання|[newline]||*[style.bold]|Слабкі проти|*[style]|юнітів дальнього бою",
//     "There is an error with your account. You will be unable to use the marketplace until we have resolved the issue. If this issue persists for several days please contact support using the help button.=З вашим обліковим записом сталася помилка. Ви не зможете користуватися ринком, доки ми не вирішимо цю проблему. Якщо ця проблема не зникне через кілька днів, зверніться до служби підтримки за допомогою кнопки довідки.",
//     "When on, this mount can spawn in the Overworld. When off, they will not appear. This setting cannot be changed once the world has been generated.|[space]|The big beak has a higher jump and can glide.=Коли ввімкнено, цього їздового моба можна призивати у Верхньому світі. Коли вимкнено, він не з’явиться. У згенерованому світі цей показник змінювати не можна.|[space]|Великий дзьоб стрибає вище та може планерувати.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement gives you a slow but steady income of coal. Without it, you will lose access to an additional passive coal income.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає повільний, але стабільний дохід вугілля. Без нього ви втратите доступ до додаткового пасивного доходу вугілля.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Gates allow access to your base while denying piglins entry. Without them, it may be hard to navigate around your base.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ворота відкривають доступ до вашої бази, але перешкоджають проникненню піґлінів усередину. Без них може бути важко переміщатися територією бази.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to hold even more redstone. Without it, you will lose access to an efficient means of storing redstone.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу зберігати ще більше редстоуну. Без нього ви втратите доступ до ефективного способу зберігання редстоуну.",
//     "Turns basic wood structures into|*[style.bold]|stone|+[key.item.stone]||*[style]|blocks which significantly increases their durability. Requires|*[style.bold]|iron|+[key.item.iron]||*[style]|in order to build.=Перетворює базові дерев’яні споруди на|*[style.bold]|кам’яні|+[key.item.stone]||*[style]|блоки, що значно підвищує їх міцність. Для будівництва потрібне|*[style.bold]|залізо|+[key.item.iron]||*[style]|.",
//     "Continuing will remove all current packs and then add the pack you are trying to apply. This will remove all behavior packs from the world which can break the world and cause you to lose what you created.=Якщо продовжити, буде видалено всі поточні пакети, а потім додано пакет, який ви хочете застосувати. Усі пакети параметрів буде видалено зі світу. Це може зламати світ, і ви втратите все, що створили раніше.",
//     "Information about various things you discover in the Overworld is collected in your journal. Use|$[key.menuMovement]|to navigate and highlight each item you've discovered to learn more about it.=Інформація про різні речі, яку ви дізнаєтесь у Верхньому світі, збирається у вашому журналі. Використовуйте|$[key.menuMovement]|для навігації та виділення кожного знайденого предмета, щоб дізнатися більше про нього.",
//     "Damages and knocks back piglins in an area.|[divider]|Cannot be collected while the Well of Fate is under assault!|[divider]|A Host relic created as a lighting rod to protect the Overworld from fires.=Завдає шкоди піґлінам на ділянці та відкидає їх назад.|[divider]|Не можна отримати, коли колодязь долі атакується!|[divider]|Реліквія Хранителя, створена як блискавичник для захисту Верхнього світу від пожеж.",
//     "Fires frost cubes that slows enemies over time. Cannot be buffed by other structures. Requires the|*[style.bold]|Improvement: Build Power Towers|*[style]||+[key.item.unlock_host_towers]|structure.=Стріляє кубиками морозу, які поступово сповільнюють ворогів. Посилення за допомогою інших споруд неможливе. Потрібне|*[style.bold]|удосконалення: будівництво силових веж|*[style]||+[key.item.unlock_host_towers]|.",
//     "In a Versus match, witches can only be spawned at certain times. When you hear the witches' cackle, head to the witch hut to spawn them for a cost. They will only be available for a short time.=У матчі суперництва відьом можна призивати лише в певний час. Коли ви почуєте відьомське гоготіння, вирушайте до відьомської хатини, щоб за певну плату призвати їх. Вони будуть доступні лише протягом короткого часу.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to hold even more diamond. Without it, you will lose access to an efficient means of storing diamond.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає змогу зберігати ще більше алмазів. Без нього ви втратите доступ до ефективного способу зберігання алмазів.",
//     "When turned on, the netherrack found in piglin bases deals damage to player characters and mobs. This will make it harder to navigate piglin bases and will require heavy use of the clear netherrack melody.=Коли ввімкнено, незеррак, знайдений на базах піґлінів, завдає шкоди персонажам і мобам гравців. Це ускладнює переміщення базами піґлінів і вимагає інтенсивного використання мелодії прибирання незерраку.",
//     "Portal guards are incredibly tough and protective of their namesake. From a distance they're not much of a threat, but their punishing chain-mace arm is always ready to strike at close range.=Стражі порталу неймовірно стійкі та роблять усе можливе, щоб захистити портал. Здалеку вони не становлять великої загрози, але їхні безжальні руки з ланцюговою булавою завжди готові завдати удару з близької відстані.",
//     "The powerful legs of the fearless frog give it speedy swimming, soft landings, and gravity-defying double jumps. Try navigating the water ways of the Overworld instead of avoiding them!=Завдяки потужним лапам безстрашна жаба може швидко плавати, м’яко приземлятися та здійснювати подвійні стрибки, що не підкоряються гравітації. Спробуйте плавати водними шляхами Верхнього світу замість того, щоб уникати їх!",
//     "Your compass appears at the top of your screen. It indicates nearby locations, points of interest and shows you what direction you are going. Refer to your compass to ensure you don't get lost.=Компас відображається у верхній частині екрана. На ньому вказуються найближчі локації й цікаві місця, а також показується, в якому напрямку ви рухаєтеся. Користуйтеся компасом, щоб переконатися, що ви не заблукали.",
//     "You need to enter Placement Preview and pick a starting point and an ending point to build a wall. The larger the wall, the larger the cost. Walls are destroyed in segments, make sure to patch them.=Вам потрібно перейти в режим перегляду розміщення та вибрати початкову та кінцеву точку, щоб побудувати стіну. Чим більше стіна, тим більше вартість. Стіни руйнуються на сегменти, не забувайте їх ремонтувати.",
//     "With the introduction of \"Night\" to the world, the|*[style.bold]|piglins|+[key.item.piglin]||*[style]|are now more active. The dark helps their sensitive eyes and most of their dastardly operations are carried out at night.=Після того як у світі з’явилася зміна дня і ночі, |*[style.bold]|піґліни|+[key.item.piglin]||*[style]|стали активнішими. Темрява не подразнює їхні чутливі очі і дає змогу капостити.",
//     "%1$s: I will build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|)|*[style]|=%1$s: Я збудую таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|, %12$d|+[key.item.%11$s]|)|*[style]|",
//     "Gold is obtained from destroying piglin bases and some of their structures. It is required to build outposts.|[space]|Taking the piglins’ gold after defeating them in battle is definitely adding insult to injury.=Золото можна отримати, руйнуючи бази піґлінів і деякі їхні споруди. Воно потрібне для будівництва застав.|[space]|Забираючи золото піґлінів після перемоги над ними, ви ображаєте їх ще сильніше.",
//     "Skip the prologue and jump into a new world with a ton of options. Recommended for experienced players. Note that changing some settings may affect performance or have unexpected results.=Пропустіть пролог і переходьте до нового світу з багатьма доступними параметрами. Рекомендовано для досвідчених гравців. Зауважте, що зміна деяких параметрів може вплинути на швидкодію або мати несподівані результати.",
//     "Brilliant beetles can climb up walls and cliffs.|[space]|If you can get over the extra legs, brilliant beetles are an excellent companion if you want to reach the higher points of the Overworld.=Діамантові жуки можуть підніматися вгору по стінах і скелях.|[space]|Якщо ви налаштовані на довгий шлях, діамантовий жук стане відмінним компаньйоном для того, хто хочете досягти найвищих точок Верхнього світу.",
//     "As their name suggests, these plants will poison you if you touch them, making you take damage for a short period of time.|[space]|Looking for any redeeming qualities or uses? They have none.=Як очевидно з назви, ці рослини отруять вас, якщо ви доторкнетеся до них, і протягом короткого періоду часу завдадуть шкоду.|[space]|Шукаєте якісь можливі корисні якості або способи застосування? Їх просто немає.",
//     "Nether spreaders poison the ground with corrupting red netherrack that prevents you from building structures. Once a Nether spreader is destroyed, the ground that it has soured can be de-nethered and reclaimed.=Поширювачі Незеру отруюють землю заражаючим червоним незерраком, який заважає будувати споруди. Знищивши поширювач Незеру, ви зможете денезерувати отруєну землю та повернути втрачену територію.",
//     "This Microsoft Account will not be the primary account for this device if you do not sync this device's purchases to this account. You will not automatically sign in when you start Minecraft.=Цей обліковий запис Microsoft не буде основним для цього пристрою, якщо ви не синхронізуєте покупки, зроблені для пристрою, з цим обліковим записом. Вхід не буде відбуватись автоматично під час запуску Minecraft.",
//     "Pits deploy piglin units. Destroy them quickly to avoid being overwhelmed.|[space]|You don't have to look too closely to tell that these pits are cobbled together by piglin builders on the battlefield.=У ямах розміщуються загони піґлінів. Знищуйте їх швидко, доки вони вас не розгромили.|[space]|Не треба занадто уважно придивлятися, щоб сказати, що ці ями викопані піґлінами-будівельниками на полі бою.",
//     "Ancient host tower. Rings loudly when enemies approach and stuns them in place. Does not damage enemies, so it needs support. Be sure to protect the Stun Tower with supporting structures.=Стародавня вежа Хранителя. Голосно дзвенить при наближенні ворогів і приголомшує їх, зупиняючи на місці. Не завдає ворогам шкоди, тому потребує підтримки. Обовʼязково захистіть оглушувальну вежу спорудами підтримки.",
//     "Help your allies find precious resources. Enter Build View to and press the ping button to quickly chat about resource locations or needed resources. Teamwork makes the dream work!=Допоможіть своїм союзникам знайти цінні ресурси. Увійдіть у меню «Перегляд споруд» і натисніть кнопку «Повідомлення», щоб швидко обговорити розташування ресурсів або необхідні ресурси у чаті. Командна робота здійснює мрії!",
//     "Achievements are only available in worlds set to survival mode with cheats off.  If you continue, no one will earn achievements while playing in this world ever again even if you switch back before playing.=Досягнення доступні лише у світах у режимі виживання з вимкнутими чіт-кодами. Якщо ви продовжите, ніхто не зможе заробляти досягнення в цьому світі, навіть якщо ви зміните цей параметр перед грою.",
//     "When enabled, player characters will move as fast as if they always had the speed wheat buff. |[space]|Player characters will no longer be buffed by speed wheat when they touch it.=Коли ввімкнуто, персонажі гравців будуть рухатися так швидко, ніби вони завжди мали підсилення швидкісної пшениці. |[space]|Але саме підсилення швидкісної пшениці більше не буде для них доступним, якщо вони її торкнуться.",
//     "When on, this mount can spawn in the Overworld. When off, they will not appear. This setting cannot be changed once the world has been generated.|[space]|The regal tiger is the fastest mount.=Коли ввімкнено, цього їздового моба можна призивати у Верхньому світі. Коли вимкнено, він не з’явиться. У згенерованому світі цей показник змінювати не можна.|[space]|Царствений тигр – це найшвидший транспорт.",
//     "Blaze Runts are better trained than mace Runts. They wield blaze rods that give them a greater range of attack.|[space]|They would never win an archery contest against the skeletons, though.=Вогняні коротуни навчаються краще, ніж коротуни з булавами. Вони володіють вогняними прутами, які збільшують їх дальність атаки.|[space]|Однак вони ніколи не виграють змагання зі стрільби з лука проти скелетів.",
//     "Fires projectiles that will knock back enemies on impact. Cannot be buffed by other structures. Requires the|*[style.bold]|Improvement: Build Power Towers|*[style]||+[key.item.unlock_host_towers]|structure.=Стріляє снарядами, які відкидають ворогів. Посилення за допомогою інших споруд неможливе. Потрібне|*[style.bold]|удосконалення: будівництво силових веж|*[style]||+[key.item.unlock_host_towers]|.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to hold even more coal. Without it, you will lose access to an efficient means of storing coal.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу зберігати ще більше вугілля. Без нього ви втратите доступ до ефективного способу зберігання вугілля.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to hold even more iron. Without it, you will lose access to an efficient means of storing iron.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення надає змогу зберігати ще більше заліза. Без нього ви втратите доступ до ефективного способу зберігання заліза.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns plank golems. Without it, you will have less answers to swarms of melee units or players.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює дощатих големів. Без неї у вас буде менше ефективних засобів проти великих мас ворожих юнітів ближнього бою або гравців.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Battle Drum's enhance nearby towers with increased attack speed. Without them, your defensive structures won't be able to attack as quickly.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Бойові барабани прискорюють атаку навколишніх веж. Без них ваші оборонні споруди будуть атакувати повільніше.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Wellhouses act as fast travel and respawn points. Without them you'll have to spend more time travelling on your mount.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Доми-колодязі працюють як точки швидкого пересування й відродження. Без них доведеться витрачати більше часу на пересування верхи.",
//     "Native to the badlands, the creepers deal devastating explosive damage to piglin structures.|[space]|When was the last time you were glad to hear sSssSssssSssssss? It's a welcome yet peculiar feeling.=Кріпери — це аборигени пустища, здатні вибухати, завдаючи нищівної шкоди спорудам піґлінів.|[space]|Коли ви востаннє були раді почути цей характерний свист? Це приємне, але вельми особливе відчуття.",
//     "Generates a world with symmetrical terrain, where each team's starting area is the same. Change this if you want to have games with more balanced opportunities for resources and points of interest.=Створює світ із симетричним рельєфом, де стартова зона кожної команди однакова. Змінюйте цей показник, якщо хочете мати ігри з більш збалансованими можливостями розміщення ресурсів і визначних місць.",
//     "The size of the world changes depending on the difficulty you've chosen; smaller on Storied and larger on Mythic and Legendary. Changing difficulty of an existing campaign will not change its size.=Розмір світу змінюється в залежності від обраної вами складності: він менший на сюжетному рівні та більший на міфічному та легендарному. Зміна рівня складності наявної кампанії не змінить її розміру.",
//     "Make sure to keep an eye on structure costs. Sometimes you'll need more than one improvement to be able to hold enough of a required resource to build structures like the Redstone Launcher.=Обов'язково стежте за витратами на споруду. Іноді вам може знадобиться більше одного вдосконалення, щоб мати можливість утримувати достатньо необхідного ресурсу для будівництва таких споруд, як редстоуномет.",
//     "Lead your golems to Action|+[key.item.action]||[space]||$[key.heroLure]|Quickly press to have nearby|*[style.bold]|golems|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|follow you=Закликачте своїх големів до дії|+[key.item.action]||[space]||$[key.heroLure]|Швидко натисніть, щоб|*[style.bold]|големи|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|поруч слідували за вами",
//     "We are now showing buildings’ health bars in banner view! Your sword can also damage buildings, and push piglins away when charging. All units have been rebalanced for more interesting strategies.=Тепер на стязі показано міцність споруд! Також ваш меч може пошкоджувати будівлі й відштовхувати піґлінів під час штурму. Змінено баланс усіх юнітів, щоб можна було застосовувати цікавіші стратегії.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Ice traps will freeze enemy units that step over them. Without them enemy players and units will be harder to deal with.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Крижані пастки заморожують ворожі юніти, які на них наступають. Без них буде важче впоратися з ворожими гравцями та юнітами.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns zombies. Without it, you may find that your army is lacking a front-line mob that can absorb a lot of punishment.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює зомбі. Без неї вам бракуватиме мобів передньої лінії, здатних поглинати багато пошкоджень.",
//     "Plank golems launch powerful ranged attack against piglin units, but are quite vulnerable to direct hits.|[space]|Some say that plank golem cuddles are totally worth the splinters.=Дощаті големи проводять потужні дальні атаки проти загонів піґлінів, але вони досить вразливі до прямих влучень.|[space]|Дехто каже, що обійми дощатих големів цілком варті скалок, які ви можете при цьому отримати.",
//     "Allays use wood to build structures like walls, stairs, and towers. It's also necessary to spawn plank golems.|[space]|It would be a bit silly to explain where it comes from, right?=Служки використовують деревину для будівництва таких споруд, як стіни, сходи та вежі. Також вона необхідна для генерування дощатих големів.|[space]|Було б трохи безглуздо пояснювати, звідки вона береться, правда?",
//     "Allays use wood to build structures like walls, stairs, and towers. It's also necessary to spawn plank golems.|[space]|It would be a bit silly to explain where it comes from, right?=Служки використовують деревину для будівництва таких споруд, як стіни, сходи та вежі. Також вона необхідна для генерування дощатих големів.|[space]|Було б трохи безглуздо пояснювати, звідки вона береться, правда?",
//     "The Devourer rules over the Horde of the Spore from their wretched royal soup-bath. They are feared for their ferocity and their insatiable hunger to consume anything in sight – runt, mob, and villager alike.=Пожирач править Ордою отруйників із огидної королівської лазні. Отруйників бояться через їхню лють і невгамовну жагу пожирати все, що трапляється їм на шляху: коротунів, мобів і селян.",
//     "In addition to wood, stone, and lapis, villagers also collect rare resources from the biome they're in if you've unlocked the ability to gather it. You can get their gifts from village chests.=Окрім деревини, каменю та лазуриту, селяни також збирають рідкісні ресурси з біому, де вони перебувають, якщо ви відкриєте можливість збирати в ньому. Отримати їхні подарунки можна з сільських скринь.",
//     "Lapis flags allow you to improve your constant drip of|*[style.bold]|lapis|+[key.item.lapis]||*[style]|to your team. The lapis flag|+[key.item.lapisFlag]|can be destroyed, so be sure to protect it.=Лазуритові прапори дозволяють вашій команді отримувати більше|*[style.bold]|лазурита|+[key.item.lapis]||*[style]|. Захищайте лазуритовий прапор|+[key.item.lapisFlag]|, бо ворог може його знищити.",
//     "Keep an eye out for the mighty Firsts while you explore the Overworld. These powerful friends will help you make short work of the piglins... as long as you have the Improvement: Wake the Firsts upgrade, of course.=Шукайте могутніх Перших, поки досліджуєте Верхній світ. Ці сильні друзі допоможуть вам швидко впоратися з піґлінами... якщо ви маєте удосконалення: пробудження Перших, звичайно.",
//     "Power towers contain a unique core, obtained when you collect or deconstruct them. Each core you collect allows you to build another tower of that type. If the tower is destroyed, the core is lost.=Силові вежі містять унікальне ядро, яке ви отримуєте, коли забираєте або демонтуєте вежу. Кожне отримане ядро дозволяє побудувати ще одну вежу такого типу. Якщо вежу зруйнують, ви втратите ядро.",
//     "Spawns zombies|[newline]||*[style.bold]|Strong vs|*[style]|mace runts, spore medics, and warboars|[newline]||*[style.bold]|Weak vs|*[style]|blaze runts, engineers, and lava launchers=Призиває зомбі|[newline]||*[style.bold]|Сильні проти|*[style]|коротунів із булавою, медиків-отруйників і бойових хряків|[newline]||*[style.bold]|Слабкі проти|*[style]|вогняних коротунів, інженерів і лавометів",
//     "Spawns plank golems|[newline]||*[style.bold]|Strong vs|*[style]|melee units, like mace runts|[newline]||*[style.bold]|Weak vs|*[style]|fire, like blaze runts and piglin towers=Призиває дощатих големів|[newline]||*[style.bold]|Сильні проти|*[style]|юнітів ближнього бою, як-от коротунів із булавами|[newline]||*[style.bold]|Слабкі проти|*[style]|вогню, як-от вогняних коротунів і веж піґлінів",
//     "Every piglin horde can perform any action, but they have a preference. Horde of the Hunt prefers to attack bases, Horde of the Bastion prefers to upgrade its bases and Horde of the Spore prefers to expand.=Кожна орда піґлінів може виконувати будь-яку дію, але вони мають вподобання. Орда мисливців атакує бази, Орда укріпників модернізує свої бази, а Орда отруйників розширює свої володіння.",
//     "We're having trouble verifying that you own Minecraft on this device. Make sure you have downloaded and installed Minecraft from the store. Or simply reconnect to the internet and try again.=Не вдалося підтвердити, що ви придбали Minecraft, на цьому пристрої. Переконайтеся, що ви завантажили й інсталювали Minecraft із Магазину. Або просто перепідключіться до Інтернету та спробуйте ще раз.",
//     "When exploring the tundra, watch out for geysers – they will send you flying high enough to make the landing... unpleasant.|[space]|Might be fun with the right mount by your side, though.=Досліджуючи тундру, стережіться гейзерів: вони відправлять вас літати настільки високо, що це зробить посадку... неприємною.|[space]|Утім, коли у вас правильно підібраний транспорт, це може бути весело.",
//     "Warning: You are currently the host of this game session.|[space]|Accepting this invite will disconnect all players and restrict you from hosting a public Versus Mode game for %s minutes.=Увага! Зараз ви є хостом цього сеансу гри.|[space]|Якщо прийняти це запрошення, усіх гравців буде відключено, а ви не зможете організовувати ігри в загальнодоступному режимі суперництва протягом %s хв.",
//     "Destroy the Nether portal|+[key.item.piglinPortal]||[space]||+[key.item.zombieSpawner]||+[key.item.skeletonSpawner]||+[key.item.creeperSpawner]|Lead these mighty mobs to push back the piglins=Знищіть портал у Незер|+[key.item.piglinPortal]||[space]||+[key.item.zombieSpawner]||+[key.item.skeletonSpawner]||+[key.item.creeperSpawner]|Пошліть цих могутніх мобів, щоб вони відтіснили піґлінів",
//     "Spawns skeletons|[newline]||*[style.bold]|Strong vs|*[style]|melee units, seekers, and portal guards|[newline]||*[style.bold]|Weak vs|*[style]|warboars, lava launchers, and pigmadillos=Створює скелетів|[newline]||*[style.bold]|Сильні проти|*[style]|юнітів ближнього бою, шукачів і охоронців порталу|[newline]||*[style.bold]|Слабкі проти|*[style]|бойових кабанів, лавометів та панцерсвинів",
//     "A base of operations in the fight against piglins. Its connection to the Well of Fate enables its unique capabilities. Unfortunately, this also makes it a target for piglin attacks at night.=Оперативна база, яка допомагає в боротьбі з піґлінами. Зв’язок із колодязем долі наділяє її унікальними властивостями. На жаль, це також робить її ласим шматком для піґлінів, які атакують її вночі.",
//     "Horses are sturdy sidekicks that can sprint indefinitely.|[space]|It’s no wonder horses are many adventurers’ first choice – they’re fast, they’re loyal, and they snort when they’re happy.=Коні — це міцні помічники, які можуть бігти безкінечно.|[space]|Не дивно, що коні є найбільш доцільним варіантом для багатьох шукачів пригод; вони швидкі, вони вірні, вони фиркають, коли задоволені.",
//     "Diamond can rarely be found in small deposits around the Overworld as well as collected in village chests. It is used by the allays to build ice traps and the spyglass overlook.=Невеликі родовища алмазів зрідка зустрічаються на всій території Верхнього світу. Алмази також можна знайти в сільських скринях. Вони використовуються служками для будівництва заморожувачів і підзорної труби.",
//     "Diamond can rarely be found in small deposits around the Overworld as well as collected in village chests. It is used by the allays to build ice traps and the spyglass overlook.=Невеликі родовища алмазів зрідка зустрічаються на всій території Верхнього світу. Алмази також можна знайти в сільських скринях. Вони використовуються служками для будівництва заморожувачів і підзорної труби.",
//     "Spawns creepers|[newline]||*[style.bold]|Strong vs|*[style]|structures, mace runts, and lava launchers|[newline]||*[style.bold]|Weak vs|*[style]|warboars, portal guards, and pigmadillos=Призиває кріперів|[newline]||*[style.bold]|Сильні проти|*[style]|споруд, коротунів із булавою та лавометів|[newline]||*[style.bold]|Слабкі проти|*[style]|бойових хряків, вартових порталу та бронепіґів",
//     "Unlocks all structures turned on for use immediately. Combine with starting resources to be able to build right away.|[space]|Any structures that have been turned off will not be available for construction.=Негайно розблоковує всі ввімкнені для використання споруди. Разом зі стартовими ресурсами це дасть можливість будувати відразу.|[space]|Жодних вимкнених споруд будувати не можна.",
//     "It is essential to build improvements that allow you to gather rare resources. In addition to unlocking new structures, allays and villagers will be able to collect these resources and put them in chests.=Важливо будувати покращення, які дозволять вам збирати рідкісні ресурси. На додаток до відкриття нових споруд, ці ресурси зможуть збирати (і класти у скрині) служки та жителі села.",
//     "You can play Minecraft Legends online with friends on other platforms — all you need to do is log in with a Microsoft Account. Don’t have an account yet? Create one for free.=Ви можете грати в Minecraft Legends онлайн із друзями на інших платформах. Вам потрібно лише виконати вхід за допомогою облікового запису Microsoft. Ви ще не маєте облікового запису? Створіть його безкоштовно.",
//     "You can play Minecraft Legends online with friends on other platforms — all you need to do is log in with a Microsoft Account. Don’t have an account yet? Create one for free.=Ви можете грати в Minecraft Legends онлайн із друзями на інших платформах. Вам потрібно лише виконати вхід за допомогою облікового запису Microsoft. Ви ще не маєте облікового запису? Створіть його безкоштовно.",
//     "Destroy the last|*[style.bold]|piglin outpost|+[key.item.piglinCamp]||*[style]||[newline]|Use|*[style.bold]|Cobblestone golems|+[key.item.stoneSpawner]||*[style]|to destroy structures.=Знищте останню|*[style.bold]|заставу піґлінів|+[key.item.piglinCamp]||*[style]||[newline]|Використовуйте|*[style.bold]|круглякових големів|+[key.item.stoneSpawner]||*[style]|, щоб руйнувати споруди.",
//     "Piglin Bases will spread netherrack around them. Netherrack prevents the construction of many of your structures, however|*[style.bold]|ramps|+[key.item.platform]||*[style]|are still able to be built though.=Територія навколо баз піґлінів вкрита незерраком. Він унеможливлює будівництво більшості споруд, однак ви можете зводити|*[style.bold]|пандуси|+[key.item.platform]||*[style]|.",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Gold is used to acquire advanced improvements, firsts and power towers.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|За золото можна придбати просунуті вдосконалення, першопрохідців і силові вежі.",
//     "Allows your team to build the First spawners which are powerful Mobs with unique abilities. Requires an|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]|structure.=Дозволяє вашій команді будувати генератори Перших — потужних мобів із унікальними здібностями. Потрібен|*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]|.",
//     "Diamond unlocks advanced structures and can be used to spawn|*[style.bold]|skeletons|+[key.item.skeletonSpawner]||*[style]|.|[space]|Diamond deposits can be found in the tundra and jagged peaks.=Алмази дають змогу будувати кращі споруди і призивати|*[style.bold]|скелетів|+[key.item.skeletonSpawner]||*[style]|.|[space]|Родовища алмазів можна знайти в тундрі та на гострих вершинах.",
//     "Are you sure you want to leave and return to the main menu? This will disconnect all other players in the current game and restrict you from hosting a public Versus game for %s minutes.=Ви справді хочете вийти й повернутися в головне меню? Усіх інших гравців у поточній грі буде відключено, а ви не зможете організовувати загальнодоступні ігри в режимі суперництва впродовж %s хв.",
//     "The amount of damage dealt by touching hazards like redthorn, poison vines and lava. Try making the damage really high to see if you can still navigate the world successfully.=Обсяг шкоди, яку завдає торкання небезпечних предметів, як червонотерник, отруйні ліани та лава. Спробуйте зробити шкоду дійсно високою, щоб побачити, чи зможете ви все ще успішно переміщуватися в світі.",
//     "Defeat the piglins attacking the village.|[space]|Your|*[style.bold]|Plank golems|+[key.item.woodSpawner]||*[style]|will be helpful here|[newline]||$[key.meleeAttack]|Press to swing your sword=Знищте піґлінів, що нападають на село|[space]|Ваші|*[style.bold]|дощаті големи|+[key.item.woodSpawner]||*[style]|тут допоможуть|[newline]||$[key.meleeAttack]|Натисніть, щоб махнути мечем",
//     "Each additional improvement adds:|[newline]||*[style.bold]|+2 build allays|+[key.item.buildAllay]||*[style]||[newline]||*[style.bold]|+2 gather allays|+[key.item.gatherAllay]||*[style]|=Кожне додаткове вдосконалення додає:|[newline]||*[style.bold]|+2 служки-будівника|+[key.item.buildAllay]||*[style]||[newline]||*[style.bold]|+2 служки-збирача|+[key.item.gatherAllay]||*[style]|",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to assemble powerful golems. Without it, you will lose access to your most powerful mobs.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу збирати потужних големів. Без нього ви втратите доступ до своїх найпотужніших мобів.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns creepers. Without it, you may find that your army is lacking burst damage against structures.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює кріперів. Без неї ваша армія може завдавати недостатньо вибухових пошкоджень ворожим спорудам.",
//     "Gain new abilities and increase existing capabilities by building improvements at the Well of Fate. Each improvement requires prismarine, which can be found when destroying piglin structures.=Отримуйте нові здібності та нарощуйте існуючі можливості, будуючи покращення біля колодязя долі. Для кожного покращення потрібен призмарин, який можна знайти,  руйнуючи споруди піґлінів.",
//     "|+[key.item.errorMessageUpgrade]|Requires:|*[style.bold]|%1$s|+[key.item.%2$s]||*[style]|&|*[style.bold]|%3$s|+[key.item.%4$s]||*[style]|&|*[style.bold]|%5$s|+[key.item.%6$s]||*[style]|=|+[key.item.errorMessageUpgrade]| Потрібно: |*[style.bold]|%1$s|+[key.item.%2$s]||*[style]|, |*[style.bold]|%3$s|+[key.item.%4$s]||*[style]| та |*[style.bold]|%5$s|+[key.item.%6$s]||*[style]|",
//     "One of the Mob Allegiances was lost. Look at the map|+[key.item.map]||$[key.mapScreen]|to see which one was and rebuild an Allegiance Structure Melody to regain their allegiance=Лояльність одного з видів мобів втрачено. Відкрийте карту|+[key.item.map]||$[key.mapScreen]|й дізнайтеся, що це за моби, а потім відновіть мелодію споруди лояльності, щоб знову схилити їх на свій бік",
//     "%1$s: Can someone build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|)|*[style]|?=%1$s: Чи може хтось збудувати таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|)|*[style]|?",
//     "Interact with the launcher and use your camera controls to move your target. Confirm your target to begin firing. The redstone launcher needs to be interacted with again after reloading.=Активуйте редстоуномет і використовуйте елементи керування камерою, щоб перемістити ціль. Підтвердьте свою ціль, щоб почати вогонь. Редстоуномет потрібно знову активувати після перезарядки.",
//     "Interact with the launcher and use your camera controls to move your target. Confirm your target to begin firing. The redstone launcher needs to be interacted with again after reloading.=Активуйте редстоуномет і використовуйте елементи керування камерою, щоб перемістити ціль. Підтвердіть свою ціль, щоб почати вогонь. Редстоуномет потрібно знову активувати після перезарядки.",
//     "Spawns the First of Diorite|+[key.item.spawnerFirstDiorite]|, powerful golems that spawn other small golems in battle. First of Diorite Spawner can only by built in your base zone.=Призиває Першого з діориту|+[key.item.spawnerFirstDiorite]|— потужного голема, який в бою призиває інших маленьких големів. Генератор Першого з діориту можна побудувати тільки в зоні вашої бази.",
//     "A masonry will convert wooden structures to stone – even after it's destroyed. Unlike other buffs, the masonry's buff will stay applied even if the masonry is destroyed or removed.=Каменярня перетворить дерев’яні споруди на кам’яні — навіть після того, як буде зруйнована. На відміну від інших бафів, баф каменярні діятиме, навіть якщо каменярня буде зруйнована або видалена.",
//     "Your compass appears at the top of your screen. It indicates nearby locations of importance and shows you what direction you're heading in. Pay attention to it to ensure you are heading to where you want go.=Компас відображається у верхній частині екрана. Він позначає важливі місця поблизу та показує, у якому напрямку ви рухаєтеся. Звіряйтеся з компасом, щоб не загубитися.",
//     "There is an error with your account. You will be unable to use the store until we have resolved the issue. If this issue persists for several days please contact support.=У вашому обліковому записі виникла помилка. Ви не зможете користуватися магазином, доки ми не вирішимо цю проблему. Якщо протягом кількох днів не вдасться усунути проблему, зверніться до служби підтримки.",
//     "There is an error with your account. You will be unable to use the store until we have resolved the issue. If this issue persists for several days please contact support.=У вашому обліковому записі виникла помилка. Ви не зможете користуватися магазином, доки ми не вирішимо цю проблему. Якщо протягом кількох днів не вдасться усунути проблему, зверніться до служби підтримки.",
//     "After this amount of time, mobs and redstone launchers on both teams receive a 30% damage increase. The purpose of this is to help end games that have turned into stalemates more quickly.=Коли цей час спливе, моби та редстоуномети обох команд будуть отримувати на 30% більше пошкоджень. Це зроблено для того, щоб допомогти швидше завершити гру, яка зайшла у патову ситуацію.",
//     "We added several new ways to communicate with your teammates in versus mode. We improved mob recall to reduce griefing. We also added more accolades to improve bragging.=Додано кілька нових способів спілкування з товаришами по команді в режимі суперництва. Покращено відкликання мобів, щоб зменшити дратування. Також додано більше нагород, щоб були кращі нагоди похвалитися.",
//     "Spawns the First of Oak|+[key.item.spawnerFirstOak]|, powerful golems that fire powerful arrow attacks from a long range. First of Oak Spawner can only by built in your base zone.=Призиває Першого з дуба|+[key.item.spawnerFirstOak]|— потужного голема, який веде потужні стрілецькі атаки з великої відстані. Генератор Першого з дуба можна побудувати тільки в зоні вашої бази.",
//     "Bouncecaps let you jump higher, allowing you to reach the treetops and scale mountains easier.|[space]|Just make sure their effect doesn't wear down by the time you land.=Гриби-стрибовики дозволяють стрибати вище, завдяки чому ви зможете дістатися до верхівок дерев і легше видиратися на гори.|[space]|Обовʼязково переконайтеся, що їх ефект не зник, до моменту приземлення.",
//     "In Versus Mode, your team will be defeated if your|*[style.bold]|base|+[key.item.headquarter]||*[style]|is destroyed. Constructing a variety of defensive structures will help prevent this.=У режимі суперництва ваша команда зазнає поразки, якщо вашу|*[style.bold]|базу|+[key.item.headquarter]||*[style]|буде знищено. Запобігти цьому допоможуть різноманітні оборонні споруди.",
//     "You are not connected to Microsoft services. Your friends with Gamertags will not be able to join your multiplayer world. Sign in to your Microsoft Account to play with your friends.=Ви не підключені до служб Microsoft. Ваші друзі з псевдонімами гравців не зможуть приєднатися до вашого мультиплеєрного світу. Увійдіть у свій обліковий запис Microsoft, щоб грати з друзями.",
//     "Allay storage improvements allow you to hold more wood, stone, prismarine, gold, and lapis. To hold more rare resources, build more of their respective gathering improvements.=Удосконалення сховища служок дозволяють зберігати більше деревини, каменю, призмарину, золота й лазуриту. Щоб зберігати більш рідкісні ресурси, побудуйте більше відповідних удосконалень для збору.",
//     "In competitive games, you can recruit the powerful Firsts to your side by building an improvement to unlock their spawners. Improvements must be built near Improvement Hubs.=У змагальних іграх ви можете переманити на свій бік потужних перших, створивши вдосконалення для розблокування їхніх генераторів. Удосконалення повинні бути побудовані поблизу центрів удосконалення.",
//     "The health of player characters. Does not change the number of hearts, just how much health each heart has.|[space]|This is not a setting we've modified across standard campaign difficulties.=Здоров’я персонажів гравців. Не змінює кількість сердець, а лише кількість здоров’я для кожного серця.|[space]|Цей параметр не був змінений у рівнях складності звичайної кампанії.",
//     "Replaces all of the water in the world with lava. The world will have a more ominous feel, and be far more treacherous to navigate. This setting cannot be changed once the world has been generated.=Замінює всю воду в світі лавою. Світ матиме більш зловісну атмосферу та буде набагато підступнішим для переміщення. У згенерованому світі це налаштування змінювати не можна.",
//     "Destroy the|*[style.bold]|piglin outposts|+[key.item.piglinCamp]||*[style]||[newline]|Use|*[style.bold]|Cobblestone golems|+[key.item.stoneSpawner]||*[style]|to destroy structures.=Знищте|*[style.bold]|застави піґлінів|+[key.item.piglinCamp]||*[style]||[newline]|Використовуйте|*[style.bold]|круглякових големів|+[key.item.stoneSpawner]||*[style]|, щоб руйнувати споруди.",
//     "Iron is a bit rarer than stone, but shouldn't be difficult to find. It is used by the allays to build structures like the protector tower and the masonry as well as some allies.=Залізо зустрічається трохи рідше, ніж камінь, але знайти його не важко. Воно використовується служками для будівництва таких споруд, як вежа захисту та каменярня, а також деякими союзниками.",
//     "Iron is a bit rarer than stone, but shouldn't be difficult to find. It is used by the allays to build structures like the protector tower and the masonry as well as some allies.=Залізо зустрічається трохи рідше, ніж камінь, але знайти його не важко. Воно використовується служками для будівництва таких споруд, як вежа захисту та каменярня, а також деякими союзниками.",
//     "Improving your rally allows you to command more mobs to follow you. It is essential to pair with the|*[style.bold]|Improvement: Flames of Creation|+[key.item.allegianceFlame]||*[style]|.=Покращення скликання дозволяє вам вести за собою більшу кількість мобів. Важливо поєднувати з|*[style.bold]|удосконаленням: полум’ям творення|+[key.item.allegianceFlame]||*[style]|.",
//     "Piglins will occupy a village if they destroy the fountain during an attack. Occupied villages do not generate resources and cannot be fast travelled to until you clear out the invading forces.=Піґліни захоплять село, якщо під час нападу зруйнують фонтан. Захоплені села не дають ресурсів, і до них неможливо швидко переміститися, поки ви не знищите сили вторгнення.",
//     "As the fight continues, piglins will get more aggressive and will send larger waves of their most skilled fighters to attack. Make sure you continue to upgrade and strengthen defenses at your base.=По ходу бою піґліни стають більш агресивними й відправляють в атаку більші хвилі своїх найкращих бійців. Не забувайте розбудовувати та зміцнювати оборону на своїй базі.",
//     "There is an error with your account. You will be unable to use the marketplace until we have resolved the issue. If this issue persists for several days please contact support.=З вашим обліковим записом сталася помилка. Ви не зможете користуватися ринком, доки ми не вирішимо цю проблему. Якщо ця проблема не зникне через кілька днів, зверніться до служби підтримки.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Protector tower's shoot down incoming projectiles. Without them some units and structures will be harder to defend against.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Захисна вежа збиває ворожі снаряди. Без неї деяким юнітам і спорудам буде важче оборонятися.",
//     "This new mount brings its double jump and expert swimming abilities to the Overworld. Bound effortlessly through the tree tops and embrace waterways instead of avoiding them!=Цей новий транспорт демонструє у Верхньому світі подвійні стрибки та майстерність плавання. Без зусиль стрибайте по верхівках дерев і використовуйте водні шляхи замість того, щоб їх уникати!",
//     "Ancient host tower. Attacks nearby enemies with a slowing ice cube that damages enemies over time with intense cold. Be sure to protect the Frost Tower with supporting structures.=Стародавня вежа Хранителя. Атакує ворогів поблизу сповільнюючим крижаним кубиком, який поступово завдає їм шкоди сильним холодом. Обовʼязково захистіть морозну вежу спорудами підтримки.",
//     "All piglins, mobs and structures have been rebalanced for more interesting strategies. You can find the strength and weaknesses of your mobs in the songbook or when building a spawner.=Всі піґліни, моби і структури були перебалансовані для більш цікавих стратегій. Ви можете знайти сильні та слабкі сторони своїх мобів у пісеннику або при будівництві яйця призову.",
//     "While you've got your map open, you can leave map markers to help allies find resource piles or to plan where you will attack from. Remember, teamwork makes the dream work!=Поки ваша карта відкрита, ви можете залишити маркери карти, щоб допомогти союзникам знайти купи ресурсів або спланувати, звідки ви будете атакувати. Пам'ятайте, командна робота здійснює мрії!",
//     "When off, this structure cannot be constructed by player characters.|[space]|This improvement allows you to collect power towers. Without it, you will lose access to your most powerful towers.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Це вдосконалення дає змогу збирати силові вежі. Без нього ви втратите доступ до найпотужніших веж.",
//     "Reach the|*[style.bold]|village|+[key.item.village]||*[style]|that is under attack|[space]||$[key.mapScreen]|Press to find it on your|*[style.bold]|map|+[key.item.map]||*[style]|=Дістаньтеся|*[style.bold]|села|+[key.item.village]|,|*[style]|на яке напали|[space]||$[key.mapScreen]|Натисніть, щоб знайти його на своїй|*[style.bold]|карті|+[key.item.map]||*[style]|",
//     "Reaching and destroying the spore tower is nearly impossible for golems as they don't have the strength to fight off the knock-back effects. These towers must be dealt with by more resolute allies.=Големи майже не здатні дістатися до отруйної вежі та зруйнувати її, оскільки вони безсилі проти ефектів відкидання. Атакувати ці вежі повинні більш рішучі союзники.",
//     "Redstone unlocks advanced structures and can be used to spawn|*[style.bold]|zombies|+[key.item.zombieSpawner]||*[style]|.|[space]|Redstone deposits can be found in the swamp and jungle.=Редстоун дає змогу будувати кращі споруди і призивати|*[style.bold]|зомбі|+[key.item.zombieSpawner]||*[style]|.|[space]|Родовища редстоуну можна знайти на болоті та в джунглях.",
//     "This world was created using a template that you have not unlocked. You must purchase the template to unlock this world.  Would you like to purchase the template used by this world?=Цей світ створено на основі шаблону, який у вас не розблоковано. Щоб розблокувати цей світ, вам потрібно придбати шаблон. Хочете придбати шаблон, що використовується в цьому світі?",
//     "Welcome to Minecraft! Use a Microsoft Account to start connecting with the Minecraft community, where PCs, consoles, phones, and tablets can all play together. And the best part?=Ласкаво просимо до Minecraft! Увійдіть під обліковим записом Microsoft, щоб підключитися до спільноти Minecraft, де грають на ПК, консолях, телефонах і планшетах водночас. І головне!",
//     "Not only does the map show the Overworld and its settlements, but it will also reveal the locations of piglin bases and piglin movements.|[space]|And you didn’t even have to make it yourself!=Карта не тільки показує Верхній світ і його поселення, але й розкриває місця розташування баз піґлінів і їхній рух.|[space]|Тож вам навіть не треба робити це власноруч!",
//     "Blue allays collect resources; yellow allays build structures.|[space]|You can build an improvement to have more allays by your side. Remember – the allays are friends, not devices.=Сині служки збирають ресурси, а жовті будують споруди.|[space]|Ви можете побудувати удосконалення, щоб мати більше служок поруч. Памʼятайте, що служки — це друзі, а не пристрої.",
//     "Warboars are tough and quick on their hooves, knocking down enemies as they speed through the battle field.|[space]|What came first, the warboar or the piglin? Best not to dwell on that.=Бойові хряки потужні та швидкі, вони часто збивають ворогів з ніг, проносячись полем бою.|[space]|Хто зʼявився першим: бойовий хряк чи піґлін? Краще на цьому не зупинятися.",
//     "For a structure to be affected, it must be inside of the zone the battle drum creates. If the battle drum is destroyed, affected structures lose their rate of fire increase.=Для впливу на споруду та має знаходитися всередині зони, яку створює бойовий барабан. Якщо бойовий барабан зруйновано, споруди, на які він впливає, втрачають ефект прискорення стрільби.",
//     "For a structure to be affected, it must be inside of the zone the battle drum creates. If the battle drum is destroyed, affected structures lose their rate of fire increase.=Для впливу на споруду та має знаходитися всередині зони, яку створює бойовий барабан. Якщо бойовий барабан зруйновано, споруди, на які він впливає, втрачають ефект прискорення стрільби.",
//     "Fabled. Recommended for players less familiar with strategy games. Balanced world size and amount of piglin bases. Requires strategy and correct use of your tools.=Казковий. Рекомендується для гравців, менш знайомих зі стратегічними іграми. Збалансований розмір світу і кількість баз  піґлінів. Потрібна стратегія і правильне використання ваших інструментів.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns grindstone golems. Without it, you will find it harder to counter enemy ranged units.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює точильних големів. Без неї буде важче захищатися від ворожих дальнобійних юнітів.",
//     "Defeat the|*[style.bold]|Great Hog|+[key.item.greatHog]||*[style]|at the|*[style.bold]|Well of Fate|+[key.item.wellOfFate]||*[style]||[space]|Destroy his forces to weaken him=Здолайте|*[style.bold]|Великого кабана|+[key.item.greatHog]||*[style]|біля|*[style.bold]|Колодязя долі|+[key.item.wellOfFate]||*[style]||[space]|Знищте його армію, щоб послабити його",
//     "The Warriors are your most powerful ally against the piglins.|[space]|For them, defending the Overworld came at a heavy cost|[newline]||*[style.bold]|Strong vs|*[style]|elite piglins=Воїни — ваш наймогутніший союзник у війні з піґлінами.|[space]|Але захист Верхнього світу дорого їм обійшовся.|[newline]||*[style.bold]|Сильні проти|*[style]|елітних піґлінів",
//     "For a structure to be affected, it must be inside of the zone the spyglass overlook creates. If the spyglass overlook is destroyed, affected towers lose their range increase.=Для впливу на споруду та має знаходитися всередині зони, яку створює підзорна труба. Якщо підзорну трубу зруйновано, вежі, на які вона впливала, втрачають ефект підвищення дальності.",
//     "For a structure to be affected, it must be inside of the zone the spyglass overlook creates. If the spyglass overlook is destroyed, affected towers lose their range increase.=Для впливу на споруду та має знаходитися всередині зони, яку створює підзорна труба. Якщо підзорну трубу зруйновано, вежі, на які вона впливала, втрачають ефект підвищення дальності.",
//     "Your device is almost out of the space that Minecraft can use to save worlds and settings on this device.  Why not delete some old stuff you don't need so that you can keep saving new stuff?=На вашому пристрої майже закінчилося місце, яке Minecraft може використовувати для збереження світів і настройок! Видаліть старі непотрібні файли, щоб зберігати нові.",
//     "It looks like you are signed into a different Microsoft Account from the one that first downloaded the Minecraft Trial. Try again after signing in with that account.=Схоже, ви ввійшли не під тим обліковим записом Microsoft, з якого було вперше завантажено ознайомлювальну версію Minecraft. Спробуйте ще раз, після того як увійдете під цим обліковим записом.",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Prismarine is used to build improvements and wellhouses.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Призмарин використовується для будівництва вдосконалень і колодязів.",
//     "Build a|*[style.bold]|Improvement Hub|+[key.item.unlock_prismarine_upgrades]||*[style]||[space]|Improvement Hubs let you build Improvements to upgrade your tools=Побудуйте|*[style.bold]|центр удосконалення|+[key.item.unlock_prismarine_upgrades]||*[style]||[space]|Центри удосконалення дозволяють створювати удосконалення для модернізації ваших інструментів",
//     "The piglin launcher flings barrels filled with piglins onto the battlefield. The size of the base that the piglin throwers are in determines which piglins get to go for a brief ride.=Піґліномет жбурляє на поле бою бочки, заповнені піґлінами. Розмір бази, де знаходяться піґліномети, визначає, які піґліни матимуть можливість вирушити на коротку прогулянку.",
//     "When off, this structure cannot be constructed by player characters.|[space]|This structure spawns warriors. Without it, you may find that your army is lacking a well-rounded late game mob.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Ця споруда створює воїнів. Без неї вам бракуватиме всебічно розвинутих мобів для пізньої гри.",
//     "Unlink your Microsoft Account from your Steam account. You will no longer be able to play online, or access the marketplace unless you link your Microsoft Account again.=Від’єднайте обліковий запис Microsoft від облікового запису Steam. Ви більше не зможете грати онлайн або отримати доступ до Ринку, якщо не зв’яжете свій обліковий запис Microsoft знову.",
//     "Coal unlocks advanced structures and can be used to spawn|*[style.bold]|creepers|+[key.item.creeperSpawner]||*[style]|.|[space]|Coal deposits can be found in the meadow and badlands.=Вугілля дає змогу будувати кращі споруди та призивати|*[style.bold]|кріперів|+[key.item.creeperSpawner]||*[style]|.|[space]|Родовища вугілля можна знайти в лугах і пустищі.",
//     "The experience that the creator of this template wants you to have might be broken if you unlock these settings.  You might not be able to return to that intended experience if you continue.=Якщо розблокувати ці параметри, цей шаблон може не працювати так, як задумав його автор. Якщо продовжити, можливо, ви не зможете повернутися до вихідних параметрів.",
//     "These piglins have claimed this area.|[divider]|Piglins construct outposts that spread netherrack, corrupting the air with spores. This allows them to build larger bases.|[divider]|=Ці піґліни захопили цю територію.|[divider]|Піґліни будують застави, які розповсюджують незеррак, заражаючи повітря спорами. Це дозволяє їм будувати більші бази.|[divider]|",
//     "%1$s: I will build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|)|*[style]|=%1$s: Я збудую таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|, %10$d|+[key.item.%9$s]|)|*[style]|",
//     "Adds an explosive damage to projectiles shot from the arrow tower, scatter tower and redstone launcher. Requires|*[style.bold]|coal|+[key.item.coal]||*[style]|in order to build.=Cнаряди, якими стріляють стрілецька вежа, розкидна вежа та редстоуномет, тепер будуть ще й вибухати. Для будівництва потрібне|*[style.bold]|вугілля|+[key.item.coal]||*[style]|.",
//     "Enable crossplay to play with your Microsoft Friends on other platforms. If crossplay is disabled, they will not be able to see you or join in.=Увімкніть кросплатформну гру, щоби грати зі своїми друзями, що використовують Microsoft на інших платформах. Якщо кросплатформну гру відключено, ваші друзі не зможуть побачити вас або приєднатися до вашої гри.",
//     "Increases the firing speed of nearby arrow towers, scatter towers, redstone launchers and traps. Requires|*[style.bold]|redstone|+[key.item.redstone]||*[style]|in order to build.=Підвищує швидкість стрільби сусідніх стрілецьких веж, розкидних веж, редстоунометів і пасток. Для будівництва потрібен|*[style.bold]|редстоун|+[key.item.redstone]||*[style]|.",
//     "When off, this structure cannot be constructed by player characters.|[space]|Without them you will be unable to destroy most Horde of the Spore bases unless you have a redstone launcher.=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Без неї ви не зможете знищувати більшість баз Орди отруйників, якщо не маєте редстоуномета.",
//     "Your base|+[key.item.headquarter]|is under attack|[space]|Return to it and defeat the attackers|[space]|Use fast travel on the map|+[key.item.map]|to get there instantly=На вашу базу|+[key.item.headquarter]|напали|[space]|Поверніться та знищте нападників|[space]|Використовуйте швидке переміщення по карті|+[key.item.map]|, щоб дістатися туди миттєво",
//     "Mythic. Recommended for players seeking a greater challenge. Larger world size with more piglin bases. Enemy units are slightly more resilient. Resources are more scarce.=Міфічний. Рекомендовано гравцям, які шукають більшої складності. Світ більшого розміру з більшою кількістю баз піґлінів. Ворожі юніти трохи стійкіші. Ресурси трохи більш рідкісні.",
//     "These tall, lanky piglins use a disruptive noise to stun units in an area for a long duration. You might have to think twice about sending your close combat mobs in blindly!=Ці високі й худі піґліни використовують руйнівний шум, щоб надовго оглушити юнітів в окрузі. Можливо, слід двічі подумати, перш ніж посилати своїх мобів ближнього бою наосліп!",
//     "Are you sure you want to block %s? You won’t be able to join each other’s game or to appear in each other’s friendlist. If you were friends, you will no longer be friends.=Ви впевнені, що хочете заблокувати %s? Ви не зможете приєднатися до гри один одного або з'явитися в списку друзів один одного. Якщо ви були друзями, ви більше не будете дружити.",
//     "Use the Ping to Team function while in Build View to communicate to your team what you want to build or mine. A team that works together wins together.=В режимі будівництва використовуйте функцію «Зв’язок із командою», щоб повідомити своїй команді, що саме ви хочете побудувати або видобути. Якщо допомагатимете одне одному, то неодмінно переможете.",
//     "As you progress, you'll encounter stronger piglins that will be tough for your golems to combat. Explore the world and find more allies to help you in the fight.=У міру просування ви будете зіткатися з більш потужними піґлінами, протистояти яким вашим големам буде важко. Досліджуйте світ і знаходьте більше союзників, які допоможуть вам у боротьбі.",
//     "Servers offer some of the most creative ways to play Minecraft! We just need you to sign in so that we can make sure you have permission to play online with new people.=Граючи в Minecraft на серверах, можна дати повну свободу своїй уяві! Вам лише потрібно ввійти в обліковий запис, щоб ми могли перевірити ваш дозвіл на гру в мережі з новими людьми.",
//     "The amount of gravity piglin units experience. Higher values increase fall speed. Lower values decrease fall speed.|[space]|This will override the global gravity setting.=Сила тяжіння, яка діє на юніти піґлінів. Вищі значення прискорюють падіння, а нижчі — сповільнюють.|[space]|Цей параметр має пріоритет над глобальними налаштуваннями гравітації.",
//     "Stuns piglins in a very large area.|[divider]|Cannot be collected while the Well of Fate is under assault!|[divider]|A Host relic that was once home to the musical allays.=Приголомшує піґлінів на дуже великій ділянці|[divider]|Не можна зібрати, поки колодязь долі під ударом!|[divider]|Реліквія Хранителя, яка колись була домом для музичних служок.",
//     "Sporebacks are the Horde of the Spore's elite units. The mushroom grenades they throw are designed to root enemies to the ground and render them defenseless against other piglins.=Спороспини — це елітні бійці Орди отруйників. Вони кидають у ворогів грибні гранати, які неначе прицвяховують тих до землі, роблячи беззахисними перед іншими піґлінами.",
//     "Powerful improvement allowing you to build a bigger army of mobs to fight back against the piglins. Spawning mobs cost Flames of Creation. When a mob dies, the flame is returned.=Потужне вдосконалення, яке дозволяє зібрати більшу армію мобів та дати відсіч піґлінам. Для призову мобів потрібне полум’я творення. Коли моб гине, полум’я повертається.",
//     "Redstone is a rare resource found in small deposits around the Overworld and collected in village chests. It’s required to build the redstone launcher and the battle drum.=Редстоун — рідкісний ресурс, який можна знайти в невеликих родовищах Верхнього світу або в сільських скринях. Він потрібен для створення редстоуномета та військового барабана.",
//     "Mossy golems use the healing waters of the Well of Fate to heal the Hero and their allies.|[space]|There’s nothing like splashing around with a mossy golem on a warm day.=Замшілі големи використовують цілющі води колодязя долі, щоби зцілити героя і його союзників.|[space]|Що може бути краще, ніж вештатися разом із замшілим големом у теплий день?",
//     "A powerful upgrade that improves your capability to spawn large armies of|*[style.paperBold]|skeletons|+[key.item.skeletonSpawner]||*[style]|and build structures that cost diamond.=Потужне покращення, яке поліпшує вашу здатність призивати великі армії|*[style.paperBold]|скелетів|+[key.item.skeletonSpawner]||*[style]|і будувати споруди за алмази.",
//     "Far away mobs can be recalled at Mob Spawners by holding|$[key.combatRecall]|when standing next to a spawner. This will recall all mobs to your position if they are not rallied.=Мобів дальнього бою можна призивати в генераторах мобів. Для цього підійдіть до генератора та утримуйте|$[key.combatRecall]|. Усі нескликані моби будуть призвані до вас.",
//     "The amount of allay chests in the Overworld. This setting cannot be changed once the world has been generated.|[space]|This setting has not been modified in existing difficulties.=Кількість скринь служок у Верхньому світі. У згенерованому світі цей параметр змінювати не можна.|[space]|Цей параметр не був змінений для існуючих рівнів складності.",
//     "Enables gather allays to collect redstone. Each additional improvement allows you to carry:|[newline]||*[style.bold]|+150 redstone|+[key.item.redstone]||*[style]|=Дає можливість служкам-збирачам збирати редстоун. Кожне додаткове вдосконалення дозволяє взяти з собою:|[newline]||*[style.bold]|+150 одиниць редстоуну|+[key.item.redstone]||*[style]|",
//     "You can play Minecraft Legends online with friends — all you need to do is log in with a Microsoft Account. Don’t have an account yet? Create one for free.=Ви можете грати в Minecraft Legends онлайн із друзями. Вам потрібно лише виконати вхід за допомогою облікового запису Microsoft. Ви ще не маєте облікового запису? Створіть його безкоштовно.",
//     "Coal is used to spawn creepers and build certain advanced structures like the kaboomery. It's fairly rare, but you can find coal deposits in most biomes.=Вугілля використовується для генерування кріперів і будівництва певних удосконалених споруд на кшталт вибухів’ярні. Воно досить рідкісне, але в більшості біомів можна знайти родовища вугілля.",
//     "Enables gather allays to collect redstone. Each additional improvement allows you to carry:|[newline]||*[style.paperBold]|+500 redstone|+[key.item.redstone]||*[style]|=Дає можливість служкам-збирачам збирати редстоун. Кожне додаткове удосконалення дозволяє носити:|[newline]||*[style.paperBold]|+500 од. редстоуну|+[key.item.redstone]||*[style]|",
//     "Action is the youngest at heart of the three Hosts. They are innocent and childlike, and are the most outspoken about their care and love for the beings of the Overworld.=Дія є наймолодшою серцем серед трьох Хранителів. Вона невинна та поводиться дещо по-дитячому, а також найбільш відверто виявляє турботу та любов до мешканців Верхнього світу.",
//     "The amount of redstone veins in the Overworld. This setting cannot be changed once the world has been generated.|[space]|Existing difficulties are set to:|[newline]|Storied =Кількість жил редстоуну у Верхньому світі. У згенерованому світі цей показник змінювати не можна.|[space]|Наявні рівні складності мають такі значення:|[newline]|Сюжетний ",
//     "Play a 4v4 game that’s open to anyone. Invite friends to your own team. Once ready, start looking for available players. Any player can join from that point.=Грайте в гру 4 на 4, відкриту для будь-кого. Запрошуйте друзів у власну команду. Коли будете готові, почніть шукати доступних гравців. З цього моменту може приєднатися будь-який гравець.",
//     "Release your golems|[space]||$[key.heroLure]|Hold to stop your |*[style.bold]|golems|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|from following you=Відпустіть своїх големів|[space]||$[key.heroLure]|Утримуйте, щоб зупинити |*[style.bold]|големів|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|, які слідували за вами",
//     "Repairs nearby structures within its zone. Healing effects cannot stack with additional carpenter huts, but can allow your team to heal structures in a wider area.=Ремонтує споруди у прилеглій зоні. Цілющі ефекти не сумуються, яку б кількість теслярень ви не побудували, але це дозволяє вашій команді відновлювати споруди на більшій території.",
//     "The Horde of the Spore's chaotic fighters will keep you on your toes. It won't be easy getting to their portals – and there will be many surprises until the battle is won.=З хаотичними бійцями Орди отруйників вам доведеться завжди бути насторожі. Дістатися до їхніх порталів буде непросто, і буде багато сюрпризів, поки битва не буде виграна.",
//     "A powerful upgrade that improves your capability to spawn large armies of|*[style.paperBold]|creepers|+[key.item.creeperSpawner]||*[style]|and build structures that cost coal.=Потужне покращення, яке поліпшує вашу здатність призивати великі армії|*[style.paperBold]|кріперів|+[key.item.creeperSpawner]||*[style]|і будувати споруди за вугілля.",
//     "For a structure to be affected, it must be inside of the zone the kaboomery creates. If the kaboomery is destroyed, affected structures lose their explosive shot.=Для впливу на споруду та має знаходитися всередині зони, яку створює вибухів'ярня. Якщо вибухів'ярню зруйновано, споруди, на які вона впливає, втрачають ефект вибухового пострілу.",
//     "For a structure to be affected, it must be inside of the zone the kaboomery creates. If the kaboomery is destroyed, affected structures lose their explosive shot.=Для впливу на споруду та має знаходитися всередині зони, яку створює вибухів'ярня. Якщо вибухів'ярню зруйновано, споруди, на які вона впливає, втрачають ефект вибухового пострілу.",
//     "The amount of diamond veins in the Overworld. This setting cannot be changed once the world has been generated.|[space]|Existing difficulties are set to:|[newline]|Storied =Кількість жил алмазів у Верхньому світі. У згенерованому світі цей показник змінювати не можна.|[space]|Наявні рівні складності мають такі значення:|[newline]|Сюжетний ",
//     "A powerful upgrade that improves your capability to spawn large armies of|*[style.paperBold]|zombies|+[key.item.zombieSpawner]||*[style]|and build structures that cost redstone.=Потужне покращення, яке поліпшує вашу здатність призивати великі армії|*[style.paperBold]|зомбі|+[key.item.zombieSpawner]||*[style]|й будувати споруди за редстоун.",
//     "Coal is used to spawn creepers and build certain advanced structures like the kaboomery. It's fairly rare, but you can find coal deposits in most biomes.=Вугілля використовується для генерування кріперів і будівництва певних складних споруд на зразок вибухів’ярні. Воно досить рідкісне, але в більшості біомів можна знайти родовища вугілля.",
