//     "How frequently the village chest is refreshed with resources.  The default value for this across all difficulties has always been 30 minutes, equivalent to one in-game day.=Те, як часто сільська скриня поповнюється ресурсами. Значення за замовчуванням для всіх рівнів складності завжди дорівнює 30 хвилин, що еквівалентно одному дню в грі.",
