//     "Open your map|+[key.item.map]|to find which resources are nearby. The|+[key.item.map]|can help you with a strategy based on the resources close to your HQ=Відкрийте карту|+[key.item.map]|, щоб дізнатися, які ресурси є поруч. |+[key.item.map]|допоможе вам розробити стратегію з урахуванням наявних біля вашого штабу ресурсів.",
//     "Enables gather allays to collect iron. Each additional improvement allows you to carry:|[newline]||*[style.paperBold]|+500 iron|+[key.item.iron]||*[style]|=Дає можливість служкам-збирачам збирати залізо. Кожне додаткове удосконалення дозволяє носити:|[newline]||*[style.paperBold]|+500 од. заліза|+[key.item.iron]||*[style]|",
//     "You are not connected to the internet. Your friends will not be able to join your multiplayer worlds. Sign in to your Microsoft Account to play with your friends.=Немає підключення до Інтернету. Ваші друзі не зможуть приєднатися до ваших мультиплеєрних світів. Увійдіть у свій обліковий запис Microsoft, щоб грати з друзями.",
//     "The amount of gravity the player experiences. Higher values increase fall speed. Lower values decrease fall speed.|[space]|This will override the global gravity setting.=Сила тяжіння, яка діє на гравця. Вищі показники збільшують швидкість падіння, а нижчі — зменшують.|[space]|Це перекриє глобальне налаштування гравітації.",
//     "Any enemy who approaches this structure will be frozen in place for a short period of time. The ice trap will continue to freeze enemies until something else eliminates them.=Ворог, який наблизиться до цієї споруди, ненадовго примерзне до землі. Заморожувач буде й надалі заморожувати ворогів, поки їх не знищить щось інше.",
//     "You can now fast travel to this village by selecting it on your map. You can travel as often as you like as long as the village fountain continues to flow.=Тепер ви можете швидко переміщуватися до цього села, вибравши його на своїй карті. Переміщуватися можна скільки завгодно часто, поки продовжує текти сільський фонтан.",
//     "The big beak calls the jagged peaks home, and dispite their flightless disposition, they still enjoy climbing craggy peaks and rock outcroppings and gliding to the ground.=Великий дзьоб вважає гостроверхі вершини своїм домом, і хоч він і не літає, йому дуже подобається дертися на круті піки, а потім планерувати на землю.",
//     "The fearless frog can be found lurking around the waterways in the swamp. It hops effortlessly between foliage and uses its superior swim speed to catch all manner of bugs.=Безстрашна жаба частенько ховається біля водних проток на болотах. Вона легко стрибає серед листя і плаває так швидко, що може ловити всіляких комах.",
//     "The fearless frog can be found lurking around the waterways in the swamp. It hops effortlessly between foliage and uses its superior swim speed to catch all manner of bugs.=Безстрашна жаба частенько ховається біля водних проток на болотах. Вона легко стрибає серед листя і плаває так швидко, що може ловити всіляких комах.",
//     "Improvement that allows you to build a few more mobs to fight back against the piglins. Spawning mobs cost Flames of Creation. When a mob dies, the flame is returned.=Вдосконалення, яке дозволяє зібрати більше мобів та дати відсіч піґлінам. Для призову мобів потрібне полум’я творення. Коли моб гине, полум’я повертається.",
//     "We added a custom campaign mode. Gain much more control over the world generation, resource amounts etc. It also allows you to skip the prologue entirely.=Додано користувацький режим кампанії. У вас буде значно більше контролю над генерацією світу, кількістю ресурсів тощо. Це також дає змогу повністю пропустити пролог.",
//     "Destroy the|*[style.bold]|piglin base|+[key.item.dbb]||*[style]|creating this permanent night.|[space]||+[key.item.headquarter]|Don’t forget to build a wellhouse=Знищте|*[style.bold]|базу піґлінів|+[key.item.dbb]||*[style]|, що створює нескінченну ніч.|[space]||+[key.item.headquarter]|Обов’язково побудуйте дім-колодязь",
//     "Short-range tower that shoots a volley of arrows at enemies that come within range. Requires|*[style.bold]|coal|+[key.item.coal]||*[style]|in order to build.=Вежа малої дальності, яка стріляє залпом стріл у ворогів, що потрапляють у радіус дії. Для будівництва потрібне|*[style.bold]|вугілля|+[key.item.coal]||*[style]|.",
//     "No time to enjoy the journey? Fast travel by opening your map, hovering over the icons surrounded by a blue square, and pressing the indicated hotkey.=Немає часу насолоджуватися подорожжю? Швидко переміщуйтеся, відкривши карту, навівши вказівник на значки, оточені синім квадратом, і натиснувши зазначену гарячу клавішу.",
//     "Air choppers create an intense blast of spore-filled air that knocks back mobs and heals piglins. Take advantage of their downtime or engage from far away.=Розпорошувачі створюють потужний повітряний вибух, наповнений отруйниками, який відкидає мобів і зцілює піґлінів. Скористайтеся їхнім простоєм або атакуйте здалеку.",
//     "If you are already using an existing Microsoft Account to access other Minecraft products on other devices, you may wish to use that account.=Якщо ви вже використовуєте наявний обліковий запис Microsoft для доступу до інших продуктів Minecraft на інших пристроях, можливо, ви схочете скористатися цим обліковим записом.",
//     "If you are already using an existing Microsoft Account to access other Minecraft products on other devices, you may wish to use that account.=Якщо ви вже використовуєте наявний обліковий запис Microsoft для доступу до інших продуктів Minecraft на інших пристроях, можливо, ви схочете скористатися цим обліковим записом.",
//     "Enables the rendering of light rays. When turned on, sunlight creates light streaks between trees and buildings placed in front of the sun.=Дозволяє відтворювати світлові промені. Коли цей параметр ввімкнуто, сонячне світло створює світлові смуги між деревами і будівлями, що розташовані на передньому плані щодо сонця.",
//     "The icons on your map denote important locations, and you can hover over them to get more information. Some icons are only visible when zoomed in.=Значки на вашій карті позначають важливі місця, і ви можете навести на них курсор, щоб отримати більше інформації. Деякі значки відображаються лише при збільшенні масштабу.",
//     "Scales the amount of extra space in the world, allowing you to make it larger or smaller. This setting cannot be changed once the world has been generated.=Масштабує кількість додаткового простору в світі за рахунок того, що дає змогу його збільшити або зменшити. У згенерованому світі цей показник змінювати не можна.",
//     "Spawns a witch|+[key.item.unlock_spawer_witch]|, a powerful mob that excels at defeating groups of mobs. Witch Huts can only by built in your base zone.=Призиває відьму|+[key.item.unlock_spawer_witch]| — потужного моба, який із легкістю перемагає групи мобів. Відьомські хатини можна побудувати лише в зоні вашої бази.",
//     "Netherrack blocks you from placing structures, use the Cure Netherrack melody to remove nether and you'll be able to build structures closer to piglin bases.=Блоки незерраку не дозволяють розміщувати споруди, тож використовуйте мелодію лікування незерраку, щоб видалити незер і будувати споруди ближче до баз піґлінів.",
//     "Defeat the piglins attacking the village|[space]|Your|*[style.bold]|golem allies|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|are useful in a fight=Знищте піґлінів, що нападають на село|[space]|Ваші|*[style.bold]|союзники-големи|+[key.item.woodSpawner]||+[key.item.stoneSpawner]||*[style]|корисні в бою",
//     "Fighting lots of piglins at once can be overwhelming – try building walls to slow them down and create some distance between you and your enemies.=Боротьба з великою кількістю піґлінів одночасно може бути непосильною, тому спробуйте побудувати стіни, щоб уповільнити їх і створити деяку відстань між вами та ворогами.",
//     "The First of Diorite is the ancient golem who specializes in summoning other mobs to the battlefield. This golem is a must for pushing into large bases.=Перший із діориту — це один із древніх големів, який спеціалізується на призові інших мобів на поле бою. Наступ на великі бази без цього голема просто неможливий.",
//     "Knowledge is a pragmatic optimist. They are hopeful for the future of the Overworld, but not so naive to think that there won't be obstacles along the way.=Досвід — прагматичний оптиміст. Він вірить у майбутнє Верхнього світу, але він не такий наївний, щоб вважати, що шлях до цього майбутнього буде безперешкодним.",
//     "Build a|*[style.bold]|Lapis Flag|+[key.item.lapisFlag]||*[style]|to increase your teams passive|*[style.bold]|lapis|+[key.item.lapis]||*[style]|income=Встановіть|*[style.bold]|лазуритовий прапор|+[key.item.lapisFlag]||*[style]|для збільшення пасивного|*[style.bold]|надходження|+[key.item.lapis]||*[style]|лазуриту",
//     "The lava launcher is a slow and lumbering beast that delivers a devastating ranged attack. But that doesn't mean you should get too close to it.=Запускач лави — це повільний, незграбний звір, дальні атаки якого, втім, несуть суцільне руйнування. Але це не означає, що ви повинні підходити до нього занадто близько.",
//     "When playing co-op, collected resources are shared with your teammates, but you'll have your own allays to build structures and gather resources.=Під час гри в режимі взаємодії ви ділитеся ресурсами з вашими товаришами по команді, але зможете використовувати власних служок для побудови споруд і збирання ресурсів.",
//     "When a village is under attack you can hear the piglin invasion horn and see horde banners on the compass to determine which directions the piglins are attacking from.=Коли село атакують, ви можете почути бойові роги піґлінів і побачити на компасі бойові стяги, які визначають, з яких напрямків нападають піґліни.",
//     "Cobblestone golems are hardy units that can take down structures easily in large numbers.|[space]|It turns out that the humble cobblestone has a mighty history.=Круглякові големи — це витривалі бійці, здатні легко зносити споруди у великій кількості.|[space]|Як виявляється, скромний кругляк має могутню історію.",
//     "Destroys large enemy projectiles in a wide area surrounding the protector tower. Requires|*[style.bold]|iron|+[key.item.iron]||*[style]|in order to build.=Знищує ворожі снаряди на великій відстані в межах прилеглої до захисної вежі зони. Для будівництва потрібне|*[style.bold]|залізо|+[key.item.iron]||*[style]|.",
//     "Ancient host tower. Attacks nearby enemies with a frost cube, slowing enemies over time with intense cold. Lost permanently if destroyed.=Стародавня вежа Хранителя. Атакує ворогів поблизу, кидаючи в них крижаним кубиком, який сильним холодом поступово сповільнює ворогів. Після знищення вежу неможливо відновити.",
//     "Need units to follow you? Rally them with the Banner of Courage to make nearby mobs and golems come to your aid and follow you through the Overworld.=Потрібно, щоб бійці слідували за вами? Скликайте їх до стяга мужності, щоб змусити мобів і големів поблизу прийти на допомогу та слідувати за вами Верхнім світом.",
//     "The Banner of Courage is a symbol of unity and hope. Together with your leadership, the Banner can inspire your allies to charge bravely into the toughest battles.=Стяг мужності є символом єдності та надії. Разом із вашим керівництвом стяг може надихнути ваших союзників мужньо брати участь у найжорсткіших боях.",
//     "The % of resources that your team will lose when a player dies.|[space]|This will add significant consequences to failure, so proceed at your own risk!=Відсоток ресурсів, які ваша команда втратить, коли гравець помре.|[space]|Унаслідок невдачі спричинятимуть значніші наслідки, тому дійте на свій страх і ризик!",
//     "The amount of knockback resistance that player character's have.|[space]|Higher values mean players will be knocked back less. Lower values mean players will be knocked back further.=Міра протидії відкиданню, яку мають персонажі гравців.|[space]|Що більше значення, то менше буде відкидати гравців, і навпаки.",
//     "The|*[style.bold]|Chest|+[key.item.fateChest]||*[style]|is empty. Please wait for the|*[style.bold]|villagers|+[key.item.villager]||*[style]|to fill it back up.=|*[style.bold]|Скриня|+[key.item.fateChest]||*[style]|порожня. Дочекайтеся , поки|*[style.bold]|селяни|+[key.item.villager]||*[style]|її наповнять.",
//     "Use sprint to traverse the Overworld faster – at least until your mount gets tired. And remember: different mounts have different abilities.=Використовуйте біг, щоб пересуватися Верхнім світом швидше — принаймні до тих пір, поки ваш транспорт не втомиться. І пам’ятайте: різний транспорт має різні здібності.",
//     "You can retrieve mobs that are scattered around by recalling them at spawners. They will not be recalled if they are being rallied or directed by an ally.=Ви можете скликати мобів, розкиданих по всій території, через їх призов до генераторів. Їх призов буде неможливий, якщо їх згуртує або направить союзник.",
//     "Medium base, moderate rewards.|[divider]|Resource Rewards:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|=Середня база, помірні винагороди.|[divider]|Ресурси в нагороду:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|",
//     "The amount of this resource that you will start with. This setting cannot be changed once the world has been generated.|[space]|Lapis is used for spawning mobs.=Кількість цього ресурсу на початку гри. У згенерованому світі цей показник змінювати не можна.|[space]|Лазурит використовується для призову мобів.",
//     "The amount of knockback that a player character deals with their sword. Increase to send piglins flying or decrease to remove it entirely.=Сила відкидання ударами меча, які завдає персонаж гравця. Цей показник можна збільшити, щоб піґліни відлітали далеко, або зменшити аж до повного усування цього ефекту.",
//     "Do you want to leave? This will disconnect all other players in the current game and restrict you from hosting a public Versus game for %s minutes.=Хочете вийти? Буде відключено всіх інших гравців у поточній грі, а ви не зможете організовувати загальнодоступні ігри в режимі суперництва впродовж %s хвилин.",
//     "Turn on to auto update content downloaded from the marketplace when new versions are available. This setting is recommended for a more stable experience.=Увімкніть автоматичне оновлення вмісту, завантаженого з Ринку, коли стають доступними нові версії. Цей параметр рекомендується для більш стабільної гри.",
//     "Small base, small rewards.|[divider]|Resource Rewards:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|=Невелика база, невеликі винагороди.|[divider]|Ресурси в нагороду:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|",
//     "The content that you are trying to use is not allowed in cross-platform multiplayer games.  If you continue you will not be able to play cross-platform multiplayer games.=Вміст, який ви намагаєтеся використати, недоступний у кросплатформних мультиплеєрних іграх. Якщо продовжити, ви не зможете грати в них.",
//     "At this time each day, villagers fill their chest with the resources they've collected, unless it's already full. Visit a village to collect your rewards!=У цей час щодня жителі села наповнюють свої скрині зібраними ресурсами, якщо тільки вони вже не заповнені. Відвідайте село, щоб забрати свої нагороди!",
//     "Swaps the|$[key.faceButton.down]|and|$[key.faceButton.right]|buttons on your DUALSHOCK®4 wireless controller. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.down]|і|$[key.faceButton.right]|на безпроводовому контролері DUALSHOCK®4. Стосується тільки меню, а не ігрового процесу.",
//     "The current state of a village can be seen on the world map. You can quickly tell if it's targeted for attack, under attack, damaged or occupied.=Поточний стан села можна побачити на карті світу. Ви можете швидко визначити, чи планується атака на нього, чи напад уже іде, чи село пошкоджено або захоплено.",
//     "You cannot join this game because cross-platform multiplayer is currently disabled. Please visit help.minecraft.net for more information.=Ви не можете приєднатися до цієї гри, оскільки кросплатформна мультиплеєрна гра зараз відключена. Будь ласка, відвідайте help.minecraft.net для додаткової інформації.",
//     "Find large bases too challenging? Make sure you unlock plenty of upgrades and make all the mob alliances you can before fighting a boss base.=Вважаєте великі бази занадто складними? Переконайтеся, що ви розблокували багато модернізацій і уклали всі можливі альянси з мобами, перш ніж битися з базою боса.",
//     "The amount of knockback resistance that piglin units have.|[space]|Higher values mean piglins will be knocked back less. Lower values mean piglins will be knocked back further.=Міра протидії відкиданню, яку мають юніти піґлінів.|[space]|Чим більше значення, тим менше буде відкидати піґлінів, і навпаки.",
//     "Swaps the|$[key.faceButton.down]|and|$[key.faceButton.right]|buttons on your DualSense™ wireless controller. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.down]|і|$[key.faceButton.right]|на безпроводовому контролері DualSense™. Стосується тільки меню, а не ігрового процесу.",
//     "One time improvement adds:|[newline]|+100% repair speed of|*[style.bold]|carpenter hut|*[style]||[newline]|+50% construction speed of all structures=Одноразове вдосконалення додає:|[newline]|+100% до швидкості ремонту |*[style.bold]|теслярні|*[style]||[newline]|+50% до швидкості будівництва всіх споруд",
//     "Build an improvement at the Well of Fate to link village chests together. This allows you to acquire the resources from all villages at any village you go to.=Побудуйте удосконалення біля колодязя долі, щоб об’єднати сільські скрині. Після цього ресурси з усіх сіл можна буде забирати у будь-якому селі.",
//     "The world is not fully synced or has been corrupted. Try playing the world on a console where it's in a good state and try migrating it again.=Світ не повністю синхронізовано або пошкоджено. Спробуйте запустити світ на консолі, де він перебуває в робочому стані, а потім спробуйте перенести його ще раз.",
//     "Where the player can fast travel to. Change this if you want traversal of the Overworld to a bigger part of the game.|[space]|Standard =Визначає, куди гравець може швидко переміщуватися. Змініть цей параметр, якщо хочете, щоб подорож Верхнім світом стала більш значною частиною гри.|[space]|Стандартне ",
//     "An essential upgrade that greatly aids in fighting back the piglin threat. Use it to push into their bases and build structures at their gates.=Важлива модернізація, яка ефективно допомагає відбивати напади піґлінів. Використовуйте її, щоби вдиратися на ворожі бази й будувати споруди біля їхніх воріт.",
//     "Markers appear on your compass and you can use this to find what you're looking for. Other Hero's Map Markers will appear on your compass as well.=Маркери відображаються на компасі, і з їх допомогою легко знаходити те, що вам потрібно. Маркери карти іншого героя також відображаються на вашому компасі.",
//     "You are out of data storage space and Minecraft is unable to save your progress! Minecraft will return you to the Main Menu to clear up storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft не вдалося зберегти результати. Вас буде переспрямовано в головне меню для звільнення місця.",
//     "Improves your Banner of Courage to rally more mobs with you at a time. Try pairing with|*[style.bold]|Improvement: Flames of Creation|*[style]|.=Покращує ваш стяг мужності, що дозволяє скликати більше мобів за раз. Використовуйте його разом із|*[style.bold]|удосконаленням: полум’я творення|*[style]|.",
//     "Permanently turns nearby walls, towers and gates into|*[style.bold]|stone|+[key.item.stone]||*[style]|blocks which significantly increases their durability.=Назавжди перетворює сусідні стіни, вежі та ворота на |*[style.bold]|кам'яні|+[key.item.stone]||*[style]| блоки, що значно підвищує їх стійкість.",
//     "You have gathered a large amount of|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|. Go back to the Well of Fate and build an improvement structure=У вас достатньо|*[style.bold]|призмарину|+[key.item.prismarine]||*[style]|. Повертайтеся до колодязя долі, щоби збудувати споруду покращення.",
//     "The Horde of the Bastion won't take the destruction of their beautiful fortresses lightly. Beware retaliation when you poke holes in their walls.=Якщо ви зруйнуєте прекрасні фортеці Орди укріпників, вони вам цього не пробачать. Тож остерігайтеся помсти піґлінів, коли протикаєте дірки в їхніх стінах.",
//     "Large base, large rewards.|[divider]|Resource Rewards:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|=Велика база, великі нагороди.|[divider]|Ресурси в нагороду:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|",
//     "Certain structures can be deconstructed to regain their resources. Approach the structure and hold|$[key.deconstruct]|to deconstruct it.=Деякі споруди можна розібрати, щоб повторно використати ресурси, що на них витрачені. Щоб демонтувати споруду, наблизьтеся до неї та утримуйте|$[key.deconstruct]|.",
//     "Villages contain chests filled with|*[style.bold]|lapis|+[key.item.lapis]||*[style]|. Go to a village and search for the chest next to the Fountain to collect it=У селах можна знайти скрині з|*[style.bold]|лазуритом|+[key.item.lapis]||*[style]|. Сходіть у село й заберіть його зі скрині біля фонтана",
//     "Turn on to auto update content downloaded from the store when new versions are available. This setting is recommended for a more stable experience.=Увімкніть автоматичне оновлення вмісту, завантаженого з Магазину, коли стають доступними нові версії. Цей параметр рекомендується для стабільнішої гри.",
//     "Turn on to auto update content downloaded from the store when new versions are available. This setting is recommended for a more stable experience.=Увімкніть автоматичне оновлення вмісту, завантаженого з магазину, коли стають доступними нові версії. Цей параметр рекомендується для стабільнішої гри.",
//     "Swaps the|$[key.faceButton.left]|and|$[key.faceButton.up]|buttons on your DUALSHOCK®4 wireless controller. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.left]|і|$[key.faceButton.up]|на безпроводовому контролері DUALSHOCK®4. Стосується тільки меню, а не ігрового процесу.",
//     "Find a big beak mount to not only jump higher, but also land gracefully. Explore the highest locations and glide down from them with grace.=Знайдіть транспорт із великим дзьобом, щоб не тільки стрибнути вище, але і витончено приземлитися. Досліджуйте найвищі місця й елегантно планеруйте з них униз.",
//     "Turns Dynamic Resolution on or off. Dynamic resolution will improve performance at lower framerates, but reduce visual quality.=Вмикає або вимикає динамічну роздільну здатність. Динамічна роздільна здатність покращить продуктивність при більш низькій частоті кадрів, але погіршить візуальну якість.",
//     "Forget how to use banner view, mount swap, or Improvements? Check out the How To Play pages for information on all these and more.=Забули, як використовувати перегляд стягів, зміну транспорту або удосконалення? Переглядайте сторінки «‎Як грати», щоб отримати інформацію про все це та багато іншого.",
//     "with field in rawtext must contain a array. Example: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]=з полем в об’єкті rawtext має містити масив. Приклад: \"rawtext\":[{\"translate\": \"chat.type.announcement\", \"with\": [ \"value1\", \"value2\" ]}]",
//     "You need a|*[style.bold]|piglin key|+[key.item.piglinKey]||*[style]|to open this chest. Found most often on piglins roaming the world.=Щоб відкрити цю скриню, вам потрібен|*[style.bold]|піґлінський ключ|+[key.item.piglinKey]||*[style]|. Переважно його можна знайти в піґлінів, що мандрують світом.",
//     "Swaps the|$[key.faceButton.left]|and|$[key.faceButton.up]|buttons on your DualSense™ wireless controller. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.left]|і|$[key.faceButton.up]|на безпроводовому контролері DualSense™. Стосується тільки меню, а не ігрового процесу.",
//     "Wood is essential for many structures. Make sure you keep your|*[style.bold]|allay Storage|+[key.item.fateChest]||*[style]|filled with wood.=Деревина потрібна для будівництва багатьох споруд. Не забувайте поповнювати запаси деревини у|*[style.bold]|сховищі служок|+[key.item.fateChest]||*[style]|.",
//     "The amount of knockback resistance that the player's mobs have.|[space]|Higher values mean mobs will be knocked back less. Lower values mean mobs will be knocked back further.=Міра протидії відкиданню, яку мають моби гравців.|[space]|Що більше значення, то менше буде відкидати мобів, і навпаки.",
//     "Stone is essential for many structures. Make sure you keep your|*[style.bold]|allay Storage|+[key.item.fateChest]||*[style]|filled with stone.=Камінь потрібен для будівництва багатьох споруд. Не забувайте поповнювати запаси каменю у|*[style.bold]|сховищі служок|+[key.item.fateChest]||*[style]|.",
//     "You can go to this world's resource and behavior pack settings and remove those packs to continue, but the world may no longer be playable.=Щоб продовжити, перейдіть до ресурсів цього світу та параметрів пакета поведінки, а потім видаліть ці пакети. Але після цього ви не зможете грати у світі.",
//     "Gates will open for you but not for enemies. Use with|*[style.bold]|walls|+[key.item.wall]||*[style]| to build an effective defense.=Ворота відкриватимуться для вас, але не для ворогів. Використовуйте разом зі |*[style.bold]|стінами|+[key.item.wall]||*[style]| для побудови ефективної оборони.",
//     " Not happy with your current mobs? Nearby mobs automatically disband if you try to spawn more but have no Flames of Allegiance left.= Не задоволені вашими нинішніми мобами? Найближчі моби автоматично розпускаються, якщо ви намагаєтеся генерувати більше, але не маєте більше полум’я лояльності.",
//     "The Horde of the Hunt has aggressive, fast-moving armies that favor direct attacks. You will need to push back hard to stop their advance.=Орда мисливців складається з агресивних і швидких армій, які полюбляють прямі атаки. Вам потрібно буде давати сильну відсіч, щоб зупинити їх просування.",
//     "Structure that enhances nearby units, applying a buff that increases their damage. When units leave the aura, the buff will persist for a short duration.=Споруда, яка підсилює сусідніх юнітів, збільшуючи їхню шкоду. Коли юніти покидають ауру, підсилення зберігається протягом короткого часу.",
//     "The skin that you have equipped is from a content pack that is not allowed in multiplayer. Continuing will disable multiplayer for this world.=Скін, який ви намагаєтеся використати з пакета вмісту, недоступний у мультиплеєрних іграх. Якщо продовжити, мультиплеєр буде вимкнуто в цьому світі.",
//     "When enabled, player characters will jump as high as if they always had the bouncecap buff.|[space]|This can stack with the bouncecap buff.=Коли ввімкнуто, персонажі гравців стрибатимуть так високо, ніби завжди мали підсилення стрибучості.|[space]|Може додаватися до підсилення стрибучості.",
//     "Gates will open for you but not for enemies. Use with|*[style.bold]|walls|+[key.item.wall]||*[style]| to build effective defense.=Ворота відкриватимуться для вас, але не для ворогів. Використовуйте разом зі |*[style.bold]|стінами|+[key.item.wall]||*[style]| для побудови ефективної оборони.",
//     "The power towers you'll come across in the Overworld have unique powers. You'll need the Improvement: Collect Power Towers to collect them.=Силові вежі, з якими ви зіткнетесь у Верхньому світі, мають унікальну силу. Щоб забрати їх собі, вам знадобиться удосконалення: забирання силових веж.",
//     "Medium bases can be challenging. Before tackling them, make sure you can defeat a horde's small bases so you're properly prepared.=Середні бази можуть бути складними. Перш ніж братися за них, переконайтеся, що ви можете розгромити невеликі бази орди, щоб бути належним чином підготовленими.",
//     "The map is a very valuable tool. It shows you where you can find specific resources, information about piglin bases, and the locations of players.=Карта є дуже цінним інструментом. Вона показує, де ви можете знайти конкретні ресурси, інформацію про бази піґлінів і місцезнаходження гравців.",
//     "Enables gather allays to convert|*[style.bold]|netherrack|+[key.item.denether]||*[style]|to a safe block that you can build structures on.=Дає можливість служкам-збирачам перетворювати|*[style.bold]|незеррак|+[key.item.denether]||*[style]|на безпечні блоки, на яких можна будувати споруди.",
//     "You can only sync packs purchased outside of the Minecraft Marketplace once. They will continue to be available to anyone who plays on this device.=Ви можете синхронізувати пакети скінів, придбані поза Ринком Minecraft, лише один раз. Вони будуть доступні всім користувачам цього пристрою.",
//     "%1$s: I will build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|)|*[style]|=%1$s: Я збудую|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|)|*[style]|",
//     "Legends say that the Great Hog was born from lava, spat out by the Nether itself to feast on the bones of those who dare to show any resistance.=Згідно з легендами, Великий кабан народився з лави, виплюнутої самим Незером, щоб ласувати кістками тих, хто наважиться чинити будь-який опір.",
//     "Brute's are the Horde of the Bastion's elite units. They pack a devastatingly fast whirlwind attack in close quarters that will smash your units to bits in an instant.=Бугаї — це елітні бійці Орди укріпників. Вони настільки швидкі в ближньому бою, що здатні миттєво знищити ваших юнітів.",
//     "The First of Brick has a large deployable shield that will protect your army from oncoming projectiles. Placement is important when commanding this ancient golem.=Перший із цегли має великий щит, який захистить вашу армію від ворожих снарядів, але важливо правильно його використовувати.",
//     "Structures and large piglins cannot be damaged by your sword. If you see your sword bounce off an enemy, try using your units to attack!=Спорудам і великим піґлінам не можна завдати шкоди мечем. Якщо ви бачите, що ваш меч відскакує від ворога, спробуйте використати свої юніти для атаки!",
//     "Pair a gate with walls in your base zone, it will help defend your base against enemies by allowing you to leave but stops enemies from pushing in.=Зведіть укріплення навколо воріт у зоні бази, це допоможе захистити базу від ворогів і дозволить вам відступити, а ворогам не просунутися.",
//     "The witches use their huts to brew their mysterious and powerful potions in solitude. While active, you can interact with the hut to spawn witches.=Відьми у своїх хатинах на самоті варять таємничі й потужні зілля. Поки хатина активна, ви можете з нею взаємодіяти, щоб призивати відьом.",
//     "Creepers deal impressive damage to most structures. Use them to blow holes in your enemy's defenses and clear the way for other units.=Кріпери завдають значної шкоди більшості споруд. Використовуйте їх, щоб зробити дірки в обороні вашого противника та розчистити шлях для інших юнітів.",
//     "You can only sync packs purchased outside of the Minecraft Store once. They will continue to be available to anyone who plays on this device.=Ви можете лише один раз синхронізувати пакети скінів, придбані не в Магазині Minecraft. Вони будуть доступні всім користувачам цього пристрою.",
//     "You can only sync packs purchased outside of the Minecraft Store once. They will continue to be available to anyone who plays on this device.=Ви можете лише один раз синхронізувати пакети скінів, придбані не в Магазині Minecraft. Вони будуть доступні всім користувачам цього пристрою.",
//     "Before opening this game up to other players, invite some friends and pick your teams.|[space]|When you’re ready, press Find Players below.=Перш ніж відкрити цю гру іншим гравцям, запросіть друзів і виберіть свої команди.|[space]|Коли будете готові, натисніть «Знайти гравців» нижче.",
//     "Turns Screen Space Reflections on or off. Enabling Screen Space Reflections will improve the visual quality while reducing performance.=Вмикає або вимикає відбиття в екранному просторі. Увімкнення відбиття в екранному просторі покращить візуальну якість, але зменшить продуктивність.",
//     "When piglins claim territory, they first build outposts. Outposts are a small taste of what is to come from the larger piglin bases.=Коли піґліни претендують на територію, вони спочатку будують застави. Застави — це лише маленька частина загрози, яку становлять більші бази піґлінів.",
//     "Not even the mobs are safe from the piglins' hunger for conquest. Check your map to see if they plan to attack a friendly homestead.=Навіть моби не застраховані від спраги завоювання, яку мають піґліни. Відкрийте карту, щоб дізнатися, чи не планують вони напасти на садибу союзників.",
//     "Keep an eye out while you explore. You can find scattered chests filled with resources that will help you win in Versus Mode.=Будьте пильними під час своїх досліджень. Ви можете знайти розкидані скрині, наповнені ресурсами, які допоможуть вам вибороти перемогу в режимі протистояння.",
//     "Defenses alone can only go so far - your presence and leadership can turn the tide of battle to help protect a village from a piglin attack.=Однієї лише оборони недостатньо — але ваша присутність і керівництво можуть перевернути хід бою, допомігши захистити село від нападу піґлінів.",
//     "Sign in with a Microsoft Account (free) and transfer your pack entitlements to that account to protect your purchased packs and Minecoins.=Увійдіть під обліковим записом Microsoft (безкоштовним) і передайте йому права на пакети, щоб захистити свої придбані пакети й монети Minecoins.",
//     "Host a 1v1 to 4v4 private game for friends or invited players only. Private games can’t be joined by players looking for public games.=Створіть приватну гру (максимум 4 на 4) лише для друзів або по запрошенням. Гравці, які шукають публічні ігри, не зможуть приєднатися до такої гри.",
//     "Large bases are difficult to defeat for the inexperienced. These piglins will throw everything they have at you, ready or not.=Великі бази важко зруйнувати, якщо у вас мало досвіду. Ці піґліни намагатимуться знищити вас за будь-яку ціну незалежно від того, готові ви до цього чи ні.",
//     "This world has Behavior and Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки та ресурсів. Хочете завантажити їх і приєднатися до світу?",
//     "The template used to create this world is missing.  That template contained an Add-On pack that you need to continue playing this world.=Бракує шаблону, який використовувався для створення цього світу. Цей шаблон містив пакет доповнень, необхідний для продовження гри в цьому світі.",
//     "Pair a gate with walls around villages, it will help defend them against enemies by allowing you to leave but stops enemies from pushing in.=Поєднайте ворота зі стінами навколо сіл, це допоможе захистити їх від ворогів, дозволивши вам піти, але не дозволить ворогам проштовхнутися.",
//     "Ancient host tower. Attacks nearby enemies and sends them flying. Be sure to protect the Blast Tower with supporting structures.=Стародавня вежа Хранителів. Атакує ворогів, що знаходяться поруч, і відправляє їх у політ. Обов’язково захистіть артилерійську вежу спорудами підтримки.",
//     "Important! Purchased packs that are only available on this device can be lost due to device malfunction, loss or uninstalling Minecraft!=Увага! Придбані пакети, які доступні лише на цьому пристрої, можуть бути втрачені через несправність чи втрату пристрою або видалення Minecraft!",
//     "|+[key.item.errorMessageUpgrade]|Requires:|*[style.bold]|%1$s|+[key.item.%2$s]||*[style]|&|*[style.bold]|%3$s|+[key.item.%4$s]||*[style]|=|+[key.item.errorMessageUpgrade]| Потрібно: |*[style.bold]|%1$s|+[key.item.%2$s]||*[style]| та |*[style.bold]|%3$s|+[key.item.%4$s]||*[style]|",
//     "Reach the |*[style.bold]|village|+[key.item.village]||*[style]|that’s under attack|[space]||$[key.sprint]|Press to toggle sprint on and off=Дістаньтеся |*[style.bold]|села,|+[key.item.village]||*[style]|на яке напали|[space]||$[key.sprint]|Натисніть, щоб увімкнути чи вимкнути біг",
//     "You are currently signed-out of your Microsoft Account.|[space]|A valid Microsoft Account is required to play online, or access the marketplace.=Ви вийшли зі свого облікового запису Microsoft.|[space]|Для гри онлайн або доступу до Ринку потрібен дійсний обліковий запис Microsoft.",
//     "Ancient host tower. Rings loudly when enemies approach and stuns them in place. Does not damage enemies, so it needs support.=Стародавня вежа Хранителя. Голосно дзвенить при наближенні ворогів і приголомшує їх, зупиняючи на місці. Не завдає ворогам шкоди, тому потребує підтримки.",
//     "The piglins aren't slowing down, so you'd better speed up. Build battle drums nearby to make your towers and redstone launchers shoot faster.=Піґліни не сповільнюються, тому вам краще прискоритися. Побудуйте поблизу бойові барабани, щоб ваші вежі та редстоуномети стріляли швидше.",
//     "While you are signed out of your Microsoft Account you will not be able to use cross-platform play to connect with friends on other platforms.=Вийшовши зі свого облікового запису Microsoft, ви не зможете використовувати кросплатформну гру та грати з друзями на різних платформах.",
//     "The Horde of the Bastion are elite defenders renowned for their strength and barbarity. Getting past their defenses is a battle in itself.=Орда укріпників — елітні захисники, що славляться своєю силою й жорстокістю. Прорвати їхню оборону — це саме по собі завдання не з легких.",
//     "Creates stairs or bridges. Use them to overcome obstacles. Can be built on|*[style.bold]|netherrack|+[key.item.denether]||*[style]|.=Створюйте сходи або мости. Використовуйте їх для подолання перешкод. Можна будувати на |*[style.bold]|незерраку|+[key.item.denether]||*[style]|.",
//     "Short-range tower that shoots a volley of arrows at enemies that come within range. This tower can be upgraded by other structures.=Вежа малої дальності, яка стріляє залпом стріл у ворогів, що потрапляють у радіус дії. Ця вежа може бути модернізована за допомогою інших споруд.",
//     "You are currently signed-in to your Microsoft Account.|[space]|A valid Microsoft Account is required to play online, or access the marketplace.=Ви увійшли у свій обліковий запис Microsoft.|[space]|Для гри онлайн або доступу до Ринку потрібен дійсний обліковий запис Microsoft.",
//     "Create stairs or bridges. Use them to overcome obstacles. Can be built on|*[style.bold]|netherrack|+[key.item.denether]||*[style]|.=Створюйте сходи або мости. Використовуйте їх для подолання перешкод. Можна будувати на |*[style.bold]|незерраку|+[key.item.denether]||*[style]|.",
//     "Curing netherrack is key towards fighting back the piglin threat. Use it to push into their bases and build structures at their gates.=Лікування незерраку допоможе вам дати відсіч піґлінам. Використовуйте його, щоб вдиратися на ворожі бази й будувати споруди біля їхніх воріт.",
//     "You can't spawn mobs without lapis. Get it from village chests, or by defeating the piglins you find roaming the Overworld.=Не можна призивати мобів без лазуриту. Отримайте його з сільських скринь або за перемогу над піґлінами, яких ви знайдете під час блукань Верхнім світом.",
//     "Banner view gives you more precise control over unit movement and attacks. Check your controls to see how to use banner view.=Перегляд стягів дає більш точний контроль над рухом юніту та атаками. Перевірте елементи керування, щоб дізнатися, як використовувати перегляд стягів.",
//     "Mining outpost.|[divider]|Resource Rewards:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|=Гірнича застава.|[divider]|Ресурси в нагороду:|[newline]||*[style.centered]||+[key.item.prismarine]||+[key.item.%1$s]||*[style]||[divider]|",
//     "When off, this structure cannot be constructed by player characters.|[space]|Walls are crucial for defense, can you survive without them?=Коли вимкнено, персонажі гравців не можуть будувати цю споруду.|[space]|Мури мають вирішальне значення для оборони. Хіба без них виживеш?",
//     "A horde of piglins spreading malice and nasty netherrack.|[divider]|Cobblestone golems|+[key.item.stoneSpawner]|will come in handy here|[divider]|=Орда піґлінів сіє злобу й огидний незерак.|[divider]|Тут у пригоді|+[key.item.stoneSpawner]|стануть круглякові големи|[divider]|",
//     "Build a wellhouse|+[key.item.headquarter]||[space]|Wellhouses act as respawn points if you die. You can also fast travel to them=Побудуйте колодязь|+[key.item.headquarter]||[space]|Колодязі дають змогу відроджуватися після смерті. Ви також можете швидко переміщуватися до них",
//     "The piglins are using dark magic to drain the sun. If there's any hope to see the sun again, the dark spell must first be broken.=Піґліни намагаються згасити сонце за допомогою темної магії. Щоб не втратити надію знову побачити сонце, спочатку треба зняти заклинання пітьми.",
//     "Enables you to collect special host towers found throughout the world for a|*[style.bold]|gold|+[key.item.gold]||*[style]|and resource cost.=Дозволяє збирати спеціальні вежі хранителів, знайдені по всьому світу, за|*[style.bold]|золото|+[key.item.gold]||*[style]|та ресурси.",
//     "Want to try facing off against a new foe? Team up with friends and test your strategies against other heroes in multiplayer battles.=Хочете спробувати протистояти новому ворогові? Об’єднайтеся з друзями та перевірте свої стратегії проти інших героїв у мультиплеєрних битвах.",
//     "Creepers require a hefty amount of coal, so if you want their help, you better get lots of it from the dry parts of the world.=Кріперам потрібна чимала кількість вугілля, тому, якщо ви прагнете їхньої допомоги, вам краще відшукати його якомога більше в сухих частинах світу.",
//     "This village will be attacked soon. Build defenses to protect it|+[key.item.arrowTower]||+[key.item.wall]||+[key.item.gate]||[divider]|=Це село скоро атакують. Побудуйте оборонні споруди для його захисту|+[key.item.arrowTower]||+[key.item.wall]||+[key.item.gate]||[divider]|",
//     "Prismarine can only be obtained from destroying piglin structures and is used to build upgrade structures at the Well of Fate.=Призмарин можна отримати тільки шляхом руйнування споруд піґлінів, а використовується він для будівництва споруд модернізації біля колодязя долі.",
//     "Prismarine can only be obtained from destroying piglin structures and is used to build upgrade structures at the Well of Fate.=Призмарин можна отримати тільки шляхом руйнування споруд піґлінів, а використовується він для будівництва споруд модернізації біля колодязя долі.",
//     "These structures will visually change over time to indicate the masonry is strengthening them. Strengthens walls, towers, and gates.=Ці споруди будуть візуально змінюватися з часом — тим більше, чим більше їх зміцнюватиме каменярня. Міцнішими стануть стіни, вежі і ворота.",
//     "Mace runts are the lowest form of piglin life, which means they will fight the hardest to claw their way up the ranks.=Коротуни з булавами є найнижчою формою життя серед піґлінів, а це означає, що вони найупертіше борються за те, щоб прокласти собі шлях угору по ієрархії.",
//     "We added several new ways to communicate with your teammates in versus mode. We also improved mob recall to reduce griefing.=Додано кілька нових способів спілкування з товаришами по команді в режимі змагання. Також покращено відкликання мобів, щоб зменшити завдану шкоду.",
//     "Emits a sonic attack that will stun any enemy within range. Cannot damage enemies. Cannot be buffed by other structures.=Виконує звукову атаку, яка приголомшить будь-якого ворога в радіусі дії. Не може завдати шкоди ворогам. Посилення за допомогою інших споруд неможливе.",
//     "An essential structure that improves the amount of resources you can carry, increasing your capacity to build structures and spawn mobs.=Важлива споруда, яка покращує кількість ресурсів, які ви можете нести, збільшуючи вашу здатність будувати споруди та призивати мобів.",
//     "Preparing for a village attack? Open the map to see which piglin horde planted its flag near the village so you can plan accordingly.=Готуєтеся до нападу на село? Відкрийте карту, щоб побачити, яка орда піґлінів встановила свій прапор біля села, та відповідно планувати.",
//     "Small base, small rewards.|[divider]|Resource Rewards:|[newline]||*[style.centered]||+[key.item.prismarine]||*[style]||[divider]|=Невелика база, невеликі винагороди.|[divider]|Ресурси в нагороду:|[newline]||*[style.centered]||+[key.item.prismarine]||*[style]||[divider]|",
//     "Use banner view to command units against the incoming attack|[space]||$[key.advancedDirect]|Hold to enter banner view=Використовуйте перегляд стягів, щоб командувати підрозділами проти вхідної атаки|[space]||$[key.advancedDirect]|Утримуйте, щоб увійти в перегляд стягів",
//     "Not much is known about where the allays keep what they gather for you, but they can definitely store a great amount of resources.=Про те, куди служки дівають те, що вони збирають для вас, відомо не так багато, але вони точно можуть зберігати велику кількість ресурсів.",
//     "You hit the resource carry limit, and cannot collect resources from the|*[style.bold]|Chest|+[key.item.fateChest]||*[style]|.=У вас із собою максимально можлива кількість ресурсів, тому ви не можете взяти більше зі|*[style.bold]|скрині|+[key.item.fateChest]||*[style]|.",
//     "Improve your towers' firing distance with the help of the spyglass overlook. Now piglins both near and far are in trouble.=Покращте дальність стрільби своїх веж за допомогою підзорної труби. Тепер піґлінам буде непереливки, і немає значення, як далеко вони знаходяться.",
//     "Beware of the aggressive piglin armies from the Horde of the Hunt. If you can't match their speed, try overcoming them with your wits.=Остерігайтесь агресивних армій піґлінів з Орди мисливців. Якщо ви не можете зрівнятися з ними у швидкості, спробуйте їх перехитрувати.",
//     "Lava coils are a devious piglin technology that protects Nether Portals. Until you destroy them, the portal they protect is indestructible.=Лавові котушки — це хитра технологія піґлінів, яка захищає портали в Незер. Поки ви не зруйнуєте їх, портал зруйнувати неможливо.",
//     "If you choose to not link your accounts now, you may do so at any time in the Settings screen, in the Accounts section.=Якщо ви вирішите не пов'язувати свої облікові записи зараз, ви можете зробити це в будь-який час на екрані Налаштування в розділі облікових записів.",
//     "The peaceful regal tiger calls the dry savanna home, and can be found whiling the day away running and playing and munching on Purple Coral.=Мирний царствений тигр вважає суху савану своєю домівкою. Удень можна побачити, як він бігає, грається та жує фіолетовий корал.",
//     "We can’t load this save file because the data has been corrupted. Try opening a different save file from the Autosaves menu.=Ми не можемо завантажити цей збережений файл, оскільки дані було пошкоджено. Спробуйте відкрити інший збережений файл у меню «Автозбереження».",
//     "Host up to 4 players in a Training session. Learn how multiplayer works and try out new strategies against the computer.=Створіть тренувальну гру (максимум 4 гравці). Дізнайтеся, як працює мильтиплеєр, і випробуйте нові стратегії у протистоянні зі штучним інтелектом.",
//     "Enables you to assemble powerful golems found throughout the world for a|*[style.bold]|gold|+[key.item.gold]||*[style]|and resource cost.=Дає можливість за|*[style.bold]|золото|+[key.item.gold]||*[style]|та ресурси збирати потужних големів, знайдених по всьому світу.",
//     "Check your map each day at dawn to see what the piglins are planning for that night. Make sure you stop their plans before the end of the night.=Перевіряйте свою карту щодня на світанку, щоб побачити, що планують піґліни на цю ніч. Зупиняйте їхні плани до кінця ночі.",
//     "Use|$[key.move]|to move around the Overworld. Be careful about where you step though, a long fall can be very dangerous.=Щоб мандрувати Верхнім світом, використовуйте|$[key.move]|. Завжди дивіться, куди йдете, адже падіння з великої висоти може бути дуже небезпечним.",
//     "The amount of damage units take when falling from a great height and lands on solid ground. The higher the distance, the greater the damage taken.=Ушкодження, якого юніти зазнають від падіння з великої висоти на твердий ґрунт. Що більша висота, то більше ушкодження.",
//     "Crossplay is currently disabled, so you can not search for crossplay friends. You can enable crossplay in the Settings menu=Кросплатформну гру наразі вимкнено, тому ви не можете шукати друзів на інших платформах. Увімкнути кросплатформну гру можна в меню параметрів.",
//     "Build improvement structures to mine iron, coal, diamond, and redstone and unlock the most powerful mobs and structures in the game.=Будуйте споруди удосконалення, щоб видобувати залізо, вугілля, алмази та редстоун і розблокувати найпотужніших мобів і споруди в грі.",
//     "Adds hostile creepers, skeletons and zombies to the Overworld that only appear at nighttime. Makes traversing the world more hazardous.=Додає ворожих кріперів, скелетів і зомбі у Верхній світ, де вони з’являються тільки вночі. Подорожувати світом стає небезпечніше.",
//     "Home to the sun-averse zombies, this unassuming collection of huts sits nestled in the jungle where the rare corpse flower blooms.=Це скромне скупчення хатин, у яких проживають зомбі, що не переносять сонця, примостилося в джунглях, де цвіте рідкісна трупна квітка.",
//     "Stylish without even trying, regal tigers are the fastest mount in the Overworld.|[space]|The only felines you can ride safely.=Стильні від природи, ці царствені тигри — найшвидший транспорт у Верхньому світі.|[space]|Це єдині котячі, на яких можна безпечно їздити.",
//     "Adds an explosive knockback to projectiles from attacking structures such as the arrow tower, scatter tower and redstone launcher.=Під час атаки на такі споруди, як стрілецька вежа, розкидна вежа та редстоуномет, снаряди будуть також спричиняти вибухове відкидання.",
//     "If you want the warriors then you'll need redstone and iron, which can be found in forest, swamp, and jungle biomes in the world.=Якщо ви хочете залучити воїнів, вам знадобляться редстоун і залізо, які можна знайти в біомах із лісами, болотами та джунглями у світі.",
//     "Build an Allegiance Structure|+[key.item.allegianceStructure]|at a mob's homestead to gain the ability to create that mob's spawner.=Побудуйте споруду лояльності|+[key.item.allegianceStructure]|у садибі мобів, щоб отримати можливість побудувати генератор цих мобів.",
//     "The Horde of the Bastion are renowned for their strength and barbarity. Only the strongest piglins are chosen to join the ranks of the Bastion.=Орда укріпників відома своєю силою й бузувірством. Для вступу в ряди укріпників відбираються тільки найсильніші піґліни.",
//     "If you build a cauldron, keep your mobs close to keep the potion buff active. The effect is especially potent when paired with a witch.=Якщо ви будуєте казан, тримайте мобів поруч, щоб підсилення зілля залишалось активним. Ефект особливо потужний у парі з відьмою.",
//     "The brilliant beetle is right at home in the treetops or any high place. If you catch a ride, it will climb anything for you.=Діамантовий жук почувається у кронах дерев або на будь-якому узвишші як удома. Якщо зможете його осідлати, він підніме вас куди завгодно.",
//     "The Beast's ferocious speed is only matched by their petulance and pride. But more than anything, this piglin lives for the hunt.=З неймовірною швидкістю Звіра може зрівнятися хіба що його дратівливість і гордість. Але більш за все цей піґлін полюбляє полювання.",
//     "%1$s: Can someone build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|)|*[style]|?=%1$s: Чи може хтось збудувати|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|)|*[style]|?",
//     "The villagers you've helped around the world give you %1$s. You leave some in the chest as you cannot carry anymore.=Селяни, яким ви допомогли у різних куточках світу, дають вам %1$s. Ви залишаєте дещо у скрині, оскільки не можете взяти з собою більше ресурсів.",
//     "The Horde of the Spore love to knock Overworld mobs off the edges of plateaus. It would be a shame if someone did the same to them.=Орда отруйників любить скидати мобів Верхнього світу з краю своїх плоскогір’їв. Було б прикро, якби хтось вчинив так само з ними.",
//     "Some resources can only be found in certain biomes. Hover over the various biomes on your map to see which resources they have.=Деякі ресурси можна знайти лише в певних біомах. Наводьте курсор на різні біоми на своїй карті, щоб побачити, які ресурси вони мають.",
//     "Your starting horse is a noble steed, but if you want a more exotic mount you'll need to explore the world to find one.=Ваш стартовий кінь — благородний скакун, але якщо ви хочете більш екзотичний транспорт, вам потрібно буде досліджувати світ, щоб знайти його.",
//     "This version of Minecraft can no longer access the Minecraft Marketplace. Update to the latest version to restore Marketplace access.=У цій версії Minecraft більше не можна відкрити Ринок Minecraft. Оновіться до найновішої версії, щоб відновити доступ до Ринку.",
//     "If you choose to not link your accounts now, you may do so at any time in the Settings screen, in the Account section.=Якщо ви вирішите не пов’язувати свої облікові записи зараз, ви можете зробити це в будь-який час у налаштуваннях у розділі «Обліковий запис».",
//     "If you choose to not link your accounts now, you may do so at any time in the Settings screen, in the Account section.=Якщо ви вирішите не пов’язувати свої облікові записи зараз, ви можете зробити це в будь-який час у налаштуваннях у розділі «Обліковий запис».",
//     "Defeat the piglins and repair the fountain|[space]||+[key.item.carpenter]|Build a carpenter hut near the fountain to repair it=Здолайте базу піґлінів і відремонтуйте фонтан|[space]||+[key.item.carpenter]|Побудуйте теслярню біля фонтану, щоб відремонтувати його",
//     "Open the chest near Action|+[key.item.action]||[space]||$[key.bsharpInteract]|Hold to open the chest when standing near it=Відкрийте скриню поблизу місця дії|+[key.item.action]||[space]||$[key.bsharpInteract]|Коли стоїте біля скрині, утримуйте, щоб відкрити її",
//     "Don't let their charming hats fool you – zombies are tough and immune to poison, so they will do well on the frontlines.=Не дозволяйте чарівним капелюхам обдурити вас — зомбі жорсткі та несприйнятливі до отрути, тому вони будуть добре справлятися на передовій.",
//     "The Flames of Creation signify the unity between you and your allies, and are used to call upon them to fight by your side.=Полум’я творення символізує єдність між вами та вашими союзниками й використовується для того, щоб закликати їх воювати на вашому боці.",
//     "You are currently signed-out of your Microsoft Account.|[space]|A valid Microsoft Account is required to activate Cross-Play.=Ви вийшли зі свого облікового запису Microsoft.|[space]|Для активації кросплатформної гри потрібен дійсний обліковий запис Microsoft.",
//     "Are the piglins destroying your spawners before you can attack? Try placing them farther away from battle, or building defenses first.=Не можете розпочати наступ, бо піґліни нищать ваші генератори? Установіть їх подалі або спочатку побудуйте оборонні споруди.",
//     "Build defensive structures to protect|*[style.bold]|Villagers|+[key.item.villager]||*[style]|when you and your mobs can't be there.=Будуйте оборонні споруди для захисту|*[style.bold]|селян|+[key.item.villager]||*[style]|, коли вас і ваших мобів немає поблизу.",
//     "Any enemy who approaches this structure will be frozen in place for a short period of time and receives a small amount of damage.=Будь-який ворог, який наблизиться до цієї споруди, буде заморожений на місці на короткий проміжок часу й отримає невелику шкоду.",
//     "The amount of resources that allay chests grant when opened.|[space]|Existing difficulties are set to:|[newline]|Storied =Кількість ресурсів, які дають скрині служок, коли їх відкрити.|[space]|Наявні рівні складності мають такі значення:|[newline]|Сюжетний ",
//     "Piglin chests are filled with resources they have taken from the Overworld.|[space]|You'll need to find a key to open them...=Скрині піґлінів наповнені ресурсами, які вони захопили у Верхньому світі.|[space]|Вам потрібно буде знайти ключ, щоб відкрити їх...",
//     "Occupying|*[style.bold]|piglins|+[key.item.piglin]||*[style]|have locked the|*[style.bold]|Chest|+[key.item.fateChest]||*[style]|.=|*[style.bold]|Піґліни-загарбники|+[key.item.piglin]||*[style]|замкнули|*[style.bold]|скриню|+[key.item.fateChest]||*[style]|!",
//     "You need to enter Placement Preview and pick a starting point and an ending point to build ramps as stairs or a bridge.=Вам потрібно перейти в режим перегляду розміщення та вибрати початкову та кінцеву точку для побудови пандусів у вигляді сходів або моста.",
//     "If a mob homestead falls and its Flame gets destroyed, you won't be able to call upon those mobs until you take it back from the piglins.=Якщо садиба мобів впаде, а її полум’я буде знищено, ви не зможете закликати цих мобів, поки не відберете її у піґлінів.",
//     "Coordinate with your teammates. Everyone has a role to play, whether it's resourcing, defending, attacking, or scouting.=Координуйте свої дії зі своїми товаришами по команді. Кожен має відігравати свою роль, будь то збір ресурсів, захист, напад чи розвідка.",
//     "Foresight has the gift of prognostication. Because they can foretell multiple futures, they weigh all decisions very carefully.=Прозорливість володіє даром передбачення. Вона може бачити декілька варіантів майбутнього, тому дуже ретельно зважує всі рішення.",
//     "This world has Behavior Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети поведінки. Хочете завантажити їх і приєднатися до світу?",
//     "Content purchased through a partner store will be available as long as your device is signed in to your partner store account.=Вміст, придбаний через партнерський магазин, буде доступний, якщо на пристрої ввійти під обліковим записом партнерського магазину.",
//     "The rate at which players passively regenerate health. You may want to set this to a higher value if you modify player health.=Швидкість, із якою гравці пасивно відновлюють здоров’я. Ви можете встановити більш високе значення, якщо зміните здоров’я гравця.",
//     "%1$s: I will build a|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|)|*[style]|=%1$s: Я збудую таку споруду, як|*[style.bold]|%2$s|*[style]||*[style.bold]|(%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|)|*[style]|",
//     "Mossy golems may not be great fighters, but the water they spray has special healing properties and cures status effects.=Замшілі големи, можливо, і не найкращі бійці, але вода, яку вони розбризкують, має особливі цілющі властивості та знімає ефекти стану.",
//     "Iron, diamond, coal, and redstone are found in different biomes in the Overworld. Keep an eye out for veins of ore while exploring.=Залізо, алмази, вугілля та редстоун зустрічаються в різних біомах у Верхньому світі. Шукайте рудні жили під час дослідження.",
//     "At dawn the piglins plan their attacks for the next night. Check your map each morning to see if any villages are threatened.=На світанку піґліни планують свої атаки на наступну ніч. Щоранку заглядайте в карту, щоб побачити, чи немає загрози якимось селам.",
//     "This world has Resource Packs applied to it that you must download to join. Would you like to download them and join?=Щоб приєднатися до цього світу, ви повинні завантажити застосовані до нього пакети ресурсів. Хочете завантажити їх і приєднатися до світу?",
//     "Update to the latest version to access all the new features, play with friends online, or see what's new in the Marketplace.=Оновіться до найновішої версії, щоб отримати доступ до всіх нових функцій, грати з друзями онлайн або переглядати новинки на Ринку.",
//     "You are currently signed-in to your Microsoft Account.|[space]|A valid Microsoft Account is required to activate Cross-Play.=Ви увійшли у свій обліковий запис Microsoft.|[space]|Для активації кросплатформної гри потрібен дійсний обліковий запис Microsoft.",
//     "The Well of Fate is a symbol of unity, renewal, and harmony. The waters that flow from the Well connect the whole of the Overworld.=Колодязь долі — символ єдності, оновлення та гармонії. Води, які ллються із колодязя, пов’язують воєдино весь Верхній світ.",
//     "You are almost out of data storage space! Minecraft has restricted access to this feature until you clear up additional storage space.=Ви майже вичерпали простір для зберігання даних. Minecraft заборонив доступ до цієї функції, доки ви не звільните місце.",
//     "Very few piglin bases can withstand the force of a fully upgraded army – as long as you bring the right units for the job.=Якщо ви повністю модернізуєте армію та будете використовувати юніти правильно, витримати ваш удар зможуть лише кілька баз піґлінів.",
//     "By freeing this homestead, you can now build|*[style.bold]|skeleton|+[key.item.waypointSkeleton]||*[style]|spawners again.=Ви звільнили цю садибу, тож тепер можете знову будувати генератори|*[style.bold]|скелетів|+[key.item.waypointSkeleton]||*[style]|.",
//     "Swaps the|$[key.faceButton.down]|and|$[key.faceButton.right]|buttons on your Joy-Con™. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.down]|і|$[key.faceButton.right]|на Joy-Con™. Стосується тільки меню, а не ігрового процесу.",
//     "The fatelands have the most stone, but you shouldn't have any trouble finding it in most biomes, with some exceptions.=У доленосних землях найбільше каменю, але у вас не повинно виникнути проблем із його пошуком у більшості біомів, за деякими винятками.",
//     "When defending villages don't forget to protect witch huts too. You won't be able to spawn witches from them if they're disabled.=Обороняючи села, не забувайте також захищати відьомські хатини. Ви не зможете призивати в них відьом, якщо вони відключені.",
//     "The amount of time that the witch hut will remain active for.|[space]|If set to 0, it will remain active forever.=Час, протягом якого відьомська хатина залишатиметься активною.|[space]|Якщо встановлено значення 0, вона залишатиметься активною назавжди.",
//     "There is no tutorial in custom game mode! We highly recommend playing a regular campaign game before trying this mode.=У режимі користувацької гри немає навчання! Ми наполегливо радимо зіграти в режимі звичайної кампанії, перш ніж грати в цьому режимі.",
//     "Turns Screen Space Ambient Occlusion on or off. Enabling SSAO will improve the visual quality while reducing performance.=Вмикає або вимикає фонове затінення в екранному просторі. Увімкнення SSAO покращить візуальну якість, але зменшить продуктивність.",
//     "Arrow towers can be upgraded by placing the following village structures nearby: kaboomery, spyglass overlook and battle drum.=Стрілецькі вежі можна модернізувати, розмістивши поруч такі сільські споруди: вибухів'ярню, підзорну трубу і бойовий барабан.",
//     "Scatter towers can be upgraded by placing the following village structures nearby: kaboomery, spyglass overlook and battle drum.=Розкидні вежі можна модернізувати, розмістивши поруч такі сільські споруди: вибухів’ярню, підзорну трубу і бойовий барабан.",
//     "Use|$[key.meleeAttack]|to swing your sword. Your sword can damage structures, but cannot be used to gather resources.=Використовуйте|$[key.meleeAttack]|, щоб махати мечем. Меч може пошкоджувати споруди, але не може використовуватися для збору ресурсів.",
//     "Someone started a purchase with the billing account on this device. Would you like to complete the purchase with this account?=Хтось почав покупку на цьому пристрої під обліковим записом для платних служб. Хочете завершити її під цим обліковим записом?",
//     "When on, unlocks all mounts for immediate use. When off, you'll have to discover mounts in the Overworld.=Коли ввімкнено, весь транспорт розблоковується для негайного використання. Коли вимкнено, вам доведеться розшукувати транспорт у Верхньому світі.",
//     "You don’t have enough local disk space available to create a new game.|[space]|Please clear some local disk space and try again.=Для створення нової гри бракує місця на локальному диску.|[space]|Звільніть місце на локальному диску та спробуйте ще раз.",
//     "Allays love music. The Lute allows you to play different melodies to ask them to do various tasks, like gathering or building.=Служки люблять музику. Лютня дозволяє грати різні мелодії, щоб вони виконували різні завдання, такі як збір або будівництво.",
//     "Anytime you die, you'll be brought back to health at the Well of Fate, or the nearest village or wellhouse you've built.=Коли ви помираєте, то відроджуєтеся у повному здоров’ї біля колодязя долі, найближчого села або дома-колодязя, який ви побудували.",
//     "Customize your hotbar to keep your most important structures easy to build. You can do this in your songbook.=Налаштуйте панель швидкого доступу, щоб зробити будівництво ваших найважливіших споруд ще простішим. Ви можете зробити це у своєму пісеннику.",
//     "Finding the game too difficult? Try making yourself invulnerable or giving yourself a lot of starting resources in a custom game.=Вважаєте гру надто складною? Спробуйте зробити себе невразливим або взяти багато стартових ресурсів у користувацькій грі.",
//     "It looks like you started a purchase with a different Microsoft Account. Do you want to complete the purchase with this account instead?=Схоже, ви почали покупку під іншим обліковим записом Microsoft. Хочете завершити її вже під цим обліковим записом?",
//     "The damage dealt by the player characters sword.|[space]|This is not a setting we've modified across standard campaign difficulties.=Шкода, завдана мечем персонажів гравців.|[space]|Цей параметр не був змінений у рівнях складності звичайної кампанії.",
//     "How warriors spawners are built in campaign. This setting cannot be changed once the world has been generated.|[space]|Standard =Те, як генератори воїнів будуються в кампанії. У згенерованому світі цей показник змінювати не можна.|[space]|Стандартне ",
//     "Every month, play solo or with your friends a short fun twist on Minecraft Legends game and earn a reward for completing it!=Щомісяця грайте наодинці або з друзями у коротку та цікаву варіацію Minecraft Legends і заробляйте нагороду за її завершення!",
//     "Note: Signing into a Microsoft Account will permanently associate it with your current account on PlayStation™Network=Примітка. Коли ви ввійдете в обліковий запис Microsoft, його буде зв’язано з вашим поточним обліковим записом у PlayStation™Network.",
//     "By freeing this homestead, you can now build|*[style.bold]|creeper|+[key.item.waypointCreeper]||*[style]|spawners again.=Ви звільнили цю садибу, тож тепер можете знову будувати генератори|*[style.bold]|кріперів|+[key.item.waypointCreeper]||*[style]|.",
//     "The|*[style.bold]|carpenter hut|+[key.item.carpenter]||*[style]|repairs nearby structures. Wait for it to repair the fountain.=|*[style.bold]|Теслярня|+[key.item.carpenter]||*[style]|ремонтує ближні споруди. Дочекайтеся, поки вона відремонтує фонтан.",
//     "Enhances the effects of witch potions, increasing their damage and knockback.|[space]|The effects of the cauldron do not stack with eachother.=Підсилює ефекти відьомського зілля, збільшуючи шкоду та відкидання.|[space]|Ефекти казана не накопичуються.",
//     "Keep an eye out for poison vines or you might find yourself losing hearts! The effect does wear off after a while, though.=Слідкуйте за отруйними виноградними лозами, інакше ви можете втратити мужність! Однак через деякий час ефект все ж таки зникає.",
//     "The ice trap will stop enemies in their tracks, but make sure to quickly follow up with an attack. Enemies will defrost eventually.=Заморожувач зупинить ворогів на їхньому шляху, але намагайтеся швидко продовжити атакою. Вороги з часом розморозяться.",
//     "Wood and stone are core resources that are very important in the early moments of the match. Be on the lookout for nearby sources of both.=Деревина й камінь — основні ресурси, дуже важливі на початку гри. Намагайтеся не пропускати їх поблизу джерела.",
//     "Home to the kind and peaceful villagers of the Overworld. Growing and protecting villages will help you in your fight against the piglins.=Дім для добрих і миролюбних селян Верхнього світу. Розбудова й захист сіл допомагає вам у боротьбі з піґлінами.",
//     "Your Minecraft account lets you play online multiplayer with friends on PCs and mobile devices. And the best part?=Ваш обліковий запис Minecraft дає вам змогу грати в Інтернеті в мультиплеєрі з друзями на комп’ютерах і мобільних пристроях. І головне!",
//     "Like the Nether spreaders, terror horns claim territory for the piglins by poisoning the ground with netherrack, but faster.=Як і поширювачі Незеру, роги жаху отруюють землю незерраком, але роблять це швидше, що дозволяє піґлінам захопити територію.",
//     "Protect the skeletons' homestead and they will align with you, allowing you to build their spawners when you need their help.=Захистіть садибу скелетів, і вони об’єднаються з вами, дозволяючи вам будувати генератори, коли вам потрібна їхня допомога.",
//     "Be sure to leave lots of space around your base so you can build larger structures such as the masonry, carpenter hut, and Improvement Hub.=Обов’язково залиште навколо своєї бази місце для таких споруд, як каменярня, теслярня та центр удосконалення.",
//     "This version of Minecraft can no longer access the Minecraft Store. Update to the latest version to restore Store access.=У цій версії Minecraft більше не можна відкрити Магазин Minecraft. Установіть останню версію, щоб відновити доступ до магазину.",
//     "This version of Minecraft can no longer access the Minecraft Store. Update to the latest version to restore Store access.=У цій версії Minecraft більше не можна відкрити Магазин Minecraft. Установіть останню версію, щоб відновити доступ до магазину.",
//     "Modify the players jump height. This can be further modified with the \"High Jump\" and \"Gravity\" modifiers.=Регулювання висоти стрибка гравців. Цей показник можна додатково змінювати за допомогою модифікаторів «Високий стрибок» і «Сила тяжіння».",
//     "Spore Medics spread netherspores that make the Overworld air breathable for the piglins and heal wounded piglin units.=Медики-отруйники поширюють спори Незера, які роблять повітря Верхнього світу придатним для піґлінів і лікують поранених піґлінів.",
//     "You may be able to climb over reinforced bone walls, but your mobs can't - take time to plan your path carefully.=Ви, може, і зможете перелізти через посилені кістяні стіни, а от ваші моби на це точно не здатні. Тому ретельно плануйте свій маршрут.",
//     "Your map is tuned to the shifting energies of the Overworld. Refer to it often to discover new dangers and opportunities.=Ваша карта налаштована на мінливі енергії Верхнього світу. Звертайтеся до неї часто, щоб виявити нові небезпеки та можливості.",
//     "Start a new campaign and earn the witches trust. In Versus, locate the witches hut and listen for their cackle!=Почніть нову кампанію й заслужіть довіру відьом. У режимі суперництва знайдіть відьомську хатину та прислухайтеся до їхнього гоготіння!",
//     "Swaps the|$[key.faceButton.left]|and|$[key.faceButton.up]|buttons on your Joy-Con™. Affects only menus and not gameplay.=Міняє місцями кнопки|$[key.faceButton.left]|і|$[key.faceButton.up]|на Joy-Con™. Стосується тільки меню, а не ігрового процесу.",
//     "Oops! Your Microsoft Account was disconnected. To invite more players, sign in on the Main Menu and restart your world.=Ой! Ваш обліковий запис Microsoft відключено. Щоб запросити більше гравців, увійдіть у головне меню та перезапустіть свій світ.",
//     "The brilliant beetle calls the jungle home, and can usually be found skittering about, playing among the dense vegitation.=Діамантовий жук вважає джунглі своєю домівкою, і зазвичай можна побачити, як він грайливо шмигляє серед рясної рослинності.",
//     "Having a hard time defeating a piglin base? Try a different strategy with your attack, or try targeting a base from a different horde.=Вам важко розгромити базу піґлінів? Спробуйте іншу стратегію зі своєю атакою або оберіть ціллю базу іншої орди.",
//     "Happy villagers will collect more resources to help you in the fight. Build defensive structures so they feel safe.=Щасливі селяни зберуть більше ресурсів, щоб допомогти вам у боротьбі. Будуйте оборонні споруди, щоб вони відчували себе в безпеці.",
//     "The Horde of the Spore are chaos defined. Their strength lies in their unpredicability and disregard for even their own ranks.=Орда отруйників — це самісінький хаос. Їхня сила полягає в їхній непередбачуваності та зневазі навіть до власних чинів.",
//     "Multi-platform crossplay needs to be enabled to join this game. You can enable it under Settings -> Accounts.=Щоб приєднатися до цієї гри, потрібно ввімкнути кросплатформну гру. Ви можете ввімкнути її в розділі «Налаштування -> Облікові записи».",
//     "%1$s has pinged|*[style.bold]|%2$s (%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|)|*[style]|=%1$s перевіряє зв’язок із|*[style.bold]|%2$s (%4$d|+[key.item.%3$s]|, %6$d|+[key.item.%5$s]|, %8$d|+[key.item.%7$s]|)|*[style]|",
//     "Want more firepower – literally? Build a kaboomery near an arrow tower to make it shoot explosive arrows.=Хочете в буквальному сенсі більше вогневої потужності? Побудуйте вибухів’ярню біля стрілецької вежі, щоб вона стріляла вибуховими стрілами.",
//     "Allays are peaceful beings, but they will help you collect resources and build structures if you play the right melodies.=Служки — мирні істоти, але вони допоможуть вам збирати ресурси та будувати споруди, якщо ви будете грати правильні мелодії.",
//     "The Unbreakable can get easily distracted - try using melee mobs to occupy the boss while you position your ranged units.=Незламного можна легко відволікти. Натравіть на нього мобів ближнього бою, а самі в цей час розставте бійців дальнього бою.",
//     "Piglin Bridges can't hurt you - in fact they can be really useful for getting around piglin bases.=Мости піґлінів не можуть вам нашкодити. Навпаки, вони можуть стати у пригоді, якщо вам знадобиться дістатися з одного кінця бази піґлінів в інший.",
//     "Certain mobs do more damage to specific piglins – maximize their effectiveness by choosing your targets accordingly.=Деякі моби завдають більшої шкоди конкретним піґлінам — збільште до максимуму їхню ефективність, відповідно вибираючи свої цілі.",
//     "%1$s says: Can someone build a %2$s? (requires %4$d %3$s, %6$d %5$s, %8$d %7$s, %10$d %9$s and %12$d %11$s)=%1$s каже: Чи може хтось побудувати таку споруду, як %2$s? (Потрібно: %3$s — %4$d, %5$s — %6$d, %7$s — %8$d, %9$s — %10$d, %11$s — %12$d)",
//     "The amount of resources stored inside village chests.|[space]|Existing difficulties are set to:|[newline]|Storied =Кількість ресурсів, що зберігаються в сільських скринях.|[space]|Наявні рівні складності мають такі значення:|[newline]|Сюжетний ",
//     "By freeing this homestead, you can now build|*[style.bold]|zombie|+[key.item.waypointZombie]||*[style]|spawners again.=Ви звільнили цю садибу, тож тепер можете знову будувати генератори|*[style.bold]|зомбі|+[key.item.waypointZombie]||*[style]|.",
//     "Sporebacks have a strong funk about them, try closing the distance quickly and take them out before the smell gets too strong.=Спороспини поширюють сморід. Спробуйте швидко скоротити відстань і перебити їх, перш ніж запах стане занадто сильним.",
//     "Try Mythic difficulty if you're finding the game too easy. Piglins will be more powerful and resources less plentiful.=Спробуйте міфічний рівень складності, якщо вважаєте гру занадто легкою. Піґліни будуть могутнішими, а ресурси — менш рясними.",
//     "This village is under attack. Spawn some plank golems to help fight off the piglins|+[key.item.woodSpawner]||[divider]|=Це село атакують. Призовіть кілька дощатих големів, щоб допомогти відбитися від піґлінів|+[key.item.woodSpawner]||[divider]|",
//     "%1$s says: Can someone build a %2$s? (requires %4$d %3$s, %6$d %5$s, %8$d %7$s, %10$d %9$s, %12$d %11$s and %14$d %13$s)=%1$s каже: Чи може хтось побудувати %2$s? (потрібно %4$d %3$s, %6$d %5$s, %8$d %7$s, %10$d %9$s, %12$d %11$s і %14$d %13$s)",
//     "Home to the reclusive creepers, this collection of stone and sulphur buildings is nestled deep in the vast barrens of the badlands.=Це скупчення кам’яно-сірчаних будівель, у яких мешкають кріпери-самітники, розташоване далеко в нетрях пустища.",
//     "Home to the noble skeletons, the skeleton homestead is marked by a fierce skull that rises out of the tundra with a roar.=Садиба скелетів — це домівка благородних скелетів. Вона позначена лячним черепом, який із ревом піднімається над тундрою.",
//     "These stout amphibians gain extra height on their jumps and increased swim speed thanks to their powerful hind legs.=Ці кремезні амфібії набирають додаткову висоту під час стрибків і збільшують швидкість плавання завдяки потужним заднім лапам.",
//     "Changes how far you can see. Increasing the view distance will improve the visual quality while reducing performance.=Зміна відстані, на яку ви можете бачити. Збільшення дальності огляду покращить візуальну якість, але зменшить продуктивність.",
//     "Make sure you check village chests regularly. They replenish each day, but can only hold three days' worth of resources.=Обов’язково регулярно перевіряйте сільські скрині. Вони поповнюються щодня, але можуть утримувати ресурси лише за три дні.",
//     "We've detected that your account has \"Let games read to me\" enabled and have automatically enabled Minecraft's screen reader.=У вашій системі ввімкнуто функцію \"Let games read to me\", тому ми ввімкнули для вас невізуальний екран Minecraft.",
//     "Update to the latest version to access all the new features, play with friends online, or see what's new in the Store.=Установіть останню версію, щоб отримати доступ до нових функцій, грати з друзями в мережі та переглядати новинки в магазині.",
//     "Update to the latest version to access all the new features, play with friends online, or see what's new in the Store.=Установіть останню версію, щоб отримати доступ до нових функцій, грати з друзями в мережі та переглядати новинки в магазині.",
//     "Excellent for gathering resource rich areas but not as efficient when trying to gather a specific resource.=Чудово підходить для збирання ресурсів у багатій на ресурси місцевості, але погано підходить для збирання якогось конкретного ресурсу.",
//     "You can only collect power towers after building a unique improvement at the Well of Fate. You will also need gold.=Ви можете збирати силові вежі тільки після будівництва унікального удосконалення біля колодязя долі. Також знадобиться золото.",
//     "This Steam account has previously been linked to a different Microsoft Account. Unlink accounts before signing in.=Цей обліковий запис Steam раніше було пов’язано з іншим обліковим записом Microsoft. Від’єднайте облікові записи перед входом.",
//     "The Microsoft Services Agreement and Privacy Statement apply. Read at: http://aka.ms/servicesagreement=Діє Угода про використання служб Microsoft і Декларація про конфіденційність. Щоб прочитати, зайдіть сюди: http://aka.ms/servicesagreement",
//     "The Microsoft Services Agreement and Privacy Statement apply. Read at: http://aka.ms/servicesagreement=Діє Угода про використання служб Microsoft і Декларація про конфіденційність. Щоб прочитати, зайдіть сюди: http://aka.ms/servicesagreement",
//     "The Microsoft Services Agreement and Privacy Statement apply. Read at: http://aka.ms/servicesagreement=Діє Угода про використання служб Microsoft і Декларація про конфіденційність. Щоб прочитати, зайдіть сюди: http://aka.ms/servicesagreement",
//     "Want to explore the Overworld and enjoy the story without having to worry about the piglins? Try the Storied difficulty.=Хочете дослідити Верхній світ і насолодитися історією, не турбуючись про піґлінів? Спробуйте сюжетний рівень складності.",
//     "Build up strong armies before attacking the enemy Base. Work with your allies to overcome the enemies counter attacks.=Створюйте сильні армії, перш ніж атакувати ворожу базу. Співпрацюйте зі своїми союзниками, щоб подолати ворожі контратаки.",
//     "Clangers stun mobs for a long duration in an area around them, try countering them with structures or ranged units.=Грюкачі надовго оглушують мобів в області навколо них. Спробуйте протистояти їм за допомогою споруд або юнітів дальнього бою.",
//     "We were unable to connect to the app store. Maybe sign in to the app store or try checking your internet connection.=Не вдається підключитися до магазину програм. Можливо, слід зареєструватися в ньому або перевірити підключення до Інтернету.",
//     "Custom game mode does not include the tutorial. If you wish to play the tutorial, please go back and select \"New Game\".=Користувацький режим гри не передбачає тренування. Якщо хочете потренуватися, поверніться назад і виберіть «Нова гра».",
//     "Spawns witches|[newline]||*[style.bold]|Strong vs|*[style]|groups|[newline]||*[style.bold]|Weak vs|*[style]|structures=Призиває відьом|[newline]||*[style.bold]|Сильні проти|*[style]|груп|[newline]||*[style.bold]|Слабкі проти|*[style]|споруд",
//     "You don’t have enough storage space available to create a new game.|[space]|Please delete some save files and try again.=У вас недостатньо вільного місця для створення нової гри.|[space]|Видаліть деякі файли збереження та повторіть спробу.",
//     "Destroy piglin structures to gain|*[style.bold]|prismarine|+[key.item.prismarine]||*[style]|for improvement structures=Руйнуйте споруди піґлінів та отримуйте|*[style.bold]|призмарин|+[key.item.prismarine]||*[style]|для споруд удосконалення",
//     "The Horde of the Bastion get mad when someone tries to out-build them, especially when it comes to siege weaponry.=Орда укріпників божеволіє, коли хтось намагається перевершити їх у будівництві, особливо коли мова йде про облогові гармати.",
//     "Use|$[key.move]|to move around the Overworld. Be careful about where you step though, a long fall can be very dangerous.=Щоб мандрувати Верхнім світом, використовуйте|$[key.move]|. Завжди дивіться, куди йдете, адже падіння загрожує смертю!",
//     "Our font for the language you have selected is not readable at a GUI scale that small.  Do you want to increase your GUI scale?=Наш шрифт для вибраної вами мови не читається в такому дрібному інтерфейсі. Хочете збільшити розмір інтерфейсу?",
//     "When you see this icon, we are saving your game. Do not turn off your Nintendo Switch™ while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте Nintendo Switch™, поки бачите цю піктограму на екрані.",
//     "%s: Child controls must have unique names: %sIn the future this will be an error and this file won't load.=%s: Імена дочірніх елементів не мають повторюватися: %sУ майбутньому це призводитиме до помилки, а цей файл не завантажуватиметься.",
//     "You need to download missing packages to join this game. Approximatively %1$s of data will be downloaded. Continue?=Вам потрібно завантажити відсутні пакети, щоб приєднатися до цієї гри. Буде завантажено приблизно %1$s даних. Продовжити?",
//     "In the next step, you’ll see how to quickly and securely sign in with a different device like a phone or tablet.=На наступному кроці ви побачите, як швидко та безпечно ввійти за допомогою іншого пристрою, наприклад телефону або планшета.",
//     "In the next step, you’ll see how to quickly and securely sign in with a different device like a phone or tablet.=На наступному кроці ви побачите, як швидко та безпечно ввійти за допомогою іншого пристрою, наприклад телефону або планшета.",
//     "An update is available for one or more of your equipped skins. We recommend updating for a better experience.=Для одного або кількох скінів, які ви використовуєте, доступне оновлення. Ми рекомендуємо оновлювати їх для кращого результату.",
//     "It's a new day, and both team's|[newline]||*[style.bold]|lapis|+[key.item.lapis]||*[style]|income has increased.=Настав новий день, і обидві команди почали отримувати більше|[newline]||*[style.bold]|лазуриту|+[key.item.lapis]||*[style]|.",
//     "The piglin invasion horn signals troop movements, so they can also give away the piglins' plans, especially at night.=Ріг вторгнення піґлінів сигналізує про рух військ, тому таким чином можуть розкриватися плани піґлінів, особливо вночі.",
//     "Turns Depth of Field on or off. Enabling Depth of Field will improve the visual quality while reducing performance.=Вмикає або вимикає глибину різкості. Увімкнення глибини різкості покращить візуальну якість, але зменшить продуктивність.",
//     "The First of Stone is an ancient golem whose mighty arms can rip stones from the earth to smash through piglin walls.=Перший із каменю — це древній голем, чиї могутні руки можуть виривати каміння з землі та пробивати ними стіни піґлінів.",
//     "It costs|*[style.bold]|%1$d %2$d|+[%3$s]||*[style]|and|*[style.bold]|%4$d %5$d|+[%6$s]||*[style]|to assemble the %7$s=%7$s: для збирання потрібні |*[style.bold]|%1$d %2$d|+[%3$s]||*[style]| та |*[style.bold]|%4$d %5$d|+[%6$s]||*[style]|",
//     "When enabled, banner view will open and close with a button press, instead of requiring the button be held down.=Коли цей параметр увімкнуто, перегляд стягів буде відкриватися і закриватися натисканням кнопки, не вимагаючи її утримання.",
//     "If you find the nether portal too difficult to destroy, try clearing out defenses and other critical structures around it first.=Якщо ви не можете знищити портал у Незер, спочатку зруйнуте оборонні та інші важливі споруди навколо нього.",
//     "The piglins have a foothold in this area.|[space]|If they are not stopped, they could expand and gain new ground.=Піґліни захопили плацдарм у цій місцевості.|[space]|Якщо їх не зупинити, вони можуть піти далі й захопити нові території.",
//     "Are you sure you want to save and return to the main menu? This will disconnect all other players in the current game.=Ви справді хочете зберегти дані та повернутися до головного меню? Усіх інших гравців у поточній грі буде відключено.",
//     "The Microsoft Account you are trying to use is already connected to another account on the PlayStation™Network.=Обліковий запис Microsoft, який ви намагаєтеся використати, уже прив'язано до іншого облікового запису PlayStation™Network.",
//     "It costs|*[style.bold]|%1$d %2$d|+[%3$s]||*[style]|and|*[style.bold]|%4$d %5$d|+[%6$s]||*[style]|to collect the %7$s=%7$s: для збирання потрібні |*[style.bold]|%1$d %2$d|+[%3$s]||*[style]| та |*[style.bold]|%4$d %5$d|+[%6$s]||*[style]|",
//     "When enabled, build view will open and close with a button press, instead of requiring the button be held down.=Коли цей параметр увімкнуто, перегляд споруд буде відкриватися і закриватися натисканням кнопки, не вимагаючи її утримання.",
//     "At the center of every piglin base is a portal. Destroy this connection to the Nether and you'll send the piglins running.=У центрі кожної бази піґлінів знаходиться портал. Зруйнуйте цей зв’язок із Незером, щоб змусити піґлінів тікати!",
//     "Destroyed piglin structures drop prismarine, which you can use to build improvements at the Well of Fate.=На місці зруйнованих споруд піґлінів можна знайти призмарин, який використовується для створення удосконалень біля колодязя долі.",
//     "Earning the trust of the witches will enable you to build cauldrons that will provide a powerful damage buff to nearby mobs.=Завоювання довіри відьом дасть змогу будувати казани, які забезпечать потужне підсилення шкоди сусіднім мобам.",
//     "Sorry, you can't join this game. The host must connect to a Microsoft Account for this game to be multiplayer.=На жаль, ви не можете приєднатися до цієї гри. Для мультиплеєра хосту потрібно підключитися до облікового запису Microsoft.",
//     "Are you sure you want to leave and return to the main menu? This will disconnect all other players in the current game.=Ви справді хочете вийти з гри та повернутися до головного меню? Усіх інших гравців у поточній грі буде відключено.",
//     "You've run out of lapis|+[key.item.lapis]|. You can get more lapis from the chests found at village fountains=У вас закінчився лазурит|+[key.item.lapis]|. Ви можете брати більше лазуриту зі скринь, розташованих біля сільських фонтанів",
//     "Wellhouses allow you to fast travel and respawn – but piglins will also target them when you're not looking.=Доми-колодязі дозволяють швидко переміщатись і відроджуватись, але піґліни також будуть націлені на них, коли ви не дивитесь.",
//     "How witches are spawned in campaign. This setting cannot be changed once the world has been generated.|[space]|Standard =Те, як відьми генеруються в кампанії. У згенерованому світі цей показник змінювати не можна.|[space]|Стандартне ",
//     "On their own, mace runts might seem unthreatening, but in higher numbers they are a force to be reckoned with.=Самі по собі коротуни з булавами можуть здатися непоказними, але в більшій кількості вони є силою, з якою слід рахуватися.",
//     "Seekers don't discriminate when it comes to targets - put a cheap structure in their path and they won't hesitate to explode it.=Для шукачів всі цілі однакові. Поставте на їхньому шляху дешеву споруду, і вони без вагань її підірвуть.",
//     "Armored towers are invulnerable unless they are actively defending. Get some mobs in close to see the armor drop.=Броньовані вежі невразливі, якщо вони активно не обороняються. Підтягніть кілька мобів ближче, щоб броню було прибрано.",
//     "Plank golems need wood in order to build their spawners. Find some in the jungle, swamp, or forest biomes.=Для будівництва нових генераторів дощатим големам потрібна деревина. Відшукайте їх у біомах із джунглями, болотами або лісами.",
//     "Online multiplayer is not rated and might expose you to user-generated content that may not be suitable for all ages.=В режимі онлайн-мультиплеєра створений користувачами контент не цензурується, а тому може мати обмеження за віком.",
//     "Low on health? Spawn in some mossy golems or find a regeneration stone in the world to quickly regain health.=Втратили багато здоров’я? Згенеруйте декілька замшілих големів або знайдіть камінь відновлення, щоб швидко відновити сили.",
//     "You can refund lured mobs at any spawner. Refunding mobs returns the resources used to spawn them.=Повернути кошти за заманених мобів можна біля будь-якого генератора. Під коштами маються на увазі ресурси, витрачені на призов мобів.",
//     "This pack has a dependency (%s) that is incompatible with your device because your device doesn't have enough memory.=Цей пакет має залежний об’єкт (%s), несумісний із вашим пристроєм, тому що на вашому пристрої недостатньо пам’яті.",
//     "Adding or removing Behavior Packs after playing a world might break the world and cause you to lose what you created.=Якщо додати або видалити пакети поведінки після гри у світі, світ може поламатися, а ви втратите все, що створили.",
//     "These piglins are crude but effective builders responsible for every piglin structure that pollutes the Overworld.=Ці піґліни — грубі, але ефективні будівельники, відповідальні за кожну споруду піґлінів, яка забруднює Верхній світ.",
//     "Turns Light Rays on or off. Enabling Light Rays will improve the visual quality while reducing performance.=Вмикає або вимикає світлові промені. Увімкнення світлових променів покращить візуальну якість, але зменшить продуктивність.",
//     "Can't get a foothold into a piglin base? Try destroying some nether spreaders and open up building space.=Не можете закріпитися на базі піґлінів? Спробуйте знищити деяких поширювачів Незеру та звільнити трохи місця для будівництва.",
//     "A fortified village is a happy village. Keep them safe from piglin attacks by building walls and towers around the fountain.=Укріплене село — щасливе село. Захищайте села від нападів піґлінів, будуючи стіни та вежі навколо фонтану.",
//     "You need lapis to spawn allies, and you can find lapis by defeating piglins or building lapis flags.=Для призову союзників вам потрібен лазурит. Ви зможете знайти лазурит, якщо переможете піґлінів або побудуєте прапори з лазуриту.",
//     "Prismarine|+[key.item.prismarine]|is key for building Improvements|+[key.item.unlock_iron_tech]|=Призмарин|+[key.item.prismarine]|є ключовим будівельним матеріалом та дозволяє створювати удосконалення|+[key.item.unlock_iron_tech]|",
//     "Use|$[key.meleeAttack]|to swing your sword. Your sword can damage structures, but cannot be used to gather resources.=Використовуйте|$[key.meleeAttack]|, щоб махати мечем. Меч не дозволяє пошкоджувати споруди або збирати ресурсів.",
//     "The pacing of the piglin invasion. As time passes or after destroying bases, the piglin response escalates. They increase the=Темп вторгнення піґлінів. Із часом або після знищення баз реакція піґлінів посилюється. Вони збільшують",
//     "Sign in with your Microsoft Account to play online with your friends and access the marketplace.=Увійдіть за допомогою облікового запису Microsoft, щоб грати через Інтернет із друзями на різних платформах та мати доступ до Ринку.",
//     "The Host of Foresight can see many possible turns of events – but can't say what's to come with certainty.=Хранитель Прозорливості може бачити багато можливих поворотів подій, але не може з упевненістю сказати, що саме буде далі.",
//     "Practice your multiplayer battle strategies with up to 4 players by playing against the AI in training mode.=Відпрацьовуйте стратегії битв у режимі мультиплеєра (до 4 гравців), граючи проти штучного інтелекту в режимі тренування.",
//     "Your base will start generating lapis from the beginning of the match, so you can start spawning mobs as early as possible.=Ваша база почне генерувати лазурит з початку матчу, тому ви можете почати призивати мобів якомога раніше.",
//     "You do not have enough Minecoins to unlock this item. You can get Minecoins from the|[newline]|Nintendo eShop.=У вас недостатньо монет Minecoins, щоб розблокувати цей предмет. Minecoins можна придбати в|[newline]|Nintendo eShop.",
//     "Ancient host tower. Attacks nearby enemies and sends them flying. Lost permanently if destroyed.=Стародавня вежа хранителя. Нападає на ворогів, що знаходяться поруч, і відправляє їх літати. Втрачається назавжди, якщо знищується.",
//     "Firsts and power towers require gold, which you can obtain from specific piglin structures and by destroying bases.=Перші та силові вежі потребують золота, яке можна отримати з конкретних споруд піґлінів і шляхом руйнування баз.",
//     "While you are signed out of your Microsoft Account you will not have access to the Minecoins and items you bought in the store.=Поза обліковим записом Microsoft ви не зможете користуватися монетами Minecoins і речами з магазину.",
//     "Increases the amount of allays available, allowing you to construct more buildings and gather more resources at a time.=Збільшує кількість доступних служок, дозволяючи будувати більше споруд і збирати більше ресурсів одночасно.",
//     "Zip around the world quickly by using fast travel at the Well of Fate, village fountains, and wellhouses.=Швидко подорожуйте по всьому світу, використовуючи швидке переміщення біля колодязя долі, сільських фонтанів і колодязів.",
//     "You can repair a village if it’s been destroyed. But first you’ll need to clear out the occupying piglins.=Ви можете відремонтувати село, якщо його зруйновано. Але спочатку вам потрібно буде знищити піґлінів, які його захопили.",
//     "Warning: You are currently the host of this game session.|[space]|Accepting this invite will disconnect all players.=Увага! Зараз ви є хостом цього сеансу гри.|[space]|Якщо прийняти це запрошення, усіх гравців буде відключено.",
//     "Warning: You are currently the host of this game session.|[space]|Accepting this invite will disconnect all players.=Увага! Зараз ви є хостом цього сеансу гри.|[space]|Якщо прийняти це запрошення, усіх гравців буде відключено.",
//     "While you are signed out of your Microsoft Account you will not be able to play with friends or access the marketplace.=Вийшовши зі свого облікового запису Microsoft, ви не зможете грати з друзями або отримати доступ до Ринку.",
//     "If you don't have the necessary tools to destroy piglin walls, the only way through for your mobs are the gates.=Якщо ви не маєте необхідних інструментів, щоб зруйнувати стіни піґлінів, єдиний шлях для ваших мобів — це ворота.",
//     "Did you know that the cauldron's buff lingers for a bit even when you leave? Try using them on offense!=Чи знаєте ви, що підсилення казана залишається на деякий час, навіть коли ви йдете? Спробуйте використовувати їх у нападі!",
//     "Sign in to a Microsoft Account to play with your friends across platforms. Creating an account is free.=Увійдіть в обліковий запис Microsoft, щоб грати з друзями на різних платформах. Створити обліковий запис можна безплатно.",
//     "Need more zombies on the battlefield? Spawn them using redstone, which can be found in the swamp and jungle.=Потрібно більше зомбі на полі бою? Генеруйте їх за допомогою редстоуну, який можна зустріти на болоті та в джунглях.",
//     "Need to strengthen your defenses? The masonry turns your wooden structures into stone for added durability.=Потрібно зміцнювати оборону? Каменярня перетворює ваші дерев’яні споруди на камінь, щоб вони були більш довговічними.",
//     "This world's multiplayer setting is set to friends only. You must be friends with the host of this world to join.=Мультиплеєр у цьому світі відкрито лише для друзів. Ви маєте бути другом хазяїну світу, щоб приєднатися до гри.",
//     "Reach the glowing beam of light to leave|[space]|Climb the stairs when you are ready to begin your adventure=Дійдіть до світного променя світла, щоб вийти|[space]|Підніміться по сходах, коли будете готові почати свою пригоду",
//     "Nether spreaders usually protect the edge of piglin bases - destroy them to gain a little ground to build on.=Поширювачі Незеру зазвичай захищають окраїни баз піґлінів. Знищіть їх, і зможете побудувати щось на їхньому місці.",
//     "You do not have enough Minecoins to unlock this item. You can buy Minecoins from your app store.=У вас недостатньо монет Minecoins, щоб розблокувати цей предмет. Ви можете придбати монети Minecoins у своєму магазині програм.",
//     "Do you want to resume that save or restart from the beginning? Restarting will delete your old save.=Ви хочете відновити це збереження або перезапустити з самого початку? Перезапуск призведе до видалення старого збереження.",
//     "Tap Charge|$[key.attackMove]|or Focus Target|$[key.forceMove]|to give an order to one mob at a time.=Натисніть кнопку «Атака»|$[key.attackMove]|або «Фокусування цілі»|$[key.forceMove]|, щоб віддати наказ одному мобу за раз.",
//     "Custom. A modifiable set of rules, allowing players to customize the gameplay as they see fit.=Користувацький. Змінюваний набір правил, який дозволяє гравцям персоналізувати ігровий процес так, як вони вважають за потрібне.",
//     "When you see this icon, we are saving your game. Do not turn off your computer while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте комп’ютер, поки бачите цю піктограму на екрані.",
//     "To view licensed content, please visit https://minecraft.net/licensed-content/ in any web browser.=Щоб переглянути ліцензований вміст, перейдіть на сторінку https://minecraft.net/licensed-content/ у будь-якому веб-браузері.",
//     "If the Lava Launcher is causing problems, try closing the distance quickly - they have a hard time shooting up-close.=Якщо запускач лави вам дошкуляє, спробуйте швидко скоротити відстань, щоб йому було важче у вас влучити.",
//     "%1$s says: I will build a %2$s (requires %4$d %3$s, %6$d %5$s, %8$d %7$s, %10$d %9$s, %12$d %11$s and %14$d %13$s)=%1$s каже: Я побудую %2$s (потрібно %4$d %3$s, %6$d %5$s, %8$d %7$s, %10$d %9$s, %12$d %11$s і %14$d %13$s)",
//     "Open the village chest to collect the villagers' help|[space]||$[key.bsharpInteract]|Hold to open chest=Відкрийте сільську скриню, щоб зібрати допомогу селянам|[space]||$[key.bsharpInteract]|Утримуйте, щоб відкрити скриню",
//     "Siegeworks increase the range of piglin towers. It's a fascinating technology – too bad it must be destroyed.=Облогові знаряддя збільшують дальність веж піґлінів. Це захоплююча технологія, і шкода, що її потрібно знищити.",
//     "Buff the redstone launcher with the kaboomery, spyglass overlook, and battle drums for even more devastating attacks.=Вибухів’ярня, підзорна труба та бойові барабани можуть зробити атаки редстоуномета ще більш руйнівними.",
//     "Skeletons can be sent flying by Grindstone golems. Use their speed against the slower Skeleton arrows.=Точильні големи можуть запустити скелетів у політ. Використовуйте їхню швидкість проти більш повільних стріл скелетів.",
//     "Piglin structures drop prismarine when destroyed. Collect as much as you can so you can build improvements.=На руїнах споруд піґлінів можна знайти призмарин. Збирайте якомога більше, щоб ви могли створювати удосконалення.",
//     "The damage of player structures.|[space]|This is not a setting we've modified across standard campaign difficulties.=Ушкодження споруд гравців.|[space]|Цей параметр не був змінений у рівнях складності звичайної кампанії.",
//     "If you are being overwhelmed by blaze runts or other ranged piglins, try destroying the corresponding piglin pit.=Якщо на вас насідають вогняні коротуни або інші піґліни дальнього бою, спробуйте знищити яму цих піґлінів.",
//     "Be patient and kind to your teammates. You're in this together, and only teamwork can lead to victory.=Будьте терплячі та добрі до своїх товаришів по команді. Ви разом, і тільки командна робота може привести до перемоги.",
//     "When you see this icon, we are saving your game. Do not turn off your device while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте пристрій, поки бачите цю піктограму на екрані.",
//     "The amount of gravity that all units experience. Higher values increase fall speed. Lower values decrease fall speed.=Сила тяжіння, яка діє на всі юніти. Вищі показники збільшують швидкість падіння, а нижчі — зменшують.",
//     "Start a new campaign and explore the swamp. In Versus, look for them in the swamp, jungle or near rivers.=Почніть нову кампанію й досліджуйте болото. У режимі суперництва шукайте їх на болоті, в джунглях або біля річок.",
//     "All teams are now gaining a passive|[newline]||*[style.bold]|lapis|+[key.item.lapis]||*[style]|income.=Всі команди тепер отримують пасивний дохід|[newline]||*[style.bold]|у вигляді лазуриту|+[key.item.lapis]||*[style]|.",
//     "If you find the brute's blades are a bit too sharp, try using stone to blunt them or arrows to keep them away.=Якщо ви вважаєте, що леза здорованя занадто гострі, спробуйте затупити їх камінням або збивайте їх стрілами.",
//     "If you are being overwhelmed by warboars or other disruptor piglins, try destroying the disruptor piglin pit.=Якщо на вас насідають бойові хряки або інші піґліни-руйнівники, спробуйте знищити окопи піґлінів-руйнівників.",
//     "Press|$[key.jump]|to jump over obstacles. Press and Hold|$[key.jump]|to perform a higher jump.=Натискайте|$[key.jump]|, щоб перестрибувати через перешкоди. Натисніть і утримуйте|$[key.jump]|, якщо хочете стрибнути вище.",
//     "Press|$[key.jump]|to jump over obstacles. Press and Hold|$[key.jump]|to perform a higher jump.=Натискайте|$[key.jump]|, щоб перестрибувати через перешкоди. Натисніть і утримуйте|$[key.jump]|, якщо хочете стрибнути вище.",
//     "We've detected that your system has a screen reader enabled and have automatically enabled Minecraft's screen reader.=У вашій системі ввімкнуто невізуальний екран, тому ми ввімкнули для вас невізуальний екран Minecraft.",
//     "You need to sign in before unlocking items in the store so that we can remember what you have already unlocked.=Перш ніж намагатися розблокувати щось у магазині, потрібно ввійти в систему, щоб ми знали, що ви вже маєте.",
//     "Find the blaze-rod throwing Runts too hot to handle? Try fighting them with something less flammable.=Не можете впоратись із коротунами, що шпурляють вогняні прути? Спробуйте боротися з ними чимось менш легкозаймистим.",
//     "Just reaching the Horde of the Spore is a challenge. If they don't provide a bridge for you, try building your own.=Дістатися до Орди отруйників не просто. Якщо вони не збудують для вас міст, спробуйте зробити це самі.",
//     "Spore towers are effective at throwing mobs around, try using heavy mobs or mobs that don't mind the smell.=Вежі отруйників ефективні для розкидання мобів. Використовуйте міцних мобів або мобів, які не бояться смороду.",
//     "In their rush to devour the Overworld, sometimes the piglins can make mistakes and damage their own bases.=У своєму прагненні поглинути Верхній світ іноді піґліни можуть робити помилки та завдавати шкоди власним базам.",
//     "Every victory you celebrate in the Overworld draws the attention of much fouler things closer to you.=Кожна перемога, яку ви здобуваєте у Верхньому світі, привертає до вас увагу дедалі сильніших і неприємніших ворогів.",
//     "Piglins will attack villages from multiple directions, so make sure you don't leave gaps in your defenses.=Піґліни атакуватимуть села з різних напрямків, тому переконайтеся, що ви не залишаєте прогалин у своїй обороні.",
//     "Build an Improvement Hub|+[key.item.unlock_prismarine_upgrades]|near your Base|+[key.item.headquarter]|=Побудуйте центр удосконалення|+[key.item.unlock_prismarine_upgrades]|поруч зі своєю базою|+[key.item.headquarter]|",
//     "Portal Guards are one-pig armies - fighting them with a single unit type won't be enough to defeat them.=Стражі порталу — це універсальні солдати-свині. Битися з ними юнітами одного типу буде недостатньо, щоб здолати.",
//     "The Firsts automatically respawn whenever you visit the Well of Fate, villages or wellhouses you've built.=Перші автоматично відроджуються щоразу, коли ви відвідуєте колодязь долі, села чи колодязі, які ви побудували.",
//     "Learn the melody required to reassemble the Firsts by building a unique improvement at the Well of Fate.=Вивчіть мелодію, необхідну для повторного зібрання Перших, створивши унікальне удосконалення біля колодязя долі.",
//     "%1$s says: Can someone build a %2$s? (requires %4$d %3$s, %6$d %5$s, %8$d %7$s and %10$d %9$s)=%1$s каже: Чи може хтось побудувати таку споруду, як %2$s? (Потрібно: %3$s — %4$d, %5$s — %6$d, %7$s — %8$d, %9$s — %10$d)",
//     "The text you entered contains words that others may find offensive and cannot be used. Please try again.=Введений текст містить слова, які можуть бути образливими для інших, тому їх не можна вживати. Спробуйте ще раз.",
//     "Keep fighting the piglins and come back to this tower after Knowledge finds a way to make it moveable.=Продовжуйте битися з піґлінами й поверніться до цієї вежі після того, як Досвід знайде спосіб зрушити її з місця.",
//     "Keep fighting the piglins and come back to this tower after Knowledge finds a way to make it moveable.=Продовжуйте битися з піґлінами й поверніться до цієї вежі після того, як Досвід знайде спосіб зрушити її з місця.",
//     "Keep fighting the piglins and come back to this tower after Knowledge finds a way to make it moveable.=Продовжуйте битися з піґлінами й поверніться до цієї вежі після того, як Досвід знайде спосіб зрушити її з місця.",
//     "The Banner of Courage draws its power from whoever wields it. In the right hands, it is a symbol of unity and hope.=Стяг мужності бере силу в того, хто ним володіє. У правильних руках він є символом єдності та надії.",
//     "The Overworld is a vast and mysterious place. Interact with everything, you never know what might happen.=Верхній світ — це величезне та загадкове місце. Взаємодійте з усім, адже ви ніколи не знаєте, що може статися.",
//     "If you want to recruit skeletons to your side, remember to gather diamonds in the frozen parts of the world.=Якщо ви хочете переманити скелетів на свій бік, не забудьте зібрати алмази у вкритих кригою частинах світу.",
//     "Provided '%s' element is not SemVer (semver.org) compliant in pack manifest; Defaulting to '%s'.=Наданий елемент \"%s\" не відповідає вимогам SemVer (semver.org) у маніфесті пакета. Використовуємо стандартний \"%s\".",
//     "Blaze rod towers put the hurt on players and mobs - destroy them to gain some breathing room.=Вежі з вогняними прутами становлять небезпеку як для гравців, так і для мобів. Знищте їх, щоб отримати невеликий передих.",
//     "The world you are about to enter contains scripts that run on your device. Would you like to join this world?=Світ, до якого ви намагаєтеся ввійти, містить сценарії, що виконуються на пристрої. Приєднатися до світу?",
//     "You will no longer be able to play this Lost Legend until you download it again.|[newline]|Delete anyway?=Ви більше не зможете грати в цю Втрачену легенду, поки не завантажите її знову.|[newline]|Видалити все одно?",
//     "When enabled, sprint will start and end with a button press, instead of requiring the button be held down.=Коли цей параметр увімкнуто, спринт почнеться та закінчиться натисканням кнопки, не вимагаючи її утримання.",
//     "Sets the quality of water. Increasing the Water Quality will improve the visual quality while reducing performance.=Задає якість води. Підвищення якості води покращить візуальну якість, але зменшить продуктивність.",
//     "You can fast travel to the Well of Fate, villages, and wellhouses as long as they're not occupied by piglins.=Ви можете швидко переміщуватися до колодязя долі, сіл і домів-колодязів, якщо вони не зайняті піґлінами.",
//     "Looking for an extreme challenge? Trying turning off certain structures or improvements in a custom game.=Хочете екстремальне випробування? Спробуйте відключати певні споруди або вдосконалення в користувацькій грі.",
//     "Witch potions work well against large goups of piglins. Just remember that structures can't be poisioned.=Відьомські зілля добре діють проти великих груп піґлінів. Але пам’ятайте, що споруди не можуть бути отруєні.",
//     "When you see this icon, we are saving your game. Do not turn off your Xbox while this icon is on screen.=Коли відображається ця піктограма, ми зберігаємо гру. Не вимикайте Xbox, поки бачите цю піктограму на екрані.",
